INSERT INTO `review` VALUES (8,'# Conference Paper Review\n## Paper’s Title \nA Research Landscape of Software Engineering Education\n## Paper Evaluation\nI   Originality (apply to Research Article)  a （Original: The results are new and original） \nII  Importance, significance and value of contribution（3 average）\nIII  Logic and Rational （3 average）\nIV  Theoretical analysis （3 average） \nV  Format  （4 good）\nVI  Language  (3 average)\nVII  Citation and analysis of recent related work (4 good)\nVIII  Density(Terse: the material is nicely terse)\n\n## Group Comments：\n          1.the process of searching data is too detailed,it would be better if it was briefly described.\n          2. there are some spelling mistakes, semantic mistakes.\n          3.The inaccurate expression of some and many in the article is not very suitable, and the actual quantity can be given.\n	  4.The meaning of numbers in the brackets are not clear.\n	  5.In table III,the connection of secondary research under the same theme can be explained,it is valuable information. The overlap of samples and reasons for differences should also be explained.\n	  6.In figure 4，if there is any overlap between tools and methods,it should be explained.Tools and methods should be distinguished.It\'s not appropriate to take open source projects into methods,it is data source or sample.\n\nReporter: Feimei Xie\nMember: Dailinzi Ye, Bohan Liu, Jing Chen, Peiyu Hou, Zan Gao, Jiaqi Zhang',13,'2020-10-09 14:37:23',49,_binary '\0'),(9,'**Paper’s Title：**\n	A Research Landscape of Software Engineering Education\n\n**Comments for the author(s):**\n\nThis paper focused on software engineering education and analyzed 26 relevant SLRs aiming to present overall start-of-art of software engineering education. However, there are still some problems in it. \n1.Motivation is still not sufficient. Authors pointed out researchers cannot obtain an overall understanding of the state-of-the-art of SEE from one or several SLRs. However, if one SLR contains mass quantity of primary studies, researchers can also get a preliminary understanding of this topic.\n2.Authors pointed out that they retrieved 1907 primary studies, but we can not reach that number based on Table III and Figure 3. \n3.In Table I, authors specifically stated that they excluded papers of elementary education in computer science. However, authors only gave some examples of elementary education in computer science without explaining why they made this decision in detail.\n4.In Section Result, this paper also included one tertiary study. Whilst, authors stated this paper is a tertiary study, which should not include such a study. Author should explain why they still reviewed this study.\n5.In RQ2, authors considered open source projects and cloud computing as exclusive methods/tools to SEE. However, this statement should be more polished. Either open source projects or cloud computing is exclusive to SEE. Moreover, we still confused that open source projects and cloud computing classified into Methods/Tools, because they still not have the essential characteristics of Methods/Tools and only provide some basic condition for methods or tools.\n\n\nQiming Dai, Huang Huang, Runfeng Mao, Xin Yang, Shenghu Gu, Wei Liu, Hongrui Liu, Huilin Yin, Fuli Zhang, Bowen Zheng, Zijia Jia\n',13,'2020-10-09 17:03:34',54,_binary '\0'),(10,'# Conference Paper Review\n## Paper’s Title\n------------------------------------\nA Research Landscape of Software Engineering Education\n## Paper Evaluation\n------------------------------------\n- I Originality (apply to Research Article) a （Original: The results are original）\n- II Importance, significance and value of contribution（4 good）\n- III Logic and Rational （4 good）\n- IV Theoretical analysis （3 average）\n- V Format （3 average）\n- VI Language (3 average)\n- VII Citation and analysis of recent related work (4 good)\n- VIII Density(Terse: the material is nicely terse)\n## Group Comments：\n--------------------\n``` java\n1. There is a problem with the layout of the 5th and 6th rows of table3, and the tense of the research purpose is not unified. To do is recommended.\n2. The number of abscissa parameters in Fig3 is not enough, it should be 26 actually 22, and the abscissa information should be more detailed\n3. The line spacing of the first sentence of introduction is recommended to be similar to the spacing between the next paragraph.\n4. The layout of RQ2 can make people mistakenly believe that the next line is also the content of RQ2, and some fine-tuning is required.\n5. Method and tools in RQ2 cannot be grouped together, and there is no distinction in B of V. SYNTHESIS AND FINDINGS. If these two have to be discussed together, it is recommended to use more abstract words to summarize.\n6. The data selected in the B. Search Process in the III. RESEARCH METHOD has not undergone quality evaluation, because we have selected published papers as data. We may not do the quality evaluation, but we should write in more detail , Rather than simply selecting high-quality articles as data.\n7. In the C. Study Selection in III. RESEARCH METHOD, OOP is deleted. Originally, CS and software engineering are very closely related. We cannot because Object Oriented Programming (OOP) courses can be recognized as elementary education in CS , we excluded this SLR. It is not appropriate to chop off OOP.\n8. Generally speaking, the author\'s own opinions are relatively few. For example, in the last paragraph of page 5, what readers want to see is not just the quantity and the textual explanation of the pictures\n```\nReporter: Jia Junyu\nMember: Wang Hao, Pan Bo, Zhang Yifan, Wang Jiarui, Yang Tao, Liu Wen, Yang Lanxin, Lu Jun, Song Kaiwen, Jia Junyu',13,'2020-10-09 17:03:35',62,_binary '\0'),(11,'**Paper’s Title**\nA Research Landscape of Software Engineering Education\n**Contribution of the paper** (problem significance, importance of results, relevance for computer science):\n\nThis paper conducted a tertiary study on Software Engineering Education with identified 26 relevent SLRs until to 2019. \nThe authors aim to show an overview of the state-of-the-art of Software Engineering Education from the three aspects:\n1)the discussed topics, 2)sample size, 3) adopted education methods/tools. \nThen, the paper answered which issues have been addressed and which were not, \nto further help readers clarify the challenges existing in current research about SEE SLRs. \n\n**Comments for the paper:**\n \nWhile there are two problems that require more effort to resolve:\n\n1. Since the motivation of this paper is not clarified clearly which lead to the reader hard to understand \nwhy the research questions are need to be addressed. \n2. The result of the RQ3 and RQ4 were not discussed detailly, it seems that the evidence for each issue is weak. \n\n**Detail comments:**\n\n1.There is a sentance said \" There are several factors which may affect the sample size, such as research purpose, topic, search period, source and inclusion/exclusion criteria. It is hard to obtain a regular pattern\", \nif the author intend to support the above assumption, we suggest the more explainations and analyses should be considered.\n2.The process of the data extraction is too terse, we want to know how did the authors find the findings of SLRs, hwo could the authors extract the answers about the RQ3（addressed issues） and RQ4（havn\'t addressed issues）.\n3.It seems that the conclusion about \"This implies the difﬁculty of setting the learning objectives for students with a high level of skills such as master students\" could not be deduced from the previous discussion in the paper context.\n4. The RQ3 and RQ4 should explicitly linked with the evidence no matter in the table(Table IV) or in the paragraph.\n\nReporter:Liming Dong\nGroup Members:Chenxing Zhong, Xiaodong Zhang, Juzheng Zhang, Changlan Fu, Zeye Zhan, Huanlei Chen, Yanze Wang, Zhiying Li',13,'2020-10-11 22:28:08',33,_binary '\0'),(12,'Conference Paper Review\nPaper’s Title\nPerformance Analysis of BitXHub Crosschain Process: A Queue Approach\n\nPaper Evaluation\nI Originality (apply to Research Article) a （Original: The results are new and original）\nII Importance, significance and value of contribution（3）\nIII Logic and Rational （3）\nIV Theoretical analysis （4）\nV Format （2）\nVI Language (2)\nVII Citation and analysis of recent related work (2)\nVIII Density(Too long: the paper is far too long for the material)\n\nGroup Comments：\nThis paper analyzes the performance of cross-chain process based on BitXHub cross-chain platform, and constructs a model using queuing theory. Our group agree that the topic of this paper is valuable. At the same time, their experience and findings may provide a new direction for the performance analysis of cross-chain process. However, there are still some problems with this paper as following:\n1.The abstract should give the results of the research, not just description of research process.      \n2.The background should provide a transition from the limitations of blockchain to the introduction of cross-chain and performance analysis, which is more smooth in logic.\n3.There are some informal expressions, such as time and quotation.\n4.The motivation of performance analysis is not fully introduced. It is better to add real scenes.\n5.Reasons of using BitXHub platform should be explained, as well as the introduction and link of this platform.\n6.The existing viewpoints mentioned in paper should be supported by references.\n7.The end of the introduction should add introduction of contributions.\n8.Section Ⅱ should adjust the structure. First, systematically introduce the study methods of predecessors and explain the innovation of the research. The title is about performance analysis, but there is no introduction to performance analysis in related work.\n9.The introduction of queuing theory should be suitable for this direction rather than an important theory.\n10.The recognition of BitXHub platform is necessary to be introduced. \n11.It should be clear whether the research only focuses on the performance analysis of this platform or proposes a methodology, and then uses this platform to verify the methsdology.The contributions should be clarified.\n11.Different results should be drawn in a figure to compare, while avoiding the simplification of figure.\n12.The title of section Ⅳ should be adjusted. This title is too general.\nReporter: Huilin Yin\nMember: Runfeng Mao, Xin Yang, Liming Dong, Zijia Jia, Chenxing Zhong, Lanxin Yang',14,'2020-10-16 21:52:23',58,_binary '\0'),(13,'Conference Paper Review\nPaper’s Title\nPerformance Analysis of BitXHub Crosschain Process: A Queue Approach\nPaper Evaluation\nI Originality (apply to Research Article) a （Original: The results are new and original）\nII Importance, significance and value of contribution（3）\nIII Logic and Rational （4）\nIV Theoretical analysis （3）\nV Format （3）\nVI Language (3)\nVII Citation and analysis of recent related work (2)\nVIII Density(Adequate: the length is about right for the weight of material)\nOverall Evaluation                             3 \nRecommendation     accept\nContribution of the paper (problem significance, importance of results, relevance for computer science):\nThis paper analyzed the implementation process of BitXHub, a cross-chain platform, builded queuing theory models M/M/1/N and G/M/1, and used Premo to test the performance.\n\nMajor comments:\n1.Abstract: It is necessary to state what the authors’ motivation of studying the cross-chain technology, and why the queueing theory was used. There are also punctuation errors in Abstract.\n\n2.INTRODUCTION: The explanation is insufficient and the motivation is not clear. More references are needed.\n\n3.BACKGROUND AND RELATED WORK: There are some problems with the language, for example, a large paragraph in parentheses, and the description of related work that should be in the past tense.\n\n4.CROSS-CHAIN PROCESS USING BITXHUB: The number of nodes is changeable, please add related explanation. Besides, the figures take up too much space, but the font in these figures is small, and the same kind of figures can be put together in grid form.\n\n5.QUEUING THEORY: The description of related theories is not very clear. It’s better to change the width of TABLE I to a single column, and reflect the information of Notation in figures.\n\n6.PERFORMANCE ANALYSIS: There are errors in some figures, and the source of the two values 937 (TPS) and 364 is not expressed.\n\n7.REFERENCES: Too few references, at least 30 references are required. In addition, the current references[4][7][10][15] are all inappropriate.\n\nTechnical correctness of the paper:\n\n\nQuality of presentation (clarity, organization, motivation, introduction, conclusion, references)\nA new section needs to be added to explain the contribution of this paper (application directions), future prospects, and theoretical limitations.\n\nOthers\nSome words are misspelled.\n\nChair Reviewer: Qianwen Xu\nOther Reviewers: Bohan Liu, Jing Chen, Tiange Li, Mengjie Ding, Yanze Wang, Zeye Zhan, Juzheng Zhang\n',14,'2020-10-16 22:54:29',8,_binary '\0'),(14,'#### Conference Paper Review\n##### Paper Title\nPerformance Analysis of BitXHub Cross-chain Process: A Queue Approach\n\n------------------------------------\n##### Group Comments\nThis paper models the core process of the BitXHub cross-chain platform and establishes a queuing theory model to analyze the performance of the cross-chain process. However, there are some problems with this paper as following.\n1. Several key indicators are given in the abstract, but there are no specific values to illustrate the results of the experiment.\n2. The abstract should give a conclusion of their contributions.\n3. The introduction should provide the meaning of this work and the reason for the research performance analysis.\n4. Section II should provide some backgroud related to the relay chain and discuss other research related to performance analysis.\n5. There are some inconsistent formats in Figure 1, Figure 2 and Figure 4.\n6. The indentation of some paragraphs in this paper is not consistent.\n7. Figures 9, 10, 11 are a bit fuzzy and need to be redrawn.\n8. GitHub links should not appear in the references.\n\nReporter: Wei Liu\nMember: Jun Lu, Changlan Fu, Feimei Xie, Fuli Zhang, Wei Liu, Ruihong Liu, Jiahui Wang, Bowen Zheng',14,'2020-10-16 23:43:50',68,_binary '\0'),(15,'# Conference Paper Review\n\n## Paper title\n\nPerformance Analysis of BitXHub Cross-chain Process: A Queue Approach\n\n## Group comments\n\n1. The motivation of this paper is not clear enough. For example, in the abstract, \"Many key cross-chain technologies ... process of the BitXHub cross-chain platform\", the above three sentences are logically separated, which makes it difficult to understand what problem this research aims to solve and what the research goal is. Similarly, the introduction section has the same issue.\n2. The structure of the introduction section is partially redundant. It is recommended to clarify the contribution of this paper at the end of the introduction section.\n3. From section III to section IV, it seems to only introduce the existing technology, which is hard for a researcher who is not familiar with this topic to get the point.\n4. The title of section IV makes audience feel that this section is still introducing existing technology rather than the model proposed by this paper.\n5. The content of section IV-A is similar to that of section III-C. It is recommended to merge the two sections or try to make them distinct.\n6. There is an issue with the layout of the figures, which leads to a waste of page space.\n7. Clarifications need to be added to make the equations in section IV easy to understand and highlight key points.\n8. The conclusion section and the introduction section are partly duplicated, such as background introduction. Furthermore, this section lacks a true conclusion.\n9. There are some expression issues. For example, on page 10, \"From Figure 10 ... in the image\", the word \"shock\" implies the authors\' subjective emotions. Meanwhile, there is a redundancy between \"From Figure 10\" and \"in the image\", which can be simplified to \"in Figure 10\". On page 11, \"It shows that under the current input state, the entire relay chain system is operating well\", the word \"well\" is ambiguous.\n\nReporter: Shenghui Gu\nMember: Kaiwen Song, Jiarui Wang, Zhiying Li, Bo Pan, Yifan Zhang, Tao Yang, Hao Wang, Jun',14,'2020-10-17 16:34:19',3,_binary '\0'),(16,'## Paper\'s Title\nSynthesizing Qualitative Research in Software Engineering: A Critical Review\n\n## Group Comments\n**Abstract:**\n1)The last sentence in the Method is more like the Conlusion. \n2)The last sentence in the Conclusion is more like the Mehod, it is better to change the way of explanation.\n\n**1. Introduction:**\n*\"Our findings can provide useful guidance to SE researchers, particularly PhD candidates and early career researchers, in selecting and using an appropriate QRS method.\"*\nThis contribution is a little limited and just provides SE researchers with useful guidance in selecting and using an appropriate QRS approach.\n\n**2. Qualitative Synthesis Methods:**\n1)*\"Hannes and Lockwood have discussed 20 QRS methods.\"*\nWhat are these 20 methods? Why are there few other methods used? What are the locations of the other methods in the decision tree?\n2)Format problem for Table 1.\n\n**5. Synthesis and Analysis:**\n1)Figure 4: A dark blue color that is not in the legend appears in the Requirements.\n2)What is the precentage calculation method in 5.1.4 and 5.1.5? 46(20%), 29(12%), 8(4%).\n\n**6. Choosing a QRS Methods:**\n1)There is a gap between *\"Note that we cannot include an exhaustive list of the methods for qualitative synthesis into the decision tree within the space available\"* and *\"The researchers should be cognizant that the boundaries between these methods are permeable and that the typologies are not necessarily mutually exclusive\"*.\n2)*\"After choosing the method for qualitative synthesis, it may be useful to revise the method for qualitative synthesis based on the reality.\"*\nHow to revise?\n\n**7. Discussion:**\nWhat is the difference between Claiming and Reporting? This paragraph has been all about Reporting\n\n## \nReporter: Xin Yang\nMember: Runfeng Mao, Qimin Dai, Huang Huang, Lanxin Yang, Chenxing Zhong, Zijia Jia, Zhiyin Li, Kaiwen Song, Huilin Yin',15,'2020-11-06 23:15:21',12,_binary '\0'),(17,'##### Paper’s Title：Synthesizing Qualitative Research in Software Engineering: A Critical Review\n------------------------------------\n1. Originality： **Original**\n2. Importance, significance and value of contribution      **4**\n3. Logic and Rational   **4**\n4. Theoretical analysis     **4**\n5. Format    **4**\n6. Language   **3**\n7. Citation and analysis of recent related work    **4**\n8. Density：**Adequate**（the length is about right for the weight of material）\n9. Accessibility：**Post graduate student**\n10. Overall Evaluation：**accept with minor revision**\n\n------------------------------------\n**Contribution of the paper：**\nThe author systematically review and understand the different aspects of qualitative research synthesis (QRS) used in SE. As a result, he found eight QRS methods applied in SE research, two of which, narrative synthesis and thematic synthesis, have been predominantly adopted by SE researchers for synthesizing qualitative data.\n**Technical correctness of the paper:**\n1) The name of this paper is the same as that of a conference paper that the author has submitted before. It is inappropriate for two articles to have the same name.\n2) In Section 3.2, the author explains why SLRs of 2019 are not included: \"Since we updated our Previous study [34] in the end of 2019, we did not include the SLRs published in 2019 yet.\" But we do not think this is necessary, and the expression is strange and confusing. The suggestion is not explained, if you receive feedback, then add.\n3) There is no evidence supporting the drawing in Figure 6.\n4) Mixed methods are mentioned in the paper, but the relationship between mixed methods and decision tree seems not to be explained. Because the leaf nodes of the decision tree are all single methods.\n5) Format: In the last sentence of the second paragraph, we do not think it is appropriate to begin with a number; We are not sure if we can put parentheses in the keywords? Table 1 typesetting disorder; Figure 2 Font is obviously different from other fonts in the text; Figure 6 Font style suggested modification;\n------------------------------------\n- How much effort did you spend refereeing this paper? **Reasonable**\n------------------------------------\n**Reporter**: XiuDi Chen\n**Group Members**: Bohan Liu, Shenghui Gu , Bowen Zheng, Yifan Zhang, Hao Wang, XiaoDong Liu, Jing Chen, Jiaqi Zhang, Jiarui Wang, Tao Yang, Junyu Jia\n',15,'2020-11-07 18:43:20',36,_binary '\0'),(18,'**Paper’s Title：Synthesizing Qualitative Research in Software Engineering: A Critical Review**\n---\n\nGroup Comments\n1. The interpretation of the conclusion is inadequate\n2. Fig1 has no explanation\n3. \"search process \" is out of place\n4. Does the sentence \"Since we updated our previous study [34] in the end of 2019, we did not include the SLRs published in 2019 yet.\"  make sense?\n5. “Considerations on Selection”  is out of place.\n6. The font of fig6 is so cute..\n7. “If your sample size is relatively small”   what  is \'small\'?\n8. The front fo the \"Discussion\" is very abrupt.\n---\nReporter: Xiaodong Zhang\nMember: Changlan Fu,Jun Lv,Xiaodong Zhang,Huanlei Chen,Zeye Zhan,Peiyu Hou,Juzheng Zhang,Jiahui Wang,Haoming Li,Yanze Wang,Mengjie Ding',15,'2020-11-07 14:15:08',34,_binary '\0'),(19,'### Paper’s Title\nSynthesizing Qualitative Research in Software Engineering: A Critical Review\n### Paper Evaluation\n1. Originality： **Original**\n2. Importance, significance and value of contribution **4**\n3. Logic and Rational **4**\n4. Theoretical analysis **4**\n5. Format **4**\n6. Language **4**\n7. Citation and analysis of recent related work **4**\n8. Density：**Adequate**（the length is about right for the weight of material）\n9. Accessibility：**Post graduate student**\nOverall Evaluation：**accept with minor revision**\n\n### Contribution of the paper\nThe author systematically review and understand the different aspects of qualitative research synthesis (QRS) used in SE. As a result, he found eight QRS methods applied in SE research, two of which, narrative synthesis and thematic synthesis, have been predominantly adopted by SE researchers for synthesizing qualitative data.\n\n### Technical correctness of the paper\n\n1、The time interval 2005-2018 in the method part of Abstract is different from the time interval 2004-2018 in the decision tree.\n2、In Table 1, there seems to be a problem with the format of the example number in the first row, and there are empty rows in the features of the second and third rows.\n3、There is a problem with the font size in Figure 2.\n4、The explanation of Figure 5 in part 5.3 of the paper is rather obscure.\n5、Our group questions the appropriateness of “Make-it-up-as-you-go-along may be OK” in the discussion section.\n\nHow much effort did you spend refereeing this paper? **Reasonable**\n\n**Reporter**: Bo Pan\n**Group Members**: Shanshan Li, Liming Dong, Qianwen Xu, Fuli Zhang, Wei Liu, Ruihong Liu, Qinglong Meng, Linzi Yedai, Zan Gao, Feimei Xie',15,'2020-11-08 10:42:01',63,_binary '\0'),(20,'This paper is a extension for Xin Zhou’s previous study. The previous study established a preliminary but realistic understanding of how does GL feed in and contribute to SE research. This paper also proposed a conceptual model for how GL works in the SE research lifecycle.This study aims to empirically validate the findings presented in the previous study. More importantly, this study explores the solutions for the challenges, e.g., quality assessment for GL. \nI still have some questions:\n1、”Abstract” expressions are confusing. The Context section should not just talk previous work. We want the background of GL and the current problems GL faces, which need to be closely linked to the solutions in this paper.\n2、The “introduction” part is inconsistent with the third section and the logic is confused. The motivation of this article is not clear. The method part of “introduction” is very vague, but the contribution part jumps to a very specific level. The “introduction” part lack in the description of each chapter.\n3、In the third section, we hope to have a clear logic. It is suggested to explain Fig2 first and then explain the three methods.\n4、The content of section 5 is general, which is of little help to readers\n\n',16,'2020-11-13 17:15:36',2,_binary '\0'),(21,'This paper is a extension for Xin Zhou’s previous study. The previous study established a preliminary but realistic understanding of how does GL feed in and contribute to SE research. This paper also proposed a conceptual model for how GL works in the SE research lifecycle.This study aims to empirically validate the findings presented in the previous study. More importantly, this study explores the solutions for the challenges, e.g., quality assessment for GL.\n\nTechnical correctness of the paper\n1.The title refer to the word ‘assessment’ but the paper doesn’t pay much attention to this content\n2.The abstract part doesn’t clearly reveal the main points of this paper, the author should declare the detail of verification reasons, methods and meanings.\n3.It’s better to replace the ‘case study’ with ‘previous study’ in the method part in abstract.\n4.The introduction part doesn’t explain the motivation of this paper clearly, the author should add some reasonable explanation to show why they did this research.\n5.What do ‘this study’ and ‘this work’ means in introduction part? It indicate the previous study or this paper?\n6.It’s unnecessary to display the previous study result with an independent section, the author could synthesize the previous shortly in section 4 and put it in the section 3.\n7.There is no clearly context to explain the three RQ, the author should fit the RQ to the purpose of this paper and declare why they come up with these three RQ.\n8.The author should add an addition part to transition the GL to SO\n9.It’s unnecessary to display the analyze method.\n10.The answer of RQ2 did directly explain why do research turn to GL. The answer should be mo specific and meaningful.\n\nGroup members:  Bohan Liu,   Runfeng Mao,   Xin Yang,   Peiyu Hou,  Huilin Yin,  \nQianwen Xu,  Juzheng Zhang,  Mengjie Ding,  Haoming Li,  \nYanze Wang,  Jiahui Wang,  Tiange Li',16,'2020-11-13 19:24:39',26,_binary '\0'),(22,'## Paper’s Title\n\nAn Evidence-Based Inquiry and Assessment into the Use of Grey Literature in Software Engineering\n\n## Group Comments\n\n**Abstract:**\n\n1. The context only introduces the widespread use of gray literature and previous work, without explaining the background of the use of gray literature.\n\n2. The conclusion describes the results of the survey, not the results of the research.\n\n**Research Method:**\n\n1. The third section is Research Method, we think \"previous work\" is not suitable as its subtitle.\n\n2. SO is a subset of GL, only by analyzing SO to draw conclusions whether it is accurate.\n\n**Verification of Findings:**\n\n1. In section 5 only the end of RQ1 no Verification.\n2. The problem of RQ3 is how to deal with Grey Literature data, but 5.3.1 is \"Proposing idea\", which is not suitable\n\n3. The example in 5.3.3 cannot prove the statement in 5.3.3(Evaluating GL).\n\n**Challenges & strategy:**\n\n1. The title of Section 6.2 and the title of Section 6 are not clearly related, which may confuse readers.\n\n___\n\nReporter: zeye Zhan\nMember: Chanlan Fu, Jiaqi Zhang, Jing Chen, Feimei Xie, Dailinzi Ye, Kesu Wan, WeiGan Ma,Chao Li, KuiLin An',16,'2020-11-13 20:15:59',27,_binary '\0'),(23,'## Paper’s Title\nAn Evidence-Based Inquiry and Assessment into the Use of Grey Literature in Software Engineering\n\n## Group Comments\n1. Context is not aligned with the following subheading. And the content of results should be the result, but it is the research method.\n2. The contribution on the second page lacks contribution No. 3, which is exactly the same as the contribution written in the conclusion.\n3. On page 3.2.1, why can we use stack overflow instead of GQM? Although GQM is the content of the article, GQM should also simply explain what it is.\n4. RQ1, 2, 3, and 4 should be put together first, otherwise it doesn\'t look good in this way (because rq1, 2, 3 are all together, it\'s not appropriate to just take out rq4)\n5. The content of the article before the introduction in Section 4 on page 6 is too long, and some contents should be reduced appropriately.\n6. Various format problems: the format of def3 on page 7, page 10 5.2.2 [Venk 16], the format of quotation marks on page 14 is inconsistent, and there is a blank column in Table 9.\n\n#### Reporter：\nJia Junyu\n#### Members:\n Liu Bingrui, Wang Jiarui, Jia Junyu, Wang Hao, Liu Wei, Gu Shenghui, Zhang Lemin, Yang Tao, Liu Xiaodong, Zhang Yifan, Liu Wengang, pan Bo',16,'2020-11-14 10:33:58',62,_binary '\0'),(24,'Paper’s Title\nHFContractFuzzer: Fuzzing Hyperledger Fabric Smart Contracts for Vulnerability Detection\n\nGroup Comments\n1.The introduction is short and the motivation is not clear.\n2.The author did not talk about what testing methods exist and why fuzz testing is used.\n3.The descriptions of others’ work are long, the author\'s own is short. Just need to give a brief introduction about others’ work, and focus on describing your content.\n4.The structure of this paper is not clear. Why do you want to optimize G-go-fuzz and D-go-fuzz? The reasons and consequences of optimization are unclear.\n5.Part C in Section III should be a little bit more.\n6.EVALUATION and DISCUSSION should be a little bit more. There is no quantification and comparison in DISCUSSION.\n7.Fig.6 is too redundant, it should be deleted or key information boxed.\n8.Vulnerability types are relatively few in TABLE V, and the introduction of smart contracts’ functions needs to be added.\n\nReporter：\nQianwen Xu\nMembers:\nBohan Liu, Runfeng Mao, Xin Yang, Peiyu Hou, Jing Chen, Tiange Li, Xiaodong Liu',17,'2020-11-27 22:30:17',8,_binary '\0'),(25,'**Group Comments**\nAbstract:\n1. Authors focus too much on background rather than describing their own work.\n\nIntroduction:\n2. The motivation is not clear and strong. Authors said \"With the diversity of application scenarios, the complexity of smart contracts is increasing, and the impact of security vulnerabilities is becoming more and more significant\", whilst, the logic is incoherent. We can not conclude that the widely application of block chain and increasing complexity of smart contracts lead to security vulnerabilities becoming more and more significant, which might be the direct motivation of this paper.\n3. Authors siad \"Symbolic Execution, Formal Verification, and Fuzzing are the main techniques of smart contract vulnerability detection\" and then chose fuzzing technology to detect vulnerability of smart constract without any description.\n4. In the last sentence of this section, authors described their work briefly. Whilst, we could not see the results of the testing method they proposed. \n\nBackground and related work:\n5. Authors seprated related work into a specific section, however, it should be better to mix the description of related work with specific domain, e.g. Hyperledger Fabric Smart Contract, Fuzzing.\n6. When authors discussed related work, authors pointed out the shortcomings of previous work. It should be better to compare your work with previous work to strengthen your contributions.\n\nIII HFCONTRACTFUZZER\n7. Authors pointed out that when trying to test, the entire network should be rebooted which seriouly affected the efficiency of smart contract testing and compared two different simulation mode. Whilst, how do these two simulation mode solve the test efficiency problem above?\n8. In Table I, the first two row is duplicated and we thought the column \'TAG\' is not necessary because we can not get any useful information of it.\n9. In Table II, authors only listed the name of 20 mutation alogrithms which is also useless. Since authors tested these 20 mutation alogrithms, authors could consider to add one column to show the results of these algorithms. Or mixed Table II and Table III directly.\n\nEvaluation:\n10. In this section, we can not see your results compared with other previous work to show your specific contributions. Since authors proposed a testing method, evaluation metrics should also be considered to measure your method.\n\nDiscussion:\n11. This section should be reorganized. In this section, authors discussed the backgourd why they did this work again and pointed the shortcomings of their own work without any defense. In our opinions, these content should not be appeared in this section.\n\nThere are also some mistakes in this paper which need to be more carefully checks. e.g. \'not possible\'.\n\n------------------------------------\nReporter: Qiming Dai\nMember: Xin Zhou, Huang Huang, Xin Huang, Shenghui Gu, Huanlei Chen',17,'2020-11-28 12:29:27',54,_binary '\0'),(26,'Paper’s Title\nHFContractFuzzer: Fuzzing Hyperledger Fabric Smart Contracts for Vulnerability Detection\n\nGroup Comments\n1.The paper focuses on the background and related research, place more emphasis on what own work \n2 The abstract mentioned Ethereum, but did not specify Ethereum\n3.In the introduction, there is no description paper organizational structure and contribution part \n4.In evaluating part,it says \"tests of typical eight Fabric smart contracts\", what eight Fabric smart contracts are shall be explained, and the part did not say the evaluation methods of the experiment, measurement standard and the benchmark\n5.Discusion part refers to the future work, this section can be placed in conclusion and future work, the order will be more clear\n6.No input and output in figure 4\n7.There is no the result return conditions indicated in figure 5 \n8.Figure 6 is blurred, and the readability is poor,convert it to a chart,it will be more clear\n\nReporter：\nXie Feimei\n\nMembers:\nGao zan,Ye Dailinzi,Fu Changlan,Lv Jun,Zheng Bowen,Li Zhiyin,Song Kaiwen',17,'2020-11-28 14:18:51',49,_binary '\0'),(27,'Paper’s Title\nHFContractFuzzer: Fuzzing Hyperledger Fabric Smart Contracts for Vulnerability Detection\n\nGroup Comments\n1. From the description of the title and the content of the article, it is not clear what is described in this article(method? framework? tool?)\n2. \"Among them, there are still many unsolved challenges in..\" What is the unsolved challenge？\n3. \"However, there is very little research on Hyperledger Fabric smart contracts.\"\nThat\'s not a good motivation, anymore why would you use Fuzz for testing\n4. \"In recent years, the majority of scholars on smart contracts fuzzing technology is still in its infancy, which makes it more difficult to use fuzzing technology to detect vulnerabilities in smart contracts.\" \nThis sentence needs reference\n5. The introduction and background sections are too long, and don\'t mention your contribution until 4/8 page of the article\n6. The evaluation section does not show the effectiveness of the work\n\n\nReporter：\nFuli Zhang\nMembers:\nFuli Zhang, Chao Li, Kuilin An, Kesu Wang, Zhiluo Weng, Chenxing Zhong, Liming Dong, Wengang Liu',17,'2020-11-29 10:46:28',2,_binary '\0'),(28,'Wengang Liu; Wei Liu; Qinglong Meng; Mengjie Ding; Qianwen Xu; Tao yang; Liming Dong; Chenxing Zhong\n\nContribution of the paper (problem significance, importance of results, relevance for computer science):\n\nThis paper give a lot of experience of authors using and set linux over ten years. Meanwhile, they give a tool named ConfigFix for official kernel config and tell us how to design and realize it. The tool--Configfix can help users of linux to get config that they want.\n \nHowever, there are still some problems of this paper as following:\n1) The paper have a long introduction for describing background so that there are too little place for other parts. Meanwhile, the application scenarios of what the paper describes have a lot of limitation.\n2) Sentence “We built on our and others’ prior work in the field to realize a translation of the kernel’s variability model into propositional logics“ under figure 1. There are no content describing the specific others’ work.\n3) There are two errors of spelling. The first is “Analternative candidate was a a configurator tool and language with built-in conflict-resolution support, which the community explicitly decided against, expressing these reasons“. The second is “so can be called called directly within xconfig without needing external calls”.\n4) There are many abbreviations not giving the full name like SAT.\n5) In III ComfigFix, B. ConfigFix Overview. There are many differences between description and figure. Meanwhile, it mix the function that have been realized and not been realized so that reader can not distinguish the different function.\n6) In III ComfigFix, D. Fix Generation. It make word RangeFix bold and describe what RangeFix are but the RangFix is not its contribution.\n7) I IV Experience And Challenges. There is little descrption of experience so that this part does not match the title.\n8) There is a error of grammer. “We believe that our tool [2] helps the Linux kernel community not only supporting the configuration process”.\n9) We don’t think the link of web should in references, this is a little strange.\n',1,'2020-12-05 10:12:30',25,_binary ''),(29,'#### Group C\n##### Paper’s Title：Effective Capacity Prediction for Cloud Systems\n------------------------------------\n1. Originality： **Original**\n2. Importance, significance and value of contribution      **3**\n3. Logic and Rational   **3**\n4. Theoretical analysis     **4**\n5. Format    **4**\n6. Language   **3**\n7. Citation and analysis of recent related work    **4**\n8. Density：**Adequate**（the length is about right for the weight of material）\n9. Accessibility：**Post graduate student**\n10. Overall Evaluation：**reject**\n\n------------------------------------\n**Contribution of the paper：**\nThis article proposes a new capacity prediction method for cloud systems. The idea is to proactively predict the failure of resource allocation regarding the low capacity state (LCS) by using machine learning methods. The article describes the algorithm in detail.\n**Technical correctness of the paper:**\n1) The article lists some challenges, but does not specifically explain how to solve them, nor does it mention how the system improves these challenges.\n2) The article introduces very little data set. If the data set is sensitive, the author can give a picture of the data set, such as listing some statistical indicators.\n3) The author pointed out: Traditional methods, such as regression, random forest and support vector machine, fail to capture continuous time information. But in TABLE5, when the author compared the experimental data of several schemes, he compared it with these self-denying methods.\n4) The author collected many features, and these data are multidimensional. In the experimental comparison part, the author compared with methods that only performed well on single-dimensional time series data.\n5) According to 3) and 4), it can be seen that the effective comparison object of the experiment is only LSTM, which is not enough to prove the effectiveness of the new algorithm proposed by the author.\n6) The paper does not support the title well: Because the purpose of the paper is to improve capacity, prediction is only a method. The experimental results are not sufficiently correlated with capacity, which means that the explanation of how the algorithm affects capacity is insufficient. The paper is more about the algorithm.\n------------------------------------\n- How much effort did you spend refereeing this paper? **Reasonable**\n------------------------------------\n**Reporter**: XiuDi Chen\n**Group Members**: LanXin Yang, Jing Chen, Bo Pan, JiaRui Wang, YiFan Zhang, Hao Wang, XiaoDong Liu, JunYu Jia ',2,'2020-12-05 10:37:42',36,_binary ''),(30,'Title: ConfigFix: Interactive Configuration Conflict Resolution for the Linux Kernel\n\nThis paper present CONFIGFIX, a tooling that they integrated with the officialkernel configurator, that is purely implemented in C, and that is finally a working solution able to produce fixes for configuration conflicts.It is a experience report.\n\nContribution of the paper (problem significance, importance of results, relevance for computer science):\n1.The paper reported their experience of leveraging results from 13 years of academic research，and describe their experiences ranging over a decade of building upon the large body of work from research on the Linux kernel configuration mechanisms.\n2.They designed and implementation the tool CONFIGFIX, which they integrated in the Linux kernel configurator by adhering to all requirements coming from the Linux community in the context of the Kconfig-SAT initiative.\n\nOur group\'s comments are as follows:\n\nIn Introduction,the purpose of the sentence “ Being completely open source, with a vast evolution history available, researchers have studied many different aspects of it, including software evolution [5], [26], [60] and software maintenance [3], [25], [27], [58] aspects, as well as its configuration mechanisms—the focus of this paper.” is to elicit their motivation,but we think the motivation is explained by quoting several literatures. This kind of motivation is relatively weak and the starting point is not natural.\n\nIn many parts of the paper, when abbreviations appear for the first time, the readability will be reduced if it is not explained.Such as the sentence “ We built on our and others’ prior work in the field to realize a translation of the kernel’s variability model into propositional logics, to implement a configuration-conflict resolution algorithm relying on SAT solving, and integrate both into the graphical configurator tool xconfig.”\n\nIn the second chapter, the author adds a conclusive description. In this case, we think it is necessary to prove in the first chapter that no similar research has been conducted before, and the first chapter needs to be expanded.\n\nWe have some doubts about the granularity of the summary. We think that if it is common sense knowledge, it is not appropriate to put it in the author\'s own summary.For example, in “Propositional Transformation in C”,we think the sentence “C was not ideal to model propositional logic formulas.” is common sense.\n\nReporter:Dailinzi Ye\nMembers:Xin Huang,Shenghui Gu,Bowen Zheng,Peiyu Hou,Fuli Zhang,Feimei Xie,Zan Gao',1,'2020-12-05 13:34:44',24,_binary ''),(31,'**Group Comments**\nThis paper proposed a novel capacity prediction approach called \'LCSP\' aiming to solve the low efficiency of traditional method to predict when \'the available capacity is exhausted\'. Combining data of servers, users and platform, authors also attached \'Attention Prediction\' in their LCSP framework and did great contribution on Microsoft\'s cloud systems in real scenario. However, there are still some weakness in this paper.\n\n1. Figure 1a seems lack of axial label. From authors\' description, \'Figure 1a shows that 60% nodes utilize more than 82% cores\', we suppose \'nodes utilization\' may be the missing label.\n2. Authors said \'a low capacity status is reached when VM allocation failures are escalated to a specific threshold\', whilst, how to establish the concrete threshold reasonably is not discussed in this paper, which should be a significant part in authors\' work.\n3. Section Challenge describes three main challenges for predicting an effective approach for cloud systems. While how authors addressed these three challenges step by step was also not discussed in detail.\n4. When authors performed data processing, we could not see the process and result of data clean, e.g. the rate of dirty data. Considering we could not see the content of real data and the consensus that the quality of data is a big concern for ML-based system, the validatiy of this paper is quite a question.\n5. In LCST framework, authors attached Attention Process aiming to increase the accuracy of prediction. Whilst, some events, such as server mitigation or specific days seem to be a date that do not need an extra prediction and meaningless to authors work.\n6. In Section Experimental Evaluation, authors listed several ML methods to compare with the appoach authors proposed. Whilst, these methods seem to be old and authors should explain the reason why they choose these methods or adding some newcoming methods.\n7. In Section Threats to validation, authors listed three problems in their work without sufficient reasonable defence. For example, authors stated they only collect data on Microsoft\'s cloud systems, while, some specific scenario or challenges they encountered on this system were also not discussed yet.\n\n\n------------------------------------\nReporter: Qiming Dai\nMember: Huang Huang, Runfeng Mao, Xin Yang, Huilin Yin, Kesu Wang, Zhiluo Weng',2,'2020-12-05 15:20:36',54,_binary ''),(32,'Title: ConfigFix: Interactive Configuration Conflict Resolution for the Linux Kernel\n\nHaoMing Li, Bohan Liu, Huanlei Chen, Yanze Wang, Jiahui Wang, Juzheng Zhang, Zeye Zhan\n\nContribution of the paper (problem significance, importance of results, relevance for computer science):\n\nThis paper provides a configuration conflict resolution tool ConfigFix under Linux. Users can realize the configuration they want by using ConfigFix.Development of ConfigFix fully complies with the relevant standards of the Linux kernel, and can be integrated into the Linux kernel, which makes a great contribution to the Linux community.\n\nHowever, there are still some problems of this paper as following:\n\nMany parts of the article spend most of the space to introduce the relevant background knowledge, which makes the original content that needs to be expressed less space for expression. For example, Part C of the second section of the article occupies too much space.\n\nThis paper is an experience report, but it is mainly talk about the implementation process of a specific tool. We should focus on the empirical conclusions that can guide the development of related tools rather than just tools.\n\nThe application scenario of this paper is limited to the configuration of Linux. However, as an article to be published in the field of software engineering, it should have some more general contributions, such as the contribution on software engineering configuration management.\n\nThis article is rather obscure and difficult to understand, mainly because there are too many abbreviations in terms of methods and development tools, and most of them have no relevant explanation. For example, \"to implement a configuration conflict resolution algorithm relating on sat solving” at the bottom of Figure 1. Besides, the format of explanations is not uniform, such as ”which resulted in the first translation tool called LVAT [49] (Linux Variability Analysis Tools),a tool suite written in Scala for analyzing Kconfig models. ” on page 3, the explanation is after abbreviation. However, “With the exception of one tool [21], all produce propositional formulas in conjunctive normal form (CNF),” on page 4, the abbreviation is after explanation.\n\nThe theme of the fourth section is experience and challenge. However, the comparison between C language and object-oriented language in the table \"proposed transformation in C\" is too common sense experience. It seems too ordinary to put it in this section, we should put some more unique and topic related experience.\n',1,'2020-12-05 16:56:52',17,_binary ''),(33,'# **Effective Capacity Prediction for Cloud Systems-Group A**\n\n## Contribution of the paper\nThis paper propose a novel capacity prediction approach. The idea is to proactively predict resource allocation failures concerning Low Capacity Status (LCS) by leveraging machine learning approaches. A low capacity status is reached when VM  allocation failures escalate to a specific threshold. By jointly considering the data from servers, users, and platform, the proposed approach can make accurate LCS predictions in a complex and dynamic cloud environment, and thereby improve the service availability of cloud systems. The proposed approach is evaluated by real-world datasets collected from Microsoft, and the results confirm its effectiveness.\n\n## Technical correctness of the paper\nThe paper\'s title is \"Effective Capacity Prediction for Cloud Systems\", but in their work, both the data processing and feature engineering are more likely base on the specific data set which from Microsoft. If the authors think this is an experience report, maybe they should modify the title of it. NOT \"Cloud Systems\", \"Microsoft AZure\" maybe appropriate choice.\n\nIn the part of Abstract, the authors just give \"VM\" but don\'t give the full name \"Virtual Machine\".\n\nAlso in the part of Abstract, when talking about the contribution of their work, the paper said: \"The proposed approach is evaluated by real-world datasets collected from Microsoft, and the results confirm its effectiveness.\" In my opinion, a more detail result should be described rather than generic.\n\nSince their work\'s aim is \"Effective Capacity Prediction\", but in the part of Introduction, they may pay more attention to resource allocation failures. So, what\'s the real relationship between them? Maybe there needs some description.\n\nThe paper gives out a special chapter called \"Challenges\", but we can\'t see any solution for those 3 challenges in their paper. Maybe the authors discuss some of it in TTV, but not enough for that chapter.\n\nIn the chapter of \"DATA PROCESSING AND FEATURE ENGINEERING\", which is the core part of this paper, in my opinion, is not described in detail. So, how can other researcher repeat this work? Just refer to the example it gives out?\n\nAlso in this chapter, it said: \"In our experiments, the value of ξ is empirically set to 50.\" So, Why ξ is 50, what\'s the reason？\n\nIn the chapter of \"EXPERIMENTAL EVALUATION\", the paper lists Logistic Regression (LR), Support Vector Machine (SVM), Random Forest (RF), LSTM as \"Classical Methods\", and writes \" In particular, our model outperforms all classical methods in term of all metrics.\" So, are these 4 kinds of methods can represent all of the Classical Methods？\n\n## How much effort did you spend refereeing this paper? \nReasonable\n\n\n------------------------------------\nReporter: Zijia Jia\nGroup Members: Jun Lv, Changlan Fu, Zhiying Li, Kaiwen Song, Chao Li, Kuilin An.\n',2,'2020-12-06 11:23:51',19,_binary ''),(34,'Title: What Do We Learn from the Migration to Microservice Architecture in Reality? An Industrial Inquiry\nAuthors: Shanshan Li, He Zhang, Cheng Zhang, Zijia Jia, Chenxing Zhong and Zhihao Shan\n\nSummary:\nThis article is an extension version of the conference paper published at ICSA 2019[1], which carries out a series of industrial interviews with practitioners from twenty software companies and aims at investigating the gaps between the ideal visions and real industrial practices on microservices and what expenses microservices bring to industrial practitioners.\nCompared with the conference paper, this article increases sample size from 13 interviewees to 20 interviewees, re-answers the two RQs with some domain-based figures and gives more in-depth discussion on the results. The article is well-structured and clearly presented.\n\nComments:\nAlthough this article is based on a conference paper, it still has the following three major problems: \n1. The article states that it \"re-answers RQs around the domain. Gaps and pains of MSA are analyzed around different domains, which is not considered in the conference paper\". Unfortunately, with the exception of some domain-related figures, the analysis methods used in results section remain largely the same in the conference paper.\n2. The article states that it gives more in-depth discussion on the integrated overview map and the implications to practitioners. However, the discussion section is still limited to the content of the results section, which does not reflect the new content worthy of taking away.\n3. The methodology is not detailed enough, which affects the rationality and correctness of the results.\n\nSome specific problems are as follows:\n1. The \"*\" in Table 1 (Page 3) is not explained.\n2. The research processes in Figure 1 (Page 3) is similar to the one in the conference paper. Is the 3 months of Data Collection accumulated from 2.5 months? The same question is the 1 month of Data Analysis. What role does the publication of conference papers play in this process?\n3. I do not find a list of interview questions in Section 2.3, which are important for readers to understand the results.\n4. \"Six interviews were conducted online due to the geographic restriction\", which six interviews are online? What type of online interview format is used? Van Maanen pointed out that text-based online interviews are not to be trusted[2]. In ethnographic studies, telephone and video online interviews are accepted[3].\n5. What are the details of theme analysis and coding? Are there any criteria for this part of the analysis? Because of the lack of criteria, it seems to me that some of the results are not at the same abstract level, e.g, in Section 4.1, \"the call chains of microservices will become longer and may burden the fault location\" and \"the chaotic independence of microservices may reduce the performance of systems due to the increasing interaction and the long call chain among distributed microservices\".\n6. Are the numbers of employees in Table 2 all the developer/engineer number? How does the size of the company affect interview results? This should be interesting, but it\'s not discussed in the article.\n7. Why the motivations and benefits should be discussed in Section 4.1?\n8. In Section 4.2, \"50% interviewees confirm this characteristic in their practice\", this shows that in the 7 additional interviews, no one commented on this idea. Why? This is worth exploring. Similarly, there may be problems in other sections as well. There may be new findings, but there are concerns about the quality of the additional 7 interviews。\n9. What does the size of the circle represent in Figure 9 (Page 9)? Compared with the conference paper, this figure only added a few tools, but the size of the circle seems the same.\n10. Section 5.1 describes the overview of the map about the results in Section 4. And the 5 decisions are proposed based on the map and results. However, what should practitioners do to complete their transition from monolithic systems to microservice systems in their contexts? This section seems to lack a roadmap or implementation framework.\n\n\n[1] Zhang, He, et al. \"Microservice architecture in reality: An industrial inquiry.\" 2019 IEEE International Conference on Software Architecture (ICSA). IEEE, 2019.\n[2] Van Maanen, John. Tales of the field: On writing ethnography. University of Chicago Press, 2011.\n[3] Kozinets, Robert V. Netnography: Doing ethnographic research online. Sage publications, 2010.\n\nReporter: Huang Huang\nMember: Huang Huang, Bohan Liu, Xin Zhou, Runfeng Mao，Jun Lv, Qiming Dai, Xin Yang, Zhiying Li, Kaiwen Song',18,'2020-12-11 17:13:20',59,_binary '\0'),(35,'Title: What Do We Learn from the Migration to Microservice Architecture in Reality?\n \nThis paper characterized the gaps between the typical characteristics accepted in the community and the industrial practices of microservices and investigate compromise between benefits and pains of microservices around those characteristics-related dimensions. And it proposed an integrated overview map of the practices and pains around the best-known characteristics of microservices identified from the industry.\n\nContribution of the paper (Increased sample size, Re-answering RQs around the domain, more in-depth discussion):\n1. They additionally invite seven interviewees from specific domains to increase sample size.\n2. Gaps and pains of MSA are analyzed in this paper around different domains .\n3. Provide an integrated overview map and more in-depth discussion. \n\nOur group’s comments are as follows:\n1.In abstract, the results part “We characterized the gaps between the typical characteristics accepted in the community and the industrial practices of microservices…. proposed an integrated overview map of the practices and pains around the best-known characteristics of microservices identified from the industry” is focus on the contribution rather than the results of the research, the specific results of the work or the phenomena reflected should be briefly summarized. Similarly, the conclusion in the abstract should focus on the meaning and summary of the work, instead of describing how practitioners study the subject.\n2.In Introduction, there is one slip.” The main contributions of this study are fourfold” The contribution is threefold rather than fourfold.\n3.In figure 1, the meaning of “pilot interviewees (2)” is not clear. “(2)” refers to two interviewees or two interviews?\n4.The definition of practice should be given to readers. What does the practice do should be clear. And if the practice is a summary of the entire project, is it possible to miss some smaller-grained questions from the interview?\n5.In 4.1 part, the title is “Practice 1: Independence by separation”, while the content is about motivation, the relationship between title and content is not intuitive.\n6.In 4.9 part, although it is specific  with regard to pain and practice and the overview of them is provided when  answering the requests, it is necessary to discuss the goals and RQ1: the gap between the vision of microservices and the actual industrial time of microservices.\n7.The content of questionnaire should be presented.\n\nReporter: Feimei Xie\nMembers: Lemin Zhang, Qinglong Meng, Xiaodong Liu, Jing Chen, Zan Gao, Xin Huang, Shenghui Gu, Bowen Zheng, Xiudi Chen, Dailinzi Ye, Changlan Fu\n\n',18,'2020-12-13 11:47:18',49,_binary '\0'),(36,'Title: What Do We Learn from the Migration to Microservice Architecture in Reality? An Industrial Inquiry\nAuthors: Shanshan Li, He Zhang, Cheng Zhang, Zijia Jia, Chenxing Zhong and Zhihao Shan\n\nSummary:\nThis article is an extension version of the previous conference paper.In terms of content, interviews with 7 companies have been added to obtain more sample data about benefits and pains of microservices.Then it proposes an integrated overview map of the practices and pains, and extracts five decision for the trade-off between benefits and pains of microservices architecture before its adoption.\n\nComments:\n1.The title contains \"Industial Inquiry\",but we can find out the list of interview question.\n2.In ABSTRACT part,the Obective description is not clear enough, and there is not compared with the conference version\n3.In Table 1,the \"C3*\" should explain the meaning considering the rigor\n4.In the penultimate paragraph of Introduction part,the statements of the 3rd and 4th contribution points are a bit similar in terms of sentences, and both use \"more in-depth discussion\", maybe you can change some rhetoric\n5.In Demographic results part, there is no explain how these companies are classified\n6.In 4.1 part,the last sentence，“All these problems may seriously influence the speed of debugging and the efficiency of developments...”，does not explain who said it\n7.In 4.6 part,references should be added to the first sentence, after all, it is quoted by Fowler and Lewis\n8.In Figure 11,we think that monitoring metrics should have units,such as CPU utilization.But there are some content in the figure without units,such as status of service.So it should be some distinction, or another form of expression\n9.In Discussion part,the 5 decisions are quite general after reading them through, and they do not show the characteristics of the domain.We hope to obtain some quantifiable domain data\n10.The references in this article are not much different from those in the conference version\n\nReporter: Huanlei Chen\nMember: Huanlei Chen, Lanxin Yang, Liming Dong, Peiyu Hou，Wengang Liu, Chao Li, Suhe Wang, Kuilin An',18,'2020-12-13 20:11:02',35,_binary '\0'),(37,'Title:Evaluating the Impact of Prediction Models on Continuous Integration Process: A Discrete-Event Simulation Approach\nAuthors: Bohan Liu, He Zhang, Haifeng Shen, Jiahui Wang\n\nSummary:\nThis paper aims to fill in the gap in the possible impact of predictive models on CI process in terms of time saving. It is mainly through the construction of discrete event simulation model to verify the validity and practicability of the prediction model in the previous work. This work has some contribution and is meaningful. However, there are still some problems. The specific review opinions are as follows.\n\nComments:\n1.The DES model mentioned in the Introduction section can be briefly introduced in the following article.\n2.In the last part of introduction to the structure of this paper, the fifth chapter is the main contribution of this paper, and the contribution points can be listed.\n3.In this paper, the correlation between the prediction model and the simulation model is not clear. The original purpose of the third chapter is to connect the two parts, but it is redundant. Meanwhile, the motivation is repetitive with the previous ones, and the whole third chapter gives people the feeling of redundancy and unclear structure.\n4.In the second section of the third chapter, TN,FP is mentioned for the first time, and it is suggested to add the full name.\n5.The fourth chapter does not begin to expatiate the work of this paper until 4.5 section. The previous part is particularly like background introduction, which is repeated with the previous one. In terms of structure, the third, fourth and fifth chapters are incoherent and have obvious jumps.\n6.In Figure 2, there is a missing space in \"TruePassed\".\n7.In Figure 6, the legend overlaps with Figure(a)\n\nReporter: Jing Chen\nMember: Kaiwen Song, Zhiying Li, Xin Yang, Changlan Fu, Jun lv',19,'2021-01-08 17:32:40',1,_binary '\0'),(38,'Title: Evaluating the Impact of Prediction Models on Continuous Integration Process:A Discrete-Event Simulation Approach\nAuthors: Bohan Liu, He Zhang, Haifeng Shen, Jiahui Wang\n\nThis paper evaluate the possible impact of prediction models on the CI process in terms of the saved time.\n\nContribution of the paper :\nThe authors propose a novel approach that exploits software process simulation to simulate a predictive CI process.\nThey build a Discrete-Event Simulation model to simulate the CI process with integrated prediction models.\nThey conduct experiments to evaluate the impact of these models on the CI process.\n\nOur group\'s comments are as follows:\n1.14 OSS projects using Travis CI and 4 OSS projects using Gitlab were chosen to compare different predictive CI models. Why is there difference is quantity？And will the differece has a impact?\n2.In section 6,Simulation for Validation, the combination of Neighbourhood Cleaning Rule [48] sampling algorithm and Gaussian Naive Bayes (NCR+GNB), the combination of Random Under Sampler and Gaussian Naive Bayes (RUS+GNB), the combination of Near Miss sampling algorithm and Gaussian Naive Bayes (NM+GNB), and the combination of Random Over Sampler and Classification and Regression Trees (ROS+CART) were built,however there is no description about the detail of data sampling.\n3.F0.5 and F2f were used to evalute the the performance of predicting passed. However, the reason using them is not given. And the  calculation formula is not presented.\n4.In terms of soundness,\" Overall the applied method seems to be sound. However, it was not possible to inspect the simulation model without having to sign up for a trial version of the simulation tool.\" Our group think it is a critical opinion. How does the author respond to it?\n5.In figure 8, it shows the relative cost savings of five selected models for different projects. We can see all models fail on project D. Why does this happen? We think this problem is worth discussing.\n6.\"The reason for this lack of adoption is that developers and companies prefer to do test selection/prioritization and batching with culprit finding to ensure that all builds are tested with a subset of relevant tests or all tests are run on a batch of tests. Despite the vast literature on test selection and prioritization the authors do not have a single reference to this area. \"  We think this is also an important opinion.\n\nReporter: Feimei Xie\nMembers: Qiming Dai, Shenghui Gu, Lingjie Li, Zijia Jia, Renhang Xu, Xue Zhao, Zan Gao',19,'2021-01-09 11:09:49',49,_binary '\0'),(39,'# **Using Learning-based Approach to Support Software Traceability Maintenance Tasks in Industrial Context-Group A**\n\n## Contribution of the paper\nThe paper design a series of experiments evaluating the performance of different components configuration of learning-based classifier. And they illustrate the barriers encountered in industry traceability maintenance practice and found that learning-based approach can achieve better performance on the industry projects which constrained by these barriers.\n\n## Technical correctness of the paper\nThis paper give out 3 RQs, but what\'s the research value and contribution of RQ1 and RQ3. In RQ1, can \"the best performing configuration\" of this study can make sense in other software projects? In RQ3, why should we check this factors? \n\nIn \"Table 1: Project characteristics of OSS dataset\", there are some columns which look like have no sense, like Comp and Domain. What a interesting thing is that the project \"Konply\" maybe \"konlpy\" in github in fact, so please check it again.\n\nIt seems that if 3.2 Learning-based Approach should make a independent chapter, instead of just\njust a section.\n\nThe paper said they identified 18 attributes for requirement-commit pair and 17 attributes for issue-commit pair, and they also said The two feature sets Ai = { a1,...,an }, Bi = { b1,...,bm }, where n,m = {16}. So what\'s the gap of them?\n\nIn the part of \"Description of Labeled Strategy\", although we can understand the description, but we also think it\'s hard to understand for other researchers which are not familiar with feature engineering.\n\nThere are also lots of terms which not give out some detail description in the paper, like \"golden link\".\n\nIn Table 3: Selected independent variables and values, \"oss\" is a Data Re-sampling method, but OSS is\nis also represent the Open Source Software!\n\nThe paper should pay more attention to the comparison of dataset dataset from OSS and Industry Software, rather than just give out a experiment and validation of it.\n\n## How much effort did you spend refereeing this paper? \nReasonable\n\n------------------------------------\nReporter: Zijia Jia\nGroup Members: Runfeng Mao, Xin Yang, Huang Huang, Bohan Liu, Chenxing Zhong, Wei Li, Qiming Dai, Xin Huang, Huilin Yin, Ruihong Liu.',20,'2021-01-15 12:52:13',19,_binary '\0'),(40,'Title: Revisit Security in the Era of DevOps: A Grey Literature Review on DevSecOps\nAuthors: Xin Zhou, Runfeng Mao, He Zhang, Qiming Dai, Huang Huang, Haifeng Shen, Jingyue Li and Guoping Rong\n\nThis paper conducts a grey literature review and reports the state-of-the-practice of DevSecOps including the impact of DevOps on security, practitioners’ understanding of DevSecOps, and the practices associated with DevSecOps as well as the challenges of implementing DevSecOps. Here are some comments for the improvement of this work：\n\n- undefined I was wondering whether you can claim this work as a Multivocal Literature Reviews (MLR), because you considered both peer-reviewed studies and grey literature.\n- undefined Since you need to demonstrates the value of new data obtained from academic studies, I do not think the current way of discussing the results separately can give much help for this purpose. From the current version, I can only get the information that the data obtained from academic studies are inadequate, which is aimed to prove that the contribution of your grey literature review. To address this problem, it is suggested to merge the results of section 4 and 5 into one section, where you can combine the findings together to answer your RQs and tell apart the source of your evidence in specific figures or tables at the same time. \n- undefined The description “As there is very little academic literature on DevSecOps, like the emerging stage of many other trendy topics in SE such as microservices…” is out-of-date. At present, a large amount of academic papers have been published.\n- undefined The abstract needs to be updated, for example, the method does not only include ‘Google search engine’ any more.\n\nReporter: Shanshan Li\nMembers: Xin Huang, Bohan Liu, Liming Dong, Shenghui Gu, Chenxing Zhong, Zijia Jia, Xin Yang, Jing Chen, Huanlei Chen \n\n',22,'2021-01-15 19:13:16',48,_binary '\0'),(41,'Title: Using Learning-based Approach to Support Software Traceability Maintenance Tasks in Industrial Contex\nAuthors: Liming Dong, Jing Chen \n\n\nSummary:\nThis paper investigates the learning-based approach, which uses the process and textual information to train link classifier to support automatic traceability maintenance tasks between software development artifacts. In order to gain an understanding of to what extent learning-based techniques can be applied to traceability maitenance tasks in a large-scale industrial dataset, this work evaluates the performance of different components configuration of learning-based classifier.They demonstrate the improvements on main components of learning-based approach pipeline using OSS and industry dataset. The results show that we can take advantage of learningbased approach on the projects to support maintenance tasks of requirement-commit and issuecommit links. This work has some contribution and is meaningful. However, there are still some problems. The specific review opinions are as follows.\n\n\nComments:\n1. Title: Did not explain this \"learning-based method\", referring to \"machine learning\", \"Deep learning\", or include both? If it is machine learning, it is better to use the word \"machine learning\", changing to another representation is like a new method.\n2. Abstract: OSS abbreviation does not give the full name, you can change the previous \"open source projects\" to \"open source software (OSS) projects\".\n3. The word is misspelled, change \"maitenance\" to \"maintenance\".\n4. There is no mention of the reasons for doing this work (product tracking and classifier evaluation, etc.), the importance and the benefits of doing this work are not reflected.\n5. This paper does not say why the learning-based method is used, whether there is a rule-based method, a knowledge-base method, the correlation and comparison between them.\n6. \"Many studies have achieved good results by evaluating their traceability recovering approaches on open source projects.\" This sentence can adde the study uses a learning-based classifier, so that it can be better connected to \"This article evaluates learning-based Classifier\".\n7. The job positioning and nature should be clear. The positioning should be clearly stated in the evaluation and experience study, and then describe the method of evaluation and the evaluation results and conclusions. After positioning, adjust the topic, the current topic is relatively large.\n8. Related work is divided into software tracking maintenance technology and software tracking practice in industrial projects. The experience study work of the same nature as this paper can be separated separately.\n9. Section III Structural Adjustment:\nThe research method can include the research process and the methods used in the process. It is not appropriate to put research questions in the research method. It can be placed in the subsequent evaluation. The evaluation can include the introduction of the data set, the reason for the selection, the research questions, and the experimental design for answering these research questions (it is not clear how to design the experiment here. Answer to RQ), evaluation indicators, etc. Here, in the fourth section of the evaluation, only 4.1 has written indicators. The experimental goals, data collection and experimental results are combined, not very standardized, and the experimental results are not very prominent; 4.2, 4.3, 4.4 The summary can be placed in the result chapter as the research result.\n10. There are two pairs of tracking chains, and the other is a requirement-issue pair. The RQ only talks about issue-commit pair. \n11. The four-fold time series verification is based on the recommendations of which research, whether there is a basis or is it a subjective choice, why the four-fold time series verification is used, and whether it will cause deviations and differences in the results, these need to be considered.\n12. There is no conclusion after evaluating the results.\n\n\nReporter: Changlan Fu\nGroup(B) Members: Changlan Fu, Lanxin Yang, Dailinzi Ye, Zan Gao, Feimei Xie, Bowen Zheng, Peiyu Hou, Fuli Zhang, Mengjie Ding, Tao Yang, Jiahui Wang, Bo Pan, Wengang Liu',20,'2021-01-16 10:56:52',6,_binary '\0'),(43,'Title: Revisit Security in the Era of DevOps: A Grey Literature Review on DevSecOps\nAuthors: Xin Zhou, Runfeng Mao, He Zhang, Qiming Dai, Huang Huang, Haifeng Shen, Jingyue Li and Guoping Rong\n\nThis paper conducts a grey literature review and reports the state-of-the-practice of DevSecOps including the impact of DevOps on security, practitioners’ understanding of DevSecOps, and the practices associated with DevSecOps as well as the challenges of implementing DevSecOps. Here are some comments for the improvement of this work：\n\n- The rigorous definition of grey literature is not peer-reviewed literature, but the article says a lot of content obtained through academic papers. Our group thinks the title can be changed to multi-channel literature review.\n- The topic of this paper focuses on DevSecOps, and RQ1 describes the impact of Devops on software security.Our group\'s suggestion is \"What are the concern/status/state of software security in DevOps?\"\n- We don\'t think it\'s necessary to talk about athours\' experience in 6.3.\n- Then there are some details that need to be fixed:\n   - In the introduction, \"five major contributions\" is not consistent with the article.\n   - The first author of the article needs to modify\n\nReporter: Bo Pan\nGroup(B) Members: Changlan Fu, Lanxin Yang, Dailinzi Ye, Zan Gao, Feimei Xie, Bowen Zheng, Peiyu Hou, Fuli Zhang, Mengjie Ding, Tao Yang, Jiahui Wang, Bo Pan, Wengang Liu',22,'2021-01-17 19:55:43',63,_binary '\0'),(44,'Title: Using Learning-based Approach to Support Software Traceability Maintenance Tasks in Industrial Context\nAuthors: Liming Dong, Jing Chen\n\nSummary:\nThis paper design a series of experiments evaluating the performance of different components configuration of learning-based classifier. They illustrate the barriers encountered in industry traceability maintenance practice and found that learning-based approach can achieve better performance on the industry projects which constrained by these barriers. Furthermore, they identified the limitations that need to be addressed in order to bridge the gap between OSS dataset experiments and real performance of learning-based approach in industrial context.\n\nComments:\n1. The introduction is rather wordy, which doesn\'t reflect the logic of the whole paper.\n2. The introduction doesno\'t clearly introduce the contribution of the paper.\n3. The information in Table 1 is redundant, and it\'s too far ahead to be used on page 5.\n4. It seems that there is no explanation why OSS projects choose multiple data sources, and there is no explanation for the processing of multiple different data sources.\n5. Most of the content in RQs is about the introduction of experimental methods, and the analysis of experimental results is too little.\n6. The meaning of the bold and underline in Table 5 is not clear.\n7. In RQ3, it seems that the reason of selecting 4.4.1 and 4.4.2 indicators is not introduced, and the selection of indicators before and after rq3 is different.\n8. The discussion section only mentions the difficulties in the industry context. It is suggested to increase the comparison between the industry context and the OSS context.\n9. The conclusion section only introduces the contribution of the paper, and there are few discussions about the research significance, application value and future work.\n\nReporter: Jiaqi Zhang\nGroup(C) Members: Xiudi Chen, Yifan Zhang, Qianwen Xu, Xiaodong Liu, Jiarui Wang, Shanshan Li, Kaiwen Song, Zhiying Li.',20,'2021-01-17 22:49:49',66,_binary '\0'),(45,'# Title：Using Learning-based Approach to Support Software Traceability Maintenance Tasks in Industrial Context---Group D\n# Authors: Liming Dong, Jing Chen\n---\n### Contribution\nThis paper design a series of experiments evaluating the performance of different components configuration of learning-based classifier. The experiments results led to observation that using ’Labeled’ data as sampling dataset and Time Series validation can achieve better performance on both OSS and industrial contexts. And the authors illustrate the barriers encountered in industry traceability maintenance practice and found that learning-based approach can achieve better performance on the industry projects which constrained by these barriers. Furthermore, the authors identified thelimitations that need to be addressed in order to bridge the gap between OSS dataset experiments and real performance of learning-based approach in industrial context.\n\n---\n### Comments\n1. There is no clear explanation for the abbreviations of OSS and AUC, and many terms are not described in detail.\n2. Line 161 section?? , 859 figure??. There are many other obvious written mistakes.\n3. There is no subscript in Section 3.2, and it should not be just a section in terms of content.\n4. Spelling error on line 179 and capitalized of on line 488.\n5. P22 is missing in table on line 874.\n6. Among the three RQs, RQ1 and RQ3 did not clearly explain their value contribution.\n7. \"Learning based approach\", this title does not explain what kind of learning method it refers to - machine learning, deep learning....\n----\nReporter: junyu jia\nGroup（D） Members: Jia Junyu, Juzheng Zhang,  Haoming Li,  Yanze Wang, Lemin Zhang, Huanlei Chen, Zeye Zhan, Hao Wang ',20,'2021-01-17 23:26:23',62,_binary '\0'),(46,'- Abstract: there are too many cliches and there is no pertinence\n\n- The gap between theory and practice in the introduction is not well explained in the following paper\n\n- 2.5.1 there are too few manually searched meetings, which are not authoritative\n\n- What is the relationship between the five characteristics in 5.1.6 and the previous stage division, and how to obtain these five points (my own opinion or summary, if there is no evidence to support, it should not be put here), we should summarize the phenomena and problems in each stage, not the characteristics\n\n- 5.2 when answering rq2, what is the basis for binding stages and topics\n\nReporter: Jiarui Wang\nMembers: Junyu Jia,Jiahui Wang,Bowen Wang,Yifan Zhang,Jiazi Jia,Qiming Dai,Lanxin Lan,Runfeng Mao,Xi Yang',24,'2021-01-24 22:56:58',65,_binary '\0'),(47,'Title: Logging Practices in Software Engineering: A Systematic Review\nAuthors: Shenghui Gu\n\nThis paper established a research report on the log practice status from the perspective of the life cycle, and systematically analyzed the existing research. A total of 54 relevant papers have been identified, which will help researchers and practitioners to systematically understand the logging practice, which is of guiding significance. Here are some comments for the improvement of this work：\n1. The results of the abstract section should not include the steps to implement the research, but should emphasize the results of the research.\n2. The reason why data source of the paper excludes springer should be explained.\n3. Chapter2.8 data synthesis part is less content.\n4. There are 8 participants in the data analysis stage. How to achieve standards and uniformity should be explained in detail.\n5. The difference between cause type and effect type should be explained in detail.\n6. The order of the table display is based on the proportion rather than the life cycle order, which causes confusion when reading.\n7. Some views in 5.1.2 are not cited.\n8. In table 7 the empirical data and finding and other raws are not in the same dimension.\n\nReporter: Zhiying Li\nMembers: Jiaqi Zhang, Jing Chen, Jun lv, Bohan Liu, Changlan Fu, Xiaodong Liu, Hao Wang, Peiyu Hou, Kaiwen Song, Chenxing Zhong, Huang Huang',24,'2021-01-24 10:18:39',22,_binary '\0'),(48,'Title: Logging Practices in Software Engineering: A Systematic Review\nAuthors: Shenghui Gu\n\nMembers: HaoMing Li, HuiLin Yin, WenGang Liu, Tao Yang, ShanShan Li, LiMing Dong, Zan Gao, XiuDi Chen, HuanLei Chen, JuZheng Zhang, ZeYe Zhan, YanZe Wang\n\nThis paper studies the current situation of log practice from the perspective of life cycle, and systematically analyzes the existing research results through 54 papers, which is helpful for researchers and practitioners to practice log activities systematically. It has certain guiding significance. Here are some questions about this work:\n\n- The title of the article contains the word \"software engineering\", but the meaning of this article to software engineering is not reflected in the abstract and introduction.\n- There are two questions mentioned in the introduction of the article: “where to log” and “what to log”, but there seems to be no clear answer in the later part of the article.\n- There are some abbreviations in the article. If there is no way to understand them directly without reference, it is suggested to explain them.\n- Section 2.1 of the article says that three RQs are proposed here, but four RQs are listed later.\n- There is a red \"stop here...\" in Section 4, which should be the unfinished part.\n- In Section 5.2, the paper is divided into several topics, but the division standard is not clear.\n- The 6 section mainly describes the answers of RQ4, which should be put in the 5 section.\n- The positions of topic and issue in Table 8 are reversed.\n- According to the comparison between table 8 and table 9, whether you need to add a comparison between issue and approach to make it more intuitive.\n',24,'2021-01-24 16:50:00',17,_binary '\0'),(49,'# Title：11 Years of Tertiary Studies in Software Engineering: A Critical Review\n\nAuthors: xin huang ,zhou xin ,huang huang\n---\n### Contribution\nThis paper intended to realize the current state-of-the-art of the existing TSs till now. they investigated and assessed the how the researchers conduct TSs in order to obtain the scope of a TS.They found that there is a great difference between TSs from the perspective of methodology and there is an important need for research to develop guidelines for conducting TSs in SE.\n\n----\n### Comments\n1. There are not many highlights in RQ. Both RQ and RQ are statistics and there is no analysis. Should have their own point of view, just stay in the collection of materials is not enough\n2. The space of 5.1; 5.2 is really valuable. It\'s only a little more than half a page, but there are too many limits.\n3. Some of the topics in Table 3 are less than 20 and some are more than 100. What do these numbers mean? However, there are only two CIT gudelinines that do not refer to guides. We should do some analysis for these outliers.\n4. The title of 5.3 should be changed to TTV (thread to validity)\n5. The format of references is not uniform\n6. The format of table5 is not uniform\n---\nReporter: Junyu Jia\nMembers: Junyu Jia,Jiarui Wang,Bowen Wang,Yifan Zhang,Jiazi Jia,Qiming Dai,Lanxin Lan,Runfeng Mao,Xi Yang\n',23,'2021-01-24 23:29:00',62,_binary '\0'),(50,'Title: 11 Years of Tertiary Studies in Software Engineering: A Critical Review\nAuthors: Xin Huang, Xin Zhou, Huang huang\n\nThis paper investigated and assessed the how the researchers conduct TSs in order to obtain the scope of a TS. They conducted a systematic literature review on the TSs published between 2009 and 2019 was conducted, and 38 tertiary studies were identified. They found that there is a great difference between TSs from the perspective of methodology and there is an important need for research to develop guidelines for conducting TSs in SE. Here are some comments for the improvement of this work：\n\n1. In introduction section, It is difficult to arouse readers\' interest, because the introduction of the contribution was not attractive.\n2. The current RQ is relatively thin, it is suggested to discuss more about the problem of TSs.\n3. The number of papers in Figure2 is not match with paper content.\n4. It exists mistakes in grammar in line 497.\n5. The contents discussed in 5.1 and 5.2 are somewhat repetitive.\n6. In general, the contribution of the paper needs to be strengthened\n\nReporter: Jiaqi Zhang\nMembers: Zhiying Li, Jing Chen, Jun lv, Bohan Liu, Changlan Fu, Xiaodong Liu, Hao Wang, Peiyu Hou, Kaiwen Song, Chenxing Zhong',23,'2021-01-24 23:30:46',66,_binary '\0'),(51,'The research proposes a Structured Synthesis Method (SSM) to support qualitative and quantitative analysis in empirical software engineering research. A tool was developed to implement the method. \n\nIn empirical software engineering research, the synthesis of evidence has always been a pain point. The motivation of this article is clear and valuable. The paper is well written and the method was validated by exemplar cases. But I have following concerns about SSM method:\n\n- What is the essential difference between SSM and SLR. The five steps of SSM are highly similar to the process of SLR, and the paper also indicates that the process refers to Kitcheham et al.\'s research. The focus of the study should be synthesis of evidence. The selection of literature has gone beyond this category.\n\n- The theory behind the SSM method is reasonable. However, this study is more like a hodgepodge. \n\n- The original contribution of this research and the differences from related research are not clear enough.\n',3,'2021-01-29 09:43:37',37,_binary ''),(52,'This paper proposed a synthesis method for EBSE to help researchers conduct research synthesis. This is an interesting topic because the huge data (both quantitative and qualitative) in SE make it hard to synthesize data. The human factors are always difficult to address because the data type can be different so that we cannot synthesize them. The SSM proposes an idea to synthesize the data through translating them into quantitative data.\n\nStrength:\n1. SSM is exactly difined, it has a complete process to address the data (the five steps). This makes it easy to accpet for the novices.\n2. SSM has been adopted in SE and we can find successful examples. \n\nWeakness:\n1. SSM translates qualitative data into quantitative data. There may be some disagreements in the translation. For example, the quality assessment. This paper gives scores to different types of literature reviews. However, I do not think the scores are exactly reasonable because the evidence may differ a lot in the same type.\n2. The translation process is not well supported in my opinion. How to set the value should be discussed more.\n\nAlthough this paper intends to serve as a guideline for conducting SSM, the SSM may need to propose a structure instead. The authors should emphasize their objective.',3,'2021-01-29 09:53:29',5,_binary ''),(53,'# **Pooling Evidence in Software Engineering with the Structured Synthesis Method**\nAuthor: Paulo S ́ergio Medeiros dos Santos, Guilherme Horta Travassos\n\n## Contribution of the paper\nThis paper present the Structured Synthesis Method (SSM). Its blend of integrative and interpretative features makes the SSM appropriate to depict the important contextual aspects and to inform the trends of the outcomes reported in the studies, as well as a confidence estimation about them. And the SSM which presented by this paper give out a five-stage process based on Ciolkowski (2009), which may be helpful to the researchers in future.\n\n## Technical correctness of the paper\nIn the part of \"2 Conceptual Grounding\":\nIt\'s very hard to understand the Fig. 1, so, what\'s the meaning of the hollow arrows and solid arrows？Do they have the same meaning with UML elements? And why Activity and Modify have no relationship with other part? \n\nIn the part of \"3  The Mechanics of Evidence Pooling: the Structured Aggregation\":\nIn the formula of \"Aggregation of two evidence related to the same theoretical structure\", why use the \"+\" between the two part?\n\nIn the part of \"5 A tiny example using the SSM\":\nThis paper said \"Continuous Integration is the theme selected to illustrate the SSM features as it does not have a well-defined set of metrics or constructs and, thus, it is convenient to demonstrate the method’s strengths.\" Is this a rigorous conclusion which CI does not have a well-defined set of metrics or constructs? \n\nOverall opinion:\nThe paper writes that \"We propose the SSM process guidance based on existing research synthesis methods. It means that we intend to avoid as much as possible to reinvent existing methods’ orientations. On the contrary, we will incorporate their definitions into SSM whenever it is reasonable.\" The paper said they will incorporate their definitions into SSM whenever it is reasonable, but do thise reasonable theory have any conflict? And how to solve it?\n\n## How much effort did you spend refereeing this paper? \nReasonable\n\n## Decision\nWeekly Accept. Please Modify and repost.\n\n------------------------------------\nReporter: Zijia Jia',3,'2021-01-29 09:57:56',19,_binary ''),(54,'This paper presents a new method of research synthesis, which integrates qualitative analysis and quantitative analysis. It is very interesting ideal, which is worth studying and exploring. But there are still some shortcomings in this paper：\n1. The author puts forward a core hypothesis in line 14: Following this line of argument, the central hypothesis behind the method described here is that putting all kinds of evidence – from experience reports to controlled studies – under the same perspective is crucial for the research synthesis process, particularly considering the heterogeneity of primary studies in SE. This supposition comes from the perception that in virtually any research synthesis method, the knowledge extracted from studies suffers an intense transformation. This transformation usually aims at translating individual results in a representation that allows them to be analyzed from the same perspective. Does it mean that the method can only be used under this assumption.\n2. The author gives 5 steps in line 34. There is no way to clearly prove the constituent elements of the method in the implementation of the 5-step method. What are the considerations for the 5-step method?\n3. Section III proposes structured summaries. The author explains that the term \"structured\" is used to refer to theoretical structures, because they are used to express (ie modeling or construction) the results of basic research. Structured summaries are very useful. It is very misleading. The author emphasizes that structured summarization is the core of SSM, but the whole method reads more like a clustering process. It is not clear where the author\'s contribution is. Otherwise, the scaling of Fig2 is problematic.\n4. The data integration method in Section 4 only integrates the current common data integration methods. Through Sections 5 and 6, no clear effect of the SSM method is found.\n5. After reading the article as a whole, it did not clearly explain what SSM is, what are his steps and methods。\n',3,'2021-01-29 10:03:58',61,_binary ''),(55,'The article proposed a method named Structured Synthesis Method (SSM) to solve the challenge of investigating the alternative research synthesis methods for SE. The authors stated that because of the blend of integrative and interpretative features, the method could appropriate to depict the important contextual aspects and to inform the trends of the outcomes (e.g., positive or negative) reported in the studies, as well as a confidence estimation about them.\n\nSome comments are as below:\n\n1. Section Introduction is strange to read. it is more like explaining the background of the research. Moreover, some important articles published in recent years seem to be ignored, such as Huang\'s [1], Fu\'s [2] and Zhang\'s [3]. These concepts are mentioned in the article, but the authors do not seem to pay attention to the latest published literature, which is a bit strange.\n\n2. Section 2.1 is about \"Theories\", I could not see the latest articles about the more famous method \"Ground Theory\" [4]. This part is more like an introduction to the tools used to form a theory.\n\n3. The SSM should foucus on the synthesis of the evidence, why should we consider the selection and some other part of SLR in SSM processes? It does not seem to be particularly helpful for those actions.\n\n4. Section 4.4, it is stated that \"The coding process in SSM does not even need to go through a continuous and iterative process of small steps as it is usually indicated.\" This sentence is somewhat arbitrary.\n\n5. Section 5, how were the two papers selected from the 373 papers? Are there any selection criteria or research biases? Random selection?\n\n6. In the both cases (Section 5 & 6), the evidence synthesis was limited in scope (2 studies in Section 5 and 5 studies in Section 6). When the evidence synthesis was actually conducted for the primary studies, there would be a large number of literatures, and we could not see the SSM\'s support for the synthesis of more literatures. Is there any difficulty in using it while synthesizing much more primary studies.\n\n7. Some values (e.g., belief value in Table 4), the types of the primary study were considered. However, the quality assessment should be considered as well. That would be a fatal blow to the reliability of the integrated evidence.\n\nIn general, the article discusses an important topic in software engineering. However, some structural organization will confuse me. The organization of the introduction to the concept at the beginning of the article is easy to lose the focus.\nEspecially Section Introduction makes me have more expectations for the synthesis of methods and the mix-method approach for SE research. Unfortunately, SSM only focuses on the synthesis of evidence between studies. Although this is important, it doesn\'t meet the expectations the Section Introduction shows to us. Thus, the contributions of SSM in the abstract and Section Introduction could be narrowed down.\n\n\n[1] X. Huang, H. Zhang, X. Zhou, M. Ali Babar and S. Yang, \"Synthesizing Qualitative Research in Software Engineering: A Critical Review\". ICSE\' 2018\n[2] C. Fu, H. Zhang, X. Huang, X. Zhou and Z. Li, \"A Review of Meta-ethnographies in Software Engineering\". EASE\' 2019\n[3] H. Zhang, X. Huang, X. Zhou, H. Huang, and M. Ali Babar, \"Ethnographic Research in Software Engineering: A Critical Review and Checklist\". ESEC/FSE\' 2019\n[4] K. J. Stol, P. Ralph and B. Fitzgerald, \"Grounded theory in software engineering research: a critical review and guidelines\". ICSE\' 2016',3,'2021-01-29 10:03:27',59,_binary ''),(56,'15～16页的图都在下一页起始，分割了正文中冒号列举的内容，行文完整性可能需要考虑改进。',3,'2021-01-29 10:09:33',69,_binary ''),(57,'This paper proposed a research synthesis method SSM putting particular emphasis on knowledge representation considering the heterogeneity of primary studies in SE regarding qualitative and quantitative approaches used in the area. The research topic is interesting and may contribute a lot for the researchers using synthesis methods in their studies. However, some comments still need to be addressed in the next step to maximize the contribution of this paper: \n\n- Section 4: More details are necessary to help elaborate the representativeness of the two RQs used in section 4.1. Why are these two RQs selected here? Is there any other kind of RQs uncovered?\n- Section 5: This section uses a tiny example for the demonstration of SSM procedure, which is good. It is better to give a comparison between it and a certain baseline, for example, the previous methods/procedures without using SSM. If this is difficultly achieved, as explained in Section 7, more kinds of evaluation work are needed to prove the benefits of SSM claimed.\n- Section 6: The arrangement of this section is puzzling. From the so-called real cases of the SSM usage, I cannot get how the SSM is used in each case and what the outcomes are after using the SSM. \n',3,'2021-01-29 10:10:13',48,_binary ''),(58,'The paper mainly present the SSM to contribute to the alternative research synthesis methods. The results proposed by the paper are new and original. For the paper, I have some opinions: \n- The meaning of the SSM is expounded in the introduction part so that the reader can continue to read, and the structure of the paper is reasonable. \n- It is really really difficult to read the paper. \n- The format of tables in the paper is not clear and so compact.\n- The size of the case study is small but it is enough to describe the method. \n',3,'2021-01-29 10:11:47',56,_binary ''),(59,'1.The paper is formatted incorrectly: lines 51-65 on each page are full of white space.\n2.It would be better to explain more about the \"add\", \"remove\" and \"join\" shown in section B of Figure 8.\n3.Enlarge the font in figure 9.\n',3,'2021-01-29 10:17:10',46,_binary ''),(60,'The paper targets at presenting an encompassing method for synthesizing qualitative and quantitative data that originated in the diverse types of primary studies. The method, namely Structured Synthesis Method (SSM) blends integrative and interpretative features to depict the contextual aspects and to inform the trends of the outcomes, as well as the confidence estimation. \n\nTwo points of this work are admirable. First, the SSM method is also facilitated with tool support.\nSecond, it is overt that the paper structure is quite clear to help readers to better understand the gist of the work.\n\nHowever, the negative side of the paper is also apparent. First and foremost, I wonder what is newly proposed by the authors. It seems that SSM is highly based on previous methodologies, like the uncertainty formalism. On the other hand, SSM has merely been supported by several case studies. It would be better if further investigation (like interviews) is conducted to provide feedback from some pertinent users. Last, there remains some steps in SSM that are somewhat biased (e.g. due to subjective points), for example, translating each piece of evidence to a theoretical structure and determine their compatibility. Is there any method to prevent such biases?',3,'2021-01-29 10:21:15',23,_binary ''),(61,'This paper proposed a Structured Synthesis Method to contribute to the challenge of investigating the alternative research synthesis methods for SE.\n+ abstract mentions the challenge of investigating the alternative research synthesis methods for SE, But it’s too vague to understand.\n+ The stages of SSM is similar to SLR, the difference between them is not stated.\n',3,'2021-01-29 10:40:22',27,_binary ''),(62,'**Title:** Pooling Evidence in Software Engineering with the Structured Synthesis Method\n**Authors:** Paulo Sergio Medeiros dos Santos, Guilherme Horta Travassos\n\n\nThis paper presents the Structured Synthesis Method (SSM) as an encompassing methods for synthesizing qualitative and quantitative data. It is valuable to combining qualitative and quantitative data since the SE researchers are willing to obtain data through various sources. The theory ground of this paper is solid and detailed. However, the major contribution of this study is not clear in this paper, and the qualitative data is less discussed.\n\n**MAIN CONCERNS INCLUDE:**\n-	INTRODUCTION: Although the authors present a detailed introduction about evidence-based research method, I expect more information about the status of method and data synthesis in SE. Moreover, the citations in this section need to update, since some research methods have been refined to adapt SE.\n\n-	CONCEPTUAL GROUNDING-THEORIES: In fact, I find this section has few contributions to help me understand the SSM, on the contrary, it makes me confused. I recommend deleting the content that not related to SSM and elaborating how these theories effects the development of SSM.\n\n-	THE STRUCTED SYNTHESIS METHOD: The process of SSM seems similar with SLR, it is reasonable. In fact, I seldom use four level quality assessment because it is hard to operate in the real work. Although I can understand the categories in TABLE 4, I am not sure about the availability of it. The author need to elaborate the rationality of it.\n\n-	EXAMPLE USING THE SSM: The process of quantitative data is interesting, but the process of qualitative data is simply. It seems SSM focus more on quantitative data and try to calculate a percent for qualitative category.\n\n-	DISCUSSION: I expect further discussion about how SSM can help the SE researchers to find the valuable knowledge from the combination of qualitative and quantitative data.\n\n**MINOR CORRECTIONS:**\n-	INTRODUCTION: I recommend merging the first two paragraphs to elaborate the relationship between \"science overload\" and evidence-based SE. Moreover, the citations at the end of paragraph 1 are confused, it is unreasonable to proof \"the recent attention\" with them.\n',3,'2021-01-29 10:24:21',39,_binary ''),(63,'Title:Pooling Evidence in Software Engineering with the Structured Synthesis Method\nAuthor:Paulo S´ergio Medeiros dos Santos,Guilherme Horta Travassos\n\nIn this paper, they proposed the Structured Synthesis Method (SSM),this method contribute to the challenge of the investigation of alternative research synthesis methods.And SSM’s blend of integrative and interpretative features makes the SSM appropriateto depict the important contextual aspects and to inform the trends of the outcomes (e.g., positive or negative) reported in the studies, as well as a confidence estimation about them.\n\nMy comments is as follows:\n1.Some Figures are hard to read ,such as Fig.2.The typesetting needs to be modified.\n2.In Fig.9 ,the font should be consistent.\n3.I think the author should explain the difference between the traditional SLR and SSM that they proposed.\n4.Why they use the five step method is not explained in this paper.',3,'2021-01-29 10:25:43',24,_binary ''),(64,'The paper proposed a method to tosynthesize the data through translating them into quantitative data,which is a help to researchers to synthesize data.Some comments are as follows:\n1.There should be a related work in the paper to disdinguish between the new method and SLR,because the five steps proposed in the method are similar to the process of SLR.\n2.In section 3.2 there is a foamatting error: The title of Fig3 is not aligned with the image',3,'2021-01-29 10:26:24',41,_binary ''),(65,'# Title: Pooling Evidence in Software Engineering with the Structured Synthesis Method\nAuthors:Paulo S´ergio Medeiros dos Santos Guilherme Horta Travassos\nThis paper presents the Structured Synthesis Method (SSM) to contribute to the investigation of alternative research synthesis methods for SE ,which is helpful for researchers to deal with qualitative and quantitative evidence in software engineering .It has certain guiding significance. Here are some questions about this work:\n•	The introduction section describes only the background of the research, the motivation and the process of using the proposed method. The introduction to the contributions of this study, especially the results and benefits of using the method, should be added.\n•	The introduction section mentions research synthesis methods are also frequently used standalone along with systematic (or non-systematic) literature reviews, but there is no further introduction in latter sections.\n•	The execution process of SSM is similar to that of SLR, and the relationship between the two is not clearly stated in the paper.\n•	In section 2, a lot of space is devoted to the introduction of theoretical concepts and mathematical theory of evidence, but this part does not make an obvious contribution. It is more like an introduction to the content involved in SSM.\n•	In Section 5, 2 articles were selected from the retrieved 373 articles, but the criteria and reasons for the selection were not explained.\n•	Has more work been done to verify the validity of the results obtained from SSM , Or compared to a baseline experiment, to make SSM more convincing?\n•	In section 6, the introduction of SSM usage is very unclear. After reading it, it is still not clear how to use SSM in these aspects. What benefits and changes does SSM bring?\n•	This paper is too long, it is suggested to be more concise.\nReporter: Huilin Yin\n',3,'2021-01-29 10:27:37',58,_binary ''),(66,'In this paper, the Structured Synthesis Method (SSM) is proposed to contribute to the investigation of alternative research synthesis methods for SE . A small worked example is presented to show the SSM capabilities, four research synthesis studies are conducted using SSM to complement the example.\n\n1. The formula in Fig 4 is ambiguous. According to the text, the plus sign and equal sign are not combined in this way.\n2. First, Fig 2 is a little far from its reference in the body, secondly, since Fig 1 and Fig 2 are the same evidence, can they be drawn in the same style?\n3. The description of the 4 real cases using SSM in Section 6 feels inadequate.\n4. Was SSM proposed for the first time? From the description in section 1, it seems a little confusing. What other empirical research methods are similar to SSM?\n5. The confidence estimation mentioned in the abstract is less described in the text.',3,'2021-01-29 10:30:35',12,_binary ''),(67,'Title: Pooling Evidence in Software Engineering with the Structured Synthesis Method\nAuthor: Paulo S´ergio Medeiros dos Santos,Guilherme Horta Travassos\n\nThis paper presents the SSM as an alternative research synthesis method to help researchers deal with qualitative and quantitative evidence. However, the paper may haven been finished in a rush. There are some flaws in format, including but not limited to:\n1. Meaningless \"-\". For example, \"-, \" in 2nd row of the 3rd paragraph of page 3 and so on. \n2. Missing reference number at the end of the paper.\n3. Misuse of punctuation marks such as “ ‘effects of SRAs that increased their belief,’ ” in 3rd row of the 3rd paragraph of page 32.\n4. There is still a text dialogue box in the graph in page 31 blocking the content of some steps in the conflict resolution process, which may have not been closed when screenshot is taken.\n\nMeanwhile, there are also some ambiguous parts in the paper, for example:\n1. The graph in page 13 is not well resized and the number at the left-down corner is too ambiguous to read.\n2. In the 3rd paragraph of page 32, the paper says \"Table 6 lists one effect for each of those groups\", but actually there is no related groups in Table 6.',3,'2021-01-29 10:33:10',81,_binary ''),(68,'This paper presents the Structured Synthesis Method (SSM), which is able to conceptualize the primary studies’ context and pool their outcomes by mixing both interpretative and integrative characteristics.\n\nThis paper is generally well-structured and well-written, but there are several issues that are in doubt.\n\n1. The author claimed that they combined \"1) orientations for SLR; 2) definitions and procedures for evidence aggregation; 3) guidelines and heuristics for knowledge modeling\", but it was not clarified how these three elements are combined as well as why SSM is based on Ciolkowsi\'s process and not other processes.\n\n2. There appears to be no citation or evidence to support the point in \"Step 5: aggregation and analysis\", which seems to be the major part of this work.\n\n3. What are the general usage scenarios hidden behind the three real cases of the SSM usage? It would be more useful if the author could summarize or generalize the general scenarios of the SSM usage.\n',3,'2021-01-29 10:35:03',3,_binary ''),(69,'This paper present the Structured Synthesis Method (SSM) to synthesize qualitative and quantitative data.  It is well written and the method was validated by exemplar cases. But I have following concerns.\n\n1. What Fig.4 wants to express is the combination of M1 with the value of 0.64 and M2 with the value of 0.4, but this method is easy to make people produce ambiguity with the final result of 0.4\n\n2. In Section 4, the five stages of the structured synthesis method are very similar to SLR, so there seems to be no innovation from the perspective of process',3,'2021-01-29 10:35:35',63,_binary ''),(70,'This method give a method named Structured Synthesis Method for SE to synthesize qualtative and\n quantitative data that originated in the primary studies. The direction of paper is good, but there are still some disadvantage of it.\n1.There are to many content in Introduction to introducing the background of paper.\n2.It is hard the read and understand the paper.\n3.The orientation of figure2 is very terrible.\n\n',3,'2021-01-29 10:39:21',25,_binary ''),(71,'1. I feel that the introduction part lacks some background, objectives and achievements, and it is difficult for people who have no experience in software engineering or research evidence synthesis to read\n2. In the introduction section, it is mentioned that “research synthesis methods are often used together with systematic (or non-systematic) literature reviews”, but this is not continued in the following analysis\n3. In the first paragraph on page 4, the author discussed \"Which research method should be used to propose a new research method?\" It feels a bit redundant to put it here\n4. In the third paragraph of section 5.1 of the article, the specific contents of the two selected papers are discussed. In the first paragraph of Section 5.2, the author directly concludes that the two papers are \"observational\", I feels that there is a lack of analysis and discussion',3,'2021-01-29 10:46:38',29,_binary ''),(72,'The paper proposed a method called Structured Synthesis Method (SSM) to synthesize qualitative and quantitative data in SE .The description of the method in this paper is quitly detailed and clear.But there are still some shortcomings in this paper:\n1:In section1,the most cited papers were published before 2012.So it will be better if authors cite some papers that were recently published.\n2.Some figures are not clear enough to read.\n3.In section5,the criteria of 22 interviewees in Ericsson are not explained in the article.\n4.In section7,there is no comparison between SSM and other synthesis method which could not explain the strengths of SSM.',3,'2021-01-29 10:47:20',14,_binary ''),(73,'This paper proposed a synthesis method for EBSE to help researchers conduct research synthesis. There are some suggestions :\n1.The architecture of this paper is not clear, Section 5 and 6 could merge to one section. \n2.Content in Section 7 refers the SSM current stage of development, it’s better to write it in the introduction section.\n3.Figure 2 is a bit fuzzy.\n4.In the end of introduction section, the author introduces the contribution and sections structure. It’s hard to understand clearly, maybe it’s better to describe it tersely. ',3,'2021-01-29 10:47:57',26,_binary ''),(74,'This paper proposed a Structured Synthesis Method(SSM) aimint to depict the importance contextual aspects and solve the challenges of no encompassing methods for synthesizing qualitative and quantitative data in Software Engineering(SE). A tool was also developed to verify the most process of SSM. In All, this work was relatively complete and had considerable research value. However, there are still some problems need to be solved. \n\n1. In Introduction, authors pointed out the necessity to solve \'science overload\' with the rapidly growing amount of scientific literature available. However, when it commes to \'Knowledge Translation\' topic, there are six papers occured during the timespan of six year. I don\'t think this growing rate in this topic is a \'science overload\'.\n2. In Section 2, authors presented some critical conceptions in SSM they proposed. In my experience, some scientific findings from primary studies sometimes are small distributed findings which can not be established as a systematic theories easily. If authors still want to make this assumption, more considerations should discussed in this part.  \n3. In Section 4, it seems authors described some critical points in five-stages that deserved to be pay more attention rather that SSM method itself. In my view, authors should describe SSM process step by step. Moreover,we can see the SSM extended to five stages across the whole systematic literature view process, is this method focus on qualitative and quantitative analysis yet?\n\nGenerally, this work was relative complete and deserved to be investigated. However, some sentence in this paper are hard to read and some citations in this paper are old. There are existing some new and high-quality outcomes in this field which authors should also consider. \n\n',3,'2021-01-29 10:48:23',54,_binary ''),(75,'This paper present the Structured Synthesis Method (SSM) to contribute to challenge for the long-term evidencebased SE success. This work has sufficient workload and the SSM does make sense in the relative area. And the following suggestions may make the work more perfect:\n1. The abstract should mention the evaluation of the tool appropriately.\n2. Figure 2 is too stretched, and it\'s better to adjust the proportion and size. \n3. The evaluation of method applicability and results can be further elaborated in relative detail. For example, is there any tool in academic circle similar  to your designed in this paper?What is the result compare with them?\n4. If it is possible, be more specific about the limitations or shortages.',3,'2021-01-29 10:53:40',55,_binary ''),(76,'1. The font in Figure 2 has been elongated, resulting in some blurring due to deformation.\n2. The colors in Figure 7 are messy and look uncomfortable.\n3. I feel that the serial number on the left side of each page is redundant. However, the reference at the end has no serial number.',3,'2021-01-29 10:56:51',77,_binary ''),(77,'The Structed Synthesis Method(SSM) is proposed in this paper to slove the challenge of synthesizing the primary studies in Software Engineering. Althougth I didn’t know much about research synthesis methods before, I still have some opinions after reading the paper:\n- Section 5 and section 6 emphasize the applicability of SSM,but I don’t see much comparison with current method to better illustare the necessity of using this method.\n- In the step of quality assessment in SSM’s five-stage process, the GRADE is used for evidence classification.However, the author does not explain the reason of using this method, especially the rationality of interval division.\n- The contribution of this paper is vague. Although the information SSM method is consolidated in this paper, there is no clear difference of contribution between this paper and the pervois work.',3,'2021-01-29 10:57:33',32,_binary ''),(78,'This paper presents the Structured Synthesis Method (SSM). The introduction and example of the method is very comprehensive, but I think there are the following problems：\n1.On page 17, line 34, the author makes a suggestion about thresholds but does not explain the rationale for the suggestion. And there’s a syntax error at “and” on line 41.\n2.Figure 8 does not explain the meaning of the white font and the meaning of the three conflict resolution operations.\n3.Page 34, end of the third line, missing”)”.',3,'2021-01-29 11:00:04',18,_binary ''),(79,'This paper is intended to consolidate the information regarding SSM. It brings essential and detailed definitions and examples about the method, which were not organized as in this text or presented yet. The authors hope this paper can serve as a guideline for using SSM in research synthesis studies in SE and support further studies using the Structured Synthesis Method.\n1. In page 31, something is more on the top right of figure 8.\n2. The mathematical and conceptual proofs are given, and the reliability of SSM is proved. At the same time, not only the method is given, but also an example of using SSM is given.\n',3,'2021-01-29 11:05:47',62,_binary ''),(80,'This paper is intended to consolidate the information regarding the Structured Synthesis Method (SSM). I have some suggestions as follows\n1.In Fig. 9,the dotted line in the figure does not give an explanation\n2.In the introduction part, the general introduction of each section is not given, and it is difficult to understand the overall reading ideas\n3.Section 6 talks about real cases of the SSM usage,and section 7.2 discusses when to use SSM. The writing order and logic are not reasonable. i think that discuss the appropriate use first, and then explain where it can be used.',3,'2021-01-29 11:06:22',35,_binary ''),(81,'This paper present a Structured Synthesis Method (SSM) to contribute to the investigation of alternative research synthesis methods in SE, they also designed and implemented a tool to support the SSM process. \n\nSome comments are as below:\n1. The structure of this paper is confusing and it is difficult to distinguish what is the author\'s own contribution and what is the work of others.\n2. From the introduction of SSM(Section 4), SSM seems to be an integration of existing research methods and does not raise some new methods/points, whether the research value of the paper is sufficient remains to be considered.\n3. Fig2 takes up a page of space and is blurred, a rearrangement of Fig2 should be considered or a clearer design diagram should be used (Fig2 now appears to be a screenshot from the tool proposed in the paper)\n4. I checked the authors\' previously published paper and found that the authors had presented a short paper at the ESEM\'2017, presenting the same content as this paper, but that paper did not seem to mention their earlier paper.\n5. According to the the Example of the SSM in Section 5, it is still difficult to understand how the SSM is used.\n6. it seems that the paper did not introduce the Evidence Factory tool in detail, Evidence Factory tool is one of the important contribution points of the paper, should be given some space to introduce.\n\nIn general, the paper is a little verbose and not clearly structured, making it difficult to read.',3,'2021-01-29 11:30:12',66,_binary ''),(82,'This paper proposes the Structured Synthesis Method（SSM）which has both integrative and interpretative features to synthesize qualitative and quantitative data in SE. It\'s a meaningful method, but it still has some problems as follow:\n - In the abstract section, the author mentions that a new method is proposed to give qualitative and quantitative analysis.However, in the fourth chapter of the article, we find that it is actually a combination of various existing methods without more new schemes, as if the contribution is different from the one mentioned above. Therefore, it is suggested to modify the statement in the abstract part appropriately.\n - I am not familiar with empirical research methods, and the description in the introduction part always fails to provide some information clearly, so it is difficult to read.',3,'2021-01-29 11:07:17',1,_binary ''),(83,'This paper present a Structured Synthesis Method (SSM) method to solve the challenge of investigating the alternative research synthesis methods for SE. The method appropriate to depict the important contextual aspects and to inform the trends of the outcomes because it integrates qualitative analysis and quantitative analysis. Some comments are as below:\n1. Figure 2 is hard to read, the proportion and size need to be modified.\n2. In Section 6, the description of how the SSM method is used in four cases and the effect of this method are not clear enough.\n3. Figure 9 is not clear, it’s better to adjust the font and size.\n4. In Section 7, author stated that SSM was not compared to other research synthesis methods. However, it does not indicate which research synthesis methods are similar to SSM.',3,'2021-01-29 11:10:53',9,_binary ''),(84,'This paper proposed a way to synthesize qualitative and quantitative data in SE called Structured Synthesis Method (SSM). The idea is good but there is some weakness:\n1.The author emphasizes structure, but the method discussed in the paper is more like a methodology, focusing on steps rather than structure.\n2.Compared with the existing methods(SLR/snowballing), what are the highlights and advantages of the method proposed by the author？\n3.Many pictures are not vector diagrams and  blurry.\n4.In Section5 , many results are by experience rather than experiment, So it is not Convincing.',3,'2021-01-29 11:21:09',22,_binary ''),(85,'##### Paper’s Title：Synthesizing Qualitative Research in Software Engineering: A Critical Review\n------------------------------------\n**Technical correctness of the paper:**\n1) In the third chapter, the author gives vague answers on how to determine whether two evidences are combinable. For example, \"We define two theoretical structures as compatible when their value concepts, including the cause,archetypes, and contextual aspects, Are the same or have the same meaning. \",\"The Compatibility between Compatibility Structures is determined in pair-by-pair order \". Both descriptions are vague and do not specify how they are quantified. I think this is the point of Fig. 3.\n2) The fourth chapter, \"The Structured Synthesis Method\", describes The five steps of SSM. But these descriptions are very similar to the steps I used to do the SLR. I think the author should emphasize the differences and highlight the contributions of this paper.\n3) The author only explained some shortcomings for the applicability of SSM, but whether there are some defects or threats in the process of SSM?\n------------------------------------\n------------------------------------\n**Reporter**: XiuDi Chen\n',3,'2021-01-29 11:21:13',36,_binary ''),(86,'In the Evidence-Based Software Engineering (EBSE) community, evidence synthesis has long puzzled researchers who study multiple researches. This study aims to present a Structed Synthesis Method (SSM) to interpretively, integrally synthese both quantitative and qualitative evidence from primary studies. Besides, this study presents an Evidence Factory tool to support SSM process, which will further advance research evidence synthesis and contribute to the state-of-the-art of EBSE if only the authors could deal with the following shortcomings.\n\n1. In my opinion, the proposed method is actually a transform of Dempster-Shafer evidence theory to EBSE. While the hypothesis, i.e., all kinds of evidence is identical and independent, is to some extent loose. What if the evidence shares diversified profiles? What if the evidence cross-validate?\n2. How to init the parameters of SSM is not clearly illustrated, which make it hard to transform.\n3. The proposed method is not comparable with other synthesis methods as it considers both quantitative and qualitative evidence. How to validate its effectiveness? What is really a case where we should consider SSM?\n4. The illustrations of case studies are insufficient. What are the results on the condition of SSM is independently applied to multiple quantitative evidence or quantitative evidence?\n5. This study elaborates five-stages of systematic literature review, which share few connections with SSM itself. \n6. The presentation is to some extent hard to understand, e.g., philosophical discussion about “Theories”.\n\n',3,'2021-01-29 11:28:09',44,_binary ''),(87,'The authors in this paper present a structured synthesis method to contribute to the challenge metioned in abstract and elabrate the method with math formula and specification,then examplify some use case to show the useful of this method.\nHere are some suggestions:\n1.Fig 2 is a little blurry compare with other figure in the paper.\n2.Section 5 and 6 are all talk about example of using the SSM which can be merge into one section.\n3.There is no comparison with other method to show the advantage or disadvantage of SSM.',3,'2021-01-29 11:32:17',17,_binary ''),(89,'Title:Pooling Evidence in Software Engineering with the Structured Synthesis Method\nAuthors::Paulo S´ergio Medeiros dos Santos,Guilherme Horta Travassos\n\nThey present the Structured Synthesis Method (SSM) to contribute to this challenge of investigating the alternative research synthesis methods for SE. Its blend of integrative and interpretative features makes the SSM appropriate to depict the important contextual aspects and to inform the trends of \nthe outcomes (e.g., positive or negative) reported in the studies, as well as a confidence estimation about them. \n\nSome comments are as follows:\n1.Figures should use the same format\n2.The process of SSM is clearly described',3,'2021-01-29 11:37:25',79,_binary ''),(90,'This paper presents a new method named the Structured Synthesis Method (SSM) to contribute to the\ninvestigation of alternative research synthesis methods for SE. In this paper, the authors propose the steps of this method and provide an example to show the applicability of the Structured Synthesis Method. This method is very valuable on the whole, but I think there are some shortcomings in this paper:\n1. The abstract does not mention the basis of the proposed method.\n2. In page 14, line 45, the authors define the compatibility between two theoretical structures, but do not explain the reason.\n3. At the end of the paper, there is no evaluation of method usability and the potential threat is also not spelled out.',3,'2021-01-29 11:46:25',73,_binary ''),(91,'1.Abstract: The background introduction is too long, but the description of the author\'s work is too little. SSM is mentioned only in the second half of the Abstract.\n2.In Section 5 and 6, examples of using SSM are presented. What are the differences between these examples? Do contents in sections 5 and 6 need to be combined or simplified?\n3.The contribution of this work is not clear.\n4.Diagram problems, for example, Fig. 2 is inconsistent with other figures in style and is too big.\n5.Reference: There is no serial number, it is not convenient for reading.',3,'2021-01-29 11:46:33',8,_binary ''),(92,'This article introduces a ssm method to deal with the major challenges of alternative research integrated methods. This article clearly describes the proposed method and the challenges faced. But this article also has the following problems:\n\n1. In Figure 1, the reference to E/P is not clear\n2. Chart 2 is not clear, it is recommended to change to the form of vector diagram\n3. The SSM method seems to have borrowed from many other research methods, but this article does not seem to have specific experimental data to point out the exact benefits of combining these methods ',3,'2021-01-29 11:47:28',43,_binary ''),(93,'Title: Pooling Evidence in Software Engineering with the Structured Synthesis Method\n\nSummary:\nThis paper proposes the SSM process guidance based on existing research synthesis aims for synthesizing qualitative and quantitative data. Its blend of integrative and interpretative features makes the SSM appropriate to depict the important contextual aspects and to inform the trend of the effects, as well as a confidence estimation about them. The method is also designed from its inception for tool support using a formal representation of scientific knowledge. This work has some contribution and is meaningful. However, there are still some problems. The specific review opinions are as follows.\n\nComments:\n\n1. In the background part of the abstract and introduction, it is said that there is still no method for integrating qualitative and quantitative data, the importance of integrating qualitative and quantitative data, or the trouble caused by the integration of the two kinds of data. Some words in the keywords only need to capitalize the first word, and lowercase the following words.\n2. The results part only said that we proposed a structured integration method (SSM) to meet this challenge. It did not say how to propose such a method, how to use this method to integrate qualitative and quantitative data, the corresponding meaning and higher Level of meaning.\n3. The contribution points and the purpose of this work are not listed in the introduction.\n4. The positioning of the contribution points of the article is not very clear. It refers to the method of integrating qualitative and quantitative data, but in fact it proposes a relatively large framework. The steps in the framework are included in existing methods such as SLR and metaethnography. Method, innovation is not clear, work is more inclined to engineering.\n5. The case part is biased towards text description, the demonstration process is not very detailed, the graphics are too few, the use of the process and the benefits are not clear, and the results are not displayed enough.\n6. No related work chapter, can systematically summarize the work related to this work.\n\nIn general, what the article said earlier is to propose a method to integrate qualitative and quantitative data, the content is mixed with some existing methods and proposes a process. There are some inconsistencies, not enough innovation, and not concentrated points. Cases the explanatory part is biased towards text description, insufficient presentation of tools and demonstration of the process, insufficient evaluation of correctness and completeness, unclear enough introduction of the process and benefits, insufficient presentation of results.',3,'2021-01-29 12:26:27',6,_binary ''),(94,'This paper presents a novel method SSM(Structured Synthesis Method) to synthesize qualitative and quantitative data in SE. And Its blend of integrative and interpretative features makes the SSM appropriate to depict the important contextual aspects and to inform the trend of the outcomes(e.g., positive or negative), as well as a confidence estimation about them.\n\nStrength:\n- This topic is very interesting and may have a positive impact in Synthesis studies.\n- The paper is well written and the key concepts are clearly explained. \n\nMinor issues:\n- Lack of comparison with other synthetic methods.\n- The concept of theories in section 2 is too obscure to understand.\n- The size and placement of Figure 2 is inappropriate.\n',3,'2021-01-29 11:57:01',84,_binary ''),(95,'1.Figure2 need to be adjusted.\n2.More relevant background knowledge will be easier for readers to understand.',3,'2021-01-29 12:07:15',7,_binary ''),(96,'This paper present the Structured Synthesis Method (SSM) to contribute to  the investigation of alternative research synthesis methods for SE.\n\nThe comments:\n1. page2. line 28: ‘science overload.’  or   ‘science overload’.\n2. page3. line 20: \"generally categorized in qualitative and quantitative –,\" is not clear.\n3. I didn\'t see the contribution in the \"Introduction\" or \"Conclusion, and what is the relation between the contibution and SSM method ?',3,'2021-01-29 12:08:40',64,_binary ''),(97,'This paper presents a method named SSM(Structured Synthesis Method) to synthesize qualitative and quantitative data in SE. It appropriate to depict the important contextual aspects and to inform the trend of the effects. Some comments are as below:\n- The work in this article on the synthesis of evidence is very meaningful for SE reresearch.\n- The part of introduction is a little long. Maybe less background of the research is better.\n- Fig.9 looks a bit confusing which may need to rearrange the layout.',3,'2021-01-29 12:30:22',83,_binary ''),(98,'This paper presented the Structured Synthesis Method(SSM) to investigate an alternative reasearch synthesis method for SE, which can conceptualize the primary studies\' context and pool outcomes by mixing both interpretative and integrative charicteristics. Although there are also some questions confused me when I read this research:\n1. The words of this paper is a little hard for me to read.\n2. The Figure2 could be put straight so that the reader can read more easily. And if the width of page limits the figure, putting the word straight is a choice.\n3. The discussion of the defination of theory is a little lengthy and the reasults in figure 5 lack of supports of experiments.',3,'2021-01-29 12:37:22',50,_binary ''),(99,'This paper present the Structured Synthesis Method (SSM) to contribute to synthesizing qualitative and quantitative data that originated in the diverse types of primary studies used in SE.\n\nContribution of the paper :\nPropose a formal representation for qualitative and quantitative evidence in SE.\nDetermine an uncertainty formalism to aggregate evidence.\nCreate a pooling procedure using the proposed formal diagrammatic representation and the selected uncertainty formalism.\nDefine a research synthesis process using the pooling procedure and design and construct a computationalinfrastructure\n\nComments are as follows:\n1.There is no very explicit description of this contribution. Some content can be added in the introduction section to highlight contribution.\n2.In Fig. 2, what \'metrics\' contain is not was not explained, and if maintainability is an indicator of measurement?\n3.In Fig. 3, What does the dotted line mean? Is there any difference between the second and the first aggregated evidence?\n4.Fig. 7 and Fig. 9 are not very nice and simple.\n',3,'2021-01-29 12:46:10',49,_binary ''),(100,'1.Some figures are not clear enough to read.\n2.Missing reference number at the end of the paper.\n3.It would be better to explain more about the essential difference between SSM and SLR',3,'2021-01-29 12:49:33',80,_binary ''),(101,'#### Conference Paper Review\n##### Paper Title\nPooling Evidence in Software Engineering with the Structured Synthesis Method\n##### Author\nPaulo S´ergio Medeiros dos Santos, Guilherme Horta Travassos\n\n------------------------------------\n##### Comments\nThis paper present the Structured Synthesis Method (SSM) to synthesizing qualitative and quantitative data that originated in the diverse types of primary studies used in SE.\nSome comments are as below:\n1. In the section 1, the authors give a detailed introduction about the background of SSM, however, it\'s too long and not easy to read and understand.\n2. The Fig2 should be ajusted to make it easier to read.\n3. A \'.\' is missing on Page 19, Line 41.\n4. There is an extra \'.\' on Page 19, Line 50.\n5. This paper may need to emphasize its contribution in Section 1(Introduction) or Section 8(Conclusions).\n',3,'2021-01-29 13:09:58',68,_binary ''),(102,'This paper presents SSM(Structured Synthesis Method) to synthesize quantitative data in SE. Some comments are as below:\n\nThe method presented in this article is very meaningful for SE reresearch.\nFigure 2 need to be presented more aproperatly.\nWords in this article should be more concise.\n\n ',3,'2021-01-29 13:20:55',70,_binary ''),(103,'This paper presents a method named SSM(Structured Synthesis Method) to synthesize qualitative and quantitative data in SE. This paper clearly states the structure and steps of SSM, and gives an actual case.\n- The style of the figures is not uniform, especially Fig2\n- Page 3, line 27: \"there is still no encoding method for synthesizing data from qualitative or mixed qualitative and quantitative research widely used in the area\". There is a little bit strange to cite a paper which was published more than ten years ago here\n',3,'2021-01-29 13:25:15',71,_binary ''),(104,'**Title:Pooling Evidence in Software Engineering with the Structured Synthesis Method**\n**Authors::Paulo S´ergio Medeiros dos Santos,Guilherme Horta Travassos**\n------------------------------------\nThis paper presents the Structured Synthesis Method (SSM) to contribute to this challenge of investigating the alternative research synthesis methods for SE. Its blend of integrative and interpretative features makes the SSM appropriate to depict the important contextual aspects.SSM is systematically elaborated in this paper,but there are some shortcomings as follows:\n\n1) Some words and grammar of the article are a bit strange, it takes a while to understand the context\n2) The whole article has no obvious cascading relationship for the method description, and the writing idea is not described well at the beginning\n3) After the description of the method is completed, there is no part to evaluate the method',3,'2021-01-29 13:32:05',74,_binary ''),(105,'This paper is intended to providea guideline for a new research synthesis method，the Structured Synthesis Method(SSM). Indeed thereare still no\r encompassing methodsfor synthesizing qualitative and quantitative data, SSM fills the gap and provides a method to combine the qualitative and quantitative findings of primary studies. \n\nHowever, the paper did not clearly clarify the relationship between the SSM and systematic literature review（SLR）? The section 4 and 5 confused readers that SSM is an independent alternative method of SLR. While the SSM process and main features given in Figure 5 and Section 7.2 show that it is a comprehensive data synthesis method, just one of the steps of SLR. \n\nThe mathematical theory of SSM discussed in Section 2.2, which is used to compare and aggregate the quantitative results of primary studies. We observe that all of the aggregation results in tiny example case and real cases are lack of sufficient validation. \n\nThe tiny example discussed only two papers, the main challenge and threat of synthesis step is the complexity of synthesis and aggression process on large scale of primary studies, this might enhance the human bias. \nHow can SSM mitigate this problem? It seems ignored in this paper. \n\nDetail typos:\n1. Most of the Figures did not have legend(Figure 1,2,8). \n2. Page 34. (Tab. 4)\n3. Page 19 ..\n\n',3,'2021-01-29 13:51:01',33,_binary ''),(106,'This paper proposed a synthesis method for EBSE to help researchers conduct research synthesis. This is a very valuable topic because a large amount of data (whether quantitative or qualitative) in SE makes it difficult to synthesize data. It combines the comprehensive and explanatory features, making SSM suitable for describing important contextual aspects, and informing the trend of effects, as well as their confidence estimation.\n\nStrength:\n\n\nSSM has a complete process to address the data. \n\nSSM is also designed from its inception for tool support using a formal representation of scientific knowledge.\n\nWeakness:\n\nThe translation process is not well supported. How to set the value should be discussed more.\n\nAlthough quantitative and qualitative evidence is considered in this method, how to verify its effectiveness? Under what circumstances should we consider SSM?\n\nThere are not enough examples in case studies. When SSM is applied to multiple quantitative pieces of evidence or quantitative pieces of evidence independently, will the results be different?\n\nThe case presentation part focuses on the text description, the tools and demonstration of the process are not enough, the evaluation of the correctness and integrity is not enough, and the introduction of the process and benefits is not clear enough.\n\nDetails:\n\n1. In Fig. 1, the reference to E/P is not clear.\n2. In Fig. 2, what ‘metrics’ contain is not was not explained, and if maintainability is an indicator of measurement?\n3. In Fig. 3, What does the dotted line mean? Is there any difference between the second and the first aggregated evidence?\n4. On page 14, line 45, the authors define the compatibility between two theoretical structures but do not explain the reason.',3,'2021-01-29 14:00:23',16,_binary ''),(107,'This paper present the Structured Synthesis Method (SSM) synthesize qualitative and quantitative data that originated in the diverse types of primary studies used in the Software Engineering area and This method is also designed for tool support using a formal representation of scientific knowledge. Here are some comments about this paper:\n1、No matter part 1 (introduction) or part 8 (conclusion) in this paper, the contribution of this method are not Obvious and clear enough.\n2、The use of pictures is not appropriate enough. For example fig 2 are too big and fuzzy to understand for readers and the fig 9 is too complicated and crowded to catch it\'s content.\n3、The proof is not rigorous enough. There is no comparison with other methods\n',3,'2021-01-29 14:00:38',67,_binary ''),(108,'This paper presented the Structured Synthesis Method(SSM) to investigate an alternative reasearch synthesis method for SE, which can conceptualize the primary studies’ context and pool outcomes by mixing both interpretative and integrative charicteristics. Although there are also some questions confused me when I read this research:\n\n1. Many pictures are not vector diagrams and blurry.\n2. The Figure2 could be put straight so that the reader can read more easily. And if the width of page limits the figure, putting the word straight is a choice.\n3. In Fig. 9,the dotted line in the figure does not give an explanation.',3,'2021-01-30 12:29:39',34,_binary ''),(109,'This paper present a Structured Synthesis Method (SSM) to contribute to this challenge. Its blend of integrative and interpretative features makes the SSM appropriate to depict the important contextual aspects and to inform the trends of the outcomes (e.g., positive or negative) reported in the studies, as well as a confidence estimation about them. But this paper alse have some questions：\n1. There are a lot of pictures that are not clear.\n2. What is the relationship between SSM and SLR？\n3. How to verify its effectiveness? In what scenario do we consider SSM?',3,'2021-01-31 21:45:23',2,_binary ''),(110,'This study evaluated the performance of learning-based approach in traceability maintenance. Compared with existing research, this study is the first to investigate the use of automatic traceability maintenance approach in both OSS and industrial contexts. However, the valuable contribution of this study is not obvious and the writing of this paper is poor. The specific comments are as follows:\n\n- In the Introduction, the logic between paragraphs is not clear. There is a large paragraph describing related work, but it does not explain the relationship between this study and related work. Nor does it clearly express the background and motivation of the research.\n\n- It lacks an introduction to the overall methodology of this study. I suggest providing a figure to describe the methodology.\n\n- The experiment appeared very suddenly in Section 3. There is a lack of description of experimental design and implementation. Before introducing what this experiment is and why it is done, the paper begins to introduce the experimental objects. It confused me.\n\n- There is no reasonable explanation for the motivation of the three research questions. Especially for RQ2 and RQ3, as they are not directly related to the research goal described in Section 4.3.\n\n- The Section 5 is about the evaluation results, but a lot of space is used to describe experiments, and the experimental procedures are very difficult to understand. This research seems to have no design and plan at all. The author is constantly deciding what new content will be in the \"further study\".\n\n- There is a lack of description of the imbalance problem. Besides, AUC will fail in imbalance problems.\n\n- The paper attempts to show that time series validation can improve prediction performance. However, model performance is an objective existence. The validation method is a means of observation. Such performance improvement is meaningless.\n\n- The paper does not provide clear conclusions for each RQ, especially for RQ1 and RQ2. The author summarized the results of RQ3. The purpose of RQ3 is factor analysis, but the conclusion is that the learning-based approach can achieve better performance. What is the relationship between this conclusion and factor analysis? And better than what? \n\n- There are no experimental hypothesis in this study. There is no design, no hypothesis, no randomness, and no control variables. So I don\'t think this research is a experimental study.\n\nThe writing of this paper is terrible! It is hard to grasp the author\'s logic and there are a lot of language issues in the text.\n\n- Missing spaces between text and \"(\".\n\n- In the abstract, \"maintainance\" -> \"maintenance\".\n\n- In Section 5, \"the highest AUC is marked with underline (_)\". Are you explaining Table 6? But Table 6 is not mentioned in the text.\n\n- In Section 5.1.1. \"...following two steps\". The paragraph is incomplete. \n\n- The words in figures are too small to be recognized.\n\n- \"... studying the based combination...\"\n\n- \"We fix ..., using only \'Labeled data\' did not ...\"\n\n- \"improvements on averagely(see Figure??)\"\n\n-\"\'Original\' data treated as the baseline data labeled strategy in our paper\"\n\n- The definition of \"Golden Link\" is important, but it is provided in the footnote.\n\n- The definition of \"Trace Ratio\" is presented in Table 7, but its first appearance is in the first section.',25,'2021-02-05 10:05:54',37,_binary '\0'),(111,'This paper reports a critical review on tertiary studies published in software engineering. This is the first study that followed the SLR guideline to review tertiary studies in the community. The paper depicts the state of the art of tertiary studies and attempts to point out the shortcomings. However, this study does not provide in-depth analysis of the existing tertiary research, and the specific problems are as follows:\n\n- The paper emphasizes that tertiary research needs a guideline. However, researchers generally followed the SLR guideline for their tertiary studies. This paper does not clearly point out the necessity of a new guideline and what are the specific problems in the existing research that follows the SLR guideline for the tertiary research.\n\n- In Section 3.1, it indicates that the goal of the paper is \"to realize what a TS is and the gap between the current practice and the definition proposed by Kitchenham et al. [30]\". What is this definition? This study did not analyze current practice against the specific definition.\n\n- The paper is vague and contradictory. Take quality assessment as an example. In Section 3.5, the paper indicates that \"most of the tertiary systematic reviews did not report the quality of its included SLRs while quality assessment is recommended in systematic reviews\". However, the rationality of not using quality assessment is explained in Section 5.4. The author also has no clear and specific ideas about what a tertiary study should be. So how can the author provide a critical review? How can the author prove that the existing research is wrong?\n\n- In Section 4.1.2, in addition to basic statistics, no more analysis can be seen for topics. For example, why were so many tertiary studies on GSE published?\nThis is an attractive issue worth discussing.\n\n- The title of Section 4 clearly states that this section discusses RQ1. But the relationship between Section 5 and RQ2 has not been clearly stated. The reason for the division of sections from 5.1 to 5.8 is also confusing.\n\n- The author classified tertiary studies into tertiary mapping studies and tertiary systematic reviews. However, the specific criteria for the classification are not clear. In addition, the necessity of this classification is not reflected in analysis.\n\n\nThere are also many issues with the language of the paper.\n\n- \"Many\" is often used in the text. It is recommended to use a more accurate expression.\n\n- \"there are 24 journal articles and 14 conference articles Among the identified 38 TSs\". \"Among\" should be lowercase.\n\n- \"This can indicate the venues, especially IST, ICSE, EASE and ESEM, which gather the most attention from empirical research community.\"\n\n- \"We intended to realize the investigate the scope of tertiary studies\nwhich are recognized by researchers in SE community\". \" realize the investigate the\".\n\n- \"the research method systematic literature review\"\n\n- \"there are relationship\"\n\n- Missing references in multiple places\n\nIn summary, the author does not have a clear definition of the needs, goals, and evaluation criteria of tertiary research. As a result, its review of the existing tertiary research is also ambiguous and inconsistent.',26,'2021-02-05 10:06:23',37,_binary '\0'),(112,'In general, this paper is interesting and valuable in my opinion. The current issue may be the expression.\n\nWeakness:\n1.Some typos: qutations in latex should  use ` plus \'  ; I can found some ? in the body;\n2. \"The previous studies\" is mentioned in this paper frequently, but I do not think this is a suitable expression. In my opinion, this term is usually referred to your previous work. You should use existing studies and a special term for [32] because [32] is signicificant in this study\n3.Section 4, I think more description should be added. I cannot find why the experiments are conducted and can be conducted.\n4.The discussion is not discussed enough.\n5.I cannot find the answers to RQ1 apparently.\n6.The contribution in this paper should be described in detail. I want to know the output directly.',25,'2021-02-05 10:08:02',5,_binary '\0'),(113,'# **Using Learning-based Approach to Support Software Traceability Maintenance Tasks in Industrial Context**\n\n## Contribution of the paper\nThis paper design a series of experiments evaluating the performance of different components configuration of learning-based classifier and illustrate the barriers encountered in industry traceability maintenance practice.\n\n## Technical correctness of the paper\nSince this paper discussed the both OSS and industrial contexts, why \"2.2 Software Traceability Practices in Industrial Context\" ? Does it means that Software Traceability Practices in OSS Context have nothing to discuss? Or you should give some difference between them.\n\nWhat\'s the relationship between the part of \"3.3 Description of Strategy\" and \"3.4 Description of Labeled Strategy\"? In purely semantic terms, the former may include the latter. So, you may rethink about the title of these sections.\n\nIn the part of 4 EXPERIMENT SETUP, why both 4.1 and 4.1.1 have the same title \"Data Collection\", Please check it. And in the \"criteria\" (4), it writes that \"After the criteria 1-3, the project still has at least 2 versions 553 left.\" You may change \"criteria 1-3\" to \"criteria (1)-(3)\".\n\n\"The included industrial projects provide the diverse set of product services including the domain like App, BigData, Clout Platform and Finance to customers.\" In my opinion, App is not a domain. And \"Clout\"?\n\n\"In contrast to the artifacts size in OSS projects 4\", \"4\"?\n\n\"(requirements(186) and issues(480)).\" You may change the description.\n\nIn \"Table 4: Number of artifacts in 17 OSS projects\", it writes \"UR@Original)\".\n\n\n## How much effort did you spend refereeing this paper? \nReasonable\n\n## Decision\nAccept.\n\n------------------------------------\nReporter: Zijia Jia',25,'2021-02-05 10:09:05',19,_binary '\0'),(114,'# **Using Learning-based Approach to Support Software Traceability Maintenance Tasks in Industrial Context**\n\n## Contribution of the paper\nThis paper design a series of experiments evaluating the performance of different components configuration of learning-based classifier and illustrate the barriers encountered in industry traceability maintenance practice.\n\n## Technical correctness of the paper\nSince this paper discussed the both OSS and industrial contexts, why \"2.2 Software Traceability Practices in Industrial Context\" ? Does it means that Software Traceability Practices in OSS Context have nothing to discuss? Or you should give some difference between them.\n\nWhat\'s the relationship between the part of \"3.3 Description of Strategy\" and \"3.4 Description of Labeled Strategy\"? In purely semantic terms, the former may include the latter. So, you may rethink about the title of these sections.\n\nIn the part of 4 EXPERIMENT SETUP, why both 4.1 and 4.1.1 have the same title \"Data Collection\", Please check it. And in the \"criteria\" (4), it writes that \"After the criteria 1-3, the project still has at least 2 versions 553 left.\" You may change \"criteria 1-3\" to \"criteria (1)-(3)\".\n\n\"The included industrial projects provide the diverse set of product services including the domain like App, BigData, Clout Platform and Finance to customers.\" In my opinion, App is not a domain. And \"Clout\"?\n\n\"In contrast to the artifacts size in OSS projects 4\", \"4\"?\n\n\"(requirements(186) and issues(480)).\" You may change the description.\n\nIn \"Table 4: Number of artifacts in 17 OSS projects\", it writes \"UR@Original)\".\n\n\n## How much effort did you spend refereeing this paper? \nReasonable\n\n## Decision\nAccept.\n\n------------------------------------\nReporter: Zijia Jia',26,'2021-02-05 10:09:33',19,_binary '\0'),(115,'This paper studies the learning-based method and designs a series of experiments to evaluate the performance of different component configurations of the learning-based classifier. It explains the obstacles encountered in the practice of industry traceability maintenance, and finds that learning-based methods can achieve better performance on industry projects that are constrained by these obstacles. It is a valuable study, but there are still some problems:\n1. The author’s contribution is not explained in detail in the abstract, lacking interest in reading it,\n2. Based on the learning method, it is easy to cause misunderstanding. Can you specify in detail which kind of learning is based on, and secondly, besides the other learning methods, are there other methods? Their limitations should be explained briefly, highlighting the motivation of the article research.\n3. Are Table 1 and Table 2 helpful to the content of the article? These two tables seem to be of no help to the content of the article at present, whether they can be deleted or readjusted.\n4. There are still some deficiencies in the setting and answering of RQ. What are the research motivations and contributions of RQ1 and RQ3?\n5. Discussing the problems found in the research and the application value should be the highlight of the article, but the complete text lacks a deep impression on this part, and the author should emphasize this part repeatedly.',25,'2021-02-05 10:11:23',61,_binary '\0'),(116,'This article investigates and evaluates how researchers perform TS in order to obtain the scope of TS. They conducted a systematic literature review of TS published from 2009 to 2019. They found that from a methodological point of view, there are big differences between TS, and there is an urgent need for research to develop guidelines for TS in SE. This is an interesting job, but there are some things to note:\n1. The article did not elaborate on the contribution of the article in the abstract section. The author emphasized that \"a great difference\" was found, but did not elaborate.\n2. The RQ setting has no bright spots and is too broad to understand the author\'s research intentions for the first time.\n3. Does Table 3 have any other functions here? If it is just a list of articles, can it be included in the appendix?\n4. After reading the entire article, I did not find the author\'s own significant views and contributions, and he needs to be revised.',26,'2021-02-05 10:12:36',61,_binary '\0'),(117,'This paper intends to realize the current state-of-the-art of the existing TSs till now. Authors investigated and assessed the how the researchers conduct TSs in order to obtain the scope of a TS. A systematic literature review on the TSs published between 2009 and 2019 was conducted, and 38 tertiary studies were identified.\n\n1. The search process in Section 3.2 is not perfect. The content in Table 1 was mentioned in Section 3.2, but it was only mentioned in Section 3.3. Is it redundant?\n2. Both 3.4 and 5.3 are called data extraction. Is it necessary to distinguish them in the paper?\n3. Chapter 6 can explain the contribution point of this work again.',26,'2021-02-05 10:14:09',12,_binary '\0'),(118,'This paper explores the extent to which learn-based techniques can be applied to traceability maintenance tasks in large-scale industrial data sets by conducting a series of experiments on learn-based classifiers. It also discusses the effectiveness and limitations of learning-based approaches to projects in OSS and industrial contexts.\n\n1. I\'m a little bit wondering why the research question at the end of Chapter 4, shouldn\'t data collection and experimental variables be based on the research question?\n2. Table 3 and Table 4 are the artifacts of industrial projects and OSS projects respectively. It is suggested that the table style can be kept consistent, such as the order of artifacts on the left.\n3. The reference header of Table 2 is missing, whether companies on OSS projects are necessary?\n4. Committer is misspelled in Table 1.\n5. Word case: data re-sampling, oss, smote, industry…',25,'2021-02-05 10:15:16',12,_binary '\0'),(119,'This paper based Systematic literature review (SLR) ,researched the current state-of-the-art of the existing TSs till now, find the difference and the necessity of develop guidelines for conducting TSs in SE. And there is a few suggestions from my personal opinion and which might make the work batter:\n1.It might be better to show more detailed information of how you get the 38 tertiary studies like some principles , methods or guidelines.\n2.I cannot understand the difference of the TSs from the perspective of methodology clearly and it might be better to list them out in a table.\n3.It might be better if the paper can mention or just talk about the directions of guidelines for conducting TSs in SE.',26,'2021-02-05 10:16:48',55,_binary '\0'),(120,'This paper designed a series of experiments to get to know the  what extent learning-based techniques can be applied to traceability maitenance tasks in large industrial data, and analysisd the shortages which is meaningful and valuable. Compared with the previous version, this version is more perfect. And there is a few more suggestions:\n1.From my personal opinion it might be better to put the RQs at the front of the article to show your experiment goals clearly and directly. And you can highlight them again at the Experiment section.\n2.It might be better to introduce the overall method by using a picture.',25,'2021-02-05 10:17:19',55,_binary '\0'),(121,'This paper studied learning-based methods to what extent can be applied in the industrial data set traceability maintenance tasks, and designed a series of experiments to evaluate classifier based on the study of the performance of the different components configuration, the author uses the experimental data proved that the use of \"Labeled\" as a sample data set and time sequence verification can get better performance in the OSS and industrial environment. Finally, the authors describe the obstacles and limitations to be overcome in industry traceability maintenance practices. This paper also has some problems:\n1.Line 70 ”[?]”, a writing mistake.\n2.At the end of the introduction part, a whole paragraph is used to introduce the cooperation with the company, which is too long and not logical. Therefore, the length can be shortened to briefly introduce the cooperation with the company.\n3.Did not state which “learning-based method” author will use, like” machine learning” or “deep learning” and so on.\n',25,'2021-02-05 10:18:53',72,_binary '\0'),(122,'This paper reviewed the current status of the studies focusing on the secondary studies in SE and using SLR to review related TSs in the past years, aiming to discover the scopes of the existing TSs and how SE researchers conducted TSs as well.\n\nComments:\n1. In the introduction, the contribution of the paper should be highlighted in the introduction. Besides, the contribution seems vague. How can SE participants \"better\" understand the research status.\n2. What is the relationship between your RQs and your research purposes? Are the research questions able to cover the research purposes? The research questions need more explainations.\n3. The detailed process of \"descriptive statistics\", \"thematic analysis\" and \"narrative summaries\" should be presented.\n4. In Section 4.1.2, \"General Software Engineering\" is the second topic in terms of quantity, but why did you skip it?\n5. The content of Section 5 should be splited into two parts: results of RQ2 and discussion, since the process of conducting TS was derived from the data.\n6. What is the relationship or difference between the process in Section 5 and that of SLR? Maybe it is more interesting and meaningful.\n\nMinor suggestions:\n1. The full name should be given for the abbreviation of the venue, e.g, ICSE.\n2. Inconsistent case of words in Table 2.\n3. In Section 3.5, \"...presented in charts\", which one?\n4. Several references and citations are broken.',26,'2021-02-05 10:20:02',3,_binary '\0'),(123,'This paper investigated the applicability and limitation of learning-based approach in industrial context, which uses the process and textual information to train link classifier to support automatic traceability maintenance tasks between software development artifacts. \n\nComments:\n1. In Related work, why did you only discussion from the two aspects? It should be clarified at the beginning of this section.\n2. It isn\'t a good practice that only discuss one topic in the Discussion section.\n3. The threats to validity doesn\'t appear to be systematically described.\n\nMinor suggestions:\n1. The introduction is too long to catch the main point. Better to put some contents into Related work.\n2. Several references are broken.\n3. There should be some words between Section 4, Section 4.1, and Section 4.1.1. Same as Section 6 and Section 6.1.',25,'2021-02-05 10:20:38',3,_binary '\0'),(124,'This article uses machine learning methods to track code traceability. Use the characteristics of commit-demand and commit-question to conduct learning-based research. The whole article starts with the definition of features and then selects different classifiers for research. Expressed ideas more clearly.\nThis article has the following possible problems\n1. Questions-whether the matching of commit and commit- requirements completely matches the traceability.\n2. The feature basis for manual selection and selection is not strong enough. Most of the time features used in this article are time features. Can this part of time features be truly matched and traceable?',25,'2021-02-05 10:27:16',43,_binary '\0'),(132,'Tertiary Study (TS), as one of the major evidence-based methodologies, has been making an increasing impact upon the empirical research of Software Engineering (SE). The authors systematically reviewed all the TSs published in SE, which is an innovative try in evidence-based research community. The presentation and architecture of this paper is great, too. Overall, this study presents the current state-of-the-art of TSs in SE with much demographic information but short of further discussion, which are\n\n1. Are there any distinguishments between secondary study, e.g., mapping study, systematic literature review and TSs in term of methodology, or among TSs? As far as I know, the former is different.\n2. Did the TSs rigorously follow the guidelines? If not, where are the differences? Exceptions are always interesting, which may lead to the improvement of guidelines.\n3. As shown in Table 3, the empirical methodology domain the TS researches, are there any suggestions for evidence-based SE researchers?\n4. I noticed there were updates among the TSs, so have you ever noticed the ‘future work’ in these TSs? What are the works since a secondary study is finished?\n5. Since this study is an innovation, I am looking forward to more personal, heuristic views. \n\nOther issues:\n1. Some citations do not work, e.g., lines 576, 577, 600.\n2. The numbers in Figure 4 are incorrect, i.e., the sum of them does not equal 38.\n',26,'2021-02-05 10:31:20',44,_binary '\0'),(133,'Traceability that is fundamental to modern software development and maintenance process, which helps to ensure properly functioning, secure programs. A large and growing body of literature has investigated the Traceability Recovery (TR), Traceability Maintenance (TM) and Traceability Validation (TV) to support software process improvement. There are a number of studies aiming at alleviating diverse traceability-related issues in OSS community but paying less attention in industry. In this study, the authors investigated the TR tasks specifically by evaluating the learning-based approaches in industrial environment, which contributes the state-of-the-art traceability research community. However, the shortcomings of this study are also obvious, which are:\n\nAbstract:\n1. Why focus on learning-based approaches?\n2. What are the relationships between TR and learning-based ‘classifier’?\n3. What are the results and conclusions of the experiments?\n\nIntroduction:\n1. The introduction of TR is too late.\n2. References, punctuations, spaces, and counting mistakes.\n3. Heuristic-based approach do not equal to thresholds determination.\n4. Deep learning approaches, e.g., RNN are powerful because their capacity to dealing with large scale of data. The statements in lines 137-143 are lack of rigorousness.\n5. The instroduction of ‘scale’ issue should be closely related to the motivation, in other words, first TR, then issues, after motivation, finally method.\n6. What are the distinguishes between the authors’ motivation and cooperators’ demands? The industrial experience report is suggested.\n7. The same issues as mentioned in Abstract, in particularly, what are the indeed results and conclusions.\n\nRelated Work:\n1. I suggest exchange the positions of two parts. \n2. Honestly speaking, the literatures are to some extent out-of-date, please see the candidate references.\n\nLearning-based Approach\n1. The title of section 3.3 is confused.\n2. Why need learning-based ‘classifier’?\n3. Where are the statements about ‘learning’ (algorithms)? \n4. I suggest group the selected features. \n5. Section 3.4 should focus on the ‘strategy’. \n\nDiscussion and Threats to validity\n1. Considering that only RF was experiment in this study, the findings and conclusions may suffer from validity.\n\nReferences\n[1] Thazin Win Win Aung, Huan Huo, Yulei Sui. 2020. A Literature Review of Automatic Traceability Links Recovery for Software Change Impact Analysis.\n[2] Rocco Oliveto, Malcom Gethers, Denys Poshyvanyk, and Andrea De Lucia. 2020. On the Equivalence of Information Retrieval Methods for Automated Traceability Link Recovery: A Ten-Year Retrospective.\n[3] Mounifah Alenazi, Nan Niu, and Juha Savolainen. 2020. A Novel Approach to Tracing Safety Requirements and State-Based Design Models. \n\n',25,'2021-02-05 10:32:40',44,_binary '\0'),(134,'This study conducted a set of experiments on 36 projects (19 industrial projects and 17 OSS projects) to gain the understanding of whether learning-based approaches could be applied to industrial traceability recovery tasks. Moreover, this study explored SSL framework based on their enhanced learning-based approach to bridge the gap between OSS dataset experiments values and performance oflearning-based approach in industrial context. \n\nHere are some comments:\n\n1. The relationship between this study and the other studies in Section Introduction and the objective of this study have not been clearly described.\n\n2. Some table widths need to be adjusted, i.e., Table 1, Table 2, Table 4, Table 9, Table 10, Table 11, and Table 12.\n\n3. The description of \'\"ai\" features between...\' should be adjusted elsewhere, e.g., in the article or below the table.\n\n4. \"we added two additional OSS projects supported by Huawei\", what are the differences between these two projects and the industry projects chosen for this paper. \n\n5. Table 5 seems to be of little use.\n\n6. Table 10 is too complex for me to get useful information, I recommend listing only the important information elements. Again, the description in the title should be removed.\n\n7. \"Thus, we choose as the result of enhanced learning-based approach to investigate the following research question atindustrial projects\" in the description of the answer to RQ1 (Section 5.1, Page 8) looks more like a background description of work.\n\n8. The answers to RQ2 did not properly describe the questions \"do these important features differ between industrial and open source projects\", especially in the summary (Page 9).\n\n9. It seems inappropriate to use \"specific\", which could be removed directly or use \"project-based\" and \"process-based\", in RQ3. Furthermore, the answers to this RQs do not match the question.\n\n10. Some other comments: there should be a space before or after the symbol, e.g., \"xxx (xx)\" and \"xx: xx\"; some references are missing, e.g., Line 70-71.\n\nIn summary, this article is a controversial improvement in quality over the previous version. However, there are many places to be improved in this paper, mainly in the description of objective and the answers to the RQs. ',25,'2021-02-05 10:34:31',59,_binary '\0'),(135,'Given that there is no systematic review on tertiary studies (TSs) in software engineering (SE), this paper intends to investigate the current state-of-the-art of TSs. For this aim, a systematic literature review on the TSs was conducted, including what topics have been studied in the TSs and how these TSs were conducted. According to the authors, this paper is expected to \"help SE participants to better understand the research status of various areas in SE\".\n\n**Some opportunities for improvement follow:**\n- The motivation in \"INTRODUCTION\" section is not strongly given, by a fact that \"the number of SE researchers focusing on TSs is increasing\" whereas \"there is no systematic reviews on TSs in SE\". The problem behind the fact is not persuasive enough. BTW, the adj \"impossible\" should be used with a second thought.\n- I believe that the vagueness of the definition of \"TSs\" and the distinction between \"tertiary systematic review\" and \"tertiary mapping study\" is one of the most outstanding contribution of this paper. Nevertheless, there exists some points that seem to be contradict with this contribution. First and foremost, from the discussion in Section 5.6, it seems that there are something supposed to be \"the characteristics of a TS\" from the opinion of the authors. Second, given the ambiguous distinction between \"tertiary systematic review\" and \"tertiary mapping study\", how the 38 primary studies included in this paper were classified (into 22 versus 16). \n- The first RQ might be rephrased since the word \"scope\" is too abstract to be understood. Or, more sentences should be given to clarify the rationale behind these RQs. After all, in the current version, I do not see the interpretation of these individual RQs.\n- In Section 3.4, the necessity of each data item is ought to be told, as well as their relationship with the RQs. For example, we do not know what is exactly \"Relationship with relevant TS\".\n- The link between Section 4.1.3 and other part of this paper is somewhat ambitious.\n- The contribution of this paper might be reinforced, e.g. outlining the contribution in the CONCLUSION section.\n\n** Minor details:**\n- Is \"overview\" in the subtitle of Section 4.1 the same as \"scopus\" in RQ1?\n- It is recommended to display RQ2 in the title or subtitle of this paper to align it with RQ1.\n- It would be better to change the title of Section 5.8 to \"TTVs\".\n',26,'2021-02-05 10:36:02',23,_binary '\0'),(136,'This paper aims at investigating to what extent learning-based techniques can be applied to traceability maintenance tasks in a large-scale industrial dataset. For this aim, the authors designed a series of experiments to evaluate the performance of different components configuration of learning-based classifer. They also illustrated the barriers encountered in industry traceability maintenance practice and associated them with the \"performance\" they studied.\n\n**For this paper, some opportunities for improvement are as following:**\n- \"Traceability\" seems to be the most significant concept in this paper; whereas, the concept is poorly defined. It would be nice if more precise definition could be given and highlighted.\n- The \"INTRODUCTION\" section explains that \"traceability maintenance\" (a keyword in this paper), together with \"traceability recovery\" and \"traceability validation\" are \"three main scenarios\" in \"traceability techniques\". Nevertheless, I am aware that the authors use \"traceability maintenance\" and \"traceability recovery\" interchargely in the paper.\n- I believe that the \"problem\" the paper aims at tackling with is too late to be given (too much words are wasted in discussing trifling things).\n- The motivation of this paper is somewhat ambiguous, given that there have already been \"5 studies\" that focus on software traceability in industrial projects.\n- For the \"EXPERIMENT SETUP\" section, I still wonder why the \"two OSS projects\" from Huawei were included.\n- Section 4.3 namely \"Research Questions\" could be put in a more former place rather than in the end of \"EXPERIMENT SETUP\" section. Btw, the precision of these RQs could be improved, as well as \"the goal of this study\". Another recommendation about RQs is to split their \"motivations\" (just below the RQs as I see it) into each RQ to clarify the rationale of each of these RQs.\n- Sincerely, I do think that the relationship between key concepts of this paper (such as barrier, factor, trace links, commit, requirement, issue, etc. ) is hard to be grasp. It is recommended to use a diagram (like class diagram) to illustrate this relationship: the way the paper (SANER-2021-CCF-B-\"Assessing Code Clone Harmfulness: Indicators, Factors, and Counter Measures\": https://mp.weixin.qq.com/s/-bAMyQnbu6Ao0AowtULl2g) do is an example. Btw, it seems that for this paper a \"BACKGROUND\" section is more imperative than a \"RELATED WORK\".\n- The \"CONCLUSION\" section could be improved to claim contributions harder.\n\n**Miner details:**\n- The \"ABSTRACT\" should be improved: \"learning-based approach can achieve better performance on the industry projects\". Comments: \"better\" than what?\n- I wonder if the \"effectiveness of enhancement\" is the same as \"performance of trace link classification model\".\n- From the gist of the paper, we get that factor analysis is of significance. However, the paragraph of paper structure does not manifest this point.\n- The author might find the number \"17\" erroneous in the title of Table 4.\n- In \"CONCLUSION\" section, the topic sentence of the second paragragh seems to be not consistent with other points.\n\n',25,'2021-02-05 10:37:23',23,_binary '\0'),(137,'Title：Adapting Learning-based Approach to Support Software Traceability Recovery Tasks in Industrial Context\n\nThis paper use some learning based approaches to build traceability in industry project.They conduct a series of experiments on 19 industrial projects and 17 OSS projects and compare different approaches.\n\nMy comment is as follows:\n1.There are some spelling mistakes in this paper such as the a13 in Table I.\n2.In Abstract,it\'s the first time the word OSS appears, but it\'s not explained.',25,'2021-02-05 10:39:39',24,_binary '\0'),(138,'This study evaluated the performance of learning-based approach in traceability maintenance.Compared with existing research, this study is the first to investigate the use of automatic traceability maintenance approach in both OSS and industrial contexts. There are some suggestions;\n1.The subtitle in section 4.1 is wrong. The title of 4.1 is “Data Collection”, but the subtitles include “data collection” and “data processing”.\n2.Section 4.3 “research question” presents the aim of this study, it’s better to introduce this part first，which means you can exchange the position of 4.1 and 4.3.',25,'2021-02-05 10:40:49',26,_binary '\0'),(139,'This article has searched SLR papers in the field of soft engineering in the past period of time, and explored the main research directions and research methods of soft engineering researchers in the EBSE field. This article shows the process in detail in the stages from problem raising to data collection and data analysis. I have the following questions about this article:\n1. The two RQ questions seem a bit simpler, do you need to add more research content?\n2. Figure 4 is not a vector diagram, it is slightly blurred after zooming in',26,'2021-02-05 10:41:37',43,_binary '\0'),(140,'1.Figure 1: Please add more quantitative information, such as the number of Pilot studies.\n2.It is better to explain the data items shown in Table 2, which research question each item is used to answer, and what information each item provides.\n3.The font style in Figure 2 and Figure 3 is not consistent with other figures.\n4.There are some mistakes in section 5.1, such as “Table ??”, “ the first TS [? ]”, “the following update [?]”, and “ Kitchenham et al.[? ]”.\n5.Figure 4 is too large, please make it smaller.\n6.Please add sufficient descriptions instead of just putting a table, such as Table 7.\n7.This is a systematic literature review of tertiary studies. Is it too high level?',26,'2021-02-05 10:41:44',8,_binary '\0'),(141,'This paper reports a critical review on tertiary studies published in software engineering. This is the first study that followed the SLR guideline to review tertiary studies in the community. There are some  suggestions:\n1.Section 3.1 presents two research questions, but the author says “This question aims at providing .....”. Which question does “this” refer to?\n2.Section 3.2 introduce the research process, which is similar with the content before 3.1, These content could be combined to one part.',26,'2021-02-05 10:41:54',26,_binary '\0'),(142,'The research in this paper is very meaningful and plays an important guiding role in evidence-based software engineering. At the same time, the great difference between TSs from the perspective of methodology found in this paper is necessary to overcome this issue while EBSE is accepted by researchers and practitioners in SE. Personally, I think it would be more beautiful if the author set the font size uniformly, as shown in Figure 1.',26,'2021-02-05 10:42:06',46,_binary '\0'),(143,'comments:\n1.In 4.2, data processing, it says \"the widely used re-sampling approaches have been\ncombined with semi-supervised labeling framework to further address of imbalance problem.\", howerver, the detail of combination processing is not mentioned.\n2.The amount of data after sampling is not mentioned in the article, which can affect the performance of model.\n',25,'2021-02-05 10:42:47',49,_binary '\0'),(144,'This paper investigates the applicability and limitation of learning-based approach in an industrial context.The paper has certain innovation.Here are some of my comments:\n1.In the CONCLUSIONS it is \'in industrial context\'(line 1329) and in the Section1 it is \'in an industrial context\'(line 200)\n2.There is a coding error in section 1 references(line 66)\n3.In Section3.3, \'as 30 hours\' writes twice\n4.In Section4.2,Since the OSS project is not numbered in table 2, the expression \'In OSS projects 4\'(line 610) does not refer to a specific OSS project\n5.In Section4.3,Why is βdefined as 0.5?\n6.In Section5.2,\'Table 6\' not \'Tables 6\'(line 739)\n7.In section6.1,\'Tables 4 and 3\' not \'Table\'(line 1254)\n8.Some of the y columns in table 11 have spaces and some don\'t',25,'2021-02-05 10:45:28',18,_binary '\0'),(145,'This paper conducts a series of experiments to understand the extent of learning-based approaches can be applied to traceability recovery tasks in industrial setting. The paper is easy to read and well organized. After reading the paper, I have some opinions:\n1 In the last phase of the section 1 describe the organization of the rest of the paper, but miss the section 3.\n2 Why put the method in the evaluation results section? Can the two be separated? \n3 The table is a bit far away from the text referring to the table.',25,'2021-02-05 10:43:07',56,_binary '\0'),(146,'comments:\n1.In reference, the 15th,\"A Review of Metaethnographies in Software Engineering\" \" is the same as 16th.\n2.The length of Table 7 should be adjusted.\n\n',26,'2021-02-05 10:43:17',49,_binary '\0'),(147,'1.ABSTRACT：Give the full name of OSS the first time you refer to it.\n2.INTRODUCTION: This section is too long, please simplify this section.\n3.EXPERIMENT SETUP: Can the Comp. Column in Table 2 be deleted?',25,'2021-02-05 10:45:09',8,_binary '\0'),(148,'Wengang Liu; Wei Liu; Qinglong Meng; Mengjie Ding; Qianwen Xu; Tao yang; Liming Dong; Chenxing Zhong\nThis paper focus on the code traceability based on the machine learning methods and designed some experiment to solve the difference\nof the industial data, meanwhile, it give the validity of the learning-based approaches on the project of industrial. It is a valuable study, but there are still a little problem:\n1.In the abstract, there are differences of the initial on (1)(2)\n2.There is a \'commiiter\' in table I.\n3.In the abstract, there is no explanation of F0.5.\n',25,'2021-02-05 10:45:50',25,_binary '\0'),(149,'This paper review the current studies focusing on the secondary studies in SE and review related TSs using SLR, they also develop guidelines for conducting TSs in SE, and introduce some limitations that need to be overcome. This paper also has some problems:\n1.Line 877 lacks a full stop.\n2.For the future work is less introduced, can introduce this part in more detail.\n3.The excessive length of Table 7 results in a mismatch in proportions.\n',26,'2021-02-05 10:51:50',72,_binary '\0'),(150,'This paper realizes the current state-of-the-art of the existing TSs till now. The authors investigated and assessed the how the researchers conduct TSs.They found that there is a great difference between TSs from the perspective of methodology and there is an important need for research to develop guidelines for conducting TSs in SE.Here are some of my comments:\n1.There is no explanation of the basis for the definition of inclusive and exclusive criteria in Section3.3\n2.There are coding errors in Section5.1\n3.Missing \'?\' in Table 64.Figure 4 does not explain the meaning of the number',26,'2021-02-05 10:51:59',18,_binary '\0'),(151,'Title：11 Years of Tertiary Studies in Software Engineering: A Critical Review\n\nThis paper intended to realize the current state-of-the-art of the existing TSs till now. They investigated and assessed the how the researchers conduct TSs in order to obtain the scope of a TS.\n\nMy comment is as follows:\n1.I think it’s better to list the contribution points because the contributions is not clear\n2.There are some grammar mistakes in this paper,for example,in the fourth paragraph of Section five,’(i.e. these studies are targeted at secondary studies and the research are conducted systematically)’，’research’ should be ‘researches’',26,'2021-02-05 10:53:18',24,_binary '\0'),(152,'Title: Using Learning-based Approach to Support Software Traceability Maintenance Tasks in Industrial Context\nAuthor: Liming Dong/Jing Chen\nThis paper adapt learning-based approach to support software traceability maintenance tasks in industrial context and help achieve automatic traceability, which is a good research idea. However, there are some defects in it:\n1.There are some syntax errors such as “by manually” in line 11(left side), which makes the paper hard to read.\n2.What does the “latter 2 tasks” in line 119(left side) refer to should be explained more clearly.\n3.There are also some typos in this paper. For example, “OSS datset” may have been misspelled in Table 11.\n4.The content in the sudden textbox of page 8, page 9 and page 10 is hard to understand, why should them be put here?',25,'2021-02-05 10:53:29',81,_binary '\0'),(153,'This paper is a study of the tertiary research in software engineering, the paper is easy to read and understand. The figures and tables in the paper is clear and beautiful. After reading the paper,I have some comments in the following:\n1 There are two typo in line 576 and 577.\n2 Can the quoted content be aligned in line 594-598?',26,'2021-02-05 10:56:43',56,_binary '\0'),(154,'This article designs a series of experiments to evaluate the performance of different component configurations of the learning-based classifier, and investigate the applicability and limitation of learning-based approach in industrial context. The background introduction, research process, and result display in the article are more detailed, but there are still some points that can be strengthened.\n1. The summary part lacks the evaluation results and meaning. OSS did not given the full name when it first appeared. \n2. There is no explanation for learning-based methods. \n3. Contrast with other methods to highlight research motivation.\n4. The evaluation index of AUC is not used much. The reason for using this evaluation index can be strengthened. So is the 4-fold time series validation.\n5. The discussion part is a bit small.',25,'2021-02-05 10:59:45',6,_binary '\0'),(155,'Title: 11 Years of Tertiary Studies in Software Engineering: A Critical Review\nAuthor: Xin Huang/Huang Huang/Xin Zhou\nThis paper use SLR to review related TSs in the past 11 years, finding that there is a great difference between TSs and there is an important need for research to develop guidelines for conducting TSs in SE. The idea is meaningful and the paper is well written, and even a noob like me can figure out what’s doing in the paper. However there some defects too:\n1.The width of Table 7 is so great that it nearly approach the text on the right.\n2.Table 8 is put among the appendix, making it hard to read. If put on the top of page 8, it would be better.\n3.There are typos such as “expect” in line 3, paragraph 2, Section 6 (Conclusions), which should be “except”.\n',26,'2021-02-05 10:57:54',81,_binary '\0'),(156,'Wengang Liu; Wei Liu; Qinglong Meng; Mengjie Ding; Qianwen Xu; Tao yang; Liming Dong; Chenxing Zhong\nThis paper gives a guideline to focus on the difference of SLR and TSs. It is a meaningful research of evidence-based software engineering.However, there are a little problems in it:\n1.The abstract is a litlte short, it does not introduce the work of this paper,.\n2.The order of the reference is a little strange.\n3.There is missing \'?\' in the last item of Table6.\n',26,'2021-02-05 10:59:29',25,_binary '\0'),(157,'This paper aims to discover the scopes of the existing TSs and how SE researchers conducted TSs. There is no big problem, but I still have some suggentions:\n1. Table 7 is not aligned with the text below.\n2. The title of 3.5 and 5.5 are similar, how to distinguish them?',26,'2021-02-05 11:07:33',73,_binary '\0'),(158,'The author intended to realize the current state-of-the-art of the existing TSs till now. They investigated and assessed the how the researchers conduct TSs in order to obtain the scope of a TS. A systematic literature review on the TSs published between 2009 and 2019 was conducted, and 38 tertiary studies were identified. The paper found that there is a great difference between TSs from the perspective of methodology and there is an important need for research to develop guidelines for conducting TSs in SE. \n\n1. 5.8 should change name to Threats to Validity，because so many xxx validity is used\n2. Figure 4 snowballing part should be less than orthers\n3. Line 591 miss ?',26,'2021-02-05 11:44:39',62,_binary '\0'),(159,'This paper show the effectiveness of learning-based tracaebility recovery approach in industrial context. I have some suggestions as follows\n1)In the abstract section,OSS and SSL abbreviation appear for the first time, but the full name is not given\n2)In the abstract section,the rhetoric of using learning-based approach is a bit awkward, why use learning-based approach \n3)In the 3.6 section, the fourth criteria of data collection, why should the project has at least 2 versions left, and I think it should be explained',25,'2021-02-05 11:15:16',35,_binary '\0'),(160,'This paper gains an understanding of to what extent learning-based techniques can be applied to traceability maintenance tasks in a large-scale industrial setting. Here are my comments:\n- In the [Introduction] section, more should focus on motivation and contribution, such as other researchs\' deficiencies in software traceability maintenance, the reasons for using the learning-based method, and it\'s essential to emphasize that this article is the first paper to apply semi-supervised mechanism and learning-based approach to this field, and the result is very successful.\n- Although the 3rd section[LEARNING-BASED APPROACH]introduces the approach individually, I think it\'s better to draw a flowchart or structure diagram to explain the approach more intuitively.',25,'2021-02-05 11:20:44',84,_binary '\0'),(161,'In this paper, an understanding of what extent learningbased approaches can be applied to traceability recovery tasks in industrial setting is obtained.  the SSL framework based on our enhanced learning-based approach explored in this paper is of great significance to bridge the gap between OSS dataset values and performance of learning-based approach in industrial context. In this article, although the recovery section is important, perhaps it would be better to reduce this section a bit.',25,'2021-02-05 11:21:49',46,_binary '\0'),(162,'This article investigates the tertiary studies(TSs). The research points are relatively new. We can see the current status of the tertiary studies, the research methods and processes are very detailed, but there are still some points that can be improved.\n1. The answer to the research question can be expanded, especially the answer to the second research question.\n2. The conclusion part can be expanded.\n3. The significance of the work can be further reflected.\n4. The reasons why guidelines are needed for the tertiary studies can be further explained to enhance the meaning of this paper.\n5. The paper is more detailed in data collection, screening, and statistics, but there is a little lack of conclusions, which can be sublimated to increase contribution.',26,'2021-02-05 11:28:23',6,_binary '\0'),(163,'There are some problems of this paper as following:\n1. The values in Figure 4 do not add up to 38.\n2. Is there something wrong with the format of the paper at lines 594 to 598？\n3. At lines 601 and 608, references are incorrectly formatted.',26,'2021-02-05 11:29:26',1,_binary '\0'),(164,'Compared with the previous version, the following aspects are modified in this version：\nThe title has been modified to make it more in line with the industry scene; In the introduction section, three scenarios of TR, RM and RV are described, There are some suggestions:\nThere is a reference error on line 70 ”[?]”.\nThere is a spelling error on table 11 ”datset”.\nThe table on the left side of the paper may be a little wide.\n',25,'2021-02-05 11:29:42',29,_binary '\0'),(165,'Compared with the previous version, the following aspects are modified in this version：\nCombine discussion and RQ2 together for explanation; Part of the content was added to explain the contribution and positioning of the paper, There are some suggestions:\nThere is case inconsistency in Table 2, such as ‘Research question’ and ‘Research Topic’.\nIt will be clearer to list the contribution points in the introduction section\n',26,'2021-02-05 11:31:09',29,_binary '\0'),(166,'The objective of this paper is to gain an understanding of to what extent learning- based approaches can be applied to traceability recovery tasks in industrial setting. To that end, this paper conduct a series of experiments on 19 industrial projects and 17 OSS projects.\nThe specific comments are as follows:\n1、In the INTRODUCTION, \"The importance of traceability is well understood in the soft- ware engineering community [17], [2], [14], [6], [?], [44], [34], [15].\" There is something wrong with reference ？\n2、I think the introduction is too long\n3、What is the principle behind feature selection\n',25,'2021-02-05 11:36:31',2,_binary '\0'),(167,'Suggestions:\n1. In the abstract, the first time OSS appears without specifying the full name and it will cause confusion to readers.\n2. In the Section 4, I think the research question should not be placed in the last part, but should be clear at the beginning of this section.\n3. Although it is said in the introduction that there are three main scenarios for traceability, this article only focuses on some of them so it should be explained in the introduction.',25,'2021-02-05 11:38:08',73,_binary '\0'),(168,'This paper designs a series of experiments to evaluate the performance of different component configurations of the learning-based classifier,illustrate the barries encountered in industry traceablity maintenance practice.The opinions are listed as follows:\n1.The conception of learning-based methods is not explained in the paper.\n2.There are many grammatical errors in the paper.',25,'2021-02-05 11:40:26',14,_binary '\0'),(169,'This paper demonstrates the effectiveness of learning-based traceability recovery methods.I have some suggestion:\n1.Give the full name of OSS the first time you refer to it.\n2.There is a \'commiiter\'  in table I.\n3.In Section5.2,\'Table 6\'  rather than \'Tables 6\'.',25,'2021-02-05 11:41:06',17,_binary '\0'),(170,'I have some suggestion:\n1.Table 7 should be aligned with the text below.\n2.Figure 4 is a little blurred.',26,'2021-02-05 11:44:35',17,_binary '\0'),(171,'A systematic literature review on the TSs published between 2009 and 2019 was conducted, and 38 tertiary studies were identified. It is found that there is a great difference between TSs from the perspective of methodology and there is an important need for research to develop guidelines for conducting TSs in SE. It is of great help to software practitioners.\nbut I still have some suggentions:\n1、What\'s the difference between secondary study and mapping study?\n2、What\'s the relationship between RQs and research purposes? \n3、Please highlight the contribution of this article',26,'2021-02-05 11:45:09',2,_binary '\0'),(172,'Comments:\n1. line 66: [?]\n2. line 66 and line 121: serveral references should only be written in one way, for example, [],[],[] or [ , , ].\n3. line 217 and line 222: Section ??\n4. line 376: the a17/a18, line 380: an/am: these notations should be written as $a_{17}$ in the latex file.\n5. line 902: Figure ??.\n6. line 1137: Figure ??.',25,'2021-02-05 11:45:19',64,_binary '\0'),(173,'**Title: 11 Years of Tertiary Studies in Software Engineering: A Critical**\n**Review**\n\nThis paper conducted a review on Tertiary Studies for a period of 11 years. \nThe authors argue that the definition of the Tertiary Study is missing, and the researchers misused Tertiary Study. \n\nAs the increasing number of Tertiary Studies in software engineering community, \nindeed, the definition of Tertiary Study and conducting process following the guideline are necessary. \nThis paper could help research novice learn and adopt correct methods with respect to Tertiary Study.\n\n**Some comments:**\n1.Detailed information relates to data extraction items should be added and explain the relationship between research questions.\n2.Does it possible to conduct a survey towards authors of the Tertiary Studies ? That might support the additional evidence for the concerned viewpoint in this critical review.\n3.The importance of Tertiary Studies should emphasized again and again in the context of the paper, not just in introduction. \n4. And the paper could further explain what is the impact of  misconducted Tertiary Studies ?\n5. Research Purpose of the Tertiary Studies should further discussed to investigate the overview objective of the TSs.\n6.Does it meaningful to extract the citation number of TSs to understand the effects and contributions of TSs on specific research domain.\n\n**Detailed errors:**\n1.Upper and  lower case errors, e.g., data extraction items in Table2.\n2.Process of Study Selection Figure(Figure 1) could redraw to show the detailed process described in Section 5.7(Disagreement on Some of the Existing TSs)\n3. Rest of the Tables and Figures should add more detailed information to increase the richness of paper context.',26,'2021-02-05 11:45:38',33,_binary '\0'),(174,'The  paper aims to gain an understanding of to what extent learning based approaches can be applied to traceability recovery tasks in industrial setting. Athours conducted a series of experiments on industrial projects and OSS projects and obtained some conclusions. But I have some doubts：\n1、The conclusion of the experiment does not seem to be emphasized in the Abstract.\n2、In Section Introduction，“Because of ..., the deep learning-based techniques did not chosen. We chose a link recovery classifier method” This logic seems to need to be considered.',25,'2021-02-05 11:45:54',63,_binary '\0'),(175,'This paper aims to gain an understanding of to what extent learning-based approaches can be applied to tracebility recovery tasks in industrial settings. Moreover, a SSL framework was first proposedt to tackle the gap between OSS dataset experiments values and performance of learning-based approach in industrial context.\n\nHere are some comments:\n1. Since authors extend the topic \'traceability\' to industrial context, the differences between the OSS and industrial setting should be discussed more detailly to outstanding the motivation of this paper.\n2. Authors stated they did not choose deep learning-based techniques in this paper. However, when we deal with a large mount of data, especially in industrial context, deep-learning based techniques are uasally adpotted. Authors should elaborate this point more or conduct some comparative experiments to verify this assumption.\n3. When authors identified 18 features to traing your own model, a PCA are also recommded to conduct to exclude some no sense features.\n4. There are some format errors. e.g. in line 70.',25,'2021-02-05 11:47:40',54,_binary '\0'),(177,'This paper intended to realize the current state-of-the-art of the existing TSs till now. They investigated and assessed the how the researchers conduct TSs in order to obtain the scope of a TS.\nMy opinions are listed as follows:\n1.The value of tertiary studies in software engineering can be embodied concretely.\n2.The structure of this paper should be adjusted because there is two \"Data Extraction\" in this ppaper.\n3.There are too many summaries and few analysis in conclusion.',26,'2021-02-05 11:49:20',14,_binary '\0'),(178,'This paper is to gain an understanding of to what extent learning based approaches can be applied to traceability recovery tasks in industrial setting. To that end, The author conduct a series of experiments on 19 industrial projects and 17 OSS projects. In This paper, they investigate three aspects. Furthermore, They identified the limitations (i.e. class imbalance)that need to be addressed in order to bridge the gap between OSS dataset experiments values and performance of learning-based approach in industrial context. \n\n1. if you just list your question in 4.4, is not enough content.\n2. Line 70 ? is wrong or other mistake.\n3. Line 631 F0.5 Format mistake.\n4. Table 1 miss b18.',25,'2021-02-05 11:51:00',62,_binary '\0'),(179,'This paper give a systematic literature review on the TSs published between 2009 and 2019 was conducted,and identify 38 tertiary studies.Based on these reviews,the paper show the gap between the definition of TS proposed in Kitchenham et al.’s guidelines and the current practice.I have some suggestions as follows\n1)In the 3.2 section,may be collect some of the tertiary studies that can be found published in 2020 to enhance the data set\n2)In the Figure 4,may be explain these data, especially some special data, such as the number of snowballing method used alone is zero',26,'2021-02-05 11:51:41',35,_binary '\0'),(180,'This paper intends to investigate the current state-of-the-art of tertiary studies (TSs) in software engineering (SE). There is no major problem with the overall structure of the paper, and the explanation is relatively clear. But there are still some minor problems. Here are my suggestions:\n- Introduction section does not clearly explain the motivation.\n- There are some lexical problems in the text, i.e. “14 conference articles ~~Among~~(among) the identified 38 TSs”. ',26,'2021-02-05 11:53:57',84,_binary '\0'),(181,'The authors systematically reviewed all the TSs published in SE, which is an innovative try in evidence-based research community. But I have some doubts\n1、The definition of “TSs”seems a little vague\n2、Maybe we can reinforce the contribution of this paper in the conclusion section.',26,'2021-02-05 11:58:10',63,_binary '\0'),(182,'This paper conduct a series of experiments to gain an understanding of to what extent learningbased approaches can be applied to traceability recovery tasks. To tackle the limitations identified by author, they explored SSL framework based on enhanced learning-based approach. Some comments are as below:\n1. In abstract, it\' s better to indicate the full name of OSS and SSL.\n2. In abstract, the contributions and main work of this paper are not fully explained.\n3. Table 10 is not clear, the font and size need to be adjusted.\n4. The introduction part is too long, the discussion part is too short.',25,'2021-02-05 12:01:56',9,_binary '\0'),(183,'This paper propose a learning-based approach to support the traceability recovery tasks in inductrial setting. After reading this paper, i have some question about these places.\n1. The title contains the word \"industrail context\", but OSS projects are also considered in the work. The use of OSS projects is not explained clearly in the paper.\n2. The importance of features for trace link classification model is explored in this work. But how does this part related to the approach proposed in this paper? It seems like an independent part.\n3. The meaning of using this approch is still not clear in my opinion, the discussion part is short.',25,'2021-02-05 12:02:36',32,_binary '\0'),(184,'comments:\n1. line 576: Table ??.\n2. line 577: TS[?].\n3. line 601: update[?].',26,'2021-02-05 12:05:58',64,_binary '\0'),(185,'This paper reviews the current status of the studies focusing on the secondary studies in SE and using SLR to review related TSs in the past years.The architecture and language of this article are clear, but there are some small problems on the tables and figures, such as the width of Table 7 is not very appropriate.',26,'2021-02-05 12:17:30',71,_binary '\0'),(186,'This paper conduct a systematic literature review on tertiary studies, aiming to realize the current state-of-the-art of tertiary studies. After reading this paper, i have some comments on this work:\n1. This work intends to appeal for more research on TS for correctly use of TS. Does the paper clearly reflect the author\'s suggestion on the correct use, rather than a summary?\n2. The contribution of this work is vague, author needes to explain the meaning of this work in further way.\n\n',26,'2021-02-05 12:27:04',32,_binary '\0'),(187,'This paper aims to realize the current state-of-the-art of the existing TSs and explore how researchers conduct TSs. Some interesting findings were also presented in this paper.\n\nHere are some comments:\n1. The format of Abstract should be adjusted. For example, it should be better to list the number of finding you summarized, and stated them number by number.\n2. In Introduction, I agreed that TS can play a vital role to assist SE practitioners and researchers to obtain the research status of target research areas quickly. Since, TS can realize the same purpose of this paper\'s, Iconfused why authors still determined to conduct a SLR for TSs. I suppose the reason \'obtain the research status quickly\' is too weak. Because TSs itself can realize it, authors should put your effort in other interesting areas deserved to be investigated.\n3. In table1, there seems to be wrong number written.\n4. Authors analysized five main process in existing TSs, however, when authors conducted a SLR on TSs, why authors did not obey what they have done. I mean this paper lack of Section quanlity assessment.\n',26,'2021-02-05 12:27:52',54,_binary '\0'),(188,'This paper is to gain an understanding of to what extent learning-based approaches can be applied to traceability recovery tasks in industrial setting. Here are some pf my comments:\n1、What is OSS refers to? I think OSS should be properly introduced or the full name of OSS should be given when it is first applied.\n2、Can the style of the table be adjusted a little more? Especially in Table 10, the font size is too small and the use of some eye-catching colors may hinder readers\' understanding of the data in the table.\n3、In line 70, the citation to the paper is misformatted.\n',25,'2021-02-05 12:27:56',67,_binary '\0'),(189,'This paper conduct a systematic literature review on the tertiary studies(TSs) published between 2009 and 2019 to discover the scopes of the existing TSs and how SE researchers conducted TSs as well. Some comments are as below:\n1. In abstract, the importance of TSs should be explained to highlight the motivation of this work.\n2. Figure 3 is not clear, it\' s better to adjust the font and size.\n3. In references, [40] and [41] are repeated.',26,'2021-02-05 12:29:25',9,_binary '\0'),(190,'# Title: Using Learning-based Approach to Support Software Traceability Maintenance Tasks in Industrial Context\nAuthors: Liming Dong, Jing Chen\n\nSummary:\nThis paper designs a series of experiments evaluating the performance of different components configuration of learning-based classifier. And result of experiments shows that using ’Labeled’ data as sampling dataset and Time Series validation can achieve better performance on both OSS and industrial contexts. They illustrate the barriers encountered in industry traceability maintenance practice and identified the limitations that need to be addressed in order to bridge the gap betweenOSS dataset experiments and real performance of learning-based approach in industrial context, which is helpful for researchers to deal with automatic traceability maintainance in software engineering.\nComments:\n	1. In Abstract section, why use learning-based approaches? Whether there is literature or experimental support?\n	2. In Abstract section,’ using ’Labeled’ data as sampling dataset and Time Series validation can achieve better performance on both OSS and industrial contexts’, better than what?\n	3. The results of the experiment should be succinctly stated in Abstract section.\n	4. In Introduction, it should be introduced first what is Software traceability instead of significance of Software traceability. \n	5. ‘Deep learning techniques might appropriate to support the traceability recovery on cross-project learning.’ In line 142, Whether there is literature or experimental support?\n	6. In introduction, it is still not clear why choose learning-based approaches ,and It should be compared with other approaches like IR-based, heuristic-based .\n	7. The results of the experiment should be succinctly stated in main contributions.\n	8. Title of 3.3 is confusing.\n	9. 3.4 is combination of description of data and strategy of labeling data, so title of this section should be adjusted.\n	10. In RQ1, configuration of learning-bases approaches is greatly influenced by data. Whether the results obtained from these experiments can be applied to other projects or other data?\n	11. Most of the content in RQs is about the introduction of experimental approaches, and the analysis of experimental results is not enough.\nDetail issues:\n	1. Literature Citation Problem in line 66.\n	2. Font size problem in line 69.\nReporter: Huilin Yin \n',25,'2021-02-05 12:36:32',58,_binary '\0'),(191,'**Title:** Adapting Learning-based Approach to Support Software Traceability Recovery Tasks in Industrial Context\n**Authors:** Liming Dong, Jing Chen\n\nThe authors conduct experiments on both industrial and OSS projects to explore what extent learning-based approaches can be applied to traceability recovery tasks in industrial setting.\n\n**MAIN CONCERNS INCLUDE:**\n-	INTRODUCTION [122-146]: This paragraph is not necessary for your INTRDUCTION. If the structure of your INTRODUCTION is [Traceability is important -> Traceability needs automation -> Some existing work -> The motivation], then you need to elaborate the relationship of IR with your work. Moreover, you mention some shortcomings of heuristic-based and the learning-based techniques, which cannot be solved in your work, it is not good for your INTRODUCTION.\n-	LEARNING-BASED APPROACH: Since the main content of this section is the strategy of generating dataset, I recommend to change the title of this section. “LEARNING-BASED APPROACH” seems that you will introduce how to process data here.\n-	EXPERIMENT: To my knowledge, in the imbalance dataset, high AUC doesn’t mean better.\n-	OTHERS: I notice that this paper refer to [35] in APPORACH, EXPERIMENT, RESULT and even TTV. Maybe you need to elaborate how [35] effects this study and the new findings based on [35].\n\n**MINOR CORRECTIONS:**\n-	INTRODUCTION [69-71]: The citation error [?]. And I do not approve to use so many citations to prove “well understanding”, some representative citations are enough.\n-	INTRODUCTION [216-225]: Where is Section 3?\n-	LEARNING-BASED APPROACH [397-398]: Repeat [as 30 hours].\n-	EXPERIMENT SETUP [546-547]: met -> meet\n',25,'2021-02-05 12:46:02',39,_binary '\0'),(192,'This paper intend to realize the current state-of-the-art of the existing TSs till now. It investigat and assess how the researchers conduct TSs and is found that there is a great difference between TSs from the perspective of methodology. Here are some of my comments:\n1、The style of the table can be reconsidered. For example: if there are too many white Spaces in Table 2 and whether Table 7 is too long.\n2、Whether it is necessary to have two doses of the 16th citation, which is only published in a different journal than the 17th citation.\n3、At present, the description of the contribution points of the paper is not clear enough. I think the contribution points of this paper can be listed more clearly',26,'2021-02-05 12:46:43',67,_binary '\0'),(193,'This paper gains an understanding of to what extent learning-based approaches can be applied to traceability recovery tasks in industrial setting. And it conducted a series of experiments to verify the problem. This paper is well-organized and the points are clear. But there are also some questions about its content:\n\n1. The comparision of the two contexts(industrial and OSS)should be more detailed so that readers can learn the difference between them more easily.\n2. The full name of these OSS name should be listed.\n3. Maybe the introduaction could be more concise.',25,'2021-02-05 12:51:15',50,_binary '\0'),(194,'Title: Using Learning-based Approach to Support Software Traceability Maintenance Tasks in Industrial Context\nAuthor: Liming Dong/Jing Chen\nThis paper adapt learning-based approach to support software traceability maintenance tasks in industrial context and help achieve automatic traceability, which is a good research idea. \n\nHere are some comments:\n1.There are some grammatical errors\n2.The introduction part is too long and not very logical',25,'2021-02-05 12:54:12',79,_binary '\0'),(195,'This paper investigated and assessed the how the researchers conduct TSs in order to obtain the scope of a TS. And it pointed out some challenges which the TS faces, which I think is valuable. But there are also some questions when in the process of reading the paper:\n\n1. The conclusion of the research consists of a series of limits, which I think lacks some deeper discussion such as how to do.\n2. The process of data extraction could be more detailed.\n3. The research question is not related enough with the conclusion.',26,'2021-02-05 13:00:43',50,_binary '\0'),(196,'A systematic literature review on the TSs published between 2009 and 2019 was conducted, and 38 tertiary studies were identified. It is found that there is a great difference between TSs from the perspective of methodology and there is an important need for research to develop guidelines for conducting TSs in SE. \nHere are some comments:\n1.The introduction part is not very clear\n2.Figure 4&Figure3 is not clear',26,'2021-02-05 13:03:15',79,_binary '\0'),(197,'**Title:** 11 Years of Tertiary Studies in Software Engineering: A Critical Review\n**Authors:** Xin Huang, Huang Huang, Xin Zhou\n\n\nThe authors review the Tertiary Studies (TS) in SE and find the adoption of TS is ambiguous. This study is interesting because it is the first work that try to review the TS.\n\n**MAIN CONCERNS INCLUDE:**\n-	RESEARCH METHOD: I think the Research Questions are not interesting enough. As a SE researcher, I want to know from what aspects that TS contribute to the community. It will be more meaningful than research the scopes and methods.\n-	SYNTHESIS AND DISCUSSION [825-827]: In fact, I do not think we need an exact definition on TS. When we read or conduct a SLR or TS, we will focus on the findings but not its definition. \n',26,'2021-02-05 13:06:35',39,_binary '\0'),(198,'Comments:\n1.It might be better to show more detailed information of how you get the 38 tertiary studies like some principles , methods or guidelines.\n2.I cannot understand the difference of the TSs from the perspective of methodology clearly and it might be better to list them out in a table.\n3.It might be better if the paper can mention or just talk about the directions of guidelines for conducting TSs in SE.',26,'2021-02-05 13:21:50',41,_binary '\0'),(199,'Comments:\n1.Are Table 1 and Table 2 helpful to the content of the article? These two tables seem to be of no help to the content of the article at present, whether they can be deleted or readjusted.\n2.There are still some deficiencies in the setting and answering of RQ. What are the research motivations and contributions of RQ1 and RQ3?\n3.Discussing the problems found in the research and the application value should be the highlight of the article, but the complete text lacks a deep impression on this part, and the author should emphasize this part repeatedly.',25,'2021-02-05 13:23:29',41,_binary '\0'),(200,'This paper propose a learning-based approach to support the traceability recovery tasks in inductrial setting. \n\nSome comments:\n1. This paper\'s title used \"industrial context\", but I think the results of the paper are limited to Huawei, and the universality of the conclusion is not enough.\n2. Table I has a spelling error: \'commiiter\'.\n3. Line 70 has a reference missing [?].\n4. Line 108: \"eg.,\"\n5. Line 141: recurrent neural network(RNN) should change to \"Recurrent Neural Network(RNN) \"\n6. Line 206: The content of the row exceeds the limit of the column.',25,'2021-02-05 13:23:38',66,_binary '\0'),(201,'#### Conference Paper Review\n##### Paper Title\n11 Years of Tertiary Studies in Software Engineering: A Critical Review\n\n------------------------------------\n##### Comments\nThis paper investigated and assessed how the researchers conduct TSs in order to obtain the scope of a TS by conducting a systematic literature review on the TSs published between 2009 and 2019.\nSome comments are following:\n1. The full name should be given when using the abbreviation for the first time such as \'SMS\' in line 153.\n2. Serial number of the inclusion criteria in Table 1 should be modified, \'IN3\' is missing.\n3. More explanation should be added for two RQs in Section 3.1.\n4. The number of the major SE literature databases should be four as listed later in line 200.\n5. The titles for section 3.4 and 5.3 are both \'Data Extraction\' but content in these sections are different. Therefore, I think titles for the two sections shoudle be modified.\n6. There are some mistakes in line 576, 577 and 601, e.g. \'Table ??\', \'TS[?]\', \'update[?]\'.\n7. The width of Table 7 is too long and shoudle be ajusted.',26,'2021-02-05 13:24:48',68,_binary '\0'),(202,'This paper conducted A systematic literature review on the TSs, and proposed that there is an important need for research to develop guidelines for conducting TSs in SE. \n\nSome comments:\n1. Figure 4 is not clear.\n2. Table 7 Out of the Column.\n3. Table 2 feels a bit empty.\n3. Is guideline necessary? Are there guidelines for TSs in other fields?',26,'2021-02-05 13:32:54',66,_binary '\0'),(203,'This paper gains an understanding of to what extent learning- based approaches can be applied to traceability recovery tasks in industrial setting. I think the following three points can be elaborated more:\n1. Problems caused by data imbalance\n2. Advantages of semi supervised framework\n3. Why SSL better than baseline classifier in working principle',25,'2021-02-05 13:36:11',71,_binary '\0'),(204,'By investigating  how the researchers conduct TSs and then obtaining the scope of a TS，they found that there is a great difference between TSs from the perspective of methodology and there is an important need for research to develop guidelines for conducting TSs in SE.\n\nThe article has been sufficiently detailed in the collation and explanation of the papers, but it would be better if the connection between the question and the conclusion can be strengthened\n',26,'2021-02-05 13:40:13',74,_binary '\0'),(205,'Some advices:\n\n1. The ACM Reference Format link on line 46 of the first page seems to be invalid.\n2. The reference index \"[?]\" in line 70 of the first page is not defined. ',25,'2021-02-05 13:41:01',82,_binary '\0'),(206,'Title: 11 Years of Tertiary Studies in Software Engineering: A Critical Review\nAuthors: Xin Huang, Xin Zhou, Huang huang\n\nThis paper investigated and assessed the how the researchers conduct TSs in order to obtain the scope of a TS. They found that there is a great difference between TSs from the perspective of methodology and there is an important need for research to develop guidelines for conducting TSs in SE. Here are some comments for the improvement of this work:\n1.	In abstract, I don\'t think the result of this study is clear enough.\n2.	In introduction section, I don\'t think the motivation for the study is strong enough, may be more problems of TS should be listed. And ‘there is no systematic reviews on TSs in SE, which makes it impossible for these tertiary studies to be readily available to those who can benefit from them’ is a bit too absolute.\n3.	The current RQ is relatively thin, it is suggested that more questions related to TS can be mined from the research. \n4.	More analysis should be done according to the data collected, reflecting the criticality in the title.\n5. I think the contribution of this paper needs to be strengthened.\nReporter: Huilin Yin ',26,'2021-02-05 13:44:58',58,_binary '\0'),(207,'This paper propose a learning-based approach by some experiments.This approach is care about classifying traceability recovery tasks. There are some problems:\n\n1.Insufficient description of software traceability in the introduction\n2.Can OSS of different company teams ensure that the model results are universal? If possible, a theoretical basis should be given\n3.It is recommended to use a clearer way to illustrate the relationship between traceability and various indicators in the code warehouse\n',25,'2021-02-05 13:47:58',22,_binary '\0'),(208,'This paper is about a learning-based methord to support the traceability recovery tasks in inductrial setting. My comments are as follows:\n- The Introduction of this paper is supposed to be more detailed in the background of the work mentioned. \n- The format and size of the tables in the paper need some adjustments.\n- There should be overview of the results and conclusions in the bstract.',25,'2021-02-05 13:48:57',83,_binary '\0'),(209,'This paper investigates the effectiveness of a learning-based tracaebility recovery approach in industrial context, which has addressed many comments given last time. Here are some new comments from my side to help your further improvement: \n\n- TITLE: It is a little bit strange that you say \"Adapting …… Approach\" without an article \"the/a\" after \"Adapting\". This problem can be seen in the full text of your paper. \n- ABSTRACT: You only mention traceability rather than **traceability recovery** in the beginning part of the abstract. It may not strongly support your objective of understanding of something related to **traceability recovery**. \n- INTRODUCTION: This section is redundant and needs a refinement through removing some unnecessary details.\n- EXPERIMENT SETUP: I can not so much understand the structure of this section, especially for the last sub section. It seem to be inappropriate to put the RQs here. Moreover, maybe it is better to explain the motivation of each RQ.\n- Minor comments: 1） The inconsistent format of \"i.e.\"and \"i.e.,\". 2) Some citation errors [?]. 3) Space is missing before bracket, for example,  \"traceability recovery(TR), traceability maintenance(TM) and traceability valida1tion(TV)\".',25,'2021-02-05 13:50:52',48,_binary '\0'),(210,'Details:\n\n1. There are many format errors. e.g. in line 66、70、121、217...\n2. Not clearly express the background and motivation of the research in introduction.\n3. The contributions of this paper should be listed in detail and repeated in the first and last sections.\n4. The previous studies” is mentioned in this paper frequently. You need to note that this is a double-blind review in FSE, do not give references to your previous papers.\n5. There is a lack of description of experimental design and implementation in section 3. ',25,'2021-02-05 13:52:43',16,_binary '\0'),(211,'#### Conference Paper Review\n##### Paper Title\nAdapting Learning-based Approach to Support Software Traceability Recovery Tasks in Industrial Context\n\n------------------------------------\n##### Comments\nThis paper proposes a learning-based approach to perform traceability recovery tasks in industrial setting.\nSome comments are following:\n1. There is a \'?\' in line 70.\n2. The full name should be given when using the abbreviation for the first time such as \'OSS\' and \'SSL\' in abstract.\n3. The section 1 Introduction is too long and should be simplified.\n4. The font size of Table 10 is too small and should be adjusted.\n',25,'2021-02-05 13:55:19',68,_binary '\0'),(212,'This papper is to gain an understanding of to what extent learningbased approaches can be applied to traceability recovery tasks in industrial setting. And then conduct a series of experiments on 19 industrial projects and 17 OSS projects.Here are some comments:\n\n1) reference index “[?]”in page1\n2)  ‘commiiter’ in Table I\n3)  I have to read the whole introduction to find the actual meaning of OSS which appeared in abstract.',25,'2021-02-05 13:55:39',74,_binary '\0'),(213,'This paper is a tertiary studies in SE.This work is helpful to find problems in tertiary studies and make tertiary studies more efficient. There are some comments:\n\n1.This paper does not contain a structured and clear research method description\n2.The width of Table 7 is too long\n3.Table 3 only serves as a document index, some additional content should be added',26,'2021-02-05 13:59:52',22,_binary '\0'),(214,'This paper aims to realize the current state-of-the-art of the existing TSs and explore how researchers conduct TSs. My suggestions are as follow:\n- More about the motivation for the research in abstract may be better, for example listing current problems.\n- The paper lacks a clear definition of the evaluation criteria of tertiary research.',26,'2021-02-05 14:01:12',83,_binary '\0'),(215,'This paper review the current status of the studies focusing on the secondary studies in SE and using SLR to review related TSs in the past years. Here are my comments: \n\n- OVERALL: The revised version of this paper is no better than its previous version. The significance of TS and its necessity should be explained through this paper. Otherwise, maybe you can not prove the rationality of your motivaiton and the potential contribution of this work. \n- RESEARCH METHOD: Section 3.1: This question -> These questions. Section 3.4: What is the relationship between the data items extracted and your research questions.\n- RESULTS: Consider use a special format to cite your primary studies, which is different from the regular references.  \n- SYNTHESIS AND DISCUSSION: I suggest you to change the format of subtitles of this section to distinguish themselves from the ones in section 3. Moreover, the logic of this section is odd. It seems that Section 5.6 (Summary of..) stands on the different level compared with other subsections. \n- Minor comments: Space is missing before bracket. Citation errors in line 576 and 577.',26,'2021-02-05 14:35:06',48,_binary '\0'),(216,'This paper propose a learning-based approach to support the traceability recovery tasks in inductrial setting.\n1. The full name of these OSS name should be listed.\n2. Table 1 miss b18.',25,'2021-02-05 18:34:06',34,_binary '\0'),(217,'This paper conduct a systematic literature review on tertiary studies, aiming to realize the current state-of-the-art of tertiary studies. After reading this paper, i have some comments on this work:\n1.Figure 4 is too large。',26,'2021-02-05 22:09:53',34,_binary '\0'),(218,'# **HGRec: A Hypergraph-based Recommender for Suggesting Code Reviewer in OSS Community**\n\n## Contribution of the paper\nThis paper identified hypergraphs that with qualities of solid mathematical basis and the adaptability to code review modeling and propose a Hypergraph-based reviewer Recommender, namely HGRec, to balance the trade-off between recommendation accuracy and recommendation coverage. \n\n\n## Technical correctness of the paper\n\nProblems：\n\nFigure 2: The logic view of hypergraph is not intuitive. I think it hard to understand the meaning of this figure.\n\nThere is a spelling mistake within the formula（12).\n\nIn the part of EXPERIMENT DESIGN, since the authors performed 30 rounds experiment, and the data set of training set is more and more big, but the test set still only 1 month, so is it reasonable?\n\nThe author said \"With the scale of the project the number of participants getting larger and larger, developers’ workload has increased a lot.\" But as we all know, the contributors of Open Source Software may can not takes all the time and energy to the OSS project. So, how to deal with this situation?\n\n## How much effort did you spend refereeing this paper? \nReasonable\n\n## Decision\n\n------------------------------------\nReporter: Zijia Jia（硕士生）',27,'2021-02-19 10:08:39',19,_binary '\0'),(219,'# **Assessing the quality of Grey Literature by use Analytical Hierarchy Process in Software Engineering Research**\n\n## Contribution of the paper\nThis paper selected and reviewed 16 studies involving quality assessment in research. We also obtained 14 replies from the invited SE community experts and we identified 24 effective quality assessment criteria.\n\n## Technical correctness of the paper\n\nProblems：\nIn the part of \"3.1\", There is onlt ONE RQ, which is \"How to evaluate the quality of GL?\". Is it too big to discuss? Maybe this RQ can be divided into several sub-RQs?\n\nIn the part of \"4.2\", it said \"For the quality assessment criteria, we create four sets; authority, evidence backed (e.g. experience), quality of writing and strength of argument (in Table 3). \" But the author don\'t give out the rational explanation for them.\n\n\n## How much effort did you spend refereeing this paper? \nReasonable\n\n## Decision\n\n------------------------------------\nReporter: Zijia Jia （硕士生）',28,'2021-02-19 10:08:02',19,_binary '\0'),(220,'This paper is aimed at proposing a new method for code reviewer recommender. This is a topic which I think have potential in the future. The following is some comments:\n\n1. Research questions should be proposed in the beginning of this paper. The RQs guide this paper not the experiments.\n2. Section 3 Methodology: This section is split from other sections in my opinion. Maybe you can combine this section with your related work, so that the readers can understand it easily.\n3. The answers to RQs is not well organized. You should emphasize your conclusion in the answers. The answers should show their values.\n\nThe work presented in this paper is interesting and valuable. But the context may have to be modified a lot. \n\nPHD',27,'2021-02-19 09:44:33',5,_binary '\0'),(221,'Grey Literature (GL) has played an increasingly import role in software engineering field. However, we also suffer low-quality grey literature that biases us a lot. This work aims at mitigating challenges in assessing GL quality by literature review, expert survey and AHP method. I am grateful for the aggerated 24 factors for assessing GL quality. Overall, the authors made a significant important work, but also need to address the following issues.\n\nTitle: “by use” -> “by using” / “by use of”. \nAbstract: Objective, method, results – Why we need assessing GL quality? What is the point of this paper? Guidelines or the AHP method? If the later, I have not seen any descriptions. \nSection 2: Since there exists a great preliminary study, I do not like the duplicate contents, such as Table 1.\nSection 3: Are there any demographic information?\nSection 4: Whether the 24 factors can be grouped? I think it is necessary. I am curious about ‘C21’ – Why the objectives of the GL influence its quality? By the way, parts of explanations for factors should be extended, e.g., ‘C6’, ‘C7’, whether the amounts or the contents influence its quality?\nSection 4: I am interested the weighting of AHP -- Can they be generalized?\nSection 7: I suggest adjusting presentations for contributions because of no differences compared in Section 2.   \nOthers: Several references do not work (I have met the same problem). The organization of appendix is badly.\n\nPhD student',28,'2021-02-19 10:33:25',44,_binary '\0'),(222,'This paper explores the solutions for the challengesin assessing the quality of GL, and propose a weighted quality checklist to the quality of GL. After reading this paper, I have some problems in the following:\n1 Why not put the calculation method of the comparison matrix in section 5.1 in the introduction of AHP in section 3.4? \n2 In the table 6, does \"Age of the site\" and \"Reputation\" need to be separated? ',28,'2021-02-19 09:25:56',56,_binary '\0'),(223,'This paper proposes a reviewer recommender based on hypergraph, introduces entropy to measure recommendation coverage, and proposes a reviewer recommender hgrec based on Hypergraph to balance the trade-off between recommendation accuracy and recommendation coverage. Code review is an important part of code quality, and it is one of the important application methods in automatic code review. The method proposed in this paper can effectively solve the imbalance of coverage in automatic code review, which is an interesting research and has certain research significance, but there are still some defects in this paper\n1. In the introduction part of this paper, the introduction of research motivation is still lack of the method for reviewers to recommend how to balance the trade-off between recommendation accuracy and recommendation coverage in the past. If the author puts forward it for the first time, it should be the first study. If not, it is suggested to supplement the previous work.\n2. The author spent a lot of time in Section 2.1 to introduce the related work, but from the content point of view, it only introduces who has done what, without further refinement, which shows that these work is insufficient, contribution or the relationship with this article, so it is suggested to modify.\n3. In Table 2 and table 3, some numbers are blacked, but the meaning of these numbers is not explained.\n4. It seems that RQ was put forward for experiment rather than research questions at the beginning. Finally, the answers to RQ need to be further sorted out, and the contribution of the article needs to be clearly and repeatedly emphasized. At present, after reading the whole article, it does not clearly show the research motivation, research questions and research contributions, which need to be revised.\n【PHD student】',27,'2021-02-19 16:08:39',61,_binary '\0'),(224,'This paper focuses on the grey literature (GL) study to explore solutions to evaluate GL quality challenges. The purpose is to provide guidelines on how to check the quality of GL in se. Through literature review and analytic hierarchy process, the author finds out how researchers use GL, and proposes a weighted quality list to eliminate one of the most critical challenges, that is, the quality of GL. This has a certain research significance. The quality of GL has always been an inevitable problem in grey literature research. However, there are still some shortcomings in this paper\n1. The purpose of this paper is to explore the quality problems of GL, but in the background part, it does not reflect the research status of other people on the quality problems of GL. The background part is more like introducing the use of GL in SE research.\n2. 2.4 and 2.5 introduce quality assessment in SLR and MLR, which seems to have little connection with the main body of the article.\n3. In 4.1, the author proposes that 24 factors can be considered in the quality evaluation of GL in the process of literature review. The author then lists these 24 factors, but does not explain how these 24 factors are obtained or where they are quoted. Secondly, the lack of sufficient persuasion shows that these 24 factors are the results of a systematic study, and the quality assessment based on these 24 factors can make a comprehensive and effective assessment of GL quality.\n4.4.2 doesn\'t seem to be complete?\n5. The weight table proposed by the author is based on the author\'s data. It seems that the weight table does not have enough verification for the application of other data, which can not effectively prove the effectiveness of the method proposed by the author.\n6. After reading the article as a whole, there is a lack of a deep impression on the contribution of the article, which needs further revision.\n【PHD student】',28,'2021-02-19 16:09:43',61,_binary '\0'),(225,'The idea of the algorithm is very good.If the paper highlights the actual application scenes and effects of the algorithm.It\'s sure to pass.',27,'2021-02-19 09:33:15',85,_binary '\0'),(226,'It would be better if the writing background of the paper could be improved.',28,'2021-02-19 09:36:10',85,_binary '\0'),(227,'\nThis paper is to address recommendation coverage imbalance issue, in this paper, the authors introduce the entropy to measure the recommendation coverage and, they propose a Hypergraph-based reviewer Recommender, namely HGRec, to balance the trade-off between recommendation accuracy and recommendation coverage.\n\n---\n\n Figure 7 maybe can change a little which left part is little but right has more things.\n\n---\n\nThis paper presents a new method, which is an innovative work.',27,'2021-02-19 09:36:42',62,_binary '\0'),(228,'This paper proposed a novel hypergraph-based reviewer recommender (HGRec) to mitigate the workload imbalance issue. \n1 Why not unify the font size in the table?\n2 The logic of the article is reasonable.',27,'2021-02-19 09:50:48',56,_binary '\0'),(229,'This study explores the solutions for the challenges in assessing the quality of GL. The authors goal in this paper is to present guidelines on how to check the quality of GL in SE.\n\n---\n\nThis paper is a new attempt for software engineering.\nIn general, due to the missing part of the article, for example: Section 4.2 and 3.1. \nAt the same time, it is also the RQ part. If there is only one RQ, there is no need to list Section 3.1 separately, just put it at the beginning of the three parts.',28,'2021-02-19 09:51:52',62,_binary '\0'),(230,'This paper proposes a new method based on hypergraph for reviewer recommender, which contributes to balance\n the trade-off between recommendation accuracy and recommendation coverage. Some suggestions are as follows:\n1. In the introduction part, the authors list some shortcomings that a number of reviewer recommendation methods have, such as flexibility, interpretability and accuracy, but the new proposed method only focus on accuracy, I think some explainations are necessary.\n2. In Table 2 and Table 3, some numbers are blacked, but the meaning behind is not explained.\n                                                                                    ----undergraduate student',27,'2021-02-19 10:09:53',73,_binary '\0'),(231,'This paper uses hypergraph to solve the problem of reviewer recommendation in code review, which is a pain point for both the open source community and the industry, and experiments are used to demonstrate the effectiveness and advantages of this method.\n\n1. Chapter 4 seems to lack of systematic and structural summary description of experimental design.\n2. There is no research purpose and objective to pave the way before RQ is introduced.\n3. Table 2, Table 3 and Table 5 have too much data. How to show that the HGRev is significantly better than the most advanced recommendation method.\n4. There are several papers in which code reviewers recommend ground truth, in which there are many factors of recommendation system and big difference in reality. It seems that the contribution point can be further explored.\n5. The formula of Accuracy in Section 4.3.2 is misspelled.\n\n【master student】',27,'2021-02-19 10:16:54',12,_binary '\0'),(232,'This paper found the shortages of code review like flexibility, interpretability, accuracy and coverage imbalance, and  propose a Hypergraph-based reviewer Recommender with the entropy to measure the recommendation coverage and get significantly results. And here is some suggestions: \n1. It might be better if you can tell us how you use entropy to measure recommendation coverage and give a short ,relevant description in the introduction section.\n2. You may emphasize the shortages of the other\'s work in your Related Work section to show the value and contribution of your paper, not only describe the history of research.\nmaster student',27,'2021-02-19 10:28:56',55,_binary '\0'),(233,'This paper carried out a Literature Review of the credibility of grey literature in SE and have a survey with the experts in SE to present the guidelines on how to check the quality of GL in SE, and propose a weighted quality checklist to erase one the of most critical challenges. Here is some suggestions:\n1.Now that you have \"Hierarchy Process\" in your title and I guess you can mention the concept in the introduction section.\n2.There is a little too brief in 3.1 and you might give more detailed description or split into several RQs. Or you can put them in the front of your paper to guide your work.\n3.The background is a bit long and you may introduce these concepts more briefly.\nmaster student',28,'2021-02-19 10:30:05',55,_binary '\0'),(234,'This paper proposed a conceptual model for how GL works in the SE research lifecycle.\n1. If the data in Table 4 is displayed in the middle, it will look more comfortable.\n2. The color of the line in Figure 3 is lighter, I think black is better.\nundergraduate student',28,'2021-02-19 10:14:06',77,_binary '\0'),(235,'This paper proposes a hypergraph-based reviewer recommender to mitigate the issues that the recommendation accuracy is low and workload is imbalanced.\n\nSome comments:\n- In the related work, the authors only introduced the results or findings of several related studies without highlighting the issues this paper aims to deal with. Therefore, it is hard to determine that the recommendation coverage is a real problem to be solved.\n- The authors mentioned their method made a trade-off between recommendation accuracy and recommendation coverage, but the trade-off seems to be manual, not automatic, so how do you determine the boundary between accuracy and coverage.\n- The statement of RQ2 doesn\'t seem to be suitable. The current research question is a yes-or-no question, however, the extent is more desirable and more meaningful.\n- In the conclusion, the text introducing the background is duplicated with that in the introduction. Moreover, the main results or findings are not appeared in the conclusion.\n\nMinor suggests:\n- There should be some words between sections and subsections.\n\nPhD',27,'2021-02-19 10:18:27',3,_binary '\0'),(236,'This paper proposes a novel hypergraph-based reviewer recommender (HGRec) to balance the trade-off between recommendation accuracy and recommendation coverage. I have some suggestions as follows\n1.In the Introduction part,maybe you can consider adding some text to illustrate the overall structure of the paper\n2.In Fig. 3,although the figure shows the hypergraph structure of the real project, I think it is better to explain briefly to highlight the advantages of the hypergraph\n3.In 4.2 part,maybe you can consider adding some data set selection criteria\n\n【master student】',27,'2021-02-19 10:24:31',35,_binary '\0'),(237,'This work aims at empirically exploring the use of gray literature by software engineering researchers, and further proposing criteria for evaluating gray literature.\n\nSome comments:\n- It is not suitable to only propose one research question.\n- Some words are needed between section 5 and subsection 5.1.\n- The contributions are duplicated between the introduction section and the conclusion section.\n\nPhD',28,'2021-02-19 10:25:36',3,_binary '\0'),(238,'This paper proposed a method novel method named \"HGRec\", which resolved the imbalanced workload in the reviewer recommendation context. In addition, compared to other method, HGRec can realise the balance of precision and workload. Althoeugh, there are also some questions which confused me. These questions are as follows:\n1. This paper used entropy to measure the workload of recommender. But I need futher explaination why you chose the metric, which I cannot find in the content.\n2. What criterion the bold figure in Table 2-4 followed should be explaination.\n------------------------------------\nMaster',27,'2021-02-19 10:30:58',50,_binary '\0'),(239,'This paper introduces the quality assessment of grey literature, which does exist in the process of software engineering research. In this paper, the author proposes a weighted quality checklist to help improve people\'s understanding of the current use of GL in SE, so that GL can better serve the SE field.\n\n1.The body of chapter 2 is not quite relevant to the topic \"background and related work\", and the concerns in grey literature are not suitable for elaboration in this chapter.\n2.The research question in Chapter 3 is is there only one?The research question seems to need more detailed and comprehensive elaboration, whether it is the purpose, objective or value of the research.\n3.The application scenarios and usage methods of the quality assessment checklist in Table 7 are not clear enough.\n4.Contribution point elaboration is not too clear, it seems that can be refined again.\n\n【master student】',28,'2021-02-19 10:31:01',12,_binary '\0'),(240,'This paper proposes a Hypergraph-based reviewer Recommender, namely HGRec, to balance the trade-off between recommendation accuracy and recommendation coverage and they introduce the entropy to measure the recommendation coverage. Here are some of my comments:\n1.\" have\" not \"has\"(line 95).\n2.\"e.g.\" not \"e.g\"(line 105,line 794)\n3.Figure 1 font is too small\n4.PR is defined in section 3.1, but PR is not defined in the Require section of Algorithm 1\n5.The \"f\" under Formula 7 is not explained(line 535)\n6.Section 4.3.2 does not explain why entropy is used and what the significance is\n7.Formula 14 does not specify the base of the \"log\"\n\n［master student］',27,'2021-02-19 10:32:44',18,_binary '\0'),(241,'This paper explores the use of GL by SE researchers and proposes criteria for evaluating GL. Here are some of my comments: \n1.In the  abstract Section, \"GL\" and \"grey literature\" mixed-use, it is recommended to use \"GL\" uniformly\n2.In the  3.4 Section, the introduction to \"Analytical Hierarchy Process\" should be in Section 2\n3.The length of Section 4.1 and Section 4.2 is seriously out of balance and the contents of Section 4.2 should be expanded appropriately\n\n［master student］',28,'2021-02-19 10:33:51',18,_binary '\0'),(242,'This paper explores the solutions for the challenges in assessing the quality of Grey Literature(GL). Here are my comments:\n\n1. The contribution of this study is to present guidelines on how to check the quality of GL in SE. \nHowever, there is no practical example of checklist in this paper, which may puzzle people who want to use this checklist. \n2. The presentation of Formula 1 is redundant, and it is recommended to use segmental function.\n3. In the limitation section, the paper emphasis on  Zhang\'s work. Will it be too much of a hint of author\'s identity?\n\n\n[master student]',28,'2021-02-19 10:36:22',32,_binary '\0'),(243,'This paper proposes HGRec, a Hypergraph-based reviewer recommender, to achieve the trade-off between recommendation accuracy and recommendation coverage. The authors consider that most of the machine learning paradigms in reviewer recommender suffer from coverage imbalance, which would result in heavy workload to core reviewers. \n\nThe idea of the paper is very novel, and authors have made many attempts on many OSS projects. However, I have two major concerns:\n\n1. I wonder whether the balance between recommendation accuracy and coverage is a false proposition. In my opinion, the recommendation algorithm should still focus on accuracy. In this context, we should regard the reviewer’s workload as an aspect of calculating accuracy, rather than as another indicator that is contrary to accuracy. Simply put, balance should also be accuracy.\n\n2. The recommendation algorithm cannot replace human choice. I am curious about the relationship between the coders’ choice of reviewers and the reviewer they chose when they first entered the project in OSS. In the case of choice, do coders prefer reviewers they are familiar with? In other words, to some extent the reviewer recommendation might have a key person.\n\nSome specific comments are as follows:\n\n1. The motivation in Section Introduction is not clearly stated.\n\n2. The contribution \"we firstly introduced entropy...\" is exaggerated for the reason that entropy has not been studied why it can be used in this context.\n\n3. The significance of this paper should be emphasized in Section 2 by comparing with related work.\n\n4. The characteristics of the OSS projects should be considered in the experiments.\n\n5. What do the bold numbers in Table 2 and Table 3 mean? Also, these two tables make me unable to grasp the main point the author wants to express.\n\n6. The answer to the two RQs should be highlighted in Section 5.\n\n------------------------------------\nMaster',27,'2021-02-19 10:36:45',59,_binary '\0'),(244,'This article introduces a reviewer recommendation method using hypergraph. Experiments show that this method achieves a good trade off in accuracy and breadth, and significantly exceeds the existing reviewer recommendation methods. Looking at the logic of this article as a whole Clear, written procedures, but the following issues may require attention:\n1. The calculation method of coverage in this article is not particularly clear. At the same time, this indicator measures whether the recommended algorithm distributes the workload evenly. But ignoring the fact that people who are less involved in the work are less familiar with the code and may spend more time reviewing\n2. The accuracy rate is not significantly improved compared to the RF method, only the coverage is improved. If the effectiveness of the coverage cannot be explained, it may be questioned by the paper reviewers',27,'2021-02-19 10:37:40',43,_binary '\0'),(245,'This paper proposed a novel hypergraph-based reviewer recommender (HGRec) to mitigate the workload imbalance issue.\n- In the conclusion part, only the experimental results are explained, and the theoretical methods are not summarized.\nundergraduate student\n\n',27,'2021-02-19 10:44:43',77,_binary '\0'),(246,'This article introduces a method to evaluate the quality of grey literature using the hierarchical tree method. This paper uses the survey method to collect data such as the opinions and opinions of gray literature users and experts corresponding to the gray literature. Using these data, Ben proposed a series of factors, and used these factors to build a hierarchical tree model. On the whole, the logic of this article is relatively clear, but there are the following problems:\n1. Whether the proposed 24 factors are complete, orthogonal, and have a significant correlation with the quality of gray literature\n2. Some indicators, such as fairness, are subjective\n3. The process is relatively cumbersome, can you give the expected time-consuming of using this method for researchers\' reference',28,'2021-02-19 10:50:25',43,_binary '\0'),(247,'The paper give a method based on Hypergraph to recommend reviewer. We can know that the effects of this method are better than other method from the data. The topic is very valuable and it has a good actual scene.  However, there is a little problems of this paper.\n1. The position of RQs is too late.\n2. Figure3 is a little complex. I can not get the information from this figure except the relation is very complex.\n3. In the last of Introduction, the paper says the method has a better behavior than other, but it does not give the specified the method.\n[master]',27,'2021-02-19 10:52:32',25,_binary '\0'),(248,'Perfect\n[undergraduate student]',27,'2021-02-19 10:51:28',80,_binary '\0'),(249,'This article proposes a Hypergraph-based reviewer Recommender method to solve the recommendation coverage imbalance issue, and this article designs an experiment to evaluate the proposed method. The method proposed in this article is novel and the problem solved is also of certain value. Some comments are as follows:\n1. In the abstract, the research background and problems are introduced much, but the research ideas and results of this article are not introduced enough.\n2. In the introduction, only one sentence is said that most of them have low recommendation accuracy and unbalanced workload. The coverage imbalance problem and impact faced by the existing methods have not been explained, and should be expanded to describe. The existing methods face many problems, such as lack of consistency, interpretability, accuracy, etc. It is also not explained why the coverage imbalance problem is only solved here.\n3. The description of the key contribution of this research in the introduction is inappropriate. The current description is describing how to propose a solution, not a description of the research contribution.\n4. It is not appropriate to place research questions in the experimental design. The experimental design is designed to evaluate the research questions (whether the HGRec proposed in this article can accurately recommend code reviewers and whether it can reduce the workload imbalance). The evaluation questions should be put Before the experimental design, or you can change the title of the fourth section to evaluation, the experimental design is placed after the research question.\n5. The research question is a bit abstract. How to design an experiment to answer the research question and evaluate the method is not clearly described.\n6. The answer to RQs in Section 5 is a bit lacking. The analysis of the results and the conclusions drawn can be further strengthened. In addition, the explanation of the chart results in RQ2 is also a bit lacking. How to solve the coverage imbalance problem, whether it is really solved, these need to be prominent.\n7. The graphs in the discussion section take up more space, and the discussion results are less described.\n\nPHD',27,'2021-02-19 11:28:22',6,_binary '\0'),(250,'Perfect\n[undergraduate student]',28,'2021-02-19 10:52:15',80,_binary '\0'),(252,'This paper explores the major challenges of the use of GL in SE with some possible solutions, and proposes a conceptual model for how GL works in the SE research lifecycle.\n\n1. It is recommended that table 3 and table 4 be set to center the text.\n2. The chart part in the appendix is interspersed in the quotation, should make a adjustion\n\n[undergraduate student]',28,'2021-02-19 10:54:15',78,_binary '\0'),(253,'This thesis proposes a novel hypergraph-based reviewer recommender (HGRec) to weigh the accuracy of the review and the scope of the review. There are some problems:\n\n1.The research motivation is not well stated in the front, and the results of previous research and investigations are not sufficiently displayed.\n2.Modify Figure 3 to make the points smaller to highlight the complexity of the line relationship.\n\nMaster',27,'2021-02-19 10:54:15',22,_binary '\0'),(254,'This paper conducted a Literature Review and a survey to research the evaluation criterion of GL, of which the result is valuable and the arguments of it are reasonable. But there are alse some questions which confused me. And these questions are as follows:\n1. One research question maybe not enough to discuss view. Maybe you can divide it into some small points.\n2. The Chapter 2 take a lot of length of paper, which I think should be more brief. \n------------------------------------\nMaster\n',28,'2021-02-19 10:54:55',50,_binary '\0'),(255,'This paper explores using AHP to evaluate the quality of Gray Literature in software engineering \n1. Table 2 is too small in width.\n2. The content of the background introduction may be a bit long.',28,'2021-02-19 10:57:15',27,_binary '\0'),(256,'This paper proposes a reviewer recommender called HGRec, which based on hypergraph theory and implemented entropy to measure recommendation coverage. There are some suggestions:\n\n1.Section 4.1 propose two research questions “Can the proposed HGRec precisely recommend code reviewers?” and “Can the proposed HGRec alleviate workload imbalance issue?”. It’s meaningless and unnecessary to set these questions. The author could introduce the aim of this study and list the digital result with form and discuss the superiority in the result section.\n\n2.The subtitles “Answering RQ1” and “Answering RQ2” in section are not suitable. They doesn’t show the main findings or contributions of this paper. The title should point out the aims or advantages to contribute HGRec. \n\n3.The related work section only introduce the wok by category, It’s better to analysis other researches’ insufficient and claim how we solve these problem or what improvement we did.\n\n4.Table 2,3,5 list plenty of result data, the related text just said “Recommendation result in terms of entropy are presented in Table 5”. Maybe it’s better to introduce these result tables clearly and point out advantages they shows.\n\n【Master】',27,'2021-02-19 10:59:23',26,_binary '\0'),(257,'This paper proposes a Hypergraph-based reviewer Recommender, namely HGRec, to balance the trade-off between recommendation accuracy and recommendation coverage.\n\n1. For Table 1, three line table is recommended.\n\n[undergraduate student]',27,'2021-02-19 10:59:41',78,_binary '\0'),(258,'This study proposes a Hypergraph-based method for code reviewer recommendation (HGRec). The study compared the performance of HGRec with 8 existing methods and a new evaluation metric, i.e. entropy was used. However, the contribution of this research is not as significant as claimed in the paper.\n\n- This comments on existing research are very negative in paper. However, this research has not achieved any substantial breakthrough. \n\n- The link between motivation and contribution in this study is not clear. In the 4th paragraph of Sec. 1, it states \"we propose a hypergraph-based reviewer recommender to mitigate these issues.\" What are the issues? Issues of Graphs or issues of reviewer recommender? How does HGRec solve the problems of existing  reviewer recommenders described in the 3rd paragraph? \n\n- Entropy was suddenly mentioned in the introduction. What is this? Why introduce it?\n\n- What is the basis for segmentation in related work? Several related studies were divide into groups for description. What are their commonalities? The subject of each paragraph is not clear.\n\n- In Sec. 3.3, what is the purpose of commenting on the study [54] alone?\n\n- This research uses the low accuracy of existing research as a motivation and has been mentioned many times. But how low is it? It is recommended to tabular them in the related work section.\n\n- The evaluation results of this study (Table 2) shows that HGRec has not significantly improved accuracy and MRR. Is the contribution of RQ1 still valid?\n\n- The Equation 14 suggests the value of Entropy would be less than 0 but Table 5 presents positive values. It seems that Equation 14 is missing a minus sign.\n\n- Where are the definitions of hypotheses?\n\n- Although entropy and accuracy present a a conflicting relationship, how much entropy is equivalent to how much accuracy? how much entropy is acceptive? It is not reasonable to indicate that HGRec performs better in the balance of entropy and accuracy as these quantitative relationships and thresholds are unknown.\n\n- This study did not substantially solve the problem of coverage imbalance. In some OSS projects, even if the recommendation system is not used, the commits are reviewed by a small number of developers, and even only a few developers have the right to review. The coverage imbalance of reviewer recommender itself may be a false proposition. Even for the purpose of reducing coverage imbalance, it can be achieved through certain recommended rules. Entropy can only provide a less intuitive evaluation, but cannot mitigate coverage imbalance.\n\nIn short, HGRec is a novel technology, but neither for RQ1 nor RQ2, HGRec shows significant advantages.\n\nThere are also some language problems in the text: \n\n- In Sec. 3.2, \"Suppose there two PRs p1, p2 ... F1, F2.\".\n\n- In equation 12, \"Acuracy\".\n\n【PhD】',27,'2021-02-19 11:03:55',37,_binary '\0'),(259,'This paper proposes a Hypergraph-based method to recommend reviewer for Open Source Software and  take some famous project into research.The idea is innocative and parctise. Here are some little probelm in this paper.\n\n1.In line 95 \"has\" shoud be \"have\".\n2.In fomula 12,\"Acuracy\" should be \"Accuracy\".\n\n[master student]',27,'2021-02-19 11:06:08',17,_binary '\0'),(260,'This thesis is a research about assessing the quality of Grey Literature. The purpose is to improve the quality of analyzing grey literature.There are some problems：\n\n1.Grey literature is not a standard literature. Can these indicators be more standardized for discussing.\n2.\"by use\" in the title should be \"by using\".\n3.Hierarchy is mentioned in the title, and it is recommended to organize the thesis in a hierarchical way\n',28,'2021-02-19 11:07:35',22,_binary '\0'),(261,'# Assessing the quality of Grey Literature by use Analytical Hierarchy Process in Software Engineering Research\n## Summary:\nThis paper proposes a weighted quality checklist to erase one the of most critical challenges by carring out a Literature Review of the credibility of grey literature in SE, and surveying the experts in SE community on the use of GL in SE research. And its findings are expected to raise the awareness about the current use of GL in SE and advocate the importance of guidelines for supporting its use in SE, which is helpful to the methodological improvements in SE.\n## Comments:\n### Abstract:\n1.	The Context section should not just talk previous work. We want the background of GL and the current problems GL faces, which need to be closely linked to the solutions in this paper.\n2.	The results section seems research method instead of results.\n### Introduction:\n3.	I think the introduction deviates from the title, and this section should explain more about how current researchers conduct grey literature quality assessment. \n4.	The introduction part doesn’t explain the motivation of this paper clearly, the author should add some reasonable explanation to show why they did this research.\n### RESEARCH METHOD:\n5.	I think the proposed RQs are too thin, maybe more meaningful RQs can be mined.\n6.	In 3.1, RQ can be independently separated from other research methods in chapters, because tltile of this section is Research Method.\n### THE QUALITY ASSESSMENT CRITERIA:\n7.	How are the 24 factors that affect quality assessment obtained?What was the basis for choosing these 24?Is it supported by data or literature?\n### QA INSTRUMENT:\n8.	After the corresponding weights of different factors are obtained, only the data are listed without explanation. \n9.	Perhaps some information can be mined from the data to supplement the RQ.\nReporter: Huilin Yin[master student]\n',28,'2021-02-19 11:12:13',58,_binary '\0'),(262,'This paper introduces a method to evaluate the quality of grey literature using the hierarchical tree method. The author aim at empirically exploring the use of GL by SE researchers, and further proposing criteria for evaluating GL. The contribution of this article is clear, but there are the following problems:\n\n1.The conclusion part in abstract doesn’t point out the main contributions of this paper. The author could refer the main contribution shortly.\n\n2.Section 3.1 propose a research question. Maybe it’s not suitable, the author could name this part with “Research goal” and explain the main goal of this paper.\n\n3.Part 3 introduce the research method. But section 3.4 introduce “Analytical Hierarchy Process”, which is not a creative process of this research. Maybe it’s better to set it in Section 2.\n\n4.The last part shows a check list, This is the main aim of this study,but it doesn’t explain the using scenes clearly. The author should spend more space to introduce this list.\n\n【Master】',28,'2021-02-19 11:16:02',26,_binary '\0'),(263,'This paper presents guidelines on how to check the quality of Grey Literature (GL) in SE. I have some suggestions as follows\n1.In the Introduction part,perhaps you can consider adding a brief description of the overall structure of the paper\n2.At the beginning of 4.1 part,\"The list of the identified criteria is given in Table\",No indication on which table\n3.In 4.1 part,whether to consider that after 24 factors are given, there is a summary paragraph that briefly explains\n\n【master student】',28,'2021-02-19 11:16:36',35,_binary '\0'),(264,'The paper explores the solutions for the challenges of assessing the quality of Grey Literature through giving the weighted quality checklist of GL. I give my comment then.\n1. There is a format problem in Table3.\n2. There is only one RQ in the paper.\n[master student]',28,'2021-02-19 11:17:57',25,_binary '\0'),(265,'This paper explores the grey literature quality assessment method and gives a checklist for grey literature quality assessment. Some comments are as follows:\n1. The method part of the abstract is said that this paper has performed a review and survey, but the text introduces the review process less, and more is the application of analytical hierarchy process.\n2. Section 2.2 is about the research of gray literature, section 2.3 is about the focus of gray literature research, but only in the first sentence of section 2.3, the previous work puts forward a five-faceted conceptual model, which searches for GL, evaluates GL and there are three concerns about using GL. Later, introduce the experience of GL search, and then talk about the related research of quality evaluation. Logic needs to be sorted out, mainly to highlight the concerns in the subtitle and why this article chooses to study quality evaluation among multiple concerns.\n3. The research question is a bit big and less, not specific enough.\n4. There are some overlaps in the research process with the previous research (An evidence-based inquiry into the use of grey literature in software engineering). You can talk about the differences and overlaps between them, and the relationship between them.\n\nPHD',28,'2021-02-19 11:29:18',6,_binary '\0'),(266,'To present guidelines on how to check the quality of GL in SE, this paper propose a weighted quality checklist to erase one the of most critical challenges, i.e. quality of GL.\nSome comments are as below:\n1. Figure 3 is not clear, it\' s better to adjust the font and size.\n2. In background and related work, the content of this section doesn\'t seem to match the theme of the paper.\n3. Section 4.1 part is too long, Section 4.2 part is too short.\n【master student】',28,'2021-02-19 11:20:42',9,_binary '\0'),(267,'1.It is better to give the full name of PR(Pull-Request) in ABSTRACT.\n2.Data preparation: Why these 20 projects are selected? Why choose these projects over others?\n3.I\'m not quite sure what the shapes(triangle, circle, square, etc.) and colors of the points represent in Figures 6 and 7.\n4.There is too much background and status statement in the CONCLUSIONS. It is suggested that the first paragraph be deleted or simplified, and add some contributions and results of this article.\nmaster student',27,'2021-02-19 11:21:29',8,_binary '\0'),(268,'This paper proposed a novel HGRec to mitigate the workload imbalance issue, their experiment on 20 OSS projects indicates that the method significantly outperforms the state-of-the-art recommenders. \nSome comments are as below:\n1. Figure 1 and figure 4 are not clear, it\' s better to adjust the font and size.\n2. In introduction, the motivation of this work should be highlighted.\n【master student】',27,'2021-02-19 11:21:11',9,_binary '\0'),(269,'Title: Assessing the quality of Grey Literature by use Analytical Hierarchy Process in Software Engineering Research\nAuthor: Xin Zhou, Xin Huang and Huang Huang\nThis paper propose a method using Analytical Hierarchy Process to assess the quality of grey literature, in order to develop methodological support for conducting research with GL. The contribution is significant because it makes it more reasonable to use GL in SE research. But in my opinion there are some issues:\n1. The listed contributions at the end of part 1 are not so obvious. It’s better to state one contribution in a new line.\n2. There are some syntax errors in this paper, such as “isgiven” in line 543.\n[Undergraduate Student]',28,'2021-02-19 11:23:27',81,_binary '\0'),(270,'Title: HGRec: A Hypergraph-based Recommender for Suggesting Code Reviewer in OSS Community\nAuthor: Yifan Zhang and Lanxin Yang\nThis paper uses HyperGraph to model the recommender for suggesting code reviewer in OSS community, which is a novel and great idea. The results in chapter 5 also validate the work. However, from my view point, there are some issues in this paper:\n1. I think the theory of hypergraph isn’t fully introduced, so someone who doesn’t know this theory enough like me may be confused.\n2. The rank of key contributions listed at the end of part 2 should be rearranged. The main idea of this paper is the use of hypergraph, but the first entry in the contribution list is about the introduction of entropy while the hypergraph is listed behind.\n3. The language needs more polish. For example, there is a typo “to suggested” in line 41, and some “and”s are missing when several words parrellel such as “rules, machine learning paradigm” in line 17.\n[Undergraduate Student]\n',27,'2021-02-19 11:24:16',81,_binary '\0'),(271,'This paper use AHP method in assessing the quality of Gray Literature in software engineering.Here are some little problem in this paper.\n\n1.The color of figure 3\'s font is too shallow.\n2.Section 3.1 and 4.2 is too brief which should be more detailed to elimate imblance of length.\n\n[master student]',28,'2021-02-19 11:24:45',17,_binary '\0'),(272,'This paper proposes a Hypergraph-based reviewer Recommender, namely HGRec, to balance the trade-off between recommendation accuracy and recommendation coverage. The algorithm is innovative and proved to be efficient by contrast with many other tools.\n[undergraduate student]',27,'2021-02-19 11:25:34',76,_binary '\0'),(273,'# HGRec: A Hypergraph-based Recommender for Suggesting Code Reviewer in OSS Community\n## Summary:\nThis paper proposes a Hypergraph-based reviewer Recommender, namely HGRec, to balance the trade-off between recommendation accuracy and recommendation coverage which is novel to code review study.\n## Comments:\n1.	In abstract , there should be a brief introduction to the proposed entropy and an explanation of why this metric is used.\n2.	In introduction, this paper should elaborate more on the current problems encountered in the reviewer\'s recommendation area to enhance the motivation of the research.\n3.	According to results, The performance of HgRec is not much better than that of the baseline experiment, and some results are even worse than that of the baseline experiment. So what are the advantages and significance of this method?\nReporter: Huilin Yin[master student]\n',27,'2021-02-19 11:31:49',58,_binary '\0'),(274,'This paper is aimed to present guidelines on how to check the quality of GL in SE, which contriutes to standardize GL researches in SE. Some comments are as follows:\n1. In Section 5.1, the authors use the AHP method to determine the weight of criteria above and this part takes up a lot of space, but in the introduction part this method is not mentioned.\n2. In Section 4.1, there are 24 factors identified during literature review. The number is so big and I can hardly grasp the key factors. So I think these factors should be sorted by importance or be grouped into different categories.\n3. There are some problems about the format, such as the size of Table 2 and the single bracket in line 995.\nundergraduate student',28,'2021-02-19 11:32:55',73,_binary '\0'),(275,'1. This study carried out a Literature Review of the credibility of grey literature in SE, and surveyed the experts in SE community on the use of GL in SE research, to explore the solutions for the challenges in assessing the quality of GL.\n2. The abstract is very clear and distinctive.\n\n[undergraduate student]',28,'2021-02-19 11:33:11',76,_binary '\0'),(276,'Comments：\n1. page 1, line 26: “recommendation coverage and, we propose a Hypergraph-based”， the \"and,\"\n2. page 1, line 113: “ Therefore, hypergraph generally have more capabilities than”， have → has\n3. the contribution part of section 1: “we firstly introduced entropy”， “We firstly introduced the hypergraph theory”\n4. page 2, line 189: “de Lima Júnior et al. [11] experimented”, the “de” ?\n5. page 2, line 203: “They first developed multiple project-specific Comment”， first → firstly\n\nmaster student',27,'2021-02-19 11:42:34',64,_binary '\0'),(277,'This thesis proposes a novel hypergraph-based reviewer recommender (HGRec) to weigh the accuracyof the review and the scope of the review. I voted A.[master student]',27,'2021-02-19 11:53:57',7,_binary '\0'),(278,'This paper explores using AHP to evaluate the quality of Gray Literature in software engineering. I voted A. [master student]',28,'2021-02-19 11:54:46',7,_binary '\0'),(279,'This paper proposes a methon with hypergraph to solve problems of reviewer recommender.This topic is interesting and meaningful.But it still has some problems as follow:\n1. While Figure 3 shows the hypergraph structure of a real project, the benefits of a hypergraph are not obvious to the reader.\n2. The two summaries in Chapter 5 should not just be titled Answer RQ1 and Answer RQ2, which does not highlight the specific problem\n\nmaster student',27,'2021-02-19 11:55:38',1,_binary '\0'),(280,'This paper present propose a Hypergraph-based reviewer Recommender named HGRec which is able to balance the trade-off between recommendation accuracy and recommendation coveragepropose and address recommendation coverage imbalance issue. I think the topic of this thesis is very novel and here are some of my comments:\n1、Please reconsider whether picture 3 is necessary for Its style is not clear. Maybe it needs to be adjusted or explained in detail and more specific.\n2、In the abstract part of this paper, entropy and hypergraph are proposed, but these two concepts and the reasons for their use are not clearly explained.',27,'2021-02-19 11:56:40',67,_binary '\0'),(281,'This paper proposes a Hypergraph-based reviewer Recommender(HGRec) to balance the trade-off between recommendation accuracy and recommendation coverage. The idea of applying the hypergraph structure to the code review problem is relatively novel. However, there are still some suggestions as following.\n- In [INTRODUCTION], the motivation of why hypergraph is used is not clearly expressed(just a brief introduction to the current methods in academic and the definition of hypergraph), and it does not indicate what is the meaning of using hypergraphs, and how the structure of hypergraphs essentially eliminates the problems existing in the recommendation system(imbalanced workload).\n- In [METHODOLOGY], Figure 2 makes me a little confused. According to the picture, the points are heterogeneous, but the vertices in a hypergraph should be homogeneous, so can I see Figure 2 as a fusion of several hypergraphs? Or I just get it wrong. In addition, I think it\'s better to draw a structure diagram or a flow chart in section 3 to make the method clearer.\n- The analysis in [RESULTS AND ANALYSIS] is well written, but it is recommended to mention it in Chapter 1 to enrich the motivation.\n\n[undergraduate student]',27,'2021-02-19 12:00:11',84,_binary '\0'),(282,'There is a format problem in Table3.\nPart 3 introduce the research method. But section 3.4 introduce “Analytical Hierarchy Process”, which is not a creative process of this research. Maybe it’s better to set it in Section 2.',28,'2021-02-19 12:02:05',34,_binary '\0'),(283,'[PhD student]\n\nThis paper carried out a Literature Review of the credibility of grey literature in SE, and surveyed the experts in SE community on the use of GL in SE research. It aims to help assess the quality of GL, which seems to be valuable in this domain. Here are some comments from my point of view for the improvement of this work in the next step: \n\n1. Title: “by use” -> “by Using”\n\n2. Abstract: The goal of this study is not clear.  In ABSTRACT you mention that this paper aims to present guidelines on how check the quality of GL in SE (SE here without full name is not appropriate). While, I can not well understand the relationship between the goal and the contributions claimed in line 105-112. By the way,  the sentences  here are totally identical to the ones in 1210-1219.\n\n3. BACKGROUND AND RELATED WORK: This section is too long and makes much effort to introduce some not so important background. This paper mentions that SE researchers have also explored the quality assessment of GL (line 237), however, it does not elaborate the difference between these related work.\n\n4. RESEARCH METHOD: 1) This section misses some essential details to help better explain the whole process. For example, why do you only use the simple data simple technique to extract factors, since it is much more challenging to give a thorough and comprehensive review. How can you ensure the quality of the results and findings through this way?  2) Figure 2 needs to be improved. For example, some terms, e.g., SO, need to be explained; output of the phases “Confirmatory Case study on SO” and “Exploratory survey on QA criteria”  and their relationships are suggested to be added. \n\n5. THE QUALITY ASSESSMENT CRITERIA: 1) Evidence support is not strong in this section. For the explanation of the 24 factors, only four of them have the evidence (references). 2) Section 4.2 requires more analysis. \n\n6. QA INSTRUMENT: The format of Phase 1, 2 and 3 in section 5.1 is different from each other. “The hierarchal structure for the factors challenging DevOps has been developed” in phase is odd. The elaboration in line 1060-1082 in section 5.2 is too short.\n\n7. LIMITATIONS: You only consider three relevant SE conferences in line 1054. How about FSE and other high-quality venues?\n\n8. Small comments: line 99 “this work aim at”; line 105-112 “1) identifying…; 2) gathering…; 3) propose…” ； line 338 “its implement”; line 861 “(Table ??)”; line 891-893 “We followed … and calculate”; line 915 “Table 8 9 and 10”.\n',28,'2021-02-19 12:10:14',48,_binary '\0'),(284,'[PhD student]\n\nThis paper proposed a novel hypergraph-based reviewer recommender (HGRec) to mitigate the workload imbalance issue.  The experiments conducted on 20 OSS projects  indicate that the proposed method significantly outperform the state-of-the-art recommenders.  Some comments are here to help you improve the quality of this work:\n\n1. The ABSTRACT needs to be further polished, since it contains many grammatical errors. For example, “appropriate code reviewers is ”, “a lot of attentions”, “A number of reviewer recommendation methods (recommenders) on the basis of heuristic rules, machine learning paradigm are constantly emerging”, “…are short of flexibility, interpretability, accuracy, and more importantly, they…”\n\n2. In-depth analysis about the RELATED WORK should be supplemented  in the next step rather than generally listing the contribution of each study. Necessary analysis can be the shortcomings or the difference between their studies and yours. \n\n3. It is better to elaborate some detail more clearly both in the EXPERIMENT DESIGN and RESULTS AND ANALYSIS section. For instance, how are the 8 baselines in section 4.3.1 selected in your study？Randomly or using some criteria？So is the selection of the 20 OSS projects in section 5.1. Why are 144K PRs and 974K reviews used as the thresholds here?\n\n4. The DISCUSSION section lacks enough explanation and is not able to deliver critical insights to the readers. \n\n5. Current discussion in the Threats to validity section is inadequate. How about the threats caused by the selection of baselines and OSS projects mentioned above? How about the Construct Validity?\n\n6. Small comments: 1) The misuse of i.e. and e.g., cause many syntax problems. For example, line 83-85 “Then someone, e.g., the invitees or the owners (the reviewers) review and evaluate the PR and provide feedbacks through an issue tracking system (e.g., Gerrit, etc.)”; line 341 “Distinguished from previous studies, e.g., [28, 45, 54, 56] that use…” ; line 760 “the proposed recommender, i.e. HGRec and RF perform the best…”. 2) Others: line 300 “PRs to 𝐺𝑏𝑎𝑠𝑒 which… ”',27,'2021-02-19 12:06:57',48,_binary '\0'),(285,'**Title:** HGRec: A Hypergraph-based Recommender for Suggesting Code Reviewer in OSS Community\n**Authors:** Yifan Zhang, Lanxin Yang, Fuli Zhang\n\n\nThis paper presents a hypergraph-based reviewer recommender named HGRec, to balance the trade-off between recommendation accuracy and recommendation coverage\n\n**MAIN CONCERNS INCLUDE:**\n-	It is difficult to get useful information from Table 5.\n-	I cannot support that HGRec “significantly outperforms the state-of-the-art recommenders” from the answer of RQs.\n\n\n[PHD STUDENT]\n',27,'2021-02-19 12:53:10',39,_binary '\0'),(286,'**Title:** Assessing the quality of Grey Literature by use Analytical Hierarchy Process in Software Engineering Research\n**Authors:** Xin Zhou, Xin Huang, Huang Huang\n\n\nThis work provide a checklist to promote quality assessment of grey literature.\n\n**MAIN CONCERNS INCLUDE:**\n-	ABSTRACT [8-13]: It is uncommon to use the authors’ previous study as context in ABSTRACT. I recommend to provide a general context of GL in SE here.\n-	INTRODUCTION [70-99]: The necessity of quality assessment is not shown in this section. In other words, there are no solid motivation to conduct this study.\n-	BACKGROUND AND RELATEDWORK: I recommend to merge the subsection 2.3 and 2.4 because the major concern of this paper is quality assessment.\n\n[PHD STUDENT]\n',28,'2021-02-19 12:06:19',39,_binary '\0'),(287,'This article is intended to provide a guideline for checking the quality of grey literature, and it is meaningful for using the GL in SE research.But it still has some problems as following:\n1. Is the first summary of chapter 3 too short?\n2. Figure 3 is not clear enough\n3. I think it is necessary to classify the 24 factors used to evaluate the quality of grey literature\n\nmaster student',28,'2021-02-19 12:08:11',1,_binary '\0'),(288,'This paper aims at solving the problem of \"coverage imbalance\" in code reviewer recommendation in OSS community, by introducing a hypergraph-based method. The reported result in this paper shows that the proposed method can significantly outperforms the state-of-the-art recommenders, balancing the trade-off between recommendation accuracy and recommendation coverage.\n\nFor this paper, some opportunities for improvement are as following:\n- The optimization objective of code review is blurred in the paper. First and foremost, the INTRODUCTION part says \"reviewers\' expertise and workload\" are of significance in the quality of code review, then most of previous studies suffer from \"low recommendation accuracy and imbalanced workload\". Besides, is the \"objective function\" of the proposed reviewer recommendation (Section 3.3) aligned with this objective? A focused discussion about this might be given. BTW, there is no detailed explaination about the \"objective function\" in Section 3.3.\n- The motivation of introducing the hypergraph-based method should be imminently refined further. This motivation was just merely illustrated by Figure 1, saying \"hypergraph generally have more capabilities than ordinary graph\" since \"an edge connects exactly two vertices\" in hypergraph. Given that this superiority of hypergraph motivates this paper, I believe more discussions are in need.\n- The authors answered RQ2 (in Section 5.2) by concluding that the proposed method make the trade-off between recommendation accuracy and workload issue, whereas RQ2 only focuses on the \"workload imbalance issue\". This is somewhat awkward. In the meantime, it might be more persuasive to prove the \"better trade-off\" by taking \"accuracy\" and \"workload\" together, e.g., using one figure.\n- The \"key contribution\" of this study (the INTROCUTION part) is driven to distraction, both the sequence of all these contributions and the individual ones, e.g., the introduction of the hypergraph theory might be the foremost contribution of this paper.\n- It is imperative to refine the CONCLUSION part: why this paper is worthwhile is ambiguous in the current one.\n- Also the ABSTRACTION part: what are the characteristics of the proposed method, why is can be used to balance the trade-off?\n- Expressions in the whole paper should be polished: lots of key statements are with insufficient evidence. \n\nIn a nutshell, this study is promising to contribute to the field of code reviewer recommendation. Nevertheless, there are plenty of issues in the current paper that are imperative to be improved.\n\n[PHD student]',27,'2021-02-19 13:48:57',23,_binary '\0'),(289,'Grey Literature (GL) is an emerging research topic in empirical software engineering. At present, researchers still have certain concerns and disputes about the use of Grey literature. The focus of the debate is on the quality of GL. This research conducted literature review and survey to study the quality assessment of GL. Quality assessment criteria and a checklist are proposed for assessing GL. The research method is reasonable. However, I still have some concerns about this research.\n\n- As indicated in the introduction, one of the contributions of this study is the identification of major challenges of the use of GL in SE with some possible solutions. However, neither the research question nor the research topic of this paper involves the identification of challenges. In addition, the evaluation of GL and the quality assessment of GL are different concepts.\n\n- The description of the research process (Fig. 2) in the paper is obviously insufficient.\n\n- The experts who participated in the survey and those who participated in the development of the checklist are different groups, but fig. 2 can make readers misunderstand.\n\n- According to the assessment criteria identified in this study, the experience and reputation of GL authors account for a high percentage. This deviates to some extent from the the quality assessment of GL itself. This is a philosophical issue, and such quality assessment may make empirical errors. This is a retrogression of science, bringing research back to the time of Aristotle. In SE, there has been a trend of blind review in academic conferences. The purpose of blind review is to avoid bias. But this research is doing the opposite.\n\n- The FSE requires blind review, but this paper mentions \"our study\" many times.\n\n- It needs to validate/evaluate the checklist. Why is expertise classified as quality of writing? What is the inevitable connection between author\'s expertise and writing quality? \n\n- The assessment criteria are too subjective, it is difficult to avoid bias even if it is quantified.\n\n- The operability of the assessment is poor, and some factors are difficult to measure. For example, it is difficult to have a consistent quantitative standard for the author\'s experience. Everyone has different expertise, and the technology is constantly changing. An expert in traditional architecture does not necessarily understand block-chain better than an expert in emerging technologies.\n\nThere are still many language problems in the writing:\n\n- In Sec. 1, \"This work aim at ...\".\n\n- In Sec. 3.2, \"that could be evaluate GL quality\".\n\n- In Sec. 5.1, \"... their respective categories (Table ??).\"\n\n- In Sec. 5.2, \"... checklist shown in Table 7). \"\n\n\nFrom an academic point of view, considering the lack of time left, I should vote for rejection; but from the perspective of friendship, I finally decided to vote for acceptance.\n\n【PhD】',28,'2021-02-19 12:12:39',37,_binary '\0'),(290,'This article proposed a reviewer recommendation method using hypergraph.Here are some little probelm in this paper:\n1.In INTRODUCTION, it\'s better to give a brife description of structure of the paper.\n2.In EXPERIMENT DESIGN, putting research quetion there is not appropriate.It would be better to put it in a new chapter to illustrate particularly.\n3.There still some grammar mistakes in this paper which you should check it carefully.\n[master]',27,'2021-02-19 12:20:26',14,_binary '\0'),(291,'This paper introduces the entrropy to measure the recommendation coverage and proposes a Hypergraph-based reviewer Recommender(HGRec) to balance the trade-off between recommendation accuracy and recommendation coverage.\n\nSome advantages:\n1. The idea of using Hypergraph is a relatively novel idea.\n2. The graphs in this paper are nice and placed appropriately.\n\nSome issues:\n1. The RQs appears too late in the paper. In fact, I think the 2 RQs has been clearly stated in the former text.\n2. In line 256, \"start-of-the-art\" should be \"state-of-the-art\".\n3. The advantages of the Hypergraph should be highlighted.\n[Undergraduate Student]',27,'2021-02-19 12:23:20',70,_binary '\0'),(292,'1. Some words in the paper are not unified in font, such as \"Hypergraph\" and \"Recommender\" in \"Abstract\".\n2. It might be better to add an introduction to the structure of this article at the end of the \"Introduction\" section.\n3. It is recommended to make the font in Figure 4 clear.\nMaster',27,'2021-02-19 12:30:41',46,_binary '\0'),(293,'1. At the end of the INTRODUCTION, add a paragraph that briefly explains the content of the following sections.\n2. It is suggested to simplify the background introduction.\n3. Add some discussions and explanations of the results.\n\nmaster student',28,'2021-02-19 12:36:27',8,_binary '\0'),(294,'#### Conference Paper Review\n##### Paper Title\nHGRec: A Hypergraph-based Recommender for Suggesting Code Reviewer in OSS Community\n\n------------------------------------\n##### Comments\nThis paper proposes a Hypergraph-based reviewer Recommender(HGRec) to balance the trade-off between recommendation accuracy and recommendation coverage.\n1. Is the Figure 3 necessary in page 4? It\'s a little confused.\n2. The comment for \"metasploit\" needs to be modified in line 442, page 4.\n\n[Master Student]',27,'2021-02-19 12:39:15',68,_binary '\0'),(295,'This paper carried out a Literature Review of the credibility of grey literature in SE, and surveyed the experts in SE community on the use of GL in SE research to explore the solutions for the challenges in assessing the quality of GL. Here are my comments about this paper:\n1、In figure 3，each element in level-2 factors is connected to each element in level-3 subfactors. Therefore, whether it is necessary to do so which make the figure not easy to understand.\n2、Some words can be corrected such as \"by use\" in title.\n',28,'2021-02-19 12:39:29',67,_binary '\0'),(296,'This paper proposes a Hypergraph-based reviewer Recommender(HGRec) to solve problems of reviewer recommender.This topic is very novel, I vote Accept.',27,'2021-02-19 12:42:43',79,_binary '\0'),(297,'This paper proposed a Hypergraph-based reviewer recommender to balance the trade-off between recommendation accuracy and recommendation coverage, which is a creative method in the context of code review recommendation.\n\n**For this paper, my main concerns are as following:**\n\n- Motivation is not sufficient yet.  Authors should state the state of code review recommendation, namely why we should do this recommendation and the challenges of nowadays code review recommendation related research. However,  authors just simply described the phenomenon that \"recommenders suggest reviewers based on historical reviews, which in turn significantly increases their workloads\", which is not convincing enough to believe. Authors should consider list some critical data to illustrate. \n- In Section 3.2, authors described three kinds of relationships in HGRec, while hyperedges are represented with \'two-vertex edges\'. If this statement is true, authors should consider another relationship, namely author-reviewer. What\'s more, I don\'t understand why authors can illustrated one relationship among three factors. Take reviewer-PR-reviewer for example, can this relationship divided into two different relationships? If this answer is True, is factor sequence is another key point in HGRec relationships? I recommend authors should explain this more.\n- According to results, the performance of HGRec is not much better than that of the baseline experiment, no matter Accuracy or Entropy.  Especially we could see recommender CN almost the same performance as HGRec, I think authors should discussed this more to polish your paper.\n- In Section 5.2, authors stated \"In conclusion, recommendation accuracy and coverage balance (entropy) are a pair of conflicting metrics\", but you drew this conclusion only based on your observation from experiments. Because these two variables have no direct relationship from formulation or process. You should stated that this assumption was drawn from your observation by conducting several experiments.\n- The “CONCLUSION” section could also improved to claim contributions harder in order to outstanding from existing work.\n- Although authors listed three metrics to evaluate the performance of different recommenders, however, we can see only two of them were discussed more in this paper, should the second metrics seem unnecessary?\n\n**Miner details:**\n\n- Some error type errors. e.g. \"Acuracy\"\n------------------------------------\n\nMaster Student',27,'2021-02-19 12:44:19',54,_binary '\0'),(298,'This paper use AHP method in assessing the quality of Gray Literature in software engineering. This topic is very interesting, I vote Accept.',28,'2021-02-19 12:44:39',79,_binary '\0'),(299,'Comments：\n1. page 1, line 109: proposing a weighted quality assessment checklist.\n2. page 5, line 640: “The list of the identified criteria isgiven in Table and thoroughly discussed hereafter.”， there is no label for the Table.\n3. page 7, line 860: “The key goals have been finalized, and the identified factors are classified across their respective categories (Table ??).” ',28,'2021-02-19 12:46:27',64,_binary '\0'),(300,'This paper proposes a new reviewer recommendation algorithm that can recommend suitable reviewers to pull requests. The innovation is the use of hypergraphs, which can better reflect the organizational relationship and more natural modeling. It solves the workload problem relatively well and achieves a compromise between the two indicators.\n1.RQ and discussion are a bit rough and may need to be polished\n2.In line 691, “acuracy” should be “accuracy”\n[master student]',27,'2021-02-19 12:47:08',29,_binary '\0'),(301,'This paper carried out a Literature Review of the credibility ofgrey literature in SE, and surveyed the experts in SE community on the use of GL in SE research.And authors find most researchers dealing with GL data bya various of statistical methods and qualitative analysis methods.But it still has some problems:\n1.The chapter BACKGROUND AND RELATED WORK,there is not conception or related work about AHP.\n2.The research questions are not specific enough.It would be better if deviding RQ into more detailed part.\n3.Figure 2,the part of 102 reviews considering grey literature and 13 studies about QA\ncriteria of grey literature is not clearly.\n[master]\n',28,'2021-02-19 12:49:44',14,_binary '\0'),(302,'The paper is a supplement to the previous version. The number of people surveyed has been expanded from 7 to 14 people. The background part has been streamlined and the relevant content of the criteria has been supplemented. But the number of QRs may not be sufficient.\n[master student]',28,'2021-02-19 12:51:34',29,_binary '\0'),(303,'This paper propose new reviewer recommendation approach, Hypergraph-based\nreviewer Recommender, namely HGRec, to balance the trade-off\nbetween recommendation accuracy and recommendation coverage, then to decrease the workload of core reviewers.\n\nDetailed comments:\n1.\"We firstly introduced the hypergraph theory into code review process modeling...\" Does it belongs to the contribution of this paper?\n2.There is lack of explaination for algorithm 1 and 2, which is difficult for redeaders to undterstand, \nwhile the algorithms seem important to the whole paper. \n3. The proposed HGRec obtained similar performance with RF in Table 4 and with CN in Table 6, how could that be explained to support your conclusion for \" the proposed method significantly\noutperforms the state-of-the-art recommenders\"? How could we understand outperforms ? with which evaluarion metrics? \n4.The the results of RQ2 discussed over tersely.',27,'2021-02-19 12:53:01',33,_binary '\0'),(304,'The efforts of the authors contribute to the methodological improvements in SE.\nIt would be better if the fonts in the diagrams and tables were the same.\nMaster\n',28,'2021-02-19 12:53:03',46,_binary '\0'),(305,'Grey Literature (GL) is an hot research topic in empirical software engineering.This paper carried out a Literature Review of the credibility of grey literature in SE, and surveyed the experts in SE community on the use of GL in SE research. Here are some comments:\n1. words in table 3 are too small to read.\n2. some words in this paper are repeated. For example in abstract, many \"in SE\" are used.\n3. In introducion part, \"the work aim at\" should be \"aims at\". Mistakes like this are common, please review the paper and correct them.\n[undergraduate student]\n',28,'2021-02-19 13:01:24',70,_binary '\0'),(306,'1. Why this paper used Analytical Hierarchy Process to assess the quality of Grey Literature?\n2. The quality of Grey Literature caused what problems?\n3. What is the search string of Section3.2?\n4. There is lack of evaluation of checklist for Grey Literature.\n5. Careful double-blind criteria.',28,'2021-02-19 13:04:02',33,_binary '\0'),(307,'This paper explores the grey literature quality assessment method and gives a checklist for grey literature quality assessment. This paper is well written and it can help assess the quality of Gl, which has potential in this domain. \nMinor issues:\n- In section 3, why choose such a subjective mathematical model AHP for evaluation is not clearly interpreted.\n\n[undergraduate student]',28,'2021-02-19 13:08:55',84,_binary '\0'),(308,'Comments:\n1. the length of 4.1 and 4.2 part are not balanced.\n2. in reference, the 23th and 24th are the same\n\nmaster student',28,'2021-02-19 13:11:22',49,_binary '\0'),(309,'This paper introduce theentropy to measure the recommendation coverage and, we propose a Hypergraph-based reviewer Recommender, namely HGRec, to balance the trade-off between recommendation accuracy and recommendation coverage.The structure of this paper is clear, with all the necessary elements.\n[Undergraduate Student]',27,'2021-02-19 13:18:46',71,_binary '\0'),(310,'Comments\n1.Figure 2 is not clear.\n2.In introduction, the motivation of this work should be highlighted.\nmaster student',27,'2021-02-19 13:20:56',49,_binary '\0'),(311,'This paper carried out a Literature Review of the credibility of grey literature in SE, and surveyed the experts in SE community on the use of GL in SE research. I can\'t make any comment on this article.\n[Undergraduate Student]',28,'2021-02-19 13:24:35',71,_binary '\0'),(312,'#### Conference Paper Review\n##### Paper Title\nAssessing the quality of Grey Literature by use Analytical Hierarchy Process in Software Engineering Research\n\n------------------------------------\n##### Comments\nThis paper carries out a Literature Review of the credibility of grey literature in SE, and surveys the experts in SE community on the use of GL in SE research to present guidelines on how to check the quality of GL in SE.\n1. \"by use\" -> \"by using\" in the title.\n2. There is only a RQ in this paper and it is a little large from my perspective.\n3. Figure 3 is not easy to understand. Why do the factors in level-2 connect to each subfactor in level-3?\n\n[Master Student]',28,'2021-02-19 13:26:12',68,_binary '\0'),(313,'This paper aims to explore the solution for the challenges in assessing the quality of GL when GL has become widespread in various of disciplines.\n\n**For this paper, my main concerns are as following:**\n\n- The content of questionnaire should be shown whether by appending Appendix or online.\n- The valid number of questionnaire received was not published.\n- Although a quality assessment checklist is provided from your work, then how to use this checklist in real research? It should be better if authors provide one case.\n- By applying this checklist, to what extend can we consider a GL belong to poor quality or high quality?  \n- Generally, authors should outstanding your contributions more, no matter making up the blank of existing research in GL or initial solution to quality assessment for GL.\n\n**Miner details:**\n\n- The content of Appendix  is confused.\n\n------------------------------------\nMaster Student',28,'2021-02-19 13:38:22',54,_binary '\0'),(314,'- Paper Title：HGRec: A Hypergraph-based Recommender for Suggesting Code Reviewer in OSS Community\n\n- Paper summary\nThis paper tries to propose the method that with qualities of solid mathematical basis and the adaptability to code review modeling. The method named HGRec， which is aims to balance the trade-off between recommendation accuracy and recommendation coverage. \n\n- Comments for author\n1. The paper focus on imbalance issue，however there is no enough evidence to show this issue is important.\n2. In this paper, the discussion of Hypergraph is not sufficient. It only lists the applications of Hypergraph in various fields, but it does not reflect the necessity and indispensability of Hypergraph research in various fields.\n3. The reasons for screening projects are not enough. It should not just be stated that these projects have been selected in other articles. The point is to show that these projects cover a enough area.\n4. “With the scale of the project the number of participants getting larger and larger, developers\' workload has increased a lot. ”There is an error in this sentence. \n5. The contribution of this article is limited to the introduction of hypergraph to code review, and does not reflect the improvement and improvement of the hypergraph method itself. Only the contributions mentioned in this article cannot meet the requirements of the FSE.',27,'2021-02-19 13:47:27',31,_binary '\0'),(315,'Title: Assessing the quality of Grey Literature by use Analytical Hierarchy Process in Software Engineering Research\nAuthor: Xin Zhou, Xin Huang and Huang Huang\nThis paper propose a method using Analytical Hierarchy Process to assess the quality of grey literature, in order to develop methodological support for conducting research with GL. The contribution is significant because it may raise the awareness about the current use of GL in SE.  I have some problems as follows:\n\n1. In the part of related work, the author mentioned that garousi has put forward the quality checklist, so whether the author needs to explain the advantages of his work compared with garousi\'s work, and whether he has solved the disadvantages of \'no one size fits all\'.\n\n2. The author has written about the evaluation methods of SLR and MLR in the relevant work section, so what is the relationship between these QA methods and GL\'s QA methods.\n\n3. In Section 3.4, does the author have any evidence or reason to say \"the AHP was the best proposed approach to prioritize the identified factors\"?\n\n4.The ending part \"Our findinigs are expected...\" as like as former part in introduction.  \n\nSome details:\n\n1. 5.1 part \'table?\', above table 4 \'8 9 and 10\'\n\n[master Student]',28,'2021-02-19 13:47:28',63,_binary '\0'),(316,'This paper targets at solutions for the challenges in assessing the quality of grey literature. For this target, a literature review involving 16 studies was leveraged, as well as a survey with 14 replies. This paper contributes to assessing grey literature by providing 24 effective quality assessment criteria and a checklist.\n\nFor this paper, some opportunities for improvement are as following:\n- The research method of this paper seems somewhat ambiguous. For example, the ABSTRACT part lists \"literature review\" and \"survey\" as the \"Method\" of this paper, while the \"Conclusion\" of the ABSTRACT part begins with \"through the literature review and analytical hierarchy process\".\n- For Section INTRODUCTION, I believe more discussion is need before the contribution and after the \"the aim of this study\". For example, why there is a need to identify the challenges of the use of GL.\n- The textual description of the \"target invitees\" of the survey seems to be not consistent with what is stated in Figure 2.\n- I believe that the RQ of this paper should be discussed further. After all, how the data pertaining to this RQ (\"how to evaluate the quality of GL\") was boilded down to the findings in Section 4 and 5 is unknown.\n- A better way to express four aspects of quality assessment criteria might be a figure rather than a table. BTW, given that the labels of the identified criteria are given, the relationship between these quality assessment criteria and the four aspects can be more conscious.\n- To be honest, I cannot see how the analytical hierarchy process was employed in this study. It seems that Section 3.4 and Section 5.1 merely introduce the methodology of analytical hierarchy process itself. BTW, where is Tables 8, 9 and 10 in this paper?\n- It is recommended to provide more hints about how to use the quality assessment checklist in Section 5.2.\n\n  [PHD student]',28,'2021-02-19 13:48:19',23,_binary '\0'),(317,'This paper proposes a Hypergraph-based reviewer Recommender(HGRec) to balance the trade-off between recommendation accuracy and recommendation coverage.  The reported result in this paper shows that the proposed method can significantly outperforms the state-of-the-art recommenders, balancing the trade-off between recommendation accuracy and recommendation coverage.However, there are still some suggestions as following.\n\n1、line 293，“i.e. ,\" ，besides，this problem formulation consufused me a lot and froced me to read over to understand,for example,it would be better if the set Ct in line 296 mentioned in line 295 after word \"list\", the detailed relationship between the modified file path set Fi and pi was not mentioned, \"prt\" in line 295 did not have textual explanation although it can be inferred from context.\n\n2、”Hypergraph construction“ introduced the construction of hypergraph, but the construction method flow in this section is not clear. paragraph in line 350 point out the two steps of the construction method, but the following text does not follow the two steps to introduce the construction method,the algorithm pseudo-code is not explained too much,and after the brief step overview is the discussion of the hypergraph elements, to be honest ,it\'s a little weird.\n\n3、line 1083 table 6 did not have description attached .The design of the two problems did not related with the advantages in data after  the new method balancing the accuracy and load balancing,which mentioned in abstract. Perhaps more explanation should be added in this regard？\n[undergraduate student]',27,'2021-02-19 13:49:35',74,_binary '\0'),(318,'This paper aims to provide a guideline for checking the quality of grey literature, and surveyed the experts in SE community on the use of GL in SE research. It is meaningful for using the GL in SE research.\nBut it still has some problems as following:\n- Fig. 2: The description of the research process in the paper is not clear enough.\n- Background & Related Work: This part may be too miscellaneous which Includes many background introductions that are not very related to the main content of this article.\n- Conclusion: The main contributions of this paper is not clear mentioned.\n[Undergraduate Student]',28,'2021-02-19 13:49:53',83,_binary '\0'),(319,'This paper proposed a Hypergraph-based method for code reviewer recommendation. The purpose is to balance the trade-off between recommendation accuracy and recommendation coverage, however the contribution of this paper does not seem to achieve this goal.\n\nFor this paper, some comments for improvement are as following:\n\n1. Motivation is not clear\nWhat are the challenges of code reviewer recommendation? Which challenges are not well solved? Your solutions can supplement them. In other words, what problems do you solve?\n\n2. The issues of the introduction part\na) The RQs appear too late in the paper. It can be integrated into the introduction.\nb) Entropy is not further explained in the introduction. From the full text, this should be a very important indicator.\n\n3. The issues of the Related work part\nThe analysis of related work is not deep enough. It is not only to list the contributions of each research, but more importantly, you need to describe their shortcomings and differences from your work.\n\n4. The issues of the Method part\na) Lack of a structure or flow chart that can make the method part read more smoothly.\nb) There is no detailed explanation about the “objective function” in Section 3.3.\n\n5.  The issues of the RQs part\na) The authors\' conclusion in RQ2 is that there is a trade-off between accuracy and workload. In fact, the work itself only focuses on \"workload imbalance\". This is not consistent with the conclusion.\nb) In order to achieve the balance between entropy and accuracy, it is necessary to have a clear threshold, otherwise, it is difficult to say which value of entropy and accuracy can reach the balance.\nc) According to the data provided by the author, the performance of HGRec is not much better than that of the baseline experiment in terms of accuracy or entropy. In particular, the performance of CN recommender is almost no less than HGRecso how to reflect the value of this method.\n\n【PHD student】',27,'2021-02-19 13:57:38',16,_binary '\0'),(320,'This paper proposed a Hypergraph-based reviewer Recommender, namely HGRec, to balance the trade-off between recommendation accuracy and recommendation coverage.\n\n1. Figure 2 is not clear.\n2. Figure 7 need to be adjusted.\n3. It seems that the performance of HGRec is not much better than other baseline algorithms.\n\nOverall this article is well written and novel in its work, I voted for Accept.',27,'2021-02-19 13:57:34',66,_binary '\0'),(321,'- Paper Title：Assessing the quality of Grey Literature by use Analytical Hierarchy Process in Software Engineering Research\n\n- Paper summary\nThis paper discusses the role of grey literature in SE research, and then presents how to check the quality of grey literature.\n\n- Comments for author\nThis paper lack guidance on how to check the quality of grey literature in SE research.',28,'2021-02-19 13:58:24',31,_binary '\0'),(322,'This paper carried out a Literature Review of the credibility of grey literature in SE, and surveyed the experts in SE community on the use of GL in SE research.The writing logic is very clear，here are some format problem.\n1、 Table3\n2、“isgiven” in line 543.\n\n[Undergraduate Student]',28,'2021-02-19 13:59:18',74,_binary '\0'),(323,'This paper is about HGRec, a Hypergraph-based reviewer Recommender. It aims to balance the trade-off between recommendation accuracy and recommendation coverage.\nMy comments are as follows:\n- The idea of the hypergraph structure in code review problem is very novel and feasible.\n- I think there should be more introduce content about the theory of hypergraph to make this paper more understandable.\n- The author should elaborate on the motivation for using Hypergraph in the problem.\n[undergraduate student]',27,'2021-02-19 14:00:16',83,_binary '\0'),(324,'This paper explores using Analytical Hierarchy Process to evaluate the quality of Gray Literature in software engineering.\n\n1. Table 2 is too small.\n2. The results are somewhat confusing and need more explanation and discussion.\n3. Check for the double cites.\n4. Figure 3 is not clear.',28,'2021-02-19 14:01:13',66,_binary '\0'),(325,'Paper Title：HGRec: A Hypergraph-based Recommender for Suggesting Code Reviewer in OSS Community\nPaper summary: \nThis paper proposes a Hypergraph-based reviewer Recommender(HGRec) to balance the trade-off between recommendation accuracy and recommendation coverage. The method is relatively novel. However, there are still some suggestions as following.\n1、Lack of sufficient motivation. Besides the unbalanced work pressure, I believe more discussions are in need.\n2、There are a lot of English grammar problems\n[master student]',27,'2021-02-19 14:01:52',63,_binary '\0'),(326,'This paper proposes a conceptual model for how GL works in the SE research lifecycle and explores the solutions for the challenges in assessing the quality of GL. \nMinor issues:\n1、Explain the benefits of using the Analytical Hierarchy Process and whether there are other criteria for evaluation or add some discussions and explanations for conclusion.\n2、There are grammatical mistakes in the article, for example \"the work aim at\"，\"that could be evaluate GL quality\"	...\n3、Figure 3 is not clear enough\n\nMaster',28,'2021-02-21 16:59:18',2,_binary '\0'),(327,'Nowadays, both software artifacts and company organization are getting larger and larger in modern software development, which bring heavy burns to all kinds of practitioners. This study investigates \nDevOps and microservices in reality by several empirical research methods, which are both novel and benefit to me. I do appreciate the authors’ work and my comments are listed as follows.\n\nAbstract:\n1. DevOps and microservices are directly presented in the context, but what are the relationships between DevOps and microservices? Actually, I mentioned them in the following sections. \n\nRelated work:\n1. I am looking forward to several best practices or lesson learned (academic literature or grey literature) from enterprise projects, as the environment of this study is in three companies.\n\nResearch Methodology:\n1. It seems that the lead author independently worked in several phase of this study, in this case, how to ensure the quality of observation?\n2. Have you ever interviewed the DevOps-specific engineers? \n3. How long have these three companies implemented DevOps/microservice architecture? This information may help in understanding answering research questions.\n\nResult and Discussion:\n1. Again, there is a gap between discussing DevOps and microservice. Section 4.4 also illustrates this phenomenon. Does this study belong to exploratory research? If so, please mention ahead.\n2. I am looking forward to more case discussions, especially the failed practices in multiple companies.\n\nOverall, this paper reports significant valuable up-to-date experiences for applying DevOps and microservices in industry. Also, the papers is well presented and is worth publishing.\n',29,'2021-02-26 09:13:59',44,_binary '\0'),(328,'This paper shows ethnographic study that combines participant observation and interviews to investigates DevOps and microservices in real software teams.I have some suggestions as follows\n1)On line 28 of the abstract section,the second result feels too general, maybe you can consider describing this general conclusion from a certain angle to be unique\n2)On line 119 of the introduction section,\"... lacked lacked the immersive thinking ... which is the basic units of software development activities\",I think it’s better to have a basis or citation to support this sentence\n3)In the 3.2 section,does the selected company have expectations? Meybe you can consider adding text to this situation \n4)The full text does not need to consider adding a new chapter to illustrate the restrictions',29,'2021-02-26 09:32:10',35,_binary '\0'),(329,'# **DevOps and Microservices in Real Software Teams: An Ethnographic Study in Three Companies**\n\n## Contribution of the paper\n\n## Technical correctness of the paper\n\"Interviews in C2 and C3 were conducted after  the lead author left the company, and interviewees were selected from team members the lead author worked with in the company.\" That seems like a lot of irrelevant detail.\n\n\"Because the context of the interviewees is not exactly the same, each interview could contain some specific topic-related questions\" Do it may affect the result if asking different interviewees with different questiones?\n\nThe reason for \"Weak Correlation between DevOps and Microservices\" may need detail discussion.\n\n## How much effort did you spend refereeing this paper? \nReasonable\n\n## Decision\nWeekly Accept. Please Modify and repost.\n\n------------------------------------\nReporter: Zijia Jia',29,'2021-02-26 09:52:52',19,_binary '\0'),(330,'Title:DevOps and Microservices in Real Software Teams: An Ethnographic Study in Three Companies\nAuthor:Huang Huang\n\nThis paper is aims to discover the impactsof DevOps and microservices on the daily work of software teams in reality and the adverse effects of software team organization on their adoption and implementation. Through observation and interview, we can get the information,they collect data related to DevOps, microservices and teamwork,then analyse the data.\n\nMy comments are as follows:\n1.It is better to list the contributions separately\n2.It is not mentioned Why you choose these three companies\n3.The words ‘achieves ’ in the sentence ‘Microservices achieves benefits (e.g., maintainability, reusability, scalability,…… light weight mechanisms’ should be ‘achieve’\n4.In the Abstract, it has been mentioned that Devops and microservices have an impact on enterprises, but the relationship between them has not been explained',29,'2021-02-26 09:55:16',24,_binary '\0'),(331,'DevOps and microservices are two methods that originated in the industry. This paper reports an ethnographic study conducted in three companies. The observations and interviews reported in the research provide valuable information for researchers to understand the status of practice of DevOps and microservices.\n\nThe paper is well written. But I have the following concerns.\n\n- DevOps and microservices are indeed related. However, microservices is a software architecture technology that can exist independently, while DevOps is a comprehensive method involving a large number of tools and technologies. Why does this study only discuss DevOps and microservices as well as their relationships?\n\n- DevOps is a concept that is difficult to define, and its boundaries are not clear. How does the author determine that these investigated three companies are adopting DevOps instead of mouthing empty slogans?\n\n- The observation items shown in Table 2 are relatively broad concepts. Are there any specific rules in actual observation? How to ensure the effectiveness and quality of data collection?\n\n- \"47 primary studies were identifed foucsing ...\" Numbers should not be placed at the beginning of a sentence',29,'2021-02-26 10:17:29',37,_binary '\0'),(332,'This article uses the ethnographic study to observe the usage of DevOps among software teams. This article explores the relationship between DevOps, microservices, and software teams. The findings of this paper contribute to the overall understanding of the concepts, practices, and perceptibility of DevOps and microservices from the immersive perspective of software teams. I agree with the work of this article.',29,'2021-02-26 10:20:10',46,_binary '\0'),(333,'There are many duplicates in Table 3,is the design of the table reasonable?\nThe words below the fig4 is too small to read clearly.\nThe text in picture 7 is too blurry.',29,'2021-02-26 10:21:55',34,_binary '\0'),(334,'DevOps and microservices are one of the more researched topics in recent years. The author focuses on the characteristics that the adoption and implementation of DevOps and microservices is not easy. The aim is to discover the impact of DevOps and microservices on the software team, using ethnographic methods to collect and analyze data from the three companies, and discover the current adoption and implementation status of DevOps and microservices, which has certain practical significance, but the article still There are some shortcomings:\n1. The article mentions three results of data analysis in the abstract, which are described as: \"1) Although DevOps has brought huge benefits to rapid delivery, the current adoption of DevOps is fragmentary; 2) the agility and product business need to be weighed for different products; …\". The second point here is prone to misunderstanding. Is it because Devops needs to be weighed when using fragmentation, or does the team need to weigh the entire project?\n2. The second part of the article, BACKGROUND AND RELATED WORK, is quite long. As a conference article, it introduces a lot of related work and background, but it has no effect on the core part of this article. Is it inappropriate?\n3. In Section 3, the article lacks a description of the quality of the observations. If the quality of the observations cannot be guaranteed, the observations will be unconvincing.\n4. For the Discussion section, I hope to see some specific cases to illustrate the findings of the article.\n5. Whether it is necessary to add the Threats to validity section, describing the author\'s risk assessment and control in the overall ethnographic survey, and increase the credibility of the article.\nPHD',29,'2021-02-26 12:16:23',61,_binary '\0'),(335,'**Title:** DevOps and Microservices in Real Software Teams: An Ethnographic Study in Three Companies\n**Authors:** Huang Huang\n\nThe authors conduct an ethnographic study in three companies. While there are both participant observations and interviews in this study, the participant observations are the preparation of interviews, and the evidence of result part is primarily form interview.\n\n**MAIN CONCERNS INCLUDE:**\nABSTRACT [28-31]: I recommend to present the specific differences of impacts and adverse effects rather than give a conclusion of “more or less”.\n\nINTRODUCTION: You need to add a paragraph to give a brief introduction of the following content.\n\nRESEARCH METHODOLOGY [618-623]: This example of coding seems unreasonable. Online chat group is also an effective way for product feedback. And from the original record, we cannot draw a conclusion that the online chat is the only way to feedback.\n\nRESULTS AND DISCUSSION: Although this is an ethnographic study, the basic evidence presented in this section are from interviews. It seems that the participant observation is just a preparation for interview in this study. I think there must exist some valuable information that can proof or contradict the description of interviewee, and I recommend to elaborate them. Moreover, I cannot understand how you get the conclusion that “the impacts of DevOps and microservices on the organizational structure is far less than the adverse effects of the organizational structure on them” in ABSTRACT, there is no evidence for it in your result.\n\nRESULT AND DISCUSSION [921-986]: DevOps pipeline is an important infrastructure for microservices. The weak correlation between DevOps and micorservices in these three companies might cause by the maturity of DevOps and the implementation of micorservices. This is a controversial conclusion and it will cause the doubt about the company interviewed. I recommend to elaborate more on the reason of this phenomenon.\n\n**MINOR CORRECTIONS:**\nABSTRACT [10-11]: “frequent software development capabilities” is not common in SE. \nABSTRACT [18-19]: The redundant “different”.\nABSTRACT [27-28]: “Trade-off” is better than “weight”.\n\nINTRODUCTION [104-105]: It will be better to delete it if you don’t have solid evidence to support that Covid 19 effects the search trend.\n',29,'2021-02-26 10:27:20',39,_binary '\0'),(336,'Devops and microservices play important roles in sofrware development and are quite difficult for companies to use. This paper through an ethnographic\nstudy in three companies to discover the impacts and the adverse effects of software team organization. The research result is meaningful.\n1.It is better to have more discussion about the failed result or negative effect in these companies to  make the work more dialectical.\n2.It might be better to explain the relationship between the Devops and microservice more detailed  in your abstract and introduction. ',29,'2021-02-26 10:31:38',55,_binary '\0'),(337,'This paper provide an immersive perspective to understand the interaction between software teams and DevOps, microservices.\n\n1. line 121，“On the ohter hand”（ Spelling mistakes: \'other\' instead of \'ohter\'）\n2. line 124，“social aspects which means” （syntax error: before \'which\' lack \', \' ）\n\n[undergraduate]',29,'2021-02-26 10:37:38',78,_binary '\0'),(338,'This paper conducts ethnographic study in three different companies. At the same time, participant observation and interviews were used to collect relevant data, and then the grounded theory was used to analyze the data. Finally, the paper show the interactions between software teams and the practices of DevOps and microservices. But there are still some problems with this paper:\n1.In the abstract part, the detailed contribution of this paper is not stated and the conclusion is too broad.\n2.In line 191, the paper does not explain what the concept “DevSecOps” means.\n3.The related work part is too long, so I think it can be cut down appropriately.\n4.Line 227 “Everything has its pros and cons” is too colloquial, I think it can be deleted.\n5.In the results and discussions section, there are places where more detailed examples are missing to support the conclusion, for example, specific to a particular developer\'s thoughts or experiences.\n6.The conclusion part is too brief, so some content can be added. In addition, only the conclusion about RQ2 is mentioned in this part, but there is no summary about the answer of RQ1.\n',29,'2021-02-26 10:49:48',72,_binary '\0'),(339,'This paper aims at proposing the overview of DevOps and Microservices in real environment using ehtnographic methods. I admire this topic and the adopted methods, but there may be some issues on expression which need to be modified.\n\n-  As an ethnographic study, the content on the raw data are not well organized and reported in this paper. Compared with the section results and discussion, the section research methodology is a bit little bigger. At the same time, no enough data was reported in the two sections. Even if the authors cannot report everything because of the space limit, a summary or examples should be given. So that the readers can realize the real environment. This is what an ethnographic study should do to the best of my knowledge. \n- The current strucutre just lists the findings. I cannot find any exact relationship between them.\n- The results and discussion are combined. This is not a bad decision. But I cannot distinguish them from the words I see. ',29,'2021-02-26 10:57:36',5,_binary '\0'),(340,'This paper aims to discover the impacts of DevOps and microservices on the daily work of software teams in reality and the adverse effects of software team organization on their adoption and implementation. Here are some of my comments:\n1.In ABSTRACT Section,\"types,sizes,products\" not \"type,size,product\",\"contribute\" not \"contributes\";\n2.A mixture of \"organisational\" and \"organizational\" throughout the paper;\n3.In 3 Section,\"humans\" not \"human\";\n4.In 3.1 Section, the authors say that RQ1 should focus on the individual rather than the organization, why should it focus on the individual rather than the organization, or both?\n5.In 3.2 Section, the checklist proposes that multiple examples should be used while the individual field study is short in duration (far less than 8 months), the authors surveyed only three companies, so wouldn\'t the sample size be too small?\n6.In 3.2 Section, will the researcher\'s participation in the internship have an impact on the original software team?\n7.In 4.4 Section,\" has become\" not \"has became\".\n\n［master］',29,'2021-02-26 11:58:05',18,_binary '\0'),(341,'Comments：\n1. line 73：“DevOps, which was proposed in 2009 [2] and originated from from the combination”： “from from”。\n2. line 84：“ Microservices achieves benefits”：“achieves” or “achieve”？\n3. line 114： “Although they are studied the current DevOps and microservices practices in the industry, they paid more attention to understandings”：“they are studies ....., they paid ....”, you should delete the \"are\".',29,'2021-02-26 11:06:40',64,_binary '\0'),(342,'[PhD student]\nThis paper reports an ethnographic study that combines participant observation and interviews to investigates DevOps and microservices in real software teams. Two valuable RQs are aimed to be answered by this study using a promising research method.  Here are some comments to help the improvement of this paper: \n\nRESEARCH METHODOLOGY: \nIn section 3.2, I was wondering why you conducted interviews in different ways and whether the difference will impact the quality of the findings in this paper. For example,\n1) interviews in one company were combined participant observation, while other two interviews were not. \n2) Since the three companies differ from each other in terms of type, size, products, customers, and even globalization, I do not think it is reasonable to select interviewees whose roles have such great difference among the three companies. \n\nRESULTS AND DISCUSSION: \n1）From the results, I can not understand how you answer RQ1 (impacts) and RQ2 (Constraints) proposed in the beginning. “Fragmentary DevOps”, “Abuse of Microservices”, or “Weak Correlation between DevOps and Microservices” all seem to be the state of the practice rather than the impacts or constraints.  Although you try to explain some relevant findings related to the answering of these two RQs in this section, I do not think the arrangement here is logical. \n2）The use of the evidence obtained from the interviews and participant observation is inadequate. The unit of company C* rather than the interviewee I* is mentioned in the whole section.\n3）Disappointedly, apart from the common knowledge that provided by previous studies, few attractive findings can be found from the discussion of this section. \n4）The data requires a more in-depth mining and the visualisation in this section needs a further revision to depict the relationship of DevOps and microservices, their impacts and the constrains. I suggest you refer to the work of **Shahin**, **An Empirical Study of Architecting for Continuous Delivery and Deployment** published at Empirical Software Engineering,  an important study related to yours. \n\nSmall comments: \n1）Devops -> DevOps\n2）microservices [19], which **is** the portmanteau of “micro” and “service”, **was** considered 82 as the architecture **solutions** for continuous architecture setting in 83 DevOps [5, 10, 56]. \n',29,'2021-02-26 11:11:56',48,_binary '\0'),(343,'The information of this paper is complete and the structure is reasonable. This paper provides basic information about the three companies and the interview participants, which is very good. There are four topics for interviews, I think it would be better to add another one, the interviewees\' stories with microservices and DevOps, although the Weak Correlation between DevOps and MicroServices is described in detail in Chapter 4.4.\nThere are also some small problems, such as inconsistent styles and fonts of figures.\n',29,'2021-02-26 11:12:51',8,_binary '\0'),(344,'This paper provides an immersive perspective to observe the usage of DevOps and microservices in the software teams and to discover the impacts of DevOps and microservices on software teams as well as the feedback from software teams on DevOps and microservices. \n\nSome comments:\n- In the introduction, the reason why you studied both DevOps and Microservices is not clear. \"Both DevOps and microservices have received an increasing attention from researchers and practitioners over the past decade\", it is not a strong enough motivation to conduct this work. It seems reasonable in terms of the content of this paper when you only study DevOps or microservices. Besides, DevOps is a concept, while microservices usually refer to an architecture. The two are not things of the same aspect.\n- Based on the above opinion, it seems that the reasons for a strong relationship between DevOps and microservices should be better clarified in Section 4.4.\n- The interview topics (IMHO, interview questions) seem to be open questions, more interesting or unexpected phenomena could be revealed. Unfortunately, the results seem to be well-known.  For this kind of results, it is difficult to be convincing if there is no statistical data, thus it is better to discover some phenomena that are not easily detectable or overlooked.\n[PhD]',29,'2021-02-26 11:12:59',3,_binary '\0'),(345,'This paper aims to discover the impacts of DevOps and microservices on the daily work of software teams\nin reality and the adverse effects of software team organization on their adoption and implementation. The\n authors provide an immersive perspective to understand the interaction between software teams and DevOps,\nmicroservices, which was overlooked in previous studies.\nI doubt the conclusion that Devops has little to do with microservices based on the survey of only three companies.\n\n',29,'2021-02-26 11:14:05',63,_binary '\0'),(346,'This paper uses the method of ethnography to study the impact of DevOps and microservices on the daily work of the software team and the adverse impact of adoption and implementation.\n- The research object of this article is DevOps and Microservices, but the two sides are different. The research problem of this paper is that the software team adopts the impacts and constraints of DevOps and microservices, but the effects and constraints of the two sides are also different. It seems inappropriate to mix them together, need to explain the relationship between DevOps and Microservices.\n- The research method of this paper is to conduct ethnographic research on three companies. Whether the three companies are enough to represent the \"Real Software Teams\", it is necessary to further explain the reasons for choosing these three companies to show that these three companies are sufficiently representative.\n- The research process and results of this paper are detailed, but the conclusions and answers to RQs still need to be more prominent.',29,'2021-02-26 11:17:20',6,_binary '\0'),(347,'This paper reports our ethnographic study that combines participant observation and interviews to investigates DevOps and microservices in real software teams.\nThe background section is too long. It does not highlight the advantages of this paper.\nThe word in Figure 4 is too small and the graph is too large.',29,'2021-02-26 11:19:42',77,_binary '\0'),(348,'This paper conducted an ethnographic study to discover the impacts of DevOps and microservices on the daily work of software teams in reality and the adverse effects of software team organization on their adoption and implementation. Some comments are as follows:\n1. In the process of observing the relevant work of the three companies, some content was not allowed because of some reasons. Is it necessary to evaluate the adverse effects to this research or explain this problems?\n2. In the design of interviews in different companies, the roles of the interviewees varied greatly among different companies. In my opinion, in the same company the roles should cover ranges as wide as possible, but in different companies the roles should be consistent with each other.\n3. Some spelling mistakes such as in line 121 \"ohter\".\n----undergraduate',29,'2021-02-26 11:20:31',73,_binary '\0'),(349,'This study aims to discover the impacts of DevOps and microservices on the daily work of software teams in reality and the adverse effects of software team organization on their adoption and implementation. The author post two research questions to providing a participatory observer’s perspective on DevOps and microservices. There are some suggestions:\n\n1.Some theories and techniques mentioned in section 3.5 should be introduced in advance. The author could introduce these content in background or set individual subtitles to explain them.\n\n2.The author spend too much space for the widely known concept “devops” and “Microservice”. The introduction for these should be cut down.\n\n3.Section 3.5 writes “The personal experiences as well as social and cultural background will become inherent biases in ethnographic research, which would be reflected in the participant observations. To alleviate this bias, the lead author discusses and has meetings in the processes of data analysis with authors who did not participate in the observation” The explanations is too rough and maybe it’s not a compellent way to elimination the bias. The author needs more reasonable details to introduce how to solve this problem.\n\n4.Section 3.2 “Study Design and Company Selection” contains too much unnecessary details such as “Researchers looked for internships online or through company-college partnerships that can help them get into the real context of the teamwork. After that, with the help of mentors.......”. The author could find a brief or general way to display.\n\n5.The conclusion in abstract seems too abstract, The author should show more practical and meaningful scene to reinforce the contribution of this work.\n\n6.The author set two research questions, but it seems these two questions are not mentioned in the rest of this paper. There is no direct response or explanation for these questions. Maybe it’s better to set a individual section or part to answer the questions.\n',29,'2021-02-26 11:21:07',26,_binary '\0'),(350,'This paper aims to discover the impacts of DevOps and microservices on the daily work of software teams. I voted A.',29,'2021-02-26 11:21:54',7,_binary '\0'),(351,'This article uses an ethnographic approach to explore the connection between microservices and DevOps.\nThe theme is novel and meaningful.\nIf we can put forward some practical methods according to the research conclusions, the content of the paper will be more enriched.\n\n[master student]',29,'2021-02-26 11:28:48',17,_binary '\0'),(352,'This paper aims to discover the impactsof DevOps and microservices on the daily work of software teams in reality and the adverse effects of software team organization on their adoption and implementation.Here is my opinions:\n1.The conclusion in ABSTRACT is too simple and broad.It is not helpful for getting contribution of thi work.\n2.The companies and interviewers are not representative enough.\n[master]\n',29,'2021-02-26 11:29:28',14,_binary '\0'),(353,'------------------------------------\n- How much effort did you spend refereeing this paper? **Reasonable**\n------------------------------------\n1）The experimental results need further analysis\n2）Explain the relationship between the Devops and microservice more detailed\n3) 4.4 The reason for “Weak Correlation between DevOps and Microservices” may need detail discussion.\n[MASTER]',29,'2021-02-26 11:31:24',36,_binary '\0'),(354,'This paper focuses on the impact and constraints of DevOps and microservices on the work of software teams,\n which can provide reflection on the application of both in real situations.\n\nHere are some comments:\n1. BACKGROUND AND RELATED WORK: The content here is a bit too long and contains some unnecessary sentences.\n2. RESULTS AND DISCUSSOIN: Regarding the 780 line of discussion, I believe that high cost is a result rather than a factor. High cost should be replaced with more resource consumption or time cost as mentioned later. \n3. some typos: \n  - 73 line: \"originated from from\".\n  - 108 line: \"Devops\" should be \"DevOps\".\n  - 121 line: \"On the ohter hand\".\n\n[ Undergradute ]',29,'2021-02-26 11:39:36',82,_binary '\0'),(355,'#### DevOps and Microservices in Real Software Teams: An Ethnographic Study in Three Companies\n\nThis study use ethnographic study to discover the impacts of DevOps and microservices on the daily work of software teams in reality and the adverse effects of software team organization on their adoption and implementation. The findings contributes to the overall understanding of the concepts, practices, and perceptibility of DevOps and microservices from the immersive perspective of software teams.\n\nThis is a paper that studies new problems with old methods\n\n- There are too many duplicate attributes in Table 2, so it\'s better to bring out the differences separately, which is also concise\n- There is no clear answer to RQ in this paper',29,'2021-02-26 11:39:28',62,_binary '\0'),(356,'The paper analyze the data to discover the impacts of DevOps and microservices on the daily work of software teams through seven-months of patticipant observations and nine interviews. The topic of this paper is very good. However, there are still a little problems.\n1.In abstract, seven-months may be a adjective, i think it can not be the subject.\n2.In introduction, there are two \"from\" line 73.\n\n',29,'2021-02-26 11:41:14',25,_binary '\0'),(357,'To providing a participatory observer\'s perspective on DevOps and microservices, this paper proposed an ethnographic study in three companies, and analyse the data related to DevOps, microservices and teamwork. Some comments are as below:\n1. The answers to the research questions seem vague and not directly identified.\n2. In Figure 4, Some of the characters are big and some are small, it\'s better to adjust the font size.\nmaster student',29,'2021-02-26 11:50:56',9,_binary '\0'),(358,'This paper discovers the impacts of DevOps and microservices and reveal their problems arising in the daily work of software teams through a ethnographic study. It gives me a good understanding of the real industrial situation of DevOps and microservices. However, there are some issues:\n1. For paper structure, I think part 2 of this paper takes too much space, while part 3 is a little short. If possible, the allocation of space should be adjusted.\n2. I’m not familiar with ethnographic study, but I don’t think the data collected from Participant Observations and 9 interviews may be sufficient to get the conclusion. And there is no mentioned standard in this paper, which makes the conclusion less convincing.\n3. In part 3.1, I don’t think RQ1 “focus more on the individual aspect than the organizational aspect”, and this point is not explained.\n4. In part 3.4, the Ground Theory used to analyze data is introduced, but the process of data analysis is not explained clearly, and it may be better to illustrate this process with a graph. Also, he conclusion “product feedback is not integrated in the pipeline” in the example mentioned in “Open coding” can’t be got from the corresponding description.\n5. The title of part 4.4 may be changed to “Weak Correlation between DevOps and Microservices in software teams” to be more specific, because from other aspects like Google trends, the correlation between DevOps and microservices is not weak.\n6. There is a confusing word “Note” on the x axis in Figure 1. And I think Figure 1 needs more ticks on x axis to illustrate the time range of Google trends to emphasize the timeliness of this paper.\n7. There are some typos in this paper, like “which cloud” in part 5; and some syntax errors such as the odd “that” after “small services” in line 27 of part 1.\n[Undergraduate Student]\n',29,'2021-02-26 11:53:05',81,_binary '\0'),(359,'This paper applies the ethnographic study to provide a participatory observer\'s perspective on DevOps and microservices, which gives the overall understanding of the concept, practices, and perceptibility of DevOps and microservices. This is the first time I heard of ethnographic study, so I think it\'s novel. The paper is well written，but there are still some minor problems as follows:\n- Why did you choose the three companies and is there any basis?\n- In Figure 3, why are the three companies inspected and interviewed in different ways? Although the forms are diversified, does it feel a bit unreasonable?\n\nSome grammatical mistakes:\n- [32-33] Our findings ~~contributes~~(contribute)...\n- [73-74] and originated from ~~from ~~the combination\n- [121] On the ~~ohter~~(other) hand\n\n[undergraduate student]',29,'2021-02-26 11:57:59',84,_binary '\0'),(360,'This paper use ethnographic and interview method to discover the impacts of DevOps and microservices on the daily work of software teams in reality and the adverse effects of software team organization on their ad-option and implementation.Here are some my comments.\n1. The conclusion in abstract doesn\'t give useful information to readers.\n2. A paragraph should be added in Introduction part to introduce the paper\'s structure.\n3. The answers to the two RQs should be highlighted in the paper.\n4. Since the companies selected are so different, The difference between companies should have an impact on results. But I can\'t see it in this paper.\n \nSmall grammatical errors:\n1. In line 154, \"a overview\" should be \"an overview\".\n2. In line 121, \"on the ohter hand\" should be \"on the other hand\"\n[undergraduate student]',29,'2021-02-26 12:17:05',70,_binary '\0'),(361,' This paper through an ethnographic study in three companies to discover the impacts and the adverse effects of software team organization. The research result is meaningful.But there are also some\naspects need to focus on.\n1.It is better to have more discussion about the failed result or negative effect in these companies to make the work more dialectical.\n2.It might be better to explain the relationship between the Devops and microservice more detailed in your abstract and introduction.',29,'2021-02-26 12:06:02',41,_binary '\0'),(362,'There are some spelling errors in the paper, and the text on some pictures is blurry.\n[undergraduate student]',29,'2021-02-26 12:11:37',80,_binary '\0'),(363,'This paper is aims to discover the impactsof DevOps and microservices on the daily work of software teams in reality and the adverse effects of software team organization on their adoption and implementation. \nMy comments are as follows:\nIt is very interesting to read. But the abstracts do not seem to fully summarize the study\'s findings.\n\n#### Abstract:\n+ Result 1 : Should Result 1 emphasize that the current adoption of DevOps is fragmented?\n+ Result 3 : The impact mentioned here is a bit abstract and I don’t quite understand. For example, the last paragraph in INTRODUCTION is easy to understand.\n+ In Result, there are few discussions related to microservices.\n+ The conclusions in the abstract do not seem to reflect the results of the analysis.\n\n#### BACKGROUND AND RELATED WORK\n+ Section 2.4 : Should you remind readers of what you want to study at the end of 2.4? Readers may forget it.\n\n#### RESEARCH METHODOLOGY\n\n+ Section 3.3.1, 3.32  : The format of titles 3.3.1 and 3.3.2 seems a bit small, Or should be bold. \n\n#### RESULTS AND DISCUSSION\n\n+ Section 4.1 : At the beginning of 4.1, only two advantages are mentioned, but challenges are also mentioned later. Should the first paragraph of 4.1 be added?\n+ Section 4.3 : There are many short paragraphs in the second half of section 4.3, the reader’s attention may be distracted, which is not conducive to the reader’s understanding\n\n#### CONCLUSION\n+ CONCLUSION seems to be not finished yet, the content is a little bit small.\n\n[master student]\n\n',29,'2021-02-26 12:23:23',27,_binary '\0'),(364,'This paper conducted an ethnography in three companies aiming to discover the impacts of DevOps and microservices on the daily work of software teams.\n\n**For this paper, my main concerns are as following:**\n\n- In abstract, I think Results 3 is not reasonable. The impacts of DevOps and microservices on the organizational structure and the adverse effects of the organizational structure on DevOps and microservices are not in the same dimension.  Moreover, to which extend can we verified it is a high impact? \n\n- The relationships between DevOps and Microservices should be illustrated clearly in theory. In Section 2.3,  authors listed the classification of research themes on microservices in DevOps, it seems  DevOps provides an environment while microservices is one of DevOps practices.  Actually, some companies could only adopt microservices architecture while do not stated they adopt DevOps. \n\n- Findings are not novelty.  For example,  it is obviously that obstinate organizational structure could hinder the implementation of DevOps and microservices. However, since authors participated into three different companies with different size, culture and globalization. Is the extend of obstinateness of organization structure in these three companies the same?  If these companies with different structure have the same impact on DevOps and microservices? \n\n- In Section 4, I did not see any content discussed the \"agility and product business need to be weighted for different products\" stated in abstract.  Is this means companies should adopt different extend of DevOps or microservices for different products or something else? I suppose authors should outstanding this point in Section 4.\n\n\n**Miner details:**\n\n- It should be better to show findings according to different RQs clearly. Namely which findings are the impacts of DevOps and microservices have on the software teams, and which findings are the opposite.\n- I suggest authors could split their several findings (e.g. fragmentary DevOps) into two aspects according to RQs and listed in a table.\n\n------------------------------------\n[master]',29,'2021-02-26 12:13:29',54,_binary '\0'),(365,'This paper aims to find the influence of DevOps and microservices on the daily work of software teams in reality and the adverse effects of software team organization on their adoption and implementation.But there are also some questions which confused me. \n1. The answers of the questions are not clear enough. \n2. The relationship of Devops and micro service should be more detailed\n------------------------------------master',29,'2021-02-26 12:21:03',50,_binary '\0'),(366,'This paper uses ethnographic methods to investigate the use of DevOps and microservices in software teams. The method of case study is used to collect data. The difference from the traditional ethnographic method is that this article analyzes these data through three-level coding.Here are some my comments.\n1.Maybe It’s better to fill in some content to make the conclusion part more detailed\n2.121 line: “ohter” should be “other”\n[master student]',29,'2021-02-26 12:21:15',29,_binary '\0'),(367,'The purpose of the paper is to discover the impacts of DevOps and microservices on the daily work of software teams in reality and the adverse effects of software team organization on their adoption and implementation.The structure of the article is reasonable and the logic is rigorous.But I think there are still some shortcomings in the paper:\n1 I think there may be some problems with the choice of interviewer. Different product lines within a company may have different working methods, which may result in different interview results. Depending on the size of the company, different alternative methods may be required.',29,'2021-02-26 12:22:50',56,_binary '\0'),(368,'This paper aims to discover the impacts of DevOps and microservices on the daily work of software teams in reality and the adverse effects of software team organization on their adoption and implementation. Here are my suggestions.\n1、There are some grammatical errors\n	two \"from\" line 73\n	\"on the ohter hand\" 120\n	\"a overview\" line 154\n2、Whether these three companies are representative?\n3、\"Both DevOps and microservices have received an increasing attention from researchers and practitioners over the past decade\". The motivation is not strong enough',29,'2021-02-26 12:25:49',2,_binary '\0'),(369,'## title：DevOps and Microservices in Real Software Teams: An Ethnographic Study in Three Companies\nThis paper explores the impacts of DevOps and microservices on the daily work of software teams in reality and the adverse effects of software team organization on their adoption and implementation by conducting an ethnographic study in three different companies . And the findings of this paper is helpful for the overall understanding of the concepts, practices, and perceptibility of DevOps and microservices from the immersive perspective of software teams.\n## Comments:\n1.	In abstract, The second finding seems to be a general view, instead of  finding. It maybe better some ways or suggestions to balance the agility and product business is added.\n2.	In BACKGROUND AND RELATED WORK, I think this paper should add a selection of sections one and two to the third section and then merge the three sections on DevOps and Microservices.\n3.	In this study, the interviewees of the three companies are different, and the size and products of the companies are also different. Therefore, whether the conclusion reached by this method is universal or not, and whether it should be discussed according to different situations.\n4.	In 3.3.2, it is necessary to introduce which businesses or departments of the company are involved in solving RQ, and then introduce the choice of interviewees. The correlation between the interviewees\' work and RQ should be emphasized to enhance the persuasiveness of the article.\n5.	In result, the interpretation of the research results is not closely related to the RQs proposed previously. Section 4 should first explain how the findings of the research answer the two RQs, and then elaborate it from different perspectives.\n6.	In conclusion, it would be better to suggest some best practices or to discuss the reasons for these phenomenons in industry.\nOn the whole, I think this paper is relatively complete and selects a good angle to sort out the research findings.\n[master]',29,'2021-02-26 12:32:56',58,_binary '\0'),(370,'This paper provide a participatory observer’s perspective on DevOps and microservices via the ethnographic study, and gives the overall understanding of the concept, practices, and perceptibility of DevOps and microservices. As I know little about the ethnographic study, I can\'t give some professional opinions. \nSome spelling mistakes, such as \"ohter hand\" in line 121.\n[undergraduate student]',29,'2021-02-26 12:34:13',71,_binary '\0'),(371,'This work aims to discover the impacts of Devops and microservices on the daliy work of software teams in reality and adverse effects of software team organization on their adoption and implementation. After read this paper, i have these comments:\n\n- undefined The motivation of this paper is not clear, specifically for studied microservices\n- undefined The construction of paper is a little mess',29,'2021-02-26 12:37:11',32,_binary '\0'),(372,'1. This paper introduces the present states, impacts and perspectives of DevOps and microservices by investigating three real software companies, which is meaningful and credible.\n2. “On the ohter hand” on line 121. And there may be some other spelling errors in the paper, so I suggest rereading the paper carefully again.\n\n[undergraduate student]',29,'2021-02-26 12:40:13',76,_binary '\0'),(373,'Paper Title\nDevOps and Microservices in Real Software Teams: An Ethnographic Study in three Companies.\n\n\nPaper summary\nThis paper conducted an ethnographic study in three companies, which both use DevOps and Microservices.\n\nComments for author\nThis paper only proposes the qualitative research results, the contribution of the paper is insufficient. Translating qualitative result into practical guidance can improve the value of the paper.',29,'2021-02-26 13:11:40',31,_binary '\0'),(374,'**[PHD student]**\n\nThis paper aims to discover the impacts of DevOps and microservices on daily work of software team and the impacts of software teams on the adoption and implementation of DevOps and microservices. Claimed to report an ethnographic study, this paper tries to provide a participatory observer\'s perspective on DevOps and microservices.\n\n**For this paper, some major opportunities for improvement are as following:**\n- It is argued that the ethnographoc study contributes to an \"immersive\" understanding of DevOps, microservices in the perspective of software teams. However, what are the imagnied benefits of this \"immersive\" understanding (i.e., motivation) and why this \"immersive\" understanding outforms other research (i.e., evidenced by findings) is not directly from this manuscript. At the same time, another selling point of this paper is that the understanding of DevOps and microservices is obtained from the perspective of software teams. Still, it would be better to put more emphasis on its motivation.\n- The mapping between the results and RQs of this paper is not directly available. Furthermore, it seems to me that the subtitles of the RESULTS AND DISCUSSION cannot cover all aspects discussed within these subsections. For example, the title of section 4.1 namely \"Fragmentary DevOps\" is merely one reason that prevents manefesting all benefits of DevOps. Section 4.1 also discusses the benefits and challenges brought by DevOps, which seemingly were not pertaining to \"Fragmentary DevOps\". Likewise, the title of section 4.2 namely \"Abuse of Microservices\" is merely one root cause of the pains of microservices. It is recommended to rephrase these titles, e.g., \"Impact of DevOps on Software Team\".\n\n**There are still some others issues:**\n- In INTRODUCTION, the motivation of this work is not implicit, by merely saying that existing works \"paid more attention to understandings at the organization level and lacked the immersive thinking from software developers and software teams\". It seems that there are two differences between these existing works and ours: 1) organizational level vs. the level of software developer and software teams; 2) our perspect of thinking is immersive. Whereas, none of these aspects is explicit to readers.\n- For section 2.3, what is the gist of this subsection? Why should we focus on the research themes of current research about microservices in DevOps? Or what are the implications of these themes to this paper?\n- In section 4.1, the relationship between the \"fragmentary DevOps\" and its following part about \"firstly\" and \"secondly\" is hard to grasp. Also, It seems to me that \"software organizations are keen to improve DevOps pipeline\" is not directly linked to its following illustration. More discussions are needed to help understanding.\n- In section 4.2, the explained adoption and implementation of microservices might lead to some distractions, provided that this section is to present the impacts of microservices on software teams (RQ1) and the impacts software teams have on the adoption and implementation of microservices belong to RQ2.\n- To me, the constraints software systems have on the adoption of DevOps and microservices are not feasible in section 4.3. What was illustrated in the begining of section 4.2 might be an option to fill in the blanks.\n- It is somewhat difficult to grasp the gist of what is presented below figure 7.\n- In CONCLUSION, research method should not be the focus of future work, given that this paper focuses on the impact of DevOps and microservices on software team.\n\n**Minor details:**\n- It seems that \"The development of microservices runs or the DevOps pipeline\" in Figure 7 is not aligned with the paper text.\n- \"Three aspects of A, B and C\" is somewhat strange.\n- Does the adj \"real\" express some meaningful information in the title?\n\nTo conclude, I believe that what the paper contributes to the literature, the immersive understanding of DevOps and microservices in the perspective of software teams can be phenomenal. The research methodology is also introduced reasonably, by the way. Nevertheless, there are some opptunities for improvement pertaining to the selling points of this paper (or the \"contribution\") and the way of presenting the results.\n',29,'2021-02-26 12:55:03',23,_binary '\0'),(375,'This thesis is about devops and microsevice .there are some problems:\n\n1.The research questions seems directly identified.\n\n2.some pictures are not clearly\n',29,'2021-02-26 12:56:06',22,_binary '\0'),(376,'1.The second conclusion in the abstract is that we can draw a conclusion without investigation',29,'2021-02-26 12:57:34',65,_binary '\0'),(377,'This paper is aims to discover the impacts of DevOps and microservices on the real-word software teams by using ethnographic methods to collect and analyze data from the three companies.The topic of this paper is meaningful and useful.But it still has some problems as following:\n- I think the result 3 mentioned in the abstract is too abstract to understand. Moreover, it\'s difficult for us to intuitively compare the impact between the two.\n- Evidence from interviews and participant observations is underused.The companies are mentioned more than interviewers.\n- The discussion of cases (especially failure cases) is not enough, which makes us unable to understand the impact of Devops and microservices on software team in more detail\n- The font size difference in Figure 4 is too big and can be adjusted appropriately\n- line 121 on the ohter hand -> on the other hand\n\nmaster student',29,'2021-02-26 13:04:10',1,_binary '\0'),(378,'the paper conduct anethnographic study is to provide an immersive perspective to observe the usage of DevOps and microservices in the software teams and to discover the impacts of DevOps and microservices on software teams as well as the feedback from software teams on DevOps and microservices. \ncomments:\n1.Company 1 has more than 1000developers, but the development enviroment and meeting are not observed. The reason should be discussed.\n2.The interviewees of three interviews are different. Will it cause inconsistency problem?\n\nmaster ',29,'2021-02-26 13:04:34',49,_binary '\0'),(379,'To figure out the impact from DevOps and microservices in real software teams,this paper observed activities of the team-work from three companies participantly as well as a series of open-ended interviews with practitioners in thesethree companies were conducted to drive the investigation of theinteraction between software teams and the two concepts.Here are some questions:\n\n1、In 3.3.2,why we chose the people with such positions to interview?\n\n2、the entired paper did not directly answer the questions rasied in 3.1 \n\n[undergraduate student]\n\n',29,'2021-02-26 13:11:44',74,_binary '\0'),(380,'This paper describes a software engineering situation where the adoption and implementation of DevOps and microservices is not easy for companies due to technical and organizational requirements. By conducting an ethnographic study in three companies with different company type, size, product, customers and different degrees of globalization, this study discovers the impacts of DevOps and microservices on the daily work of software teams in reality and the adverse effects of software team organization on their adoption and implementation. Here are some comments about this paper:\n1、In line 73 there are two \"from\"\n2、Whether to use the plural form of the solution in line 82\n3、“Microservices achieves“ in line 83 looks strange\n4、In line 104 \"might be due to\" the syntax is fine, but it\'s rarely used this way.\n5、In line 121 \"On the ohter hand\"\n[master]\n\n\n',29,'2021-02-26 13:13:56',67,_binary '\0'),(381,'This paper aims to discover the impactsof DevOps and microservices on the daily work of software teams in reality and the adverse effects of software team organization on their adoption and implementation.I vote Accept',29,'2021-02-26 13:19:20',79,_binary '\0'),(382,'[Undergraduate student]\n    This paper want to discover the impacts of DevOps and microservices on the daily work of software teams in reality and the adverse effects of software team organization on their adoption and implementation.\n    Through actual interview, the application of DevOps and MicroServices in enterprises and some existing problems are shown more intuitively and clearly.Make the results more convincing.\n\nHere are my suggestions.\n\n[content arrangement]\nBACKGROUND AND RELATED WORK\nIntroduced too much basic introduction, can consider a concise language.\n\n[Some other syntax errors]\nLine 208 [syntax problem]: ...much support for agility and for rapid deploymen...(maybe the second \'for\' is redundant )\nLine 225 [syntax problem]: ... an increasing attention in both academia..(\'on\' instead of \'in\'?)\nLine 227 [syntax problem]: Microservices focuses on single...(\'focus\' instead of \'focuses\'?)\nLine 272,Figure 2; Line 283 [syntax problem]: Approaches and tool support for microservices based systems in DevOps(\'tools\' instead of \'tool\'?)\nLine 296 [syntax problem]: ...discussed the combined effect and benefits...(\'effects\' instead of \'effect\'?)\nLine 316 [syntax problem]: ...a DevOps workflow whih was evaluated at...(\'which\' instead of \'whih\'?)\nLine 319 [syntax problem]: ...core DevOps concern...(\'concerns\' instead of \'concern\'?)\nLine 389-290 [syntax problem]: ...Figure 3 shows the processes of this study(\'process\' instead of \'processes\'?)\n\n',29,'2021-02-26 13:23:29',85,_binary '\0'),(383,'This paper provides a study which uses ethnographic methods to collect and analyze data from the three companies, aims to discover the impacts of DevOps and microservices on the daily work of software teams in reality and the adverse effects of software team organization on their adoption and implementation. Since DevOps and microservices are hot topics on SE research in recent years, so I think this paper has certain practical meaning. But there still are some comments of mine:\n\n- I think that before discussing the experimental process and conclusions, we can add some motivations for choosing these three companies and some necessary introductions, such as an introduction to their Decops and microservices implementation. The answer to this point may help solve the second point I raised.\n- Interviews from different companies may need to be in the same occupational scope in order to draw more convincing conclusions. But if the author thinks that the cases of the three companies can reflect different problems, I think it is okay.\n- Since this article mentions both Devops and microservices, does the relationship between the two need to be added? I mean in the actual operation of the company.\n- A spelling mistake in line 121 \"ohter\" should be \"other\".\n\n[undergraduate student]',29,'2021-02-26 13:54:06',83,_binary '\0'),(384,'This paper discovered the impacts of DevOps and microservices on the daily work of software teams in reality and the adverse effects of software team organization on their adoption and implementation.\n\nSome comments:\n1. In my opinion, the motivation for this paper is rather weak and the topic discussed is not appealing\n2. It is recommended to mark the horizontal and vertical coordinates of Fig1.\n3. Fig5 and Fig7 are not a vector image.\nOverall, this paper was written in a good style and was informative, I voted accept.',29,'2021-02-26 13:59:36',66,_binary '\0'),(385,'#### Conference Paper Review\n##### Paper Title\nDevOps and Microservices in Real Software Teams: An Ethnographic Study in Three Companies\n\n------------------------------------\n##### Comments\nThis paper aims to discover the impacts of DevOps and microservices on the daily work of software teams in reality and the adverse effects of software team organizaiton on their adoption and implementaion. To achieve this purpose, this paper conducted an ethnographic study in three companies.\nSome comments:\n1. \'contributes to\' -> \'contribute to\' in page 1, line 33.\n2. \'On the ohter hand\' -> \'On the other hand\' in page 2, line 121\n\n[Master Student]',29,'2021-02-26 14:36:01',68,_binary '\0'),(387,'This paper aims to evaluate the performance of relay chain based on queuing theory. Firstly, it introduces the conceptual background and main methods of cross-chain, constructs two queuing models under the service rules of FCFS based on queuing theory, and finally analyzes the performance and presents the Premo test framework.\n\nHere are some comments:\n\n1. The formula takes up a lot of space and is a little scattered, which makes it unbalanced with other contents in the 4th part. I think it\'s better to combine formulas with curly braces and explain them in words.This can keep the necessary formula while explaining the model itself more.\n\n2. Some typos:\n  - in ABSTRACT, \"the system The average number of cross-chain transactions, ...\", \"The system\" should be deleted.\n  - in INTRO, \"consortiumpermissioned\"\n  - in page 2, \"Ours contributions are as follows\", \"Ours\" should be \"Our\"\n\n3. Some syntax problems:\n  - Note some plural words in sentence: \"There has been a lot of ...\"( \"has\" should be \"have\" )， \"There is still a great number of other projects\"( \"is\" should be \"are\" )',30,'2021-03-05 13:53:16',82,_binary '\0'),(388,'- Paper Title\nPerformance Evaluation of Cross-chain Systems Implemented Using the Relays Pattern: A Queuing Approach\n\n- Paper summary\nRelying on the cross-chain platform, this paper applies a cross-chain technology to model the core process of the relay chain.\n\n- Comments for author\nThis paper only use a cross-chain technology in the cross-chain platform, which not reflect innovation of this study.\nThis paper did not compare their technology with other studies.\nThe limitation of this paper is not been discussed.\n“By using the difference equation and the embedded Markov chain method, we have obtained the conditions for the stability of the relay chain system and several key indicators related to the system: the rejection probability of the system; the average queue length of cross-chain transactions, and the system”.This sentence miss a full stop.',30,'2021-03-05 13:54:33',31,_binary '\0'),(389,'This paper studies a type of cross-chain technology and researches  the performance evaluation of the cross-chain process.\nAfter reading this paper, I think the paper has the following problems:\n1The citation format of references is a bit problematic, for example, Line 11 of the second page of the article.\n2 In the Section3, I think the organizational structure is not reasonable. Before introducting the cross-chain process, the concept of \"relay chain\" and \"node group\" should be presented.\n3 The quotation of the table in the text is inconsistent with the format of the table caption.',30,'2021-03-05 14:16:24',56,_binary '\0'),(390,'This paper studies a type of cross-chain technology with a relay chain model, and relies on a representative cross-chain platform to model the core process of the relay chain.\n\n1. Figure 1~4，The two ends of the line (arrow and circle) are too small\n2. In Section 5.2, the conclusion is “We can see the rejection probability is zero when 入 < 4.91”, but Figure 5 shows that 入 < 8 approximately \n3. In the introduction part, quote \"[6?]\" may should be \"[6]\"\n4. Several key indicators proposed in Paper, like following :  \n  - the rejection probability of the system; \n  - the average queue length of cross-chain transactions\n  - the average number of cross-chain transactions\n  - the average queuing time of cross-chain transactions in the system\n  - the average response time of cross-chain transactions in the system\n  I suggest that Indicators can be abbreviated, with a table to explain the abbreviated indicators',30,'2021-03-05 14:23:49',78,_binary '\0'),(391,'This paper studies a type of cross-chain technology with a relay chain model, and relies on a representative cross-chain platform to model the core process of the relay chain.It also established a queuing theory system for the two components of the relay chain to process cross-chain transactions: consensus and block generation.Here are some comments:\n1. In abstract, \"Established a queuing theory...\" has a grammar mistake. Maybe you should add a subject in it.\n2. In page 4, The pictures looks a lot bit messy. Maybe you should consider to properly arrange them.\n3. In page 2, “Ours contributions are...”, “Ours” should be changed into “Our”\n[undergraduate student]',30,'2021-03-05 14:25:31',70,_binary '\0'),(392,'This paper studies a type of cross chain technology with a relay chain model, and relays on a representative cross chain platform to model the core process of the relay chain.\nThis paper also establishes a testing framework Premo to test the consensus time and block generation time, and calculates the variable performance indicators of the relay system.\nI agree with the content and logical structure of this paper. However, it would be better if the font in the figure could be enlarged a little, such as the ordinate label in Figure 6.',30,'2021-03-05 14:29:26',46,_binary '\0'),(393,'Title: Performance Evaluation of Cross-chain Systems Implemented Using the Relays Pattern: A Queuing Approach\n\nThis paper studies a type of cross-chain technology with a relay chain model, and relies on a representative cross-chain platform to model the core process of the relay chain.\n\nContribution of the paper:\n\nModel the core cross-chain process of the cross-chain platform. \nproposed two different types of queuing subsystems, and established M/M/1/N and G/M/1 queuing theoretical models. \nProvide an integrated overview map and more in-depth discussion.\nobtain the conditions for the stability of the relay chain system and calculate the key performance indicators of the two subsystems.\nbuilt a transaction test framework Premo to test the consensus time and block generation time of cross-chain transactions\n\nOur group’s comments are as follows:\n1.The abstract part is too long, the research background, process, results can be concentrated, the background behind can be combined with the research objectives.\n2.In the abstract, research hotspot is not the motive of study.And the contribution points are not just related work. And the key word is incorrect.\n3.The background and related work part is too long, the content can be divided into two parts.\n4.The experimental verification is too brief, and lack the verification results screenshots and verification results of contrast. Validation process is not stated clearly.\n5.There is no study conclusion.\n6.The paper focuses on modeling, while the theme of the conference is assessment. The mathematical formula is too much.\n7.In the introduction part, \"the rest of this paper\", the expression is not appropriate as conference paper.\n8.There are some slips, in the abstract, \"the system The aver\", it is lack of the period. And in the 5.2 part ,\"greater than the .\", one word is missing\n\nReporter: Feimei Xie\nMembers: Zan Gao, Changlan Fu, Jing Chen, Lanxin Yang, Jiaqi Zhang, Xiaodong Zhang, Mengjie Ding, Hao Wang, Wengang Liu,Yifan Zhang, Junyu Jia, Bo Pan,Fuli Zhang',30,'2021-03-05 15:42:28',49,_binary '\0'),(394,'This paper uses a representative cross-chain technology-BitXHub cross-chain platform and simulated its core process by applying the queuing theory model to a single relay chain, aiming to provide the cross-chain system with a feasible solution for the performance understanding and measurement. But there are still some problems with this paper:\n1.Some of the paragraphs in the paper are too long, I think we can consider dividing them, such as the second paragraph of the “BACKGROUND AND RELATED WORK” part.\n2.The formula reasoning process in the paper is too detailed, so I think it can be properly simplified.\n3.Some of the pictures in the paper are a little fuzzy, which makes it hard to see the text and content above, such as Fig. 6 and Fig. 8. I think you can reput some clearer pictures.\n',30,'2021-03-05 14:50:54',72,_binary '\0'),(395,'\nThis paper studies a type of cross-chain technology with a relay chain model, and relies on a representative cross-chain platform to model the core process of the relay chain.And here are my comments.\n1,The summary section could be more concise.\n2,The background and related work sections can be divided into smaller subheadings.',30,'2021-03-05 14:57:40',85,_binary '\0'),(396,'1. There are too many mathematical formulas.\n2. You are explaining your proposed approach in Chapters 3 and 4, but there is a lot of unimportant information, such as background.\n3. In chapter 5, you are going to do the experiment, but the structure is not the structure of the experiment, you need RQ to guide the experiment.\n4. The experimental results must be discussed according to the results.\nReporter: xiaodong zhang\nMembers: Huang Huang,Runfeng Mao,Xin Yang,Jiahui Wang,Jun lv,Kaiwen Song,Chenxing Zhong,Zhiying Li,Bowen Zheng,Liming Dong,zijia Jia\n',30,'2021-03-05 15:08:14',34,_binary '\0'),(397,'Title: Performance Evaluation of Cross-chain Systems Implemented Using the Relays Pattern: A Queuing Approach\n\nThis paper chose a representative cross-chain technology-BitXHub cross-chain platform and simulated its core process by applying the queuing theory model M/M/1/N and G/M/1 to a single relay chain, aiming to provide the cross-chain system with a feasible solution for the performance understanding and measurement. \n \nOur group’s comments are as follows:\n1.The title contains “A Queuing Approach” but the author didn’t mention it in the introduction section.\n2.It’s better to use brief way to claim what we exactly contribute in the abstract.\n3.The introduction mentioned “smart contract platform” which should be introduced in background or other sections.\n4.The background section has no clear context logic. It’s better to separate several partition and introduce related tech or method by logical category.\n5.The background section said “Therefore, the safety, efficiency, performance and resource consumption of cross-chain technology need to be studied in depth.” but the whole paper didn’t involve “safety” .\n6.It’s better to add “future work” section to introduce how will we move closer to mainstream platforms like cossmos and polkadot.\n\nReporter: Juzheng Zhang\nGroup members: Bohan Liu, Zeyan Wang, Huilin Yin, Tao Yang, Zeye Zhan, Haoming Li',30,'2021-03-05 18:19:10',26,_binary '\0'),(398,'Title: Performance Evaluation of Cross-chain Systems Implemented Using the Relays Pattern: A Queuing Approach\n\nThis paper studies a type of cross-chain technology with a relay chain model, establishes a queuing theory system for the two components of the relay chain to process cross-chain transactions and have obtained the conditions for the stability of the relay chain system By using the difference equation and the embedded Markov chain method.\n\nOur groups’ comments are as follows:\n1.There are full names behind the figure just like “Figure 1”, but the paper where it cites the figure use abbreviation such as \"Fig. 1 \".\n2.In part 4.1, when describing the node, the paper use “node 2”and “node2” two formats which should be unified.\n3.There are too many mathematical formulas in part 4 and the omission of intermediate derivation seriously affects the readability of the paper as the software engineering paper.\n4. In part5 performance analysis, the paper focuses on the presentation of results, may be more suitable for summarizing visual conclusions. \n5.The part of “Future work” should be made up as soon as possible\nWriting problems：\n6.In the abstract, “i.e,” should be changed to “i.e.,”\n7.It is beter not to begin a sentence in your paper with \"AND\"\n8.Misspelling of words：such as “the system The average” in abstract.\n\nReporter: Ruihong Liu\nMembers: Wei Liu, Xin Huang, Shenghui Gu, Peiyu Hou, Huanlei Chen, Bowen Zheng, Qiming Dai, Xin Zhou\n',30,'2021-03-05 19:32:17',67,_binary '\0'),(399,'This paper introduces the origin and method of STGT, as well as its application and challenge in the field of software engineering.\nHowever, fig 1 is distorted after amplification, so it is recommended to modify it.',4,'2021-03-12 11:04:17',46,_binary ''),(400,'Title: Socio-Technical Grounded Theory for Software Engineering\nGroup Members: Liming Dong, Shanshan Li,Huilin Yin, Juzheng Zhang, Yanze Wang, Zeye Zhan, Haoming Li, Lanxin Yang\n\nThis paper outlines the a noval method, Socio-Technical Grounded Theory (STGT), a variant of the traditional GT methods. Motivated by the misalignment of the traditional GT methods in software engineering research community. This paper is very logical, with rich content and accurate expression. It is an example to all of us. \n-If we have to offer the comments, the structure of the Section 4-Section 7 need to be relabeled becuase. There are several types of sub paragraphs with tertiary subheading, boldface and orderly title, we are confusing about the relationships of these sections. \n-Figures in this paper need to be replaced with vectorgraph.\n-Hota 2020->Hota 2021.\n',4,'2021-03-12 13:56:42',33,_binary ''),(401,'This paper emphasizes that GT, as a traditional qualitative method to analyze social phenomena, has inconsistencies and deficiencies in software engineering, such as the abuse and misunderstanding of GT in a large number of pappers. Some kinds of behaviors in software engineering are linked to social technology. The author updated the GT method and proposed STGT as a solution, aiming at alleviating researchers\' concerns and understanding of costs, and promoting the development of theoretical research.\n\n\n1. Some questions about figures:\n\n  1. The title of Fig1 is too long, it should be placed in the body.\n\n  2. There is a spelling error mark in the upper right corner of Fig2.\n\n  3. The figures on page 16 and 18 should be marked with a title, and look out for spelling mistake marks.\n\n  4. All the figures need to be changed into high-resolution vector pictures. And pay attention to the marks of spelling mistakes.',4,'2021-03-12 13:52:03',82,_binary ''),(402,'This paper describe Socio-technical Grounded Theory(STGT), a socio-technical variant of the traditional GT method, including its unique socio-technical research context, philosophical foundations , methodological steps and procedures, and evaluation guidelines.\n\n1. All figures are suggested to be replaced with vector images\n\n[undergraduate]\n',4,'2021-03-12 14:06:01',78,_binary ''),(403,'Title: Socio-Technical Grounded Theory for Software Engineering\nReporter: Jiahui Wang\nGroup members: Xin Huang, Zijia Jia, Zhiying Li, Peiyu Hou, Kaiwen Song, Jun Lv, Huang Huang, Chenxing Zhong, Qiming Dai, Shenghui Gu\n\nOur group’s comments are as follows:\n1. On the whole, there are too many contents to show, only 26 pages is not enough to express so much content, so the author focuses on the description of methods, but this leads to less foreshadowing. If the whole content is written into a book, it will be more complete.\n2. On the whole, the article is conceptually strong, but other citations are less, and the basis is less, It only gives a forward-looking conclusion. Maybe It is better to simplify the existing article framework with a specific case.\n3. There are red wavy lines under the words in some figures, such as the figures on page 16 and 17.\n4. It\'s better to give the differences in the use of grounded theory, such as when to use the traditional grounded theory and when to use the new grounded theory proposed by the paper.',4,'2021-03-12 14:24:13',29,_binary ''),(404,'Title：Socio-Technical Grounded Theory for Software Engineering\nReporter: JunYu Jia\nGroupmembers:Junyu Jia ,Jiaqi Zhang ,Runfeng Mao ,Jiarui Wang , Wei Liu ,Ruihong Liu .Xin Yang .Mengjie Ding .Yifan Zhang .Hao Wang .Peiru Li ,Xue Zhao \nThis paper outlines the Socio-Technical Grounded Theory(STGT) method, a variant of the traditional GT methods. With its unique socio-technical lens, STGT presents philosophical and methodological guidance for studying socio-technical phenomena and theory development in software engineering and related disciplines.\n- The Authors should write more example which use their theory to do some practice\n- In page 25 Line 32 has an format mistake, and like fig 2 has red line on the figure should make some change',4,'2021-03-12 14:47:51',62,_binary ''),(405,'This paper introduces the STGT method, which presents philosophical and methodological guidance for studying socio-technical phenomena and theory development in softwar engineering and related disciplines. The problem with this paper is that some of the pictures are blurry and they don\'t describe every picture.',4,'2021-03-12 15:01:34',72,_binary ''),(406,'Title: Socio-Technical Grounded Theory for Software Engineering\nReporter: Bo Pan\nGroup members:Bohan liu，Changlan fu， Xiaodong liu， Tao yang， Qianwen xu， Fuli zhang， Linzi yedai， Zan gao，Bo pan， Leming zhang， Feimei xie，Wengang liu.\n\nOur group’s comments are as follows:\nThis paper outlines the Socio-Technical Grounded Theory(STGT) method, a variant of the traditional GT methods. With its unique socio-technical lens, STGT presents philosophical and methodological guidance for studying socio-technical phenomena and theory development in software engineering and related disciplines.\n\nOur group’s comments are as follows:\n1. In the abstract part, it mainly introduces the pain points of GT and traditional GT which are not suitable for soft work. But only two sentences are used to explain that the main contribution of this work is to propose STGT method, which provides theoretical and methodological guidance for the development of soft engineering theory and the study of St phenomenon.\n2. The overall structure of the article is just like his abstract, which has spent a lot of time describing the conceptual things of STGT. Like the previous group\'s point of view, the concept is very strong, but the space describing the application aspects and application results of STGT is very small, which is only placed in the sixth and seventh parts at the end of the article.\n3. Our group believes that the author needs to have some powerful cases and evaluation criteria to demonstrate the innovation, correctness and practicability of the work.\n\n\n',4,'2021-03-14 11:12:23',63,_binary ''),(407,'This paper aims to give a comprehensive discussion of AS, discuss what AS is and how to detect and refactor ASs. The main research methods are literature screening and information aggregation.\n\nHere are some small suggestions:\n\n1. Format problem:\n  - In page 2, RQ2 should be in a newline.\n  - In the last paragraph of INTRODUCTION, \"Section ??\" should be given clearly.\n2. Figure problem:\n  - Figure 5 should use a table or vector diagram.',31,'2021-03-19 11:34:29',82,_binary '\0'),(408,'This paper described the concept of Architectural Smells, and approaches and tools for Architectural Smells detection and reconstruction.\n\n- Introduction section: \n  - Looking at GOAL For RQ1, the sentence \" The purpose of this RQ is to understand the performance impactthe causes of ASs and how to describe it\" may be wrong，\'impactthe\' should be \'impact the\'. And the following sentence \"RQ 2: What Architectural Smells have been studied?\" should be a new paragraph.\n  - In the last paragraph,  Some Sections ?? have not be mentioned, should complete them.\n- Table 5 : the secend criteria , \'appropriate\' should be \'appropriately\' ; the fourth criteria, \'evidence\' should be \'evidences\'\n- All tables\' title should be one line and center\n- All figures are fuzzy,  should be replaced with vectorgraph\n- Paper mentions the reconstruction (or refactoring) of ASs，It\'s better to use the same words (reconstruction or refactoring)',31,'2021-03-19 14:23:07',78,_binary '\0'),(409,'Title: A Systematic Literature Review on Understanding the Software Architectural Smells\nReporter: Jiahui Wang\nGroup members: Zijia Jia, Peiyu Hou, Bowen Zheng, Huanlei Chen, Yanze Wang, Jvzheng Zhang, Zeye Zhan, Haoming Li, Huilin Yin\n\nOur group’s comments are as follows:\n\n1. The Objective in the Abstract section of the paper says that the paper \"research and proposed Architectural Smells\", but the whole paper lacks the \"proposed\" part.\n2. Part 5.3 corresponds to the \"three major types of Architectural Smells detection technologies and two reconstruction technologies\" mentioned in the Abstract, but the writing method of 5.3 is not intuitive.\n3. Various research methods are introduced in the introduction section, such as \"Kitchenham\'s guide\", which should be placed in Chapter 3 METHODOLOGY.\n4. In 3.2, some synonyms of \"architecture smile\" are given, but the selection criteria are not given.\n5. Different retrieval sources in Table2 may contain the same paper, so we need to remove duplicates.\n6. The names of figures 1, 2, and 3 are the same, and the table and figure titles are not centered.\n7. Table 7 has many repeated conference names, these need to be aggregated.\n8. The classification basis of SLR is not given in section 5.2(\"such as Interface,Change,Dependency...\")\n9. Figure3 is a big picture, but it is only briefly explained in the article.\n10. The labeling is confusing on the page 10.\n11. Title 6.1 uses the word \"confusing\", which has a subjective feeling. It\'s better to reconsider it.\n12. \"C, Java, C,C++...\" on page 15 may be ambiguous, whether the target of detection is these languages, or the tool itself is developed by these languages. In addition, \"C, Java, C,...\" is repeated.',31,'2021-03-19 16:25:54',29,_binary '\0'),(410,'Title: A Systematic Literature Review on Understanding the Software Architectural Smells\nReporter: Yifan Zhang\nGroup members: Lanxin Yang, Changlan Fu, Yifan Zhang, Hao Wang, Meifei Xie, Fu Pan, Dailinzi Ye, Xiaodong Liu, Qinglong Dong, Zan Gao, Tang Yang, Fuli Zhang\n\nOur group’s comments are as follows:\n1. In the start of abstract, this paper shows the opinion that \"Software Architecture is the foundation of software application\". But this opinion lacks the support of references.\n2. In the context part of the abstract, this paper says that there is a lack of systematic understanding of ASs but ignores the fact that a SLR work has been conducted in the area of ASs Dectecting.\n3. Words like \"publication\", \"research\", \"study\", \"paper\" were used randomly in this paper.\n4. In the conclusion part of abstarct, the word \"research\" is used to refer to different works, which may trouble readers.\n5. In the part of Introduction, the word \"GOAL\" is used to explaion the motivations of RQs. It would be more appropriate to use the word \'MOTIVATION\' instead of \'GOAL\'.\n6.Part of 3.1, this paper says that \"We have no found any SLR related to ASs\", but this sentence conflict the fact.\n7.The title of part 3.2 is \"Data search\". But the title here is better to use term \"Data Study\" especially in the work of SLR.\n8. The search string seems like contains some words that are not directly related to ASs.The explaionation of using this string needs to add in the paper.\n9. The inclusion criteria in Data selection is too ambiguous. Readers could hardly find reason to select these papers.\n10. IEEE Software is referenced in the table 3, this is a magazine.\n11. It\'s better to exchange the two suggestion in order at the end of conclusion.\n',31,'2021-03-19 18:58:43',32,_binary '\0'),(411,'Title: A Systematic Literature Review on Understanding the Software Architectural Smells\nReporter: Ruihong Liu\nGroup members: Wei Liu, Bohan Liu, Kaiwen Song, Qiming Dai, Shenghui Gu, Xin Huang, Zhiying Li, Lingjie Li, Peiru Li, Xue Zhao\n\nOur group’s comments are as follows:\n1.	The quotation format of the name is not accurate (before cite 29 in abstract)\n2.	The statement in the first line of the third paragraph of Introduction is not accurate and a more detailed description may be more appropriate.\n3.	The RQ of the Introduction part is better put in the later part, because the Introduction in the earlier part leads to very little description in the part 3\n4.	The selection of research questions can be reconsidered because the difference between RQ1 and RQ2 is not obvious. The data sources of two RQs are consistent, and the expression differentiation of research questions is relatively low\n5.	In RQ1 line 2 “Figuring out what Ass is is” uses two “use”\n6.	“We use Kitchenham’s guide” should be changed to “guidelines” before cite 8\n7.	The last paragraph of Part 2 should focus on what is different from other work, rather than what you actually did\n8.	Add a flowchart in part3 to introduce the whole process, which will make the article easier to understand\n9.	The descriptions of the two manual searches should be merged into one section\n10.	 Figure1 can occupy a single column and figure2 is more suitable as a table\n11.	In part5, the key answers of the research questions are not clearly expressed. The paper aims at getting the definition and classification through SLR, but the definition and classification description are not clear, which seems to be just a simple mapping\n12.	Figure3 the figure does not match the content\n13.	The discussion is relatively simple, there is no substantive direction for discussion, and a general conclusion should be drawn from multiple RQs instead of each one\n\n',31,'2021-03-19 20:15:16',67,_binary '\0'),(412,'**Title:** A Systematic Literature Review on Understanding the Software Architectural Smells\n**Authors:** Jun Lv, Shanshan Li\n**Reviewers:** Runfeng Mao, Huang Huang, Xin Yang, Jiarui Wang, Junyu Jia, Lemin Zhang, Jiaqi Zhang, Jing Chen, Wengang Liu, Mengjie Ding, Liming Dong\n\n\nThe authors conduct a SLR on Architectural Smells (AS) to explore the status of it in academia. However, we find a systematic mapping study on AS published on JSS 2021, which have same research objective with this study especially RQ3.\n\n**MAIN CONCERNS INCLUDE:**\nABSTRACT: I recommend to rewrite the abstract since the current version is too colloquial.\n\nINTRODUCTION: I recommend to remove the description of RQs to section 3.1.\n\nMETHODOLOGY: \n1.	I think the title of section 3.3 should be “study selection”. Moreover, I am confused about IC1, what is “some form of data about ASs”, you need to elaborate which form of data is available for this SLR.\n2.	Since data synthesis is necessary for SLR, and the researchers pay more and more attention to it in the recent year, I recommend to clarify the data synthesis of this study in detail. For example, a table to illustrate the coding process can be helpful.\n\nANALYSIS AND SYNTHESIS:\n1.	RQ1: Without a solid evidence for your classification, the current answers of RQ1 is suspect. I recommend to elaborate how you get the classification especially form the data synthesis.\n2.	Figure 2 seems useless.\n3.	There are many repeat rows in Table 7, you need to check it.\n4.	The current answer of RQ2 is just some descriptions about different ASs. I recommend to elaborate more about the relationship between Ass and how the academia explore them.\n5.	I recommend to delete RQ3 since there is a systematic mapping study on AS published on JSS 2021, which have same research objective with this study especially RQ3.\n\n**MINOR CORRECTIONS:**\nCITIATION: “[5][6]” should be revised to “[5,6]”. Moreover, it is uncommon to use formal reference and appendix together, if you want to cite studies in appendix, add it to reference will be better.\n\nINTRODUCTION\n1.	I cannot understand what do you want to express through the sentence “Joshua[6] first proposed ASs”.\n2.	A “\\newline” is required before “RQ 2: What Architectural Smells have…”.\n3.	Typos: “Section ??”\n\nANALYSIS AND SYNTHESIS: You need to add a citation to Figure 3.\n',31,'2021-03-21 21:17:49',39,_binary '\0'),(413,'Title: Synthesizing Qualitative Research in Software Engineering: A Critical Review\nAuthors: Xin Huang, Xin Zhou, Huang Huang\n\nSummary:\nThis paper studies the methods of Qualitative Research Synthesis (QRS), including what are the methods of QRS, the use of these methods, understanding, and the influencing factors of method selection. This paper discuss the difference and similarities between the process of QRS methods and further propose a decision tree to help researchers understand QRS methods. This work has a certain research contribution and is meaningful. Some comments are as follows.\n\nComments:\n\n1. Abstract: The method part describes the biased process, which can focus more on the method, for example,  tertiary studies combines email inquired.\n2. The reviewed SLRs were published between 2005 and 2018. It is necessary to supplement the data of recent years until 2020.\n3. Section 5.1: Research question RQ1 is what methods are used in SE to integrate qualitative research and how to use these methods? When answering, each method is described independently, each method is briefly introduced, and the purpose of using the method in the SLR is listed, but there is no answer to how to use this method and the process of using this method. Only a few commonly used methods are mentioned, and there are some other methods that are not fully covered. In addition, you can consider whether these methods can be combined to come up with a commonality as a conclusion.\n4. Figure 4: The data has not been updated, and the total summation in the back does not correspond to the previous number.\n5. Table 5: The meaning of the symbol \"#\" is not clear and can be changed to \"number\".\n6. The font in Figure 6 looks informal, you can adjust it and consider adding some data to enrich it.\n7. \"If your sample size is relatively small, narrative synthesis should be considered as an candidate method.\" In this sentence, \"relatively small\" is more general and can be quantitatively given a certain range or threshold.\n8. Section 7: \"Make-it-up-as-you-go-along may be OK, but then you have to say: ‘I’m making-it-up-as-I-go-along, guys.’ \" This sentence is put here alone, which is a bit abrupt, and the intention is unclear.\n9. Section 7.3: Lines 5-6 of the second paragraph illustrate that the narrative synthesis method is not well used. \"Just copy paste\" is a little straightforward and can be euphemistic.\n\nReporter: Changlan Fu\nGroup Members: Changlan Fu, Dailinzi Ye, Zan Gao, Feimei Xie, Huanlei Chen, Peiyu Hou, Fuli Zhang, Yifan Zhang, Bo Pan, Xiaodong Liu, Qinglong Meng, Mengjie Ding, Peiru Li',32,'2021-03-26 21:26:56',6,_binary '\0'),(414,'Title: Towards a corpus for credibility assessment in software practitioner blog articles\n\nThis paper present a new corpus of almost 20000 sentences, annotated for argumentation and evidence to aid the credibility community.\n\nOur group’s comments are as follows:\n1.The author get blogs from only one practitioner, the data set is not diverse.\n2.In abstract, the result part only contains the f1 value, and the value is not convincing for verification.\n3.There is no need to divided into the introduction part into three part, because the 1.2 and 1.3 are too short.\n4.The table takes up too much space and the format is not uniform.\n5.It\'s not good to put result and discussion together. The result is not outstanding. The author should focus on how to get the result and the conclusion from the result. And discussion should be in a section.\n6.Future research and thread are fairly long, but the contribution of the paper is not enough.\n7.The tag is not enough for identifying quality content, and the process of getting the tag is not illustrated.\n\nReporter: Feimei Xie\nGroup Members: Changlan Fu, Dailinzi Ye, Zan Gao,Changlan Fu, Huanlei Chen, Peiyu Hou, Fuli Zhang, Yifan Zhang, Bo Pan, Xiaodong Liu, Qinglong Meng, Mengjie Ding, Peiru Li',5,'2021-03-26 21:55:18',49,_binary ''),(415,'Title: Synthesizing Qualitative Research in Software Engineering: A Critical Review\nAuthors: Xin Huang, Xin Zhou, Huang Huang\n\nMembers: HaoMing Li, Shenghui Gu, Zhiying Li, Kaiwen Song, Huilin Yin, Yanze Wang, Jiahui Wang, Juzheng Zhang, Zeye Zhan\n\nThis paper studies the application of Qualitative Research Synthesis method in software engineering field through the application of decision tree method.It has certain guiding significance. Here are some questions about this work:\n\n1. There is a format error in Table 1.\n2. Section 4.1 states that the author studied the papers published from 2005 to 2018, but only the data from 2005 to 2015 is shown in Figure 2.\n3. Figure 6 is not shown completely and needs to be adjusted.\n4. The drawing of decision tree in Section 6.2 lacks more evidence support.\n5. The starting year stated in the abstract is 2005, but the starting year stated in Section 6.2 is 2004, which is inconsistent.\n6. The word \"small\" in Section 6.2 is a little vague.\n7. The \"critical\" in the title is not reflected in the passage.\n8. The figures 26 and 34% in section 5.1.1 have no obvious source.',32,'2021-03-26 22:03:07',17,_binary '\0'),(416,'Title: Synthesizing Qualitative Research in Software Engineering: A Critical Review\nAuthors: Xin Huang, Xin Zhou, Huang Huang\nSummary:\nThis paper reviewed the use of QRS methods and found eight QRS methods applied in SE research. This study determines that a significant amount of missing knowledge and incomplete understanding of the defined QRS methods in the community, discuss the difference and similarities between the process of QRS methods and further propose a decision tree to help re- searchers understand QRS methods. \n\nHere are some of our comments\n1.	A few changes to the title may be better to show the difference from the previous conference paper\n2.	The cited papers are published from 2005 to 2018, it might be better to expand the citation of papers after 2018\n3.	In the abstract or introduction section, you should mention the previous work as well as the new work\n4.	The value of this paper may be better highlighted by adding the changes in software developers\' perceptions of QRS method before and after the publication of the conference paper\n5.	The title of 7.1 7.2 7.3 may give rise to ambiguity\n6.	The connection between the decision tree and the results derived from the previous paper is not obvious\n7.	Table1 has formatting issues\n8.	In figure3, it might be better to show the number or the percentage (not all) of papers in parentheses\n9.	The meaning of the dark blue color in figure4 is not explained\n10.	In part 6.2 line 2 punctuation problems\n11.	The position of figure6 is not centered \nReporter: Ruihong Liu\nGroup Members: Wei Liu, Lanxin Yang, Chenxin Zhong, Jun lv, Runfeng Mao, Xin Yang, Qiming Dai, Zijia Jia\n',32,'2021-03-27 12:33:11',67,_binary '\0'),(417,'Title: Towards a corpus for credibility assessment in software practitioner blog articles\n\nThis paper present a corpus labelled for argumentation and evidence to aid the credibility community and trained a model based on this dataset with InferSent and LinearSVM, which achieves an F1-score of 0.64 and could help future research on detecting the credibility of gray literature.\n\nOur group’s comments are as follows:\n\n1. The overall logic of the paper is a bit strange; it does not seem to be common sense to assess the credibility of the grey literature by constructing a corpus.\n2. The dataset for the paper\'s experiments is not credible; first, the dataset uses only one person\'s blog, and this person\'s blog is only relatively active from 2000-2012; second, the content of the blog is rather fragmented; third, the dataset is labeled by students, who may be insufficient in terms of experience and expertise.\n3. The authors are too optimistic about the results of the paper. From the experimental results, it seems to be inconsistent with the authors\' description in the conclusion in the abstract.\n4. In 3.1, the authors\' description of the reasons for the adoption of the dataset is reluctant.\n\nReporter: Jiaqi Zhang\nGroup Members: Liming Dong, Bohan Liu, Tao Yang, Junyu Jia, Lemin Zhang, Lingjie Li, Xue Zhao, Jiarui Wang, Xiudi Chen, Jing Chen',5,'2021-03-28 21:51:28',66,_binary ''),(418,'Title: Synthesizing Qualitative Research in Software Engineering: A Critical Review\nAuthors: Xin Huang, Xin Zhou, Huang Huang\n\nSummary:\nThis paper reviewed the methods of Qualitative Research Synthesis (QRS) in SLR. This paper discuss the difference and similarities between the process of QRS methods and proposed a decision tree to help researchers understand QRS methods. \n\nOur group’s comments are as follows:\n1. In the Conclusions section of the Abstract, we believe that the verb \"determines\" is too arbitrary to be used here; furthermore, the logical relationship between the three conclusions is insufficient.\n2. In the second paragraph of the Introduction, there is too little evidence for \"much confusion\".\n3. The fourth paragraph of the Introduction, like the first point, has a weak logical relationship to the introduction of the contribution.\n4. The first sentence of the second paragraph of the second part of Qualitative Synthesis Methods is too short on relevant work.\n5. Fig2 needs to be updated.\n6. Some typographical problems.\n7. Consider reducing the use of emotive words.\n\nReporter: Jiaqi Zhang\nGroup Members: Liming Dong, Bohan Liu, Tao Yang, Junyu Jia, Lemin Zhang, Lingjie Li, Xue Zhao, Jiarui Wang, Xiudi Chen, Jing Chen',32,'2021-03-28 21:58:05',66,_binary '\0'),(419,'Title:Towards a corpus for credibility assessment in software practitioner blog articles\nThis paper presents a corpus labelled for argumentation and evidence to aid the credibility community.\nOur group’s comments are as follows:\n1. In abstract, method only describes the process of labelling and analyzing the corpus, without adding the specific techniques used in training.\n2. The classification method used in the result should be placed in the method.\n3. The introduction mentioned that there are a lot of researches on grey literature, and then introduced the relevant content of credibility, but it did not explain how blogs are used in the research on grey literature, and why blog content is chosen to build corpus.\n4. The reasons given in 3.1 for selecting this blog to build the corpus are not convincing enough, and the representativeness and universality of this blog are not strong enough.\n5. 3.2 \"Pattern\" method is used for text extraction. This paper only gives the source code link, but does not introduce the principle of the method and why this method is chosen.\n6. Section 4 only introduces several classification methods, but does not introduce how to apply them in specific research work, and what is the complete process.\n7. Section 5 simply introduced the results of the classifier without further explanation, and the experimental results were rather pale.\n8. Should a more in-depth elaboration be made on the corpus constructed through blogs and how classification results affect the assessment of the credibility of grey literature.\nReporter:Huilin Yin\nGroup members:Shenghui Gu, Haoming Li, Zeye Zhan, Yanze Wang, Juzheng Zhang, Jiahui Wang, Kanwen Song, Zhiying Li',5,'2021-03-28 22:17:51',58,_binary ''),(420,'#### Conference Paper Review\n##### Paper Title\nTowards a corpus for credibility assessment in software practitioner blog articles\n\n------------------------------------\n##### Comments\nThis paper aims to present a corpus labelled for argumentation and evidence to aid the credibility community. Three annotators label the corpus with a series of conceptual crediblity criteria, reaching an agreement of 0.82(Fleiss\' Kappa).\nSome comments:\n1. In Abstract, Results talks about the results of different training model. However, we think it deviates from the title of this paper and the results of the corpus construction should be discussed here.\n2. It is not necessary to divide the introduction part into three parts because section 1.2 and 1.3 are too short.\n3. The title of this paper refers to blog articles, but the gray literature is discussed in the related work. Therefore, we think the scope is too large.\n4. In the related work, we don\'t see other work about using blog articles to build a corpus.\n5. The title for Section 3 isn\'t appropriate because this section discusses the process of constructing the dataset.\n6. In Section 4, the descriptions of the four traning approaches are not uniform. And except for BERT, the other approaches(KNN, DT, SVM) are a little old now.\n7. Section 5 focuses the discussion on the model results, but we think it should be on the corpus construction.\n\nReporter: Wei Liu\nGroup Members: Ruihong Liu, Xin Yang, Runfeng Mao, Chenxing Zhong, Lanxin Yang, Jun Lv, Zijia Jia, Xin Zhou, Huang Huang, Qiming Dai',5,'2021-03-28 22:28:03',68,_binary ''),(421,'Title: FluentCrypto: Cryptography in Easy Mode\n\nSummary:\nIn order to ease the secure adoption of crypto APIs, bridges the gap between cryptography experts and mainstream developers, this paper developed a fluent API named FluentCrypto to ease the secure and correct adoption of cryptography in the Node.js JavaScript runtime environment and conducted a preliminary user study to evaluate FluentCrypto from different aspects. This work has certain research significance, but there are still some problems. Some comments are as follows.\n\nComments:\n\n1. Abstract: The abstract was written too concisely, resulting in the background of the research, the research method and the process are not clearly introduced.\n2. Introduction: Here is an introduction to FluentCrypto, which is a wrapper for Node.js encryption API, it relaxes developers from crypto concerns. However, it does not introduce the research process of the work itself, how to propose FluentCrypto, and the methods used. These basic theories can be introduced in the introduction.\n3. Introduction: \"Nevertheless, the work presented in this paper is in its preliminary state and further studies are necessary to claim any generalization.\" The sentence before the organizational structure mentions the shortcomings of this paper, which can be said later, and the contributions of this paper can be listed here.\n4. Section 3: Here is a lot of space to describe this encryption example in detail. The example can be mentioned, but it is mainly necessary to describe the research background and motivation in descriptive language.\n5. Section 5: The experiment setup has no basis, only some steps are mentioned.\n6. Section 5.1 The participants: This method is used by developers who lack cryptography knowledge. The participants should be consistent with the developer’s experience, but here is \"None of the participants expressed that they had either no knowledge or expert knowledge in cryptography.\"\n7. The previous claims are two aspects, one is ease of use, and the other is to reduce misuse to prevent information leakage, but here is only the evaluation of ease of use based on the completion time and difficulty of the task, misuse is not involved, and there is no indicator for correct use.\n8. The difficulty level in the experiment is also subjectively given by the participants. There is no basis for whether there is an average value or how to score it.\n9. Section 6: After the research results are given, the conclusions need to be summarized.\n10. Section 6.3 Final remark: The summary and meaning can be placed in the conclusion chapters. The discussion chapters can be added here, and there is still a lot of space for the article.\n11. There are some formatting issues: There is a space in the middle of \"2 324\" without a comma. Some lists have serial numbers and some have not, some serial numbers are on the outside and some are on the inside, and the format is not uniform. There are uppercase and lowercase problems in some places.\n12. There are some typesetting issues: There are too many blank lines above the section 5.2.3.\n\nReporter: Changlan Fu\nGroup Members: Shiqi Zhou, Xueshan Gu, Qinglong Meng, Leming Zhang, Dailinzi Ye, Zan Gao, Feimei Xie, Jiali Chen, Xiaodong Liu, Wengang Liu, Qianwen Xu',6,'2021-04-02 20:56:47',6,_binary ''),(422,'Title: FluentCrypto: Cryptography in Easy Mode\n\nMembers: HaoMing Li, BoHan Liu,HuanLei Chen,PeiYu Hou,ZhiYing Li,KaiWen Song,Tao Yang,HuiLin Yin,JuZheng Zhang,YanZe Wang,ZeYe Zhan,JiaHui Wang\n\nContribution of the paper (problem significance, importance of results, relevance for computer science):\n\nThe main contribution of this paper is to provide a cryptography API for Node.js developers as a task-based solution.To a certain extent, this work reduces the difficulty of using cryptographics-related APIs in the project, so that users who do not know much about information security can easily complete the work related to encryption and decryption.\n\nHowever, there are still some problems of this paper as following:\n\n1. The introduction states that mainstream developers are prone to misuse of the API and expose sensitive data, but the subsequent experiments do not describe how the tool solves the problem of sensitive data exposure.\n\n2. The data of only 8 people are used as the sample data for the study, which seems a little too small, so it should be considered to increase the number of sample data.\n\n3. How to quantify the difficult values in Table 2, 3, 4, etc., is not clear in this paper, so this data value is hard to convince people.\n\n4. The experiment process is not detailed in this paper. The most important thing is that it does not explain whether the participants have enough time between using the two tools, otherwise the experience of using Node.js native API may affect the time taken to use Fluentcrypto.\n\n5. The conclusion of the article says \"Specifically, it helped developers to deliver secure solutions in a shorter time.\"However, as can be seen from the conclusion of the article, for those who have rich knowledge of information security, Fluentcrypto sometimes takes longer to complete the task. This phenomenon should be explained in the article.\n\n6. Section 4.1 of the article states that this article proposes a DSL, and as an obvious contribution it should be reflected in the abstract, otherwise it will be easy for the reader to think that the contribution is just providing an API.\n\n7. In Section 4.1, \"considering the code example in Listing 6 and the constraints in Listing 3Listing 4Listing 5\", the three listings are written side by side in a strange format.\n',6,'2021-04-02 21:52:11',17,_binary ''),(423,'Title: FluentCrypto: Cryptography in Easy Mode\nSummary:\nThis paper developed a fluent API named FluentCrypto to ease the secure and correct adoption of cryptography in the Node.js JavaScript runtime environment. This paper conducted a preliminary user study and found that FluentCrypto is hard to misuse even for developers who lack cryptography knowledge; and compared to the standard Node.js crypto API, it is easier to use for developers and helps them to develop secure solutions in a shorter time.\nComments:\n1.	The introduction part should explain the purpose before the result, but this article does not describe the purpose of developing the tool first.\n2.	This paper mentions the domain-specific language Cryrule but does not introduce it in the introduction section.\n3.	The Introduction section describes in detail the disadvantages of using other encryption tools, but the use of the developed tools FluentCrypto does not completely solve these problems.\n4.	This article should have explained the background and motivation of developing this tool first, and then explain the usage of other tools. But this article reverses this order.\n5.	The description of how to use this tool is too simple in this paper.\n6.	Representation of Figure 1: In figure 1，the first two parts of the figure jointly determine the third part, but the sequential arrangement of parts one, two and three may mislead the reader.\n7.	The usefulness of the figures is not obvious: the tool FluentCrypto is designed to solve the problem of password security, but simply by reading the figures in the paper does not reflect the improved security performance of the tool.\n8.	The description of the procedure of experiment 2 is not specific and rigorous enough\n9.	The validation cannot be based on events and experiments alone, and the practical results do not show the benefits of the tool. The design of the experiment is not accurate enough, for the new tools when the experiment used the documentation to help the experimenter, while the test using the original tool did not mention the use of documentation, from this point alone is not sure whether it is because the documentation to improve the accuracy of encryption.\nReporter: Ruihong Liu\nGroup Members: Lanxin Yang, Xin Zhou, Runfeng Mao, Jun Lv, Zijia Jia, Huang Huang, Bowen Zheng, Xin Yang, Wei Liu, Bo Pan, JiaRui Wang\n\n',6,'2021-04-04 19:11:01',67,_binary ''),(424,'Title: FluentCrypto: Cryptography in Easy Mode\nAuthors: Xin Huang, Xin Zhou, Huang Huang\n\nSummary:\nThis paper provided a cryptography API for Node.js developers. This work reduces the difficulty of using cryptographics-related APIs in the project, so that users who do not know much about information security can easily complete the work related to encryption and decryption.\n\nOur group’s comments are as follows:\n1. The length of the paper is not sufficient. The main text is not more than 10 pages.\n2. The introduction does not present the contribution points very clearly.\n3. The theme of the paper does not seem to fit with the conference.\n4. The trade-off between ease and functionality is not reflected in the paper.\n5. The experiment is based on the subjective evaluation of eight people, the reliability of the conclusions is doubtful, and the results do not seem obvious.\n6. The results of the study are not universally applicable and it is recommended to propose a generic solution.\n7. The fifth line of the second paragraph of the Introduction section, \"2,324\" is problematic.\n\nReporter: Jiaqi Zhang\nGroup Members: Hao Wang, Yifan Zhang, Jing Chen, Peiru Li, Xue Zhao, Lingjie Li, Junyu Jia, Mengjie Ding, Xin Huang',6,'2021-04-04 23:22:45',66,_binary ''),(425,'Title: Overview of Blockchain Cross-chain Technologies\n\nMembers: Junyu Jia, Haoming Li, Juzheng Zhang, Kaiwen Song, Jiarui Wang, Zhiying Li, Peiyu Hou, Shenghui Gu, Jiahui Wang, Zeye Zhan, Xin Huang\n\nContribution of the paper (problem significance, importance of results, relevance for computer science):\n\nIn this paper, authors investigated more than one hundred cross-chain project technical solution from the academic literature, the grey literature, the white paper and so on.Then presented on the general description of the present situation of research in this field, and to the different classification of solution for the lateral comparison, and then meet the technical difficulties in the process of project development of the future research direction is given.\nAt present, there are few cross-chain related articles, and the work of this paper is relatively innovative and meaningful.\n\nHowever, there are some issues in this article that need to be fixed:\n\n1. It is mentioned in the abstract and Section 3.1 of this paper that 131 items of data in this paper come from retrieval. However, as the data source, the source should be further explained in detail, such as what keywords are used for retrieval and how to exclude data that does not meet the requirements.\n\n2. Since this paper has investigated so many cross-chain projects, it is necessary to use a part of the paper to introduce the advantages and disadvantages of each project, so as to serve as a reference for blockchain developers and make the paper more practical.\n\n3. There are some inconsistency of case in this paper, such as Section 2.5 PoW and PoS, the middle \"o\" should be all lowercase, the same problem exists in Table 2, and the format of WASM and WASM should be the same.\n\n4. There are some proper nouns in this paper that are not explained, such as \"BSN\" in the abstract, \"GHOST\" in Section 3.2.1, \"HTLC\" and \"HTLA\" in Section 4.6, and \"BOS\" in Section 4.4, which should be explained simply or given their full names.\n\n5. The order of labels in Fig. 5 and Fig. 6 is disordered and needs to be adjusted.\n\n6. There is a format problem in the table. The space in the two Chinese characters is too large, which can be solved by adjusting word newlines.\n\n7. 4.8 The format of the serial number in section 4.8 is not unified. Some use \"1,\" and some use \"1)\", which should be unified.\n\n8. There is something wrong with the format of the references, and the items in \"Chinese references attached\" and \"references\" cannot correspond,which should need to be adjusted.',33,'2021-04-09 16:08:34',62,_binary '\0'),(426,'Title: State-of-the-Art Review of Cross-chain technologies\nAuthors: Qianwen Xu, Yanze Wang, Shanshan Li\n\nSummary:\nThis paper studied cross-chain technology solutions through analyzing the ideas, characteristics and challenge of existing cross-chain technologies to help understand the current development status and explore the future research directions.\n\nOur group’s comments are as follows:\n1. There are too many technology backgrounds but rare own opinions.\n2. The English title misses an article \"A\" or \"The\".\n3. The first section has no title, introduction?\n4. In the related work of the first section, the format of each work should be consistent: whether there is a year, the author’s name is in Chinese or English, with the full name or only the last name.\n5. In Chinese papers, Chinese should be interpreted in English to be explained. Such as In section 2.4, Lock-in(锁定) should be 锁定(Lock-in).\n6. Some pictures become blurred after zooming in.\n7. The tables do not have English titles, which is included in the template.\n8. In Table 2, a \"-\" is not centered.\n9. Section 4 talks about the four most critical questions, but followed by more than 4 subsections.\n10. The formats of some references are not arranged well, such as the second one.\n\nReporter: Peiru Li\nGroup Members: Lanxin Yang, Lingjie Li, Xue Zhao, Jing Chen, Jiaqi Zhang, Mengjie Ding, Fuli Zhang, Hao Wang, Huanlei Chen',33,'2021-04-09 16:41:52',76,_binary '\0'),(427,'Title: An Empirical Study on the Usage and Evolution of Identifier Styles in Practice\n\nSummary:\nIdentifiers play an important role in helping developers comprehend and maintain source code. However, the usage and evolution of identifier styles have not been fully explored. This paper conducted an empirical study on 9,792 GitHub projects to gain some insights into these problems. This work has a certain workload, but there are still some problems. Some comments are as follows.\n\nComments:\n\n1. Abstract: \"Questions like these are important\" why these issues are important? The purpose and motivation of the usage and evolution of the identifier style of this research is not clear.\n2. Abstract: \"Our empirical results achieved some interesting findings. For example---\" The research results and conclusions did not cover all the previous research questions. The two most important points: what kind of impact the use of identifier styles will have on software development, and how the identifier styles will evolve, are not given in the results, especially for the impact of not answering led to the failure to reflect the meaning of this work. \"Our study provided some hints for developers when using specific identifier styles in their identifier-related activities.\" This hints also needs to be linked to the influence of the use of the identifier style, which is related to the necessity and meaning of this hints. The text of the paper does not give this hints.\n3. INTRODUCTION: The first point and the second point of contribution are actually one point, and the two are inclusive (overall and subdivision) relationships. The organization structure of the article is not listed.\n4. EXPERIMENTAL SETUP: The experimental setting currently only has target items and research questions, and needs to include experimental steps, process, indicators, hypotheses, comparisons, etc. The research question only needs to list the research question, and the steps and evaluation indicators in it should be placed in the experimental design and indicators respectively. RQ3 and RQ5 should be put together, they both talk about evolution.\n5. EXPERIMENTAL RESULTS: In the answer to RQ1, here are five forms that developers follow to define identifiers with this style and their respective proportions. The result report is relatively straightforward, and the analysis process and evidence support are somewhat lacking.\n6. Finding 2: \"camel case style appear to have a higher popularity and a larger code-scale than those projects with the snake case and other styles\". The word \"appear to\" in the second discovery is used here to indicate that the discovery is uncertain, so it cannot be regarded as a discovery.\n7. The scale of figure 5 is different, it should be explained.\n8. Finding 4: On average, the changed identifiers directly involve 6.52% of the source files. This means that a lot of modification operations are required to propagate style changes.\nThe research question is what are the potential impacts of the identifier style change? The answer is too superficial, only that a lot of changes are needed, but it does not actually answer what are the \"potential\" impacts.\n9. Generally speaking, this paper is not an experimental empirical research. It is a bit similar to SLR. The data of SLR is literature, and the execution process of SLR is based on. The data here is projects, and the execution process is not based on strong. A bit subjective and general.\nAfter reading, we didn\'t see what we wanted to see, and we wanted to see the influence of the naming method on the evolution and development speed of the project.\n\nReporter: Changlan Fu\nGroup Members: Bowen Zheng, Dailinzi Ye, Feimei Xie, Zan Gao, Xueshan Gu, Qinglong Meng, Bo Pan, Jiali Chen, Bohan Liu, Shiqi Zhou, Xiudi Chen, Wengang Liu, Leming Zhang',7,'2021-04-09 17:12:37',6,_binary ''),(428,'Title: 区块链跨链技术综述 \nAuthors: Qianwen Xu, Yanze Wang, Shanshan Li\n\nSummary:\nThis paper proposes research and research on cross-chain technology solutions, and analyzes the ideas, characteristics and challenges of the existing blockchain cross-chain technology. This paper retrieved 131 academic documents or grey documents corresponding to cross-chain technology solutions, pointed out the overall description of the current situation, and compared the solutions under different categories, so as to propose the technical difficulties encountered in the project development process. Suggestions for future research directions. This work is meaningful. Some comments are as follows.\n\nComments:\n\n1. The paper is written from the related work, it is better to write from the background.\n2. In the organization structure of the paper, \"Section 3 introduces the research method and process of this article\" did not see the research problem behind it. The latter is actually written according to the development research status and project comparison, which is different from the previous one. \"The fourth section answers three research questions\" but the fourth section introduces four challenges.\n3. Section 2 Cross-chain mechanism: The application scenarios of each type of cross-chain mechanism are not introduced.\n4. Figure 3: Each icon is not introduced.\n5. Figure 6 is in front of figure 5, figure 5 is not explained.\n6. The line spacing in section 2.5 is a bit large and inconsistent.\n7. Several \"POW\" are inconsistent.\n8. The format of the first paragraph of section 3.1 is different.\n9. Section 4: \"Statistics are shown in Figure 4-1\". However, the figure below the figure is marked as Figure 10. What is written in the paper is \"summarizing the four most critical issues in cross-chain technology\", but what the paper said earlier is the three issues.\n10. References: The format needs to be more compact. According to the format of the Journal of Software, Chinese references should be written in English, and the corresponding Chinese referencesand serial numbers should be listed in the attached Chinese references.\n Generally, the organizational structure needs to be adjusted, the format needs to be standardized, the capitalization needs to be unified, and the typesetting needs to be standardized.\n\nReporter: Changlan Fu\nGroup Members: Bowen Zheng, Dailinzi Ye, Feimei Xie, Zan Gao, Xueshan Gu, Qinglong Meng, Bo Pan, Jiali Chen, Bohan Liu, Shiqi Zhou, Xiudi Chen, Wengang Liu, Leming Zhang',33,'2021-04-09 17:56:31',6,_binary '\0'),(429,'Title：An Empirical Study on the Usage and Evolution of Identifier Styles in Practice\n\nMembers: Haoming Li, Junyu Jia, Juzheng Zhang, Kaiwen Song, Jiarui Wang, Zhiying Li, Peiyu Hou, Shenghui Gu, Jiahui Wang, Zeye Zhan, Xin Huang\n\n In this paper,authors conducted an empirical study on 9,792 GitHub projects to gain some insights into these problems. Specifically,they first analyzed how different identifier styles were formed within five categories of identifiers, including methodnames, variable names, etc. Then, they studied the correlations between the usage of identifier styles and the main characteristics of projects. Next, they explored the change patterns of identifier styles along with the project evolution.Finally, they investigated the potential impacts as well as categories of identifier style-changes. Their empirical resultsachieved some interesting findings. Their study provided some hints for developers when using specific identifier styles in their identifier-related activities.\n\n1. The whole paper only selects java project, the conclusion is obviously not rich enough, and if only studies java project, it should be reflected in the abstract.\n2. In the first paragraph of the second page, it is mentioned that there are two typical combination styles. However, there is no detailed explanation for the other style mentioned later, and the other style appears many times later, so we should give a good explanation.\n3. The second paragraph of the second page is \"questions like these are important but have not been fully answered by researchers yet.\" at the same time, the conclusion in the sixth section is a little short, which shows that the author may exaggerate his own contribution.\n4. Many statistical data are listed in Table 1, but no clear explanation is given later.\n5. In RQ, the experimental design and experimental process of each RQ are mixed together for writing, which is not well split, leading to unclear structure. At the same time, for rq4, the experimental design can not get the answer the author wants.\n6. For the validity in Section 4.2, a conclusion validity is missing',7,'2021-04-09 17:59:16',17,_binary ''),(430,'Title: 区块链跨链技术综述\nAuthors: Qianwen Xu, Yanze Wang, Shanshan Li\nSummary:\nThis paper retrieved 131 academic or gray literature (technical reports, white papers, etc.) on cross-chain technology solutions, gave a general description of the current state of affairs, and made a cross-sectional comparison of the solutions under different categories. This paper alsp suggested future research directions for the technical difficulties encountered during project development.\nOur group’s comments are as follow:\n1.	The abstract part should contain the results and conclusions. But in this paper, the abstract only contains the results, describes the horizontal comparison, but does not describe the results of the horizontal comparison, nor the conclusions drawn by comparing the results\n2.	Organizational issues in the paper (the introduction of cross-chain technology in the first part will make this paper like a technical document)\n3.	The use of descriptions such as \"this paper thinks\" makes the paper less precise\n4.	The method of classifying cross-chain mechanisms is not clearly based \n5.	The formatting of the front part of the paper is different from the back part (including the formatting of the tables), where the line spacing in part 3.1 suddenly becomes larger\n6.	The paper\'s explanation and depiction of the same term is inconsistent\n7.	An explanation of a Chinese term should be followed by parentheses and a note in English, not the other way around\n8.	The same English word should not be used in the interpretation of multiple terms(such as token)\n9.	A large number of figures in the paper are not explained\n10.	For figure 10 reference is “4-1”\n11.	There is no need for multiple explanations of the same terms\n\n\nReporter: Ruihong Liu\nGroup Members: Runfeng Mao, Xin Yang, Liming Dong, Wei Liu, Jun Lv, Zijia Jia, Huilin Yin, Huang Huang, Qiming Dai, Chenxin Zhong\n\n',33,'2021-04-11 13:12:13',67,_binary '\0'),(431,'Title: An Empirical Study on the Usage and Evolution of Identifier Styles in Practice\n\nSummary: \nIdentifiers play an important role in helping developers comprehend and maintain source code. In this paper, the authors conducted an empirical study on 9792 GitHub projects to gain some insights into some problems about the usage and evolution of identifier styles. Their empirical results achieved some interesting findings. Their study provided some hints for developers when using specific identifier styles in their identifier-related activites.\n\nComments:\n1. Abstract: \'Our empirical results achieved some interesting findings. For example...\'. We think it is not appropriate to use \'For example\' in the abstract to describe the findings of the study.\n2. This paper only selected Java projects, but the identifiers are not unique to Java projects. Therefore, the conclusion is obviously not adequent.\n3. The authors claimed that they conducted some experiments, however, the detailed design and steps of these experiments are not clearly given in this paper.\n4. In Section 2, although 9792 projects were selected, except for the experiments about RQ1, the other experiments only selected a small amount of data from them.\n5. RQ3 discusses how does identifier style change along with the project evolution, but no criteria for identifier style changes are given in RQ3.\n6. We are confused about the meaning of Fig.1 and Fig.2. It seems hard to draw meaningful conclusions from them.\n\nReporter: Wei Liu\nGroup Members: Runfeng Mao, Xin Yang, Liming Dong, Ruihong Liu, Jun Lv, Zijia Jia, Huilin Yin, Huang Huang, Qiming Dai',7,'2021-04-11 23:06:30',68,_binary ''),(432,'Title: An Empirical Study on the Usage and Evolution of Identifier Styles in Practice\n\nSummary:\nIdentifiers play an important role in helping developers comprehend and maintain source code. However, the usage and evolution of identifier styles have not been fully explored. This paper conducted an empirical study on 9,792 GitHub projects to gain some insights into these problems.\n\nOur group’s comments are as follows:\n1. The format of the paper does not meet the requirements of EASE, including font, font size, etc.\n2. Incomplete structure of the paper as an empirical study, e.g. no related work, no introduction to the research methodology, etc.\n3. RQs have no recursive logic.\n4. Findings only found some phenomena, no in-depth exploration of the phenomena.\n\nReporter: Jiaqi Zhang\nGroup Members: Peiru Li, Lanxin Yang, Lingjie Li, Xue Zhao, Jing Chen, Jiaqi Zhang, Mengjie Ding, Fuli Zhang, Hao Wang, Huanlei Chen',7,'2021-04-11 23:28:54',66,_binary ''),(433,'Title：Evaluating the Impact of Predictors on Continuous Integration Process: A Discrete-Event Simulation Approach\n\nMembers: Haoming Li, Huilin Yin, Lanxin Yang, Xin Zhou, Huanlei Chen, Zeye Zhan, Juzheng Zhang, Jiahui Wang, Yanze Wang\n\nIn this paper, the author uses the discrete event simulation method to predict the result information of continuous integration, which is helpful for developers to save time.This work is obviously significant and relatively new. However, there are still some problems. The specific review opinions are as follows.\n\n1.The current paper template is ACM template, which needs to be changed to IEEE template.\n\n2.Additional links in the paper can retrieve information such as the author\'s name and school and may cause rejection.\n\n3.As a A class paper, two RQs will appear to be A little insufficient workload, so it is suggested to add another RQ.\n\n4.There\'s the word \"approach\" in the title, but \"Results\" and \"Conclusion\" in the summary don\'t say anything about \"approach\".\n\n5.In stating RQ2 and answering RQ2, there seems to be a mismatch of concerns.\n\n6.The data sources in Table 3 are somewhat dated, which may affect the timeliness of the article.\n\n7.Some overlap occurs in Figure 3 and needs to be adjusted to eliminate the overlap.\n\n8.There are some grammatical errors in the article, such as not using connectives at the beginning of the paragraph, which should be corrected by polishing.\n',34,'2021-04-16 18:57:49',17,_binary '\0'),(434,'Title: Evaluating the Impact of Predictors on Continuous Integration Process: A Discrete-Event Simulation Approach\n\nThis study presents a novel approach to evaluating the impact of predictors on the CI process using SPS technique. The authors developed a DES model to simulate the CI process with and without predictive CI, which can help researchers to holistically evaluate the value of predictive CI more practically from the perspective of CI process.\n\nHere are several comments:\n\n- In the Abstract, there is a redundant expression, \"To fill the gap, we aim to...\"\n- There are several evaluation metrics listed in Table 2, but the authors only focused on the Recall of predicting failed/passed in RQ1. The reason should be clarified in the explanation of RQ1.\n- In Table 2, the term \"Recall of failed/passed\" can be replaced by terms \"Sensitivity and Specificity\", since it is a binary classification test.\n- The term \"cost\" in RQ2 can be replaced by term \"time\", since time is the only one cost mentioned in the following sections.\n- \"CONTINUOUS INTERGATION\" and \"CI\" should be unified in titles, for example, Section 4 and Section 5.\n- The content of Section 4 should be placed before the Methodology section, since it is more like a background or related work.\n- The data set listed in Table 3 seems to be outdated. Are they able to represent CI process of current software projects.\n- In line 671, three percentages were given, but the reason that 0%, 50%, 100% were chosen are not clear, which needs more explanation.\n',34,'2021-04-16 21:11:03',3,_binary '\0'),(435,'Title: Evaluating the Impact of Predictors on Continuous Integration Process: A Discrete-Event Simulation Approach\n\nSummary:\nThis paper conducts simulation experiments to evaluate the impact of predictors on the CI process using a Discrete-Event Simulation (DES) model calibrated by real CI data from projects in Github. This work has a certain research contribution and is meaningful. Some comments are as follows.\n\nComments:\n\n1. ABSTRACT: Research significance can be added to the Conclusion section.\n2. INTRODUCTION: Can introduce the discrete event simulation model and use the discrete event simulation model to simulate the relevant background of the CI process.\n3. Organization structure can be listed.\n4. Section 3.3: Why use these indicators and the basis for using these indicators.\n5. Section 4: Prediction CI introduces some conceptual things, which can be put in the second section, and the results should be introduced here.\n6. Figure 2: Three branches, the middle one has no conditions and can be drawn in a diamond shape.\n7. Figure 3: Only the first one has the middle piece, and the others do not. If it is placed in the middle, it can be placed next to it.\n8. \"Besides, the proportion of failed is at a low level [10, 32] for most projects.\" Putting after the name or at the end of the sentence, it is not appropriate to put in the middle. \"ECDFD has a greater impact on the sensitivity of cost to 𝑅𝑓 than on the sensitivity of cost to 𝑅𝑝.\" The letters in this sentence are not bold.\n\n\nReporter: Changlan Fu\nGroup Members: Shiqi Zhou, Qinglong Meng, Feimei Xie, Jiali Chen, Dailinzi Ye, Wengang Liu, Tao Yang, Kaiwen Song, Zhiying Li, Xiaodong Liu, Ruihong Liu, Wei Liu',34,'2021-04-16 21:38:35',6,_binary '\0'),(436,'Title: Evaluating the Impact of Predictors on Continuous Integration Process: A Discrete-Event Simulation Approach\n\nComments:\n1、The content of the fourth section is quite abrupt and not related to the third and second sections, so it is suggested to integrate it into the introduction\n2、The judgment logic of Predict to Queue in Figure 2 is not clearly written\nReporter: Jiarui Wang\nGroup Members: Chenxin Zhong, Runfeng Mao, Bo Pan, Jiazi Jia, Bowen Zhen, Huang Huang, Xi Yang',34,'2021-04-18 23:25:51',65,_binary '\0'),(437,'**A Practitioner’s Perspective on Impacts, Causes, andSolutions of Architectural Smells in Microservices**\nICSME \nChenxing Zhong,Huanghuang\nThis paper discussed the impacts, causes and solutions of AS(Architecture Smell) in Miscroservices by a mix-method data collection approach. There are some comments in detail:\n\n1.The title should in consistence with the description in paper, i.e. ‘xxx in Microservices’ or ‘xxx in MSA’.\n2.What are the differences of three steps of data collection methods? In questions or results?\n3.The new finding in Fig3 can highlight and claim it\n4.The ‘constraints’ in RQ3 might proper to discuss in Section Discussion.\n5.The title of Section V-A used the ‘xxx Scalability’, however, the discussion of this subsection did not explain too much about ‘Scalability’.\n6.The authors need claims the granularity of ICSASM framework in introduction. \n\nGroup Members：Liming Dong, Xin Zhou, Zijia Jia, Runfeng Mao, Jun Lv, Qiming Dai',35,'2021-04-23 10:40:26',33,_binary '\0'),(438,'This article explains the goals, objects, effects, etc. of an enterprise in an activity called off-site review. The study used a variety of research methods such as interviews, data analysis, and questionnaires to study off-site reviews. Overall, we believe that the study has some problems can be improved:\n\nContent structure issues:\n\n1. Explain the necessity of off-site.\n2. 5.1 and 5.2 should list more data and evidence.\n3. The insummary in the box can be replaced.\n4. Should it be compared with on-site?\n5. 6.2.2 Suggestions on on-site reivew may not be appropriate.\n\nSyntax diagram problem:\n\n1. The first sentence is a bit weird.\n2. What is the process after off-site?\n3. What is the difference between testing and post-deployment off-site review?\n4. There is a problem with the order of figure 2.\n5. 6.1 should be best practices.\n6. figure 7\'s title is a bit confused',36,'2021-04-23 11:23:41',43,_binary '\0'),(439,'Off-site Review: A Practice to Enhance Code Reviews\nFSE\nLanxin Yang,Fuli Zhang\nThis case study aims to empirically in vestigate off-site review by its origins, implementations, outputs, experience and lessons learned, and additionally, to recommend suggestions for improvement. A mix-method strategy that consists of archive analysis, questionnaire survey and focus interview was employed to understand the up-to-date off-site review practice. There are some comments in detail:\n\n1.In Figure 3, there are some problems in the expression of ‘Focus Interview’. The icons for ‘Research Questions’ and ‘Questionnaire’ should be different.\n2.Introduce the reasons for doing research on ‘On-site Reviews’.\n3.Figure 6 should be interpreted in addition to the data.\n4.Whether the legend in Figure 7 is arranged in proper order. It can be arranged in ascending order.\n5.RQ3\'s definition of target is very broad. It seems that 100% of the projects will be selected by this definition. Think about what won\'t be the target.\n\nGroup Members：Liming Dong, Xin Zhou, Zijia Jia, Runfeng Mao, Jun Lv, Qiming Dai, Yanze Wang, Kaiwen Song, Xue Zhao, Peiru Li',36,'2021-04-23 13:31:16',77,_binary '\0'),(440,'Title：A Practitioner’s Perspective on Impacts, Causes, and Solutions of Architectural Smells in Microservices\n\nMembers: Haoming Li, Yanze Wang, Shenghui Gu, Fuli Zhang, Lanxin Yang, Kaiwen Song, Zhiying Li, Huanlei Chen, Peiyu Hou, Xin Huang\n\nIn this paper, the problem of architecture odor in software maintenance is explored and the grounded theory is used to conduct data analysis and form a set of framework to analyze the causes and solve the problem. This work is obviously significant and relatively new. However, there are still some problems. The specific review opinions are as follows.\n\n1.In this article, architecture smell, design, and maintainability are all mentioned, but how they are related is not well explained.\n2.There is the word \"extra\" in the abstract, and when you look at the word it is easy to ask what is the main complexity in the architecture design.\n3.The abstract states that little attention has been paid to the effects and causes of architectural smell that make this work challenging, but in fact this should not be the motivation for this article. \n4.This article analyzes the problem from a practitioner\'s perspective. But it does not explain why the problem should be analyzed from this perspective rather than from an academic perspective.\n5.Six representative architectural odors were selected for the study, but there is no explanation of why they were chosen.\n6.As a reading material for readers with certain research experience, too much space is spent in the abstract to popularize MSA and AS.\n7.At the end of the first chapter there is a brief introduction to each of the other chapters, but the sixth chapter is missing.\n8.There may be some spelling mistakes in the text, such as \"change-proness\" misspelled as \"change-proness\" in part C of section 2.\n',35,'2021-04-23 14:57:32',17,_binary '\0'),(441,'Title: A Practitioner’s Perspective on Impacts, Causes, and Solutions of Architectural Smells in Microservices\n\nSummary:\nIn order to support improving architecture design for MSA and improve architecture design in MSA context. This study conducted a mix-method to investigate six ASes in an international information and communication technology company.  This paper proposed a framework namely Impacts, Causes, and Solutions of Architectural Smells in Microservices (ICSASM), that covers the three concerns. This work has a certain research contribution and is meaningful. Some comments are as follows.\n\nComments:\n\n1. Organizational structure in INTRODUCTION: Section VII written after Section V. It should be Section VI.\n\"directly related in our result to a specific type of ASes, namely MV.\" The MV in this sentence is in italics, and the MV in other places is not in italics.\n2. Revised Question List: The questionnaire needs to be given.\n3. The third section of the research method: \"Descriptive statistics together with Grounded theory were employed.\" Why combine these two methods, there are many methods of data analysis and synthesis, and why choose Grounded theory.\n4. TABLE II: The experience of most people is greater than 10, and one of them is larger than 2 and some are less than 2. This is the reason for this arrangement.\n5. Figure 3: This paper only talked about one company. Considering the universality of this framework, it should come from multiple companies. The framework should include things from multiple companies instead of a single company. The distribution of personnel also needs to involve multiple companies.\n6. The answers to RQ2 and RQ3 should be analyzed and indirectly answered in addition to surveys. The result is not well integrated with the method. The results are reported directly after the method is written. The results need to reflect the analysis details and enhance the basis.\nThe display of the results is a bit biased towards the textual listing, can see if it can be further sublimated.\n\nReporter: Changlan Fu\nGroup Members: Shiqi Zhou, Xueshan Gu, Feimei Xie, Jiali Chen, Qianwen Xu, Zan Gao, Wengang Liu, Xiaodong Liu, Peiru Li, Xue Zhao',35,'2021-04-23 17:57:03',6,_binary '\0'),(442,'Title: Off-site Review: A Practice to Enhance Code Reviews\n\nSummary:\nBy employing long-term observations and a mix-method study strategy, this study has investigated one of up-to-date software process improvement practices and reports off-site review that an enhancement of general code reviews, including its origins, targets, implementations and outputs. This work has a certain research contribution and is meaningful. Some comments are as follows.\n\nComments:\n\n1. Abstract: \"both on-site reviews and off-site reviews themselves.\" The title, research question, and main part of the article are all researching off-site reviews, but there are several descriptions (discoveries, conclusions, contributions, opinions) including on-site reviews.\n2. Section 3: PRELIMINARY: PRACTICE BRIEF: This part mainly introduces participants and activities in off-site reviews. If there is no special need, can be put in the introduction.\n3. Figure 3: The data collection part in the middle can be framed.\n4. The RQ column is more detailed. RQ3 and RQ4 anomalies and comments can be grouped into one. Comments are not very accurate as research questions. The following explanation for it is \"what they said\", which can be used as a way instead of research questions. Through comments and what they said to answer research questions.\n5. Section4.3.1 Archive Analysis: This method is not used a lot, can add explanations and references.\n6. 5.1.3 The last sentence of the conclusion is an executive\'s statement. 5.1.4 The last sentence of the conclusion is that an interviewee said that he prefers interviews, but does the research method use a mixed method, or that different RQs use different methods, this Need to say.\n7. Figure 7: The title and content of the figure are not very consistent. The title refers to the feelings of the reviewer. The figure shows some data ratios.\n8. Line 761 \"them involved in off-site reviews mainly because of cross-departmental communication and education needs.\" In this sentence, the \"tal\" in \"departmental\" comes out.\n\nReporter: Changlan Fu\nGroup Members: Shiqi Zhou, Xueshan Gu, Feimei Xie, Jiali Chen, Qianwen Xu, Zan Gao, Wengang Liu, Xiaodong Liu',36,'2021-04-23 18:51:28',6,_binary '\0'),(443,'Title：DevOps and Microservices in Software Teams: A Cross-Company Ethnographic Study\n1、This research is based on the industry, and is an immersion research, but there is no quantitative content, but qualitative content.\n2、In this paper, only one RQ is proposed and at least two RQs are suggested.\n3、The RQ proposed in this paper is a bit broad, and industry participants may want to see some practical things, such as the way Devops and microservices are used in several companies, the delivery cycle, the common problems and so on.\n4、Are industrial researchers also practitioners?\n5、Are the pains displayed in this paper not previously discovered by company participants? Can it be solved now? If it can\'t be solved, it means less.\n6、The title of this paper naturally makes readers think that Devops and microservices are related, but section 4.4 says \"weak correlation between Devops and microservices in software teams\" makes readers disappointed.\nReporter: Xueshan Gu\nGroup Members:Lanxin Yang,Xiaodong Liu,Qianwen Xu,Xueshan Gu,Wengang Liu,Bowen Zheng,Qinglong Meng,Tao Yang,Jiali Chen',37,'2021-04-30 15:43:30',46,_binary '\0'),(444,'Some comments are as follows:\n1. In the Introduction part, the authors introduce Microservices architecture at first, but in the Background part, the authors mention the content of microservices at the end. So we think there is a problem with the order of organization.\n2. The title of this paper indicates that this paper is an industrial paper, but the fourth part of this paper is academic research, which should not occupy lots of space and should be divided into preparatory work. Besides, the first point of this paper\'s contributions is also from an academic perspective.\n3. The line chart is mainly used to show the changing trend of the data, and the chart in section 6.1 only aims to show the statistical results of different microservices, so we think it is not appropriate to use the line chart.\n4. There are also some issues about formatting and wording, such as in line 734 and 750 \"Section ??\" and in line 36 the word \"discovering\" is not suitable.\n组内成员：杨岚心、刘晓东、胥倩雯、顾雪珊、刘文港、郑博文、孟庆龙、杨涛、周世旗、陈佳丽\n',38,'2021-04-30 16:42:04',73,_binary '\0'),(445,'Title: DevOps and Microservices in Software Teams: A Cross-Company Ethnographic Study\n\nSummary:\nThis paper reports the ethnographic study that combines participant observation and interviews to investigates the adoption and effects of DevOps and microservices in real software teams. This work has a certain research contribution and is meaningful. Some comments are as follows.\n\nComments:\n\n1. ABSTRACT: Because devops and microservices are relatively new and efficient implementation, research is conducted on them, and the research motivation for devops and microservices is not enough.\n2. The Conclusion part only includes the meaning and does not include the research conclusion.\n3. INTRODUCTION: The description of the contribution only mentions it is helpful for a comprehensive understanding. The paper actually gives suggestions, but does not mention it.\n4. Section 3.3: No explanation for \"The triangulation of data collection\".\n5. Section 4: The answer to the research question in the result is not very straightforward and needs to be highlighted. Table 3 can be expanded into a summary of the RQ answer. In addition, the relationship between the three and the reaction can be added. \n6. The boundary of the discussion is not clear. The current chapter can be directly the result of the research method combined with the analysis. You can explain the reasons for putting it together, explain it, or take it out separately.\n\nGroup Members: Changlan Fu, Jing Chen, Dailinzi Ye, Feimei Xie, Zan Gao, Jiaqi Zhang, Yifan Zhang, Xiudi Chen, Mengjie Ding, Hao Wang, Peiru Li, Xue Zhao',37,'2021-05-01 22:51:10',6,_binary '\0'),(446,'Title: Identifying and Detecting Architectural Smells in Microservices: An Industrial Experience Report\n\nSummary:\nThis paper leverages prior research to identify and detect Architectural Smell (AS) in microservices-based systems, with the aim of discovering such architectural issues. This paper encountered many challenges that were not reported in prior research when identifying and detecting ASes in the industrial microservices system. This work has a certain research contribution and is meaningful. Some comments are as follows.\n\nComments:\n\n1. ABSTRACT:This part mentions a lot of previous research. It would be better to focus on this research. It can be reflected that this research is based on the collection, screening, and judgment of previous studies to determine and form several suitable architectural smell and detections method.\n2. Related work: Can look at whether there are research reports on the challenges and solutions of architecture smell , especially whether the several architecture smell and detection methods finally determined in this paper are used in industrial cases when they are proposed, and the application process is reported. If there are any challenges in this paper, it can be compared with the application in the microservice environment of this article. If there are none, it would be better to talk about it.\n3. Some lessons such as lesson1 are more special and superficial.\n4. Chapter 4 and Chapter 5 are the same in structure. In the front, we need to show the difference between the two, which is to identify and detect architectural smell.\n5. Section 5.2: This is from challenge5, but they are not the same thing. The challenge and lessons in front of this are for identification, and here is for detection.\nAccording to the title, they are a combined theme, but the content is divided. \n6. There are some formatting issues: Section ??.\n\nGroup Members: Changlan Fu, Jing Chen, Dailinzi Ye, Feimei Xie, Zan Gao, Jiaqi Zhang, Yifan Zhang, Xiudi Chen, Mengjie Ding, Hao Wang, Peiru Li, Xue Zhao',38,'2021-04-30 19:58:54',6,_binary '\0'),(447,'Title: DevOps and Microservices in Software Teams: A Cross-Company Ethnographic Study\n\nThis paper conducted an ethnographic study that combines participant observation and interviews to investigates the adoption and effects of DevOps and microservices in real software teams. The structure of this paper is clear and several lessons are presented for both practitioners and researchers.\n\nHere are several comments:\n\n- In the introduction, the reason why you studied both DevOps and Microservices is not clear. “Both DevOps and microservices have received an increasing attention from researchers and practitioners over the past decade”, it is not a strong enough motivation to conduct this work. It seems reasonable in terms of the content of this paper when you only study DevOps or microservices. From the contents of Section 4.4, you aimed to claim that the correlation between DevOps and microservices in software teams is weak. However, you did not provide adequate evidence to prove that developers thought the correlation is strong.\n- It may not be suitable to provide only one research question. Maybe you can list three questions about the benefits and costs of adopting DevOps & microservices, and how do developers balance between them.\n- Figure 4 need to be described, for example, the meaning of blue lines did not be clarified.\n- The lessons for practitioners seem to be meaningless and unimplementable for practitioners, e.g., the one in Section 4.1.\n- In Section 4.2, the authors just describe the phenomenon of abuse of microservices without digging out the deeper causes of this phenomenon.\n\nGroup members: Shenghui Gu, Runfeng Mao, Xin Yang, Qiming Dai, Bo Pan, Ruihong Liu',37,'2021-05-01 21:55:26',3,_binary '\0'),(448,'Title: Identifying and Detecting Architectural Smells in Microservices: An Industrial Experience Report\n\nThis paper presents the experience of adopting and adapting prior approaches to identify and detect architectural smells in one large-scale microservices system of the authors\' collaborators, with the aims of supporting microservices architecture improvement. In particular, an overall process of architectural smells identification and detection is introduced.\n\nHere are several comments:\n\n- This paper mainly reports the experience of identifying and detecting architectural smells, respectively. However, the practitioners may not benefit from the former experience. The identified architectural smell list is enough and the developers may not care about the process of identification that is not an industrial experience. Therefore, the title \"An Industrial Experience\" is not suitable for this report.\n- Several challenges are reported both in the process of the identification and the detection of architectural smells. However, these challenges may weaken the credibility of the evidence, such as the architectural smell list for microservices.\n- In Figure 1, \"Scopes\" should be \"Scopus\".\n\nGroup members: Shenghui Gu, Runfeng Mao, Xin Yang, Qiming Dai, Bo Pan, Ruihong Liu\n',38,'2021-05-01 23:21:58',3,_binary '\0'),(449,'Title: DevOps and Microservices in Software Teams: A Cross-Company Ethnographic Study\n1、The pros and cons of DevOps in 4.1.1 are common sense to people in the field, so there\'s no need to go into this much detail.\n2、Is it possible that the examples in 4.2 turned out badly because they didn\'t understand microservices well enough rather than because microservices weren\'t suitable for their project？\n3、In 4.4, it was stated that DevOps and microservices together can help developers understand task distribution, but our group believes that DevOps and microservices are two directions. It seems that the paper does not explain the correlation between the two and how they are combined together to reach this conclusion.\n4、The fifth section says that this experience is not applicable to other scenes, but only to similar cultural scenes. But the definition of other scenes and cultural backgrounds is not clear. How can I know if I belong to other scenes and whether the cultural background is consistent when I want to learn from them.\nReporter: Jiarui Wang\nGroup Members:Kaiwen Son, Zhiyin Li, Peiyu Hou, Huanlei Chen, Yanze Wang, Juzheng Zhang, Lemin Zhang, Fuli Zhang\n',37,'2021-05-02 23:32:11',65,_binary '\0'),(450,'Title: Identifying and Detecting Architectural Smells in Microservices: An Industrial Experience Report\n1、In the chapter of Process in 4.1, our group thought that we should introduce the four processes clearly instead of each module, which did not fit the name of Process\n\nReporter: Jiarui Wang\nGroup Members:Kaiwen Son, Zhiyin Li, Peiyu Hou, Huanlei Chen, Yanze Wang, Juzheng Zhang, Lemin Zhang, Fuli Zhang\n',38,'2021-05-02 23:33:34',65,_binary '\0'),(451,'Title: Performance Modeling of Cross-blockchain Systems Implemented by Relays Pattern: A Queuing Approach\n\nThis paper focuses on the cross-blockchain systems implemented by the Relays pattern and proposes an analytical performance model according to the queuing theory.\n\nHere are several comments:\n\n- Since there is no study using analytical modeling methods to evaluate the performance of systems implemented by the newly emerged cross-chain technology, the research motivation is to fill this gap. Nevertheless, such motivation does not have adequate context to be placed here. Can current modeling methods be directly used to evaluate the performance of systems implemented by cross-chain technology? If not, what are the issues and challenges that practitioners may encounter? These issues and challenges should be the direct reasons that inspired you to conduct this research.\n- The reason for adopting queuing theory (line 89) should be clarified in the introduction or other places.\n- In the first main contribution (line 92), \"BitXHub is selected ... Relay-pattern solutions.\" it is an explanation of why you chose BitXHub rather than a real contribution. This explanation can be advanced into line 89.\n- \"Note that although ... as well.\" (line 112) such external validity is better not included in the introduction.\n- The font size in most figures is relatively small, and the padding between entities is slightly wider. \n- In Section 2.1, \"Considering that BitXHub ... modeling and analysis\" (line 182) \"detailed documents\" and \"easier communication\" are the advantages of adopting BitXHub, not the decisive reason. \"quit advantageous technology\" should be detailed.\n- In Section 4 (line 313), the reason that you only consider the FCFS rule should be clarified.\n- Line 577, \"4C8G\" should be \"4 cores and 8 gigabytes\".\n- One section on threats to validity should be added. If possible, the limitation of the proposed model could be discussed.\n',39,'2021-05-07 15:35:47',3,_binary '\0'),(452,'Some comments are as follows:\n1. The proposed simulation model is based on BitXHub, but in line 16 the statement \"a promising tool\" is confusing, why not say the name of the tool and explain the reason for the tool selection?\n2. The first point of this paper\' contributions state that the tool selection process is based on a certain paper, in which several existing solutions are compared. So we think this should not be counted as a contribution.\n3. In section 4.3, the \"1 ≤ 𝑛 ≥ 𝑁\" in formula (6) and \"==\" in formula (8) are unreasonable.\n4. In section 5.1, the authors say \"After starting BitXHub, we use Linux’s free command to check that the actual available memory is 5GB\", but in the context the meaning of this data is not explained.\n5. The settings of the experiment are all explained in text, and it is recommended to add some tables to make the setting parameters more intuitive.\n6. In Table 2 and 3, the line break is a bit abrupt in the second row.\n7. In the end of the experiment, the authors only explain the reason for the data but do not explain the meaning of the data for the validity verification of the proposed model.',39,'2021-05-07 17:14:37',73,_binary '\0'),(453,'Title: Performance Modeling of Cross-blockchain Systems Implemented by Relays Pattern: A Queuing Approach\n\nSummary:\nIn order to provide the cross-chain system with a feasible solution for the performance understanding and measurement, this paper proposes a theoretical simulation model based on the queuing theory for cross-blockchain systems and conducted a series of experiments to validate the simulated model. This work has a certain research contribution and is meaningful. Some comments are as follows.\n\nComments:\n\n- ABSTRACT: The last sentence \"Although the simulation is conducted using only one relay-pattern solution, the methodology can be expanded to a wide range of cross-blockchain systems.\" is a bit subjective, and the article seems to have no evidence to support.\n- INTRODUCTION: Some unnecessary things are written in the contribution. For example, the reason for choosing BitXHub is not suitable for writing in the contribution.\n- Section 4: What is the model proposed in this paper is not very prominent. In Section 4, it is better to introduce the simulation model proposed in this research. Most of this is to introduce some background knowledge including the overview of the relay chain and the existing theoretical model.\n- Some experimental settings are not involved in the experimental part, such as experimental data and processes. It is not said how the theoretical value of the comparison came from. The conclusions drawn from the experimental results and verification results are not enough.\n\nGroup Members: Changlan Fu, Jing Chen, Jiaqi Zhang, Huilin Yin, Zan Gao, Feimei Xie, Mengjie Ding, Junyu Jia',39,'2021-05-07 20:26:11',6,_binary '\0'),(454,'Title: Performance Modeling of Cross-blockchain Systems Implemented by Relays Pattern: A Queuing Approach\n1、In formula 6, 1<=n>= n.\n2、Two equal signs in formula 8.\n3、The parenthesis problem in Equations 9 and 10, is N+1 superscript or multiply.\n4、The performance modeling and analysis in 2.2 has not been explained and what is the specific meaning of the challenge in This paper address the challenge?\n5、The title of 2.2 is the same as that of 4. What\'s the difference.\n6、Some discussion of the work, such as the deficiencies of the work, is felt to be missing between Chapters 5 and 6.\n\nReporter: Jiarui Wang\nGroup Members: LiMing Dong, Bo Pan, Jiazi Jia, Wei Liu, Runfen Mao, Xi Yang, Bohan Liu',39,'2021-05-09 23:12:40',65,_binary '\0'),(455,'Some comments are as follows:\n1. In the search process of SLR, the authors do not prove the validity of the search string or explain the reason behind it, and we think they should search manually before determining the search string.\n2. In the search process, the amount of selected digital liberaries is too small, and some major liberaries are not considered such as ACM.\n3. In the exclusion criteria, the first point explains the exclusion of gray literature, but in the table of selected publications, the \"IEEE software\" is a magazine. It is in conflict with the context.\n4. In the process of SLR, there are few procedural data. For instance, after the work of quality assessment, they should explain the result of quality assessment and give scores to these papers.\n5. The \"Theory\" in the title has little to do with the four research questions.\n6. In figure 4, there is overlap between different nodes, and the different types of relationships are represented by different types of lines, but there is no legend in this figure.\n7. The description of the figure 4 is literature oriented, but we think the description should be figure oriented. The authors should make separate statements about what these objects(strategies, effects and so on) contain and describe the source of literature for each concern.\n8. In the discussion section, there are also some issues. At first, the answer to the second research question focused on deployability and is not comprehensive enough. The answers to the third and fourth research question are not enough, and the answer to the fourth question is not clear so we suspect that the authors did not conduct pilot research to make this question meaningful.',8,'2021-06-11 17:26:31',73,_binary ''),(456,'This paper carried out a systematic literature review, aiming at building a theoretical model of the issues relating to software architecture and its capacity to support the continuous delivery of the software product.\nHere are several comments:\n\n- In Section 3.2, the authors claimed that they used three libraries, i.e. Scopus, IEEEXplore, and Web of Science. However, two of them are not full-text index, and thus users cannot search the whole paper.\n- The research scope of this paper is not clear, and thus the search string is not concise enough.\n- The inclusion/exclusion criteria contain many criteria based on subjective judgment, e.g., \"I1 Discuss continuous delivery.\"\n- In Table 2, the fields are not highly related to the elements in Figure 4. It is not clear how the categories in Figure 4 derived from these fields.\n- It is not a good choice to present the primary studies in the way of Section 5.2. The authors should give a list of primary studies.\n- The Section 6 is about the qualitative analysis and synthesis, and the content is organized from a perspective of researcher, that is, the process of how the authors conducted the analysis and synthesis was mainly presented. However, a process of the abstraction of these categories should be presented instead.\n- Figure 3 and Figure 4 share the same caption.\n- The element types of the paradigm (Figure 3) were vague.\n- Many of the categories in Figure 4 are arbitrary, and several high-level concepts seem to be not reasonable.\n- The answers to the research questions were presented in the Discussion section, and the content lacks of evidence.\n- This paper is on architecting for continuous deployment, but as a high-related concept and technique, the paper did not mention microservices a lot.\n',8,'2021-06-12 21:48:20',3,_binary ''),(457,'Title: Performance Evaluation and Comparison of Typical Cross-blockchain Technologies: A Qualitative and Quantitative Research\n\nSummary:\nThis paper carried out an investigation and research on cross-chain technology solutions, a general description of several types of cross-chain projects is given investigate the three most popular cross-chain projects, introduce the structure of each cross-chain technology, and analyze the cross-chain process and the applicability of the relay chain for each project, and testing the system delay of the relay system, system throughput and response time of cross-chain transactions, etc., provide guidelines for the configuration of these parameters of the relay chain system. This work has a certain research contribution and is meaningful. Some comments are as follows.\n\nComments:\n- The two words \"method\" and \"process\" in the titles of the two papers should be common, but the content is actually only applicable to what scenarios, and the performance test can be expressed in another way, or the title can be replaced with a colon plus \" case study\";\n- Abstract: The research goals and motivations of the article are not reported;\n- The structure needs to be adjusted. Qualitative and quantitative research on the topic. Quantitative research emphasizes how many 131 academic and gray literatures. It must be focused. The focus is on performance testing. Actually, many of them are ideas. When the third paragraph describes the work, you can draw a picture. Including research questions and what experiments they have done and what results have been obtained;\n- The paper focuses on performance testing, and the entire research work is not important;\n- There is a problem with the picture, the reference of the picture;\n- The performance test tells a lot of conclusions whether it is universal or the result of applying a certain tool. The description should be distinguished;\n- Not the reason should be the analysis;\n- The article has many short paragraphs;\n- The abstract and contribution points put forward several simple optimization methods, but they are not given in the article;\n- The last paragraph of the first section: The three cross-chain technologies are given in the front, and the two types are compared and analyzed later. They are inconsistent and not well connected;\n- Section 2: There is no report on the research process of the investigation and research, here it is said that the system combines academic literature and gray literature, but the source of the literature search is not specific enough, the search process is not given, and the number of academic literature and gray literature is determined. ',41,'2021-06-25 11:38:22',6,_binary '\0'),(458,'Title: Performance Modeling of Cross-blockchain Process Implemented by Cosmos :A Queuing Approach\n\nSummary:\nThis paper propose a theoretical simulation model based on queuing theory to study the performance of crosschain technology under a type of relay mode represented by the cross-chain technology Cosmos. Several performance measurement parameters were obtained through the established simulation model, tested the values of related parameters through experiments, compared the difference between the theoretical value and the test value, and verified the validity of the proposed simulation model. This work has a certain research contribution and is meaningful. Some comments are as follows.\n\nComments:\n- The two words \"method\" and \"process\" in the titles of the two papers should be common, but the content is actually only applicable to what scenarios, and the performance test can be expressed in another way, or the title can be replaced with a colon plus \" case study\";\n- The structure needs adjustment;\n- When introducing work, you can draw a picture, including research questions and what experiments they have done, and what results are obtained;\n- There is a problem with the picture, the quotation of the picture;\n- Whether the conclusion is universal or the result of applying to a certain tool should be distinguished in the description;\n- The article has many short paragraphs;\n- By checking these parameters, the validity of the model can be proved, whether there is a basis;\n- The performance indicators and formulas lack explanations and are not easy to understand, existing theories can be cited.',42,'2021-06-25 11:52:45',6,_binary '\0'),(459,'Paper Title：\nPerformance Evaluation and Comparison of Typical Cross-blockchain Technologies: A Qualitative and Quantitative Research\n\nPaper summary：\nThis paper investigated 131 existing studies on cross-chain technology solutions, and gives an overview of the types of cross-chain technology. The paper concludes that the most widely used mechanism in cross-chain projects is the side chain/relay chain mechanism. This paper also introduces the three most popular cross-chain projects: Polkadot, Cosmos and BitxHub. By investigating different indexes, this paper gives suggestions to the configuration of relay chain system parameters.\n\nComments for author:\n1. The Motivation of the article is not sufficient, and the pain points studied and the necessity of this paper is not introduced in the introduction.\n2. The description of the experiment is not clear enough, so it is suggested to adjust the format of the paper by referring to the paper in ISSTA.\n3. It is suggested to add an experimental structure diagram in Chapter 3 to show the steps of the experiment so that readers can understand the experimental structure more quickly.\n4. The pictures and formulas in the article need to be adjusted to standard format.\n5. in the third chapter \"The Architecture of Three Types of Cross-chain Projects\",The introduction of Cosmos architecture and BitxHub architecture does not give references\n6. In the third chapter \"Performance evaluation\", the suggestions given  are not macroscopic and cannot reflect the value of the research.',41,'2021-06-27 23:33:34',31,_binary '\0'),(460,'Paper Title：\nPerformance Modeling of Cross-blockchain Process Implemented by Cosmos :A Queuing Approach\n\nPaper summary:\nIn this paper, a simulation model based on queuing theory is proposed to study the performance of cross-chain technology in the relay mode represented by cross-chain technology Cosmos. Rejection probability and other parameters were obtained by establishing a simulation model. The validity of the model is verified by comparing the differences between the theoretical values and the tested values.\n\nComments for author:\n1. The content of the related work is too long and does not reflect the focus of the paper.\n2. This article applies other research to cross-blockchain, rather than proposing a generic approach. The approach in the title suggests modified to method.\n3. The article is not sufficiently motivated to explain why the queuing model should be applied.\n4. In the fourth chapter \"Single-relay system model\", the findings and conclusions mentioned in the article are only the results directly discovered from the pictures.The significance of these findings and conclusions is not explained.\n5. This paper only applies the queuing model, and does not reflect the necessity of this work.',42,'2021-06-27 23:59:56',31,_binary '\0'),(461,'Title: A Research Landscape of Software Engineering Education\n\nSummary:\nThis paper carried out a tertiary study on SEE, a landscape was presented, and this paper summarized the methods and tools identified in the SLRs on SEE, further collected the issues studied in the published research and to be addressed for the instructors. This work has some contribution and is meaningful. Some comments are as follows.\n\nComments:\n1. The motivation of this paper seems not enough, none of the existing SLRs is able to draw an overall state-of-the-art of SEE due to their limited focus, so this paper carried out a tertiary study on SEE.\n2. Data Synthesis: Meta-ethnography, specifically reciprocal translation and refutational synthesis, was adopted was used in the answers to RQ3 and RQ4.However, the use of refutational synthesis has not been reflected, and the necessity has not been well reflected.\n3. The starting period in Figure 2 is from 2008, and the data of the article is from 2004, and the two are inconsistent.\n4. Among the related technologies shown in Figure 3, open source projects are not considered Methods/Tools, and are not of the same type as other methods.\n5. The discussion chapter mentioned \"Lack of Concerns on How to Choose a Suitable Method/Tool for Students with Different Levels of Skills\", but did not give relevant suggestions on how to choose suitable methods and tools. If the suggestions can be given,\nThe contribution of the paper will increase.\n6. The data exists a tertiary study on SEE [Budg 12], but the paper claims to be a tertiary study performed with a secondary study as the data. It is necessary to consider whether the inclusion will produce noise on the results, indicating the necessity of inclusion.',46,'2021-07-09 11:08:25',6,_binary '\0'),(462,'Title: Performance of Different Cross-blockchain Technologies: An Empirical Analysis\n\nSummary:\nThis paper conduct an empirical study using the experiment method, analyze the performance of two widely-used cross-chain technologies based on the side chain/relay chain pattern, and identify potential performance bottlenecks to better understand the performance of these different technologies.  This work has some contribution and is meaningful. Some comments are as follows.\n\nComments:\n- The connection between \"assess the performance of different cross-blockchain technologies\" as the core work and \"bridging the gap between different blockchains/ Interoperability of het erogeneous blockchains\" in the question and background is not explained.\n- In the contribution point, \"some relevant guidelines are also given to potential technology users or researchers.\" However, the guidelines given in the article are not very prominent, and the guidelines can be gathered together and highlighted.\n- This paper has many observation and conclusion, you can consider using tables or other manifestations presentations to be more intuitive.\n- The paper has many relatively short paragraphs.\n- Figure 1 and Figure 2 are not clear.\n- The discussion chapter is a little less.',45,'2021-07-09 12:12:18',6,_binary '\0'),(463,'Title: Synthesizing Qualitative Research in Software Engineering: A Critical Review\n\nSummary:\nThis paper studies the methods of Qualitative Research Synthesis (QRS) and discuss the difference and similarities between the process of QRS methods and further propose a decision tree to help researchers understand QRS methods. This work has a certain research contribution and is meaningful. Some comments are as follows.\n\nComments:\n\n- The method part of the abstract describes like process, and you can pay more attention to the method, for example, tertiary studies combined with e-mail inquiry.\n- The SLRs reviewed were published between 2005 and 2018, and it is necessary to expansion data to recent years.\n- The research question in Section 5.1 What methods does RQ1 use in SE to integrate qualitative research and how to use these methods? When answering the question, each method is described independently, each method is briefly introduced, and the purpose of using the method in the SLR is listed, but there is no answer on how to use the method and the process of using the method. Only a few commonly used methods are mentioned, and some other methods are not fully covered.\n- The data in Figure 4 has some problem, the sum in the back does not correspond to the numbers in the front.\n- The meaning of the symbol # in Table 5 is not clear and can be changed to number.\n- The font in Figure 6 looks informal, you can adjust it and consider adding some data to enrich it.\n- If the sample size is relatively small, narrative synthesis should be considered as a candidate method. Relatively small and more general, a certain range or threshold can be given quantitatively.\n- In section 7, \"Make whatever you want may be okay, but you have to say: ‘Guys, I’m making whatever I want.’\" This sentence is left alone here, somewhat abrupt, with unclear intentions, descriptive sentence can be added.',44,'2021-07-09 17:16:16',6,_binary '\0'),(464,'The main work of this paper includes:\n- Describes the current status of the development of the hardware and software ecosystem of the ARM processor architecture and the ecosystem of supporting tools for the development of microservices.\n- Propose a framework for migration of heterogeneous applications, and carry out actual case analysis.\n\nI have a few comments on this paper:\n- The logic of this article is clear and the overall structure of the thesis is very good.\n- In 3.2, why only save the first 100 data from the 6568000 results as the initial data pool? Will the sample size be so small that the analysis results are not convincing?\n- Is the inclusion/exclusion criteria in 3.3 too simplistic? Is the statement of “any document related to the ARM processor architecture” too absolute that it may conflict with the exclusion criteria.\n- 6.2 There are two \"confession walls\" in Figure 3. Could it be a drawing error?\n- The abstract, introduction and summary of this paper all mention \"the development of a heterogeneous application migration framework based on the experience of enterprise experts\", but the specific contribution of enterprise experts is not mentioned in the process of describing the heterogeneous application migration framework in Chapter 5 of the paper.',50,'2021-07-16 21:19:57',83,_binary '\0'),(465,'The main work of this paper includes:\nThis article has compiled 44 best practices for code developers and reviewers to help them deal with the pain points of code review. In each step of the code review, most of the pain points can be solved in a number of good ways. The conclusion of this article is that implementing best practices in current and future tools should be automatically adopted by the community.\n\nI have a few comments on this article:\n- In section C of the second part, when selecting items manually, this article lacks the basis and motivation for selection.\n- In the second part, when snowballing strategies first appeared, this article did not provide corresponding explanations, and no references were given.',49,'2021-07-16 21:21:01',83,_binary '\0'),(466,'Some comments are as follows:\n1. In the line 2 of the RQ1, the authors write \"research question\", while I think the abbreviation should be used here to keep it consistent with other places.\n2. In the process of determining the search keywords in the academic literature search, the authors use several synonyms terms to expand keywords, but it may not be comprehensive. I think it is better to do a manual search before determining the search keywords.',49,'2021-07-16 21:35:36',73,_binary '\0'),(467,'Some comments are as follows:\n1. In the content arrangement in section 1, the authors refer to \"the answer to research question 1 & 2\", but they do not propose research questions before. I think the statement should be revised.\n2. In the section 3.1, there are some format issues such as the missing of colon in RQ2.',50,'2021-07-16 21:46:57',73,_binary '\0'),(468,'This article mainly focuses on the pains and best practices of code review and it explores academic literature and gray literature and found 20 code review pains and 44 code review best practices.\n- The writing process of the thesis is well-founded, and the statement of RQ is relatively clear.\n\nHowever, the following points are worthy of further improvement:\n- The motivation is not clear. For the practice of code review, there are some people in academia who are committed to this area, so what is the difference and highlight of your contribution from others? This point needs to be clearly stated.\n- Since the mention of gray literature has led to an increase in the number of code review practices, it is necessary to make it clear that this review specifically screens gray literature. At present, the explanation of this part in the introduction part is not very clear.\n- The style of Fig.1 is recommended to be modified. The size is too large and the picture is not compact. On the contrary, Fig.3 is too compact, and the color of the rectangle box (green and orange) is too saturated, which makes the black text less obvious.',49,'2021-07-16 22:26:06',84,_binary '\0'),(469,'1.The contributions and views of enterprise experts in “the development of a heterogeneous application migration framework based on the experience of enterprise experts”\" are needed to be elaborated and summarized \n2.There are some formatting issues that need to be checked further',50,'2021-07-16 22:43:56',55,_binary '\0'),(470,'1.Search keywords but may not be comprehensive. The results can be supplemented by a manual search\n2.It should be noted in the introduction section that this review was specifically designed to screen for gray literature, and clear your motivation at the beginning of the paper\n',49,'2021-07-16 22:44:30',55,_binary '\0'),(471,'This paper uses a gray literature review research methodology to give readers a general understanding of the development ecology of ARM architecture processors through two RQs, based on an explanation of the differences between traditional x86 architecture and ARM architecture processors. A heterogeneous application migration framework is then proposed to help developers complete microservice application migration between the two architectures. Overall, the research topic of this article is valuable and has inspiring ideas, however there are also some issues to be addressed:\n1. Content.\n(1) The title is not very clear. For example, \"2.2 Gray Literature\" is not specific, and I think it can be changed to \"Introduction to Gray Literature Research\". Similarly, Section 3 is entitled \"Research Methodology\", but the subheading of the section makes the reader think that it is the details of the research process.\n(2) There are few words about data presentation and processing in the paper. Instead, the answer to RQs are proposed directly after Section 3.\n(3) The answer to RQ2 in section 4.2 takes up too much space and most of the text is about introduction of the three types of tools, which is irrelevant to the arm architecture and deviates from the research topic.\n(4) Section 5 is somewhat fragmented from the previous research on arm ecology and does not detail the process of the proposed framework.\n(5) In Figure 3, the \"front-end applet\" layer in the model diagram has duplicate \"white-wall\" modules, and there should be a \"community activity\" module according to the rest of the paper.\n(6) It’s better to add a footnote to indicate the source of the gray literature website.\n2. Textual embellishment:\n(1) There are statements lacking subject and other components which made the statements not smooth, such as Section 2 \"directly adopt CISC processor architecture, its structure is complex\".\n(2) There are also unclear references, in 4.1.1 the second paragraph at the beginning of ARM should refer to ARM company.\n(3) There are typos, in Section 5 the Chinese homophony \"xìng\" in \"interpretative language\" should be \"xíng\".\n(4) There are also ambiguities, such as \"these projects are running on ARM platform\" in 4.2.3, which makes readers think that Jenkins is only running on ARM platform.\n3. Layout.\nFigure 1 should be placed at the bottom right of the second page to save space; some tables are cross pages, which is not easy to read.\n',50,'2021-07-16 22:52:03',81,_binary '\0'),(472,'Through system mapping study, this paper finds that the most difficulty of code reviewers and collect the best practices in code review, which is a brilliant idea and can provide help for research and industry. However, there are some issues in this paper:\n1. There are some words sheltered behind lines in Fig 3. The \"Step 6: Approving and merging code change\" in Table IV is not put center.\n2. There are some missing punctuation marks in this paper: for example there may be a missing \":\" after “topics” in \"topicsDavila2021\" in 4th line in 2nd paragraph of Section II; there may be a missing \".\" before \"We\" in “We analyzed 58 blogs\" in last but 8 line in page 3.\n3. There are unreadable codes such as \"/ref[tab:grey selection criteria]\" in last but 6 line in page 2. Table I also has this problem in \"Exclusion Criteria\".\n',49,'2021-07-17 09:09:31',81,_binary '\0'),(473,'Through questionnaire and data analysis, this paper informs readers of the evolution of DevOps in the cloud native era, which is an up-to-date research idea. However, I think there are some issues in this paper:\n1. The title of this paper is somewhat ambiguous. According to the following content, the paper mainly concentrates on the evolution of DevOps in China, which is not expressed in the title.\n2. There are missing labels and axis names in some bar plots of Section 3.2, which make these plots less understandable.\n3. The urls for Annual survey reports and questionnaires in Section 2 and Section 3 are useless because browser visiting is always been redirected.\n4. The language of this paper is chatty and not suitable for paper writing.\n',52,'2021-07-16 22:54:52',81,_binary '\0'),(474,'This paper provides practitioners and researchers with a comprehensive overview of code review pains and best practices throw academic literature and grey literature. There are some suggestions:\n\n1.The title mentioned this paper is a mapping study, but the content in this paper doesn’t point out the mapping, Please high light this part in abstract and conclusion.\n\n2.Abstract doesn’t point out the “code review process”. The author split the code review process to 6 stage and map the pains and best practices to these stage in result. It’s better to mention the stage. \n\n3.Please consider if it is appropriate to mention the conclusion “the implementation of best practices in the current and future tools should be taken automatically by the  community” in abstract, because the whole paper do not discuss it detailedly.\n\n4.RQ2 (What code review best practices are shared in the grey literature? ) is not point out the whole word you have done. The mapping work should be height in this question. It could be modified like “What code review best practices are shared in the grey literature and how they solved the problem in code review” or “What code review best practices are shared in the grey literature for code review pains”\n\n5.The introduction doesn’t list the contribution clearly. Please height several contribution in the introduction part.\n\n6.Expression problem in Section 2. “During the code review process, our study explores  the literature to find out the pain points encountered.” The author explores literature to find out the pain points in code review process, not to do the code review and do the research.\n\n7.Figure 2 and it’s explanation in Section 3\n1)I can’t distinguish red column and black column, description says “Since 2010 our SMS found academic research began to discuss code review pains,” But the column on 2010 is black and it represents the grey literature according to the annotation on figure. Please notice the consistency between the text and figure.\n2)The column on 2013 and 2014 is red, but I can’t understand the height of black column, is the red column cover the black?\n3)The description says “In Fig.2, we can see publications trends of code review painsand corresponding literature on code review best practices.” But the annotation for black and red column in figure is grey literature and academic research. The annotation need to be modified to fit the description.\n\n8.There is no text reference and explanation for table 3, please check it.\n\n9.Some bottom text is cut off in figure3\n\n10.There is some error on table reference like “ /ref[tab:grey selection criteria]”',49,'2021-07-16 22:55:11',26,_binary '\0'),(475,'This paper reports the ARM processor micro-service development ecology followed by the development of business experts on the basis of gray literature and finally use of this framework for migration case studies. There are some suggestions:\n\n1.This paper developed a migration framework and practiced in real project. The final result shows that the request success rate of 4 rounds of stress tests is 100%. But you need to set a baseline group for your test. It’ better to make some comparison and height the superiority of experiment result\n\n2.The author divide research question 1 to two sub-questions in 3.1, but they doesn’t explain the main aim and reasons clearly. It’s better to describe it in a more logical way and point out what exactly you want to conclude in this study.\n\n3.This paper reports the ARM processor micro service development ecology followed by the development of business experts on the basis of gray literature. But the author doesn’t introduce how they made the experts support process, and whether it is correct.\nIt’s better to add this content to improve the rationality of proposed framework.\n\n4.The search process describe in section 3.2 is too brief to support the research process\n1)The author only says that they briefly analyze the 100 result found on google and think they are useless. But the reviewers may question the rationality of this process. It’s better to replace the word “briefly analyze” and explain the reason why the result got on google is useless.\n2)The author turns to the open source community and obtains the search result as the final data support. But What is your searching method and detail process on open source community? What kinds of data you have found? What is your middle data record during the process? It’s better to describe the process clearly to support the correctness of your conclusion.\n\n5.Please notice your expression in this paper. Some grammar is not suitable for Chinese expression custom. I found that the author writes some declarative sentences followed by a question mark, this is illegal in Chinese.\n\n6.There is no further discussion in conclusion part, more content need to be discussed to high light the contribution of this study.',50,'2021-07-16 23:20:16',26,_binary '\0'),(476,'本文探究了ARM处理器架构的软硬件生态发展现状，并提出了x86处理器架构到ARM处理器架构应用的迁移过程，对ARM处理器架构的发展具有较大的意义。\n\n当前论文还可以从以下几个方面加以改进：\n**1. 论文的动机描述不够清晰。**论文的目的是什么？为什么探究ARM处理器架构的软硬件生态发展现状？为什么基于灰色文献进行探究？本文并未对这些问题做出解释。尽管引言部分隐晦地表达了“ARM处理器架构的开发生态尚不明确”这一现状，然而这与本文内容之间的关系仍不直接。\n**2. 研究问题的分解及关系不明。**研究问题1探究“ARM 处理器架构开发生态的发展现状”，这包括对研究问题1.2“微服务开发配套工具生态发展现状”的回答。然而，作者并未说明ARM处理器架构与微服务开发配套工具之间的关系，即为什么回答研究问题1.2对于回答研究问题1而言是必要的。此外，研究问题2探究“异构应用迁移方法”，然而作者并未对“异构”概念本身做出解释，为什么该问题的回答与本文相关仍未可知。\n**3. 研究方法不够严谨。**比如，搜索过程仅选取“前100条数据作为初始数据池”是否足够，此处是否有相关灰色文献guideline提供决策支撑？比如，未说明本文的数据抽取项，即本文在灰色文献中抽取哪些数据。\n**4. 第5章研究结果的证据支撑不明确。**第5章的内容是基于灰色文献整合到的对研究问题2的回答，抑或是作者基于经验总结的框架，本文对此未给出明确的解释。如果是对研究问题2的回答，这与引言部分的描述不一致；如果是基于经验总结的框架，那么这部分这与研究方法部分的描述不一致；如果是基于二者，那么哪部分结果来自灰色文献，哪部分是基于经验总结得到的，作者应给出具体说明。\n**5. 案例研究部分缺少对其本身的设计。**即如何进行案例研究，从哪几个方面评估所提出的迁移框架。比如，压力测试的结果如何说明所提出的迁移框架的合理性。',50,'2021-07-17 00:04:57',23,_binary '\0'),(477,'This paper reports the development ecology of ARM processor microservices, and develops a heterogeneous application migration framework based on the gray literature combined with the experience of enterprise experts, and finally uses this framework for migration case studies. In general, the outline of this paper is very clear and reasonable. However, there are some suggestions.\n- Regarding the setting of RQ, it should be a question of the conclusions explored in this article.\n- Regarding the data search, there is no detailed explanation. For example, why only select 100 items, why not take random sampling, and whether the initial failure to obtain valid data is related to data selection?\n- For Chapter 4, the hierarchy of subheadings may be too detailed.\n- For the graph in the paper, you can consider replacing them with a higher-definition version.\n\n\n',50,'2021-07-17 00:12:17',84,_binary '\0'),(478,'This article comprehensively discusses the difficulties in the process of code review, and summarizes some best practices to solve these difficulties. There are some suggestions:\n\n1. In Figure 3, part of the text goes beyond the rectangle. Consider adjusting the size and position of the rectangle\n\n2. In table 4, part of the text goes beyond the rectangle. Consider adjusting the position of the text, such as: horizontal left alignment, vertical top alignment',49,'2021-07-17 09:39:18',78,_binary '\0'),(479,'\nThis article has compiled 44 best practices for code developers and reviewers to help them deal with the pain points of code review. Most of the pain points at each step of the code review process can be addressed in a number of good ways. The conclusion of this article is that implementing best practices in current and future tools should be taken automatically by the community.\n\nSeveral opinions for this article\n\n1. The second part, snowballing strategies appeared for the first time without explanation or reference\n\n2. Section C of the part II does not explain the basis or reason for manually selecting items',49,'2021-07-17 09:57:32',79,_binary '\0'),(480,'This paper explores the development status of hardware and software ecology of ARM processor architecture, and proposes the migration process from x86 processor architecture to ARM processor architecture application.\nHere are some comments on this article:\nAre the inclusion/exclusion criteria in 3.3 too simplistic',50,'2021-07-17 10:02:37',79,_binary '\0'),(481,'Based on grey literature review, this paper discusses the development status of ARM processor architecture development ecology, and develops a heterogeneous application migration framework. There are some suggestions:\n\n- Figure 2 is suggested to be kept on the same page as Section 5\n- Table 2 is suggested to be displayed on the same page to ensure the integrity of the table\n- Figure 4, the content of the third level title and after is too small\n- Figures 5 and 6 are too vague',50,'2021-07-17 10:26:13',78,_binary '\0'),(482,'本文探索了x86架构应用向arm架构迁移的现状(含方法)，对业界具有重要实践意义。但本文写作存在较多问题，概述如下\n\n1. 写作动机不明确，贡献不突出。仅简要揭示现状是不够的。\n2. GLR过程缺乏严谨性，如(1)文献检索返回海量数据，仅考虑前100；(2)纳入/排除标准，(3)数据合成与分析描述\n3. 研究方法是混合研究，而非GLR\n4. 选取地案例研究不具备代表性(数量、规模、类型等)\n5. 图表，参考文献等不规范\n',50,'2021-07-17 11:05:10',44,_binary '\0'),(483,'本文使用问卷调查方法收集和整理了云原生时代下DevOps在国内发展的最新现状，对国内云原生、DevOps的普及和发展具有重要意义。但本文仍存在较多写作问题，概述如下:\n\n1. 已经有过大面积、高质量的调研，并且有论文发表，本文的动机和贡献体现在何处?\n2. 内容不完整，大量数据结果和分析未更新；\n3. 大量数据仅停留在报告数字层面，数字背后反映了什么，学术界和工业界是否有不同的观点，对调整的潜在的应对解决方案；\n4. 仅凭问卷调研不足以真实、系统反映当前现状。',52,'2021-07-17 11:14:21',44,_binary '\0'),(484,'This paper uses the questionnaire survey method to collect and sort out the latest development status of Devops in China in the cloud native era, which is of great significance to the popularization and development of cloud native and Devops in China., But there are other problems:\n1. The format of the paper does not meet the submission requirements, such as the picture should be black and white.\n2. You need to further analyze the meaning behind the data.',52,'2021-07-17 13:12:56',61,_binary '\0'),(485,'Some suggestions for the article:\n1 It doesn\'t look like Mapping, or it\'s not thorough enough.\n2 The introduction should highlight the contribution of this article\n3 The author did not elaborate on what the pain points are.',49,'2021-07-17 13:16:56',61,_binary '\0'),(486,'本文借助调查问卷的形式，从DevOps涵盖的组织表现、组织文化及相关实践、云原生等新技术影响等方面，综合分析了云原生时代下DevOps在国内的发展现状与趋势。有如下建议：\n\n- 4.1节，4.2节，6节，7节内容需要补充完整\n- 3.2节的所有图片中的图例格式需要调整，统一字体格式和大小\n- 4.3节第二幅图的图例显示不全，第四幅图的“效率”数据标签位置需要调整\n- 所展示的数据还需进一步分析',52,'2021-07-17 13:18:56',78,_binary '\0'),(487,'This article mainly focuses on the pains of review and give some best practices, it\'s very practical. However, there are still some problem.\n1.In Figure 3, part of the text is out of the rectangle.\n2.Some of the contents in Table 4 are out of the box.',49,'2021-07-17 13:22:20',17,_binary '\0'),(488,'This paper explores the migration process from x86 processor architecture to ARM processor architecture application, which has great practicality.\nThere are a few minor issues in this article that need fixing:\n1. There are some formatting problems in Section 3.1.\n2. Figures 5 and 6 are somewhat fuzzy.',50,'2021-07-17 13:25:12',17,_binary '\0'),(489,'This paper uses questionnaire survey to collect and sort out the latest development status of DevOps in China under the cloud native era, which has practical significance for the development of DevOps in China. However, there are still some problems in this paper, which are summarized as follows:\n\n1. Questionnaire as data support is not comprehensive enough.\n2. The content analysis is not comprehensive enough and needs to be more detailed.',52,'2021-07-17 13:28:05',17,_binary '\0'),(490,'The paper has not been completed but the DDL is approaching. \n- The motivation of the study is not well explained. What are the research questions of this study?\n- The references are obviously insufficient.\n- The design of the survey is not clear. The questions in the questionnaire are superficial.',52,'2021-07-17 13:43:48',37,_binary '\0'),(491,'With the help of questionnaire, this paper comprehensively analyzes the development status and trend of DevOps in China under the cloud native era from the aspects of organizational performance, organizational culture and related practices, and the impact of new technologies such as cloud native\n\n1.The purpose of this research is unclear. The motivation and contribution of this paper are not clear.\n2.The content and experiment are not complete. We can consider other means to collect data by multi-channel to truly reflect the current situation.',52,'2021-07-17 13:56:45',55,_binary '\0'),(492,'This paper is more like a technical report than a research literature. The paper spends a lot of space on the history of ARM, which reads like a news report. The case study also lacks novelty.',50,'2021-07-17 13:57:25',37,_binary '\0'),(493,'In the design of this study, pain points come from academic literature, and best practices come from grey literature. Is there a gap between these two communities? Strictly speaking, there are no real pain points in the academic community. The paper lacks an introduction to related work and does not explain the necessity of research. The fig. 3 is not readable.',49,'2021-07-17 14:12:17',37,_binary '\0'),(494,'This paper uses the questionnaire survey method to collect and sort out the latest development status of Devops in China under the cloud native trend, which is of great significance to the popularization and development of cloud native and Devops in China. There are other suggestions:\n\n1.This research based on the investigation of devops. During the questionnaire design phase, the investigation group refer some academic literature and devops report in puppet lab. So I suggest that the author could compare the investigation result with last year report or related report published aboard.\n\n2.We focus on the popular technology and trend ---- “cloud native” in 2021 devops investigation. As I know it rarely appeared in other devops related papers and reports.\nIt’s a good point for the paper and I suggest the abstract and introduction section should high light the innovation of this study.\n\n3.The whole paper seems like an investigation report rather than an academic literature. The author should pay more attention to change the paper framework and make it more logical.\n\n4.The main aim and contribution is not clear, please list them in abstract and introduction part. You should not just throw out the investigation result, more further contribution and meanings should be discussed.\n\n5.What extra data could be included in your research process? The simple questionnaire analysis can’t support this paper entirely. Maybe the author could post some extra literature review or expert confirm process.',52,'2021-07-17 14:16:21',26,_binary '\0'),(495,'In terms of the research methodology, the \"code review pains\" are from the scientific publication, while the \"code review benefits\" are from the grey literature. The point is why it was designed and why the two community contribute to these two aspects this way.\nBy the way, the chapter of the research methodology is named by \"search process\", which seems to be not reasonable.\n\nThe results of RQ1 and RQ2 are structured by the process of code review, step by step. Yet this process has not been introduced before the results.\nThe way of reporting RQ1 and RQ2 results are different: RQ1 results are in figure while RQ2 results in table. Why there is such differences?\nPersonally, given that the pains and best practices are relevant in the paper, I suggest to organize these pains and best practices together along the code review process.\n\nFrom the references, it seems that many related works are not presented.',49,'2021-07-17 14:56:29',23,_binary '\0'),(496,'显然，本草稿不能算是该论文的完整版本，它仍未完整地表达作者的所有观点。这使我对该论文产生了以下几点疑问：\n1. 论文的动机不明，“云原生”与\"DevOps\"的关联是什么，为什么探究云原生时代下DevOps的发展有其意义。\n2. 该论文已有相关调查报告发布，为什么还有report成论文的意义，它有该调查报告之间的关系是什么？文中描述“两次调查结果”，“前四次的调查”，究竟有几次相关调查，话句话说，本文的研究过程不明。\n3. 论文的结果看起来并不吸引人，它仅仅给出了量化的直接的数据分析结果，这些结果带来的启发是什么？\n4. 论文结果仅包含组织表现、组织文化及相关实践和云原生三个方面，且两个方面与组织相关。为什么包含这些方面，这些方面与DevOps的关系是什么？',52,'2021-07-17 15:17:26',23,_binary '\0'),(497,'There are still some writing issues in this paper:\n1. The inclusion and exclusion criteria should be re-checked;\n2. i.e,. should be i.e.\n3. The Fig. 1 can be re-organized into a smaller version\n4. Some sentences may need to be modified, e.g., \"Participants in our review have experience with sec-ondary studies Dong2017, Yang2021, Huang2018, Zhang2013 in software engineering\"; maybe a () is necessary\n5. I wonder why only blogs were included\n6. More discussion may be necessary. The results of this paper are not clear enough.',49,'2021-07-17 17:15:44',5,_binary '\0'),(498,'文章在描述上可能还不够严谨，比如摘要中“本文进行灰色文献评阅，在 Google上获取了 6568000 条结果，并选取前 100 条作为初始数据池，随后在与 ARM 处理器架构更为相关的 CSDN、 ARMDevelop、InfoQ 和 GitHub 上进行搜索，最终选取了 23 篇灰色文献”，逻辑上看不出前后的关系和必要联系。并且在结果部分，仅仅报告出了测试的结果，却没有基于测试结果得到更深层次的能够得到广泛应用的贡献点。',50,'2021-07-17 17:20:08',5,_binary '\0'),(499,'目前来看，文章过于依赖一些基础定量数据的展示分析，而没有体现出一些重要的定性数据的结果分析整合；同时结果贡献的部分完成度较低，缺少必要的贡献展示，这些内容在文章中应当强调出来。',52,'2021-07-17 17:23:41',5,_binary '\0'),(500,'董黎明\n\nThis paper focus on investigating the development of the devops under cloud native technique. There are.some questions should be highlight in current versions: \n\n1. Which questions in this survey relates to the relationship between devops and cloud native technique?\n2. In section 4, there are quite few findings from this survey talks ahout the challenges of devops under cloud native, large portions of them discuss the advantages and problems of cloud native itself. Hence, the results findings should go back to the vary purpose of this paper.\n3.How could this survey find the new challenges in section 5.2. This paper could  clearly link the results of questionnaire with the new findings discussed in Section 5.',52,'2021-07-17 19:31:04',31,_binary '\0'),(501,'董黎明\n1.筛选条件第一条，如何能够保证文献讨论了是是往微服务迁移的文献。\n2.3.4部分抽取的具体数据项是什么？如何能够回答本文的研究问题。\n3.建议在case study 部分比较迁移前后测试结果差异参数值时，采用统计性检验方法，以此说明测试结果差异是具备显著性的。\n4.事实上，迁移服务的实例大多数是高复杂系统，case study 的结果如何能够说明arm处理器架构的优势？\n5.指南产生的细节是否能够进一步补充?',50,'2021-07-17 19:52:05',31,_binary '\0'),(502,'This article uses questionnaires to collect raw data and explores the latest status of DevOps development in China in the cloud-native era.\nMy opinion is as follows:\n- The content of this article is not perfect, and many results have not been analyzed yet.\n- This article only uses the questionnaire data for analysis, and the analysis only excavates the simple characteristics of the data. Is there any other research in academia to prove the results of the findings?',52,'2021-07-17 20:05:46',84,_binary '\0'),(503,'Paper Title：\nCode Review Pains and Best Practices - a Systematic Mapping Study\n\nPaper summary:\nCode review is an important and error-prone task. In order to effectively promote the enterprise code review, this paper identified 20 typical code pains through peer-reviewed. Further code review best practices were identified through a secondary review of the grey literature. Most of the existing difficulties can be addressed through the best practices in this study.\n\nComments for author:\n1. The Motivation of the article was not sufficient. It only mentioned that the current code review work was difficult, but did not report the reason why it was difficult.\n2. There is a Gap in this study. The pain points of code review of RQ1 are extracted from academic papers through review, while the lack of best practices of RQ2 is extracted from grey literature. The reason for this is not given in the article.\n3. The reason why the answer of RQ1 is connected with STEP is not explained\n4. The reason why the answer of RQ2 is connected with STEP is not explained\n5. The text box in Figure 3 needs to be adjusted\n6. In this paper, RQ1 and RQ2 are connected in series through step, but there is no sentence given by step\n7. The symbol before \"6 Pages\" in Table 1 should be deleted',49,'2021-07-17 20:06:13',31,_binary '\0'),(504,'The author conduct a literature review on both peer-review publications and grey literature to understand the pains and best practices on code review. However it is unclear about the contribution of grey literature to this study. Moreover, the relationship between peer-review publication and grey literature is not reported in this paper, it seems the analysis of them are independent.\n\nI am curious about how the authors exclude more than 5,000 papers while the search process since the selection criteria is so simple. The peer-review publication always have a specific background and objective which compose the motivation of them, it means that most of them try to report or resolve a problem in code review. In this context, I wonder which peer-review publication will be marked \"Discussed the pains encountered in code review process\".\n\n\n\n',49,'2021-07-17 20:17:55',39,_binary '\0'),(505,'Paper Title：\nARM Processor Architecture: Microservices Development of Ecology and Application Migration\n\nPaper summary:\n\nThe architecture of ACM processor balances performance and power consumption,which becomes one of the most important computing platforms. The existing software ecosystem, however, is unclear. In this paper, grey literature review was carried out, and 23 grey literatures were obtained. On this basis, the research developed a migration framework. The experimental results show that this study can complete the migration work well.\n\nComments for author:\n1. The motivation of this paper is not clear enough to explain why the development ecology of the existing ACM processor architecture is not clear enough.\n2. The position of Figure 1 needs to be adjusted\n3. The status of the existing migration framework is not reported\n4. The answers to RQ2 are not combined with the selected grey literature\n5. Figure 4 is not a vector diagram\n6. The experimental results were not compared with other studies',50,'2021-07-17 20:22:31',31,_binary '\0'),(506,'文章针对ARM处理器架构在微服务场景下生态不明确的问题，进行了灰色文献评阅并通过案例研究的方式说明评阅结果的可靠性。整体工作的完成度比较高。\n\n文章目前主要的问题有\n1. 作者反复提到ARM处理器架构的开发生态不明确的问题，并将此作为研究的动机，这是比较模糊的。作为学术论文应当详细说明开发生态在哪些具体的方面不明确，这些不明确之处又会对开发者带来什么挑战，以此论证为什么开发生态不明确这个问题具有研究的价值。\n2. 灰色文献在中文社区的使用还没有得到广泛的认可，在这种背景下我更推荐作者在第一章（引言）部分加入说明为什么要引入灰色文献去研究ARM处理器架构的开发生态，为什么学术研究不足以去解决问题。\n3. 在得到6568000结果的情况下，为什么只选择了前100条，需要补充参考文献作为依据\n4. 此外，文章还存在一些格式不规范之处，还需要进一步改正，如：灰色文献评阅（Grey Literature Review GLR）应为（Grey Literature Review, GLR）\n\n',50,'2021-07-17 20:31:03',39,_binary '\0'),(507,'Paper Title：\n\nThe Development of DevOps in the Cloud-Native Era\n\nPaper summary:\n\nCloud native can help enterprises to construct extensible and agile business systems, which attracts more and more researchers\' attention. In order to fill the research gap, this paper conducted a questionnaire survey. The development of DevOps in China under the cloud native era is analyzed comprehensively from the organizations, related practices , cloud native and so on.\n\nComments for author:\n\n1. The introduction of DevOps and cloud native in this article lacks more literature support\n2. Many questions in the questionnaire are not related to the cloud native\n3. The article mainly lists the results, and lacks more useful information summarized in the questionnaire\n4. The article does not reflect the necessity of cloud native to enterprises in the questionnaire\n5. The form of the pie chart is not uniform',52,'2021-07-17 20:39:48',31,_binary '\0'),(508,'文章目前还不完整，只能明确文章意在通过问卷调查研究云原生时代下如何实施更高效的DevOps实践。\n\n文章目前的主要问题如下：\n1. 在已经有刘博涵等人的论文在软件学报发表的情况下，本文需要明确自己的工作与软报工作的不同之处，可以考虑从这几年来DevOps在国内的发展来看，也可以考虑从云原生的角度去做区分，但是目前还不清楚作者打算走哪条路线。\n2. 我认为问卷的结果不应当作为文章的主体内容，毕竟本文要探究的是如何进行更高效的DevOps实践，那么仅仅是去分析问卷受访者中的高效企业和其他受访者的区别是不够的，因为国内实际上整体还是处于一个初期或者中期的发展阶段，虽然在摘要中说明了本文要研究的是国内的企业，但是从目前的标题来看，读者在看到这个标题的时候更多的还是想看到从宏观的角度来看，国内整体应该如何发展。在这种情况下，补充一些国际环境的内容或者在讨论部分去展开讨论应该会是本文在投稿截止前修改的目标。\n3. 目前本文的完成度不够高，很难整体去评价本文的质量，但是目前的内容看起来还比较零碎，一个整体的框架图或者表能够更好地帮助读者理解本文的工作，毕竟讨论云原生下的DevOps本身就是一个比较复杂的事情。',52,'2021-07-17 20:42:16',39,_binary '\0'),(509,'some suggustions are as follows:\n1、The text at the bottom of Figure 3 exceeds the border；\n2、The introduction does not elaborate on the contribution of this article',49,'2021-07-17 20:52:54',74,_binary '\0'),(510,'Some comments are as follows:\n1、Figures 5 and 6 are too small to be effective\n2、Too little preface in Chapter 4',50,'2021-07-17 21:03:18',74,_binary '\0'),(511,'The article currently only describes the questionnaire survey process mechanically, without analyzing the overall trend of DevOps on the basis of the questionnaire survey. So overall, the article\'s appeal is not strong enough.',52,'2021-07-17 21:09:29',74,_binary '\0'),(512,'This paper focuses on revealing the state-of-the-art of DDD in software engineering. It presents four characteristics of DDD and three categories of the claimed benefits for software projects of adopting DDD. It also identifies eleven challenges in applying DDD and seven solutions to address them.\n\n- The overall logic of the paper is very clear, and the introduction of the research method part makes the conclusions summarized or collated in the article more convincing.\n- The paper also mentioned \"no study contributed to DDD by acting as Evaluation paper and Opinion paper.\" This makes the research value of this paper more manifest.\n- The \"Roadmap for applying DDD\" proposed in the paper is very meaningful for the practice of DDD. It has high reference value for real practitioners.\n\nI have some suggestions for this paper：\n- The location of Table 1 is a bit far away from its citation. In order to ensure the comfort of the reader, its layout should be in front of Figure 1.\n- It is written in Chapter III.B that \"the year range of the search was set from 2003 to 2019.\" But in the introduction and conclusion, it is written \"from 2003 to January 2020\".\n- Chapter IV states \"the years after 2017 have witnessed an increasing number of published papers in this area\", but the data shown in Figure 2 shows that after the explosive growth in 2018, it has been reduced by half in 2019.\n- Figure 7 looks a bit messy and hard to understand.\n- The \"a), b)\" and \"B1-1, C1-4\" and other bold headings in Chapter IV are all headings at the same level. They seem a bit messy and make the logic of the reader not clear enough when reading this chapter.',53,'2021-07-23 09:20:20',83,_binary '\0'),(513,'- The paper did not clarify the motivations of research questions, for example, why do we still need a new definition of DDD?\n- The definition of DDD provided in the paper is not very rigorous, for example, \"DDD as a method suitable for agile processes\" is not equivalent to \"DDD is an agile software development approach\".\n- The benefits of a design method should be relative. That is, what are the pros and cons of DDD relative to a reference method (such as a common design method)?\n- The paper did not give a good answer to \"how\", but simply explained the terms of related practices. However, most of the information can be obtained from the Internet. The author lacks sufficient analysis of the evidence. For example, \"\n[S23] suggests that not to model all objects using ET since this might cause performance problems due to the increase of instances in a system.\" WHY?\n- MDD is not a new finding. It is a common practice to build a domain model, and even if you search for a DDD introduction on google, it will tell you that you need to build a model. \n- Regarding the patchwork of just a few words in the published paper, I\'m not sure whether this can create a reasonable and complete pratice map.\n- The reasons behind differences presented in Fig. 7 and the benefits of the new practice map are lacking in discussion\n- I am more interested in what these DDD studies were doing and what new discoveries they found. But the paper did not present this point well. It is difficult for us to recognize from the results of this paper which information is unique and novel in the primary study, that is, in which aspects we can establish new understanding of DDD through this SLR.\n- There are some grammatical errors in the text. For example, \"there is still no a comprehensive understanding ...\"; ',53,'2021-07-23 09:44:54',37,_binary '\0'),(514,'This study presents state-of-the-art applying Domain-Driven Design (DDD) by performing a Systematic Literature Review (SLR) from 2003 to 2020. My comments (shortcomings as well as suggestions) are as follows.\n1. Why DDD is important?\n2. Why in need of an SLR?\n3. The time span of searching is nearly twenty years, while the number of primary studies is 34 merely. Does this phenomenon indicate that DDD is more popular in the industry? Moreover, I noticed that there are suggestions for practitioners, the limited evidence from academic literature is not enough. If you do not want to include grey literature, how about discuss it in Threats to Validity?\n4. In my review, the answer to RQ1 is less interesting and it more like an introduction of background.\n5. Despite the authors indicate the roadmap for practitioners and the presentations are good, I do not like the style as presented. Most practitioners tend to seek for guidelines, technical reports, documents rather than academic paper (tell me what, but do not tell me how in practice).\n',53,'2021-07-23 10:43:54',44,_binary '\0'),(515,'The research focuses on developing the latest applications of DDD software through system Literature Overview (SLR), and introduces the latest object-oriented design applications from 2003 to 2020. It reflects the four functions that use DDD and the three benefits of software projects that use DDD. It also defines 11 problems and 7 solutions for DDD applications. And here are my suggestions:\n\n1.By highlighting the importance of DDD and the need for SLR at the beginning of the article, the motivation for the article needs to be further elaborated\n2.The work done in DDD studies and their findings need to be further refined and presented in a reasonably clear manner\n3.The interpretation of some of the diagrams, such as Fig 7, is unclear and difficult to understand, and there are slightly formatting issues and some grammatical errors.',53,'2021-07-23 11:09:17',55,_binary '\0'),(516,'This study shows the latest technology of application domain driven design (DDD) by implementing the system literature review (SLR) from 2003 to 2020. My opinions are as follows:\nThe motivation of the paper needs to be further clarified. For example, why do we need a new definition of DDD?\nThe time span of paper retrieval is very large, but the number of papers selected is very small, and the reason is not clearly explained\nIn Chapter 3 B, it is written that \"the search year range is from 2003 to 2019\". But in the introduction and conclusion, it is \"from 2003 to January 2020\".\nThe author puts forward a new practice map, so we should focus on him.',53,'2021-07-23 11:48:15',61,_binary '\0'),(517,'- The background and Objective in the abstract is relatively simple. \n- The standard of Studies that focus on DDD in TABLE V is more general, and the article Not the latest version needs to mention that is remove duplicate previous versions.\n- The large difference between the research published in 2018 in Figure 2 and other years can explain the reason or describe which aspects have increased.\n- Roadmap for applying DDD is for practitioners, but the Involve domain experts included in the content, roadmap is biased towards suggestions.',53,'2021-07-23 12:06:59',6,_binary '\0'),(518,'This paper reveals the sate-of-art of DDD in software engineering through a system literature review study, and convey the characteristics, patterns, challenges and solutions of DDD to readers. Although I really appreciate the work done in this paper, there are also some issues in it to be addressed:\n1. About the DDD activities in software development. In NO.2 contribution of Section I, the word \"four activities\" first appeared without interpretation, which is somewhat confusing. However in Section II, there are only 3 DDD activities listed in Part A. There must be your considerations, I think it\'s better to clarify it.\n2. There are also some minor flaws in my opinion. For example, there are words \"catalog\"s and \"catalogue\"s in the paper, it\'s better to uniform them. And the last field in TABLE IX is \"#\", and it\'s confusing because it’s not interpreted.\n',53,'2021-07-23 13:29:40',81,_binary '\0'),(519,'This paper performed a Systematic Literature Review (SLR) by searching the literature   from 2003 to January 2020 to aggregate and synthesize empirical evidence from 34  primary studies and revealed the state-of-the-art of DDD in software engineering. There are some suggestions:\n\n1.The conclusion in abstract doesn’t point out meaningful contribution clearly. I can’t understand what the author exactly conclude from this study. I notice the author says “there is still much can be done for both the practitioners and researchers to disclose more about the ‘how’ aspects about DDD”. This expression is too vague. What does the author really want to say? Please explain it clearly.\n\n2.I notice that the author says “Our results offer implications for practitioners through an overall road map for applying DDD and for researchers through several valuable  research directions” in abstract. I have some questions:\n1)The author doesn’t claim the target clearly. It’ s not enough to say that the result can help practitioners and researchers. What does this study exactly help them in what condition? The author should make further discussion.\n2)Many researchers turn to grey literature to observe and analyze the practitioners’ view. But this study doesn’t include this information. A potential risk is that the data coverage may be questioned.\n\n3.Expression in “Study search” of section 3. The author says “most of the relevant papers have been found if these papers are found”. What does it mean? Why don’t you refer all of the ad-hoc papers? Someone may question the integrality of this part. You can modify your expression to avoid that.\n\n4.The research method in figure 1 is very complex, It’s hard to understand the research map for readers. There is no brief explanation for this figure to help readers know the simple framework of this study.\n\n5.The author could make some analysis for figure 2 and figure 3 to explain why the trend show like this.',53,'2021-07-23 16:30:34',26,_binary '\0'),(520,'This paper performes a SLR to introduce the state-of-the-art of DDD in software engineering. It introduces DDD from the aspects of characteristics, definition, advantages, challenges and solutions. There are some comments：\n\n1. Section IV，a grammer error：\"CH3. Bounded contexts.:\" , the \".\" is redundant and should be deleted.\n2. In TABLE VII, it is recommended to sort the items by \"Total score\" in descending order\n3. Fig 7 is too messy, make it difficult for reader to understand the intention',53,'2021-07-23 19:32:58',78,_binary '\0'),(521,'Here is some problem we find in discussion section.\n1.The granularity problem of UL may need to be supplemented and clarified in an iterative manner\n2.The output of DD-TD is fuzzy, and the domain model is abstract in meaning, and a concrete explanation is desired\n3.There are two DA phases in the flowchart that can cause confusion and it is recommended to distinguish them\n4.Each stage is suggested to be illustrated by example, otherwise it is somewhat abstract to understand',53,'2021-07-23 20:40:33',17,_binary '\0'),(522,'This article uses mature information collection and analysis methods to complete the SLR for the topic of domain-driven design. Here are some opinions:\n1. The motivation of the article is still a bit vague. Except for the last one, the three questions are all about redefining and refurbishing domain-driven design. In the second question, the advantages of domain-driven design are more suitable to promote domain-driven design than to summarize.\n2. In the discussion section, two DAs can be confusing. It’s best to explain in the first paragraph what this part of the summary can help for practitioners, and explain the summary statement in the box that appears halfway through the paragraphs.\n3. There are still some formatting issues in the article, such as the messy picture 7, the fonts of \"a)\" and \"b)\" in the subtitles in the RQ3 explanation are smaller than the nouns in it, and there is a large space between the box and paragraphs in p15.',53,'2021-07-24 00:52:57',74,_binary '\0'),(523,'1. The huge difference between the studies published in 2018 and other years in Fig 2 can explain why or describe what has increased.\n2. Fig 7 is too messy and it is difficult to find the information I am concerned about.\n3. The displayed map containing all the findings is best to be distinguished by different color areas, and can be mentioned in the corresponding position in the text.\n4. The conclusion in abstract doesn’t point out meaningful contribution clearly. ',53,'2021-07-24 09:00:56',16,_binary '\0'),(524,'This paper performed a Systematic Literature Review (SLR) by searching the literature from 2003 to January 2020 to aggregate and synthesize empirical evidence from 34 primary studies, and presented four characteristics of DDD and three categories of the claimed benefits for software projects of adopting DDD. The structure of this paper is relatively clear and the overall logic is reasonable. However, there is still room for improvement and perfection. My minor suggestions are as follows:\n- The motivation in the abstract is not strong and attractive.\n- The status quo described in RQ1 feels like a basic introduction to the concept of DDD. Given that some background has already been mentioned in the related work, may you consider less space here?\n- RQ3 needs your personal findings and arguments from research instead of conceptual explanations.',53,'2021-07-24 10:41:23',84,_binary '\0'),(525,'Domain-Driven Design in Software Engineering: A Systematic Literature Review\n\nAn excellent piece of writing. We gain a thorough understanding of DDD through this paper. DDD users will benefit from the roadmap, as it provides guidelines for both researchers and practitioners. \n',53,'2021-07-24 11:04:58',33,_binary '\0'),(526,'Paper Title：\nDomain-Driven Design in Software Engineering: A Systematic Literature Review\n\nPaper summary:\nDomain-Driven Design (DDD) is an approach to software design，which attract more and more attention. However, there is still no in-depth understanding of DDD. The purpose of this paper is to understand and show the state-of-the-art in the field. This paper discusses how to use DDD from the benefits of applying DDD and the challenges and measures of existing DDD, so as to give other researchers some references. \n\nComments for author:\n1. The introduction of DDD in the introduction part is not sufficient, and it does not reflect the importance of DDD in software design. In addition, in the introduction part, some challenges of applying DDD proposed by researchers need to be discussed to illustrate the importance of this paper.\n2. RQ\'s motivation is not clear enough. Some evidence is needed to prove the necessity and effectiveness of them. For example, the need to discuss benefits is not explained and why challenges and solution need to be discussed.\n3. Fig1 shows both the action and the entity, which is a bit confusing. Does the product consider arrow + number instead.\n4. The benefits and measures mentioned in the paper do not give the number of papers, that is, what many researchers believe are the benefits of applying DDD and the measures to solve the challenges. The direct listing of results is less instructive for researchers.\n5. Benefits, challenges and solution are separate, and they are not connected in this paper. I feel that the whole RQ proposal is fragmented.\n6. In this paper, the pattern is an important part, but it is not mentioned in RQ.\n7. The eleven in the abstract should be Roman numerals.\n8. The comparison with Evans in Figure 7 is confusing, whether other forms of presentation are considered, such as curves instead of lines.\n9. Section 5，Discussion did not discuss the benefits and challenges of the previous content in depth. Section 5 does not reflect the value of this papers。\n10. How to apply DDD is a very important and valuable RQ. It is not enough to answer this question mainly by pattern. There is no explanation on how some steps mentioned in the answer were obtained. \n11. In Section 5, when introducing the application process of DDD, the discussion on how to get the process is not sufficient. For example, \"In this activity, every feature in the requirements document are discussed line by line [S20].\", which does not explain how to perform this step.',53,'2021-07-24 13:27:19',31,_binary '\0'),(527,'This is a Systematic Literature Review of Domain-Driven Design in software engineering. As a long-term research work which has been reviewed two times before, this work is well-wirtten and well-structured. I suggest to submit it to the journal and get some comments from SE community.',53,'2021-07-24 18:38:44',39,_binary '\0'),(528,'This paper investigates the impacts, causes and solutions of architectural smells in microservice system so as to better support microservice boundary evolution, which serves up-to-date empirical evidence from industrial perspective. In a nutshell, this paper is well presented and can be improved from the following aspects:\n1. What about indicating “case study” in title, abstract? I noticed that this study merely conducted at one enterprise with limited participants. How can we transfer the conclusion and suggestion given in this study?\n2. Why six architectural smells were selected? Is it because they are representative, or critical, or the challenges faced by the target enterprise?\n3. Lack of meta quantitative data support for indicating the impacts of architectural smells. \n4. To me, the strategies of dealing with architectural smells are somewhat high-level, however I can understand it is significant challenge. \n5. Figure 3 is a double-edged sword, as Dr. Kuang mentioned.\n',54,'2021-08-13 09:36:54',44,_binary '\0'),(529,'This paper proposes an ensemble learning approach for automatically detecting vulnerability, which helps in reducing false positive, false negative, etc. This paper can be improved as follows:\n1. Where are the results and analysis to the proposed hypothesis?\n2. I noticed that this study used CNN, LSTM, etc. as feature extractor and then feed the high level features to LR, RF? Am I correct? Why not implement an end-to-end solution?\n3. The ensemble strategy is somewhat less rigor.\n4. The details of the proposed approach are not clear to me. Will you publish the source code?\n5. The presentation should be improved.\n',55,'2021-08-13 09:37:31',44,_binary '\0'),(530,'It should be weak reject.\n- The language expression of the paper needs to be polished repeatedly. Don\'t use rhetorical questions.\n- The motivation is not clearly and accurately stated. In abstract, you stated \"Existing solutions\nto this problem are mostly based on features that are defined by human experts and directly lead to missed potential vulnerability\". However, there are already several related studies using deep learning.\n- Compared with other work that used deep learning, what are your contributions? In terms of contribution,the improvement of prediction performance or the proposal of a framework is not enough. Selection of a known algorithm is also not enough as a contribution. I suggest describing the framework as a new approach and clarifying the characteristics that distinguish it from existing approaches. \n\n',55,'2021-08-13 10:03:52',37,_binary '\0'),(531,'It should be reject.\nThe paper is well written, but the contribution is not sufficient.\n- Section 3.2, both the number of ASes and maintainability are related to scale. If scale is not excluded, it is difficult to directly explain the correlation between number of ASes and maintainability. \n- Section 5, \"theory\" cannot be established through survey.\n- The relationship between causes and ASes is too vague, which neither helps practitioners to understand the ASes nor helps to improve the architecture. These causes are almost common sense, they cover different aspects of the input of software development, and they are clearly related to the outcome (architecture) of development. There are many other constraints to these causes besides architecture, and in this regard, the effectiveness of the solutions reported in the study is debatable. Obviously, the investigated team is aware of these solutions, but their architecture is still suffering ASes.',54,'2021-08-13 10:26:11',37,_binary '\0'),(532,'1. The main problem is that what the paper contriutes to the community is not clear, i.e., \"what is the innovative point of the PreNNsem method\" is not present consistently in the introduction and the related work.\n2. In the design of PreNNsem, why are the two hypotheses? Do the authors want to elaborate the rationality of treating vulnerability detection the same as natural language processing? If yes, the point is that is it a creative idea for the community? If all is okay, it is suggested to specify the title further. \n3. Still in the design of PreNNsem, what is present in figure 1 is not properly explained in the text. Take a simple example, what are the corresponding elements of ``embedding layer\".\n4. As for the experiments and results, what are the objectives of this part? Through what experiement, the effectiveness of the proposed approach could be validated. What are the hypotheses and expected results from the authors, if the approach is effective enough. More descriptions should be given.',55,'2021-08-13 10:52:15',23,_binary '\0'),(533,'This paper proposes intelligent and automated vulnerability detection while using deep\nrepresentation learning and heterogeneous ensemble learning. The following are some of my comments on this paper：\n\n- This paper does not elaborate on the shortcomings of previous machine learning applications, and the corresponding areas in which progress has been made in this paper.\n- The two hypotheses in Section 3 seem a bit abrupt, and it will be more convincing if you add detailed arguments.\n- In the preprocessing of Section 3-C, when indexing code words, is the relative difference of the index related to the semantics of the word? Will it affect the effectiveness of the NLP method?\n- The Chapter 4 of the paper is very logical and convincing for the method selection process of the PreNNsem framework, but the comparative verification part is somewhat weak. It is recommended to expand the content of the comparative verification to show the advantages of the PreNNsem framework.\n- The PreNNsem framework is more like a permutation and combination of existing methods. It would be better if such a combination can be reasonably demonstrated to be sufficiently contributory or to elaborate on the differences between the PreNNsem framework and the existing methods.',55,'2021-08-13 12:47:52',83,_binary '\0'),(534,'This paper discusses the impact of ass on microservice system, which is of research significance, but there are other problems:\n1 the article understands the causes and solutions of ass through interviews. It is strange that the respondents clearly found the causes and solutions of ass and why ass still occurs. This point deserves further exploration.\n2 The solutions proposed in this paper are very common, and their real effectiveness and practicability need to be discussed. There is a lack of sufficient data to show that the solution is useful and can provide reference for other developers.',54,'2021-08-13 13:04:28',61,_binary '\0'),(535,'There are some problems in the article:\n1 The significance, motivation and contribution of the research need to be further improved.\n2 the method of \"prennsem\" proposed in this paper does not highlight the innovation.\n3 Other scholars also use deep learning for relevant research, and there is a lack of comparison of relevant work in the article.',55,'2021-08-13 13:12:01',61,_binary '\0'),(536,'Using a hybrid approach of survey, interview, and focus group, this paper collects practitioners\' views on six typical architectural smell in real telecommunications systems living in microservices architecture, and discusses the possible impacts, causes, and solutions of AS to explore strategies for using AS to support the evolution of microservices boundaries.\n\nSome personal views on this article:\n\n1. When describing the impact of architectural smell on the boundary of microservices, there is no intuitive data representation, which is not very impressive. Can we discuss it more intuitively with relevant data?\n\n2. Whether the sample size is too small for the interview and investigation of relevant practitioners in the industry.',54,'2021-08-13 13:28:39',79,_binary '\0'),(537,'In this paper, an intelligent automated vulnerability detection method based on deep representation learning and heterogeneous integration learning is proposed.\n\nPersonal views on this article:\n\n1. In chapter 4, the part of comparative verification is not sufficient and does not have convincing force. Can we expand the content of comparative verification to show the advantages of PreNNsem framework?\n\n2. This paper does not elaborate on the defects of previous machine learning applications, and what corresponding progress has been made in this paper.',55,'2021-08-13 13:38:35',79,_binary '\0'),(538,'This study presents an overall classification of the impacts, causes, and solutions of architectural odors (TAS) to support the evolution of microservice boundaries, addressing three major issues.\n \nViews on this article:\n \n1. For the survey of industrial practitioners, whether the number of interviews is insufficient\n \n2. Six typical AS are not explained. Why are they typical',54,'2021-08-13 13:41:29',83,_binary '\0'),(539,'This paper shows us the impacts, causes, and solutions of AS through a mixed-method approach consisting of survey, interview and focus group. And it also discusses TAS and strategies for evolving microservice boundaries. In a word, it\'s a both informative and directive paper, while there are some issues to be addressed in my opinion.\n1. I think the content of Section 4 is important in this paper, so it\'s better to add more details to enrich it. For example, the process of data processing and the results of data analysis can be detailed by some figures to make the conclusions more credible.\n2. Figure 3 play a significant role in this paper, but it\'s too complicated to read, I think it\'s better to add explanation of it and remove some lines in it.\n3. The title of Figure 2 ends with an odd \".\", which is meaningless.\n4. There are some language problems in this paper. For example, the \"impacts\" in 4th line of Abstract should be \"impact\", and the \"generates\" in the 1st line of Section 4.3 should be \"generate\". Also, there some syntax problems, like the sentence \"While the research on the causes…\" is not complete in English.\n',54,'2021-08-13 16:49:35',81,_binary '\0'),(540,'This paper proposes a machine learning framework called \"PreNNsem\" featured by \"Ensemble Learning\" to help detect vulnerabilities in software code. The research idea of this paper is brilliant and the research results also outperform some professional tools, however there are still some issues to be discussed.\n1. In my opinion, the key contribution is not highlighted enough in the title and abstract. The main contribution is the proposed framework called \"PreNNsem\", while the word doesn\'t appear in the title or abstract, which could make readers like me confused. I also think that the feature \"Ensemble Learning\" is only part of the framework, and is not emphasized enough in this paper. Another detail about this is that, in the 1st line of 6th paragraph of Section I, the first appearance of \"PreNNsem\" is better to be put behind the word \"framework\".\n2. I also think that in the Section III, the basic knowledge of machine learning such as CBOW and the metrics takes too much space of the paper, which makes the contribution of the paper  less highlighted. The relevant content could be cut down.\n3. There are also some language problems in this paper. \n1)In terms of punctuation marks, some possessive cases miss letter \"\'\" in them, such as \"a token s context\" in the 1st line of page 3. \n2)In terms of sentence tense, there are also some discordance, such as \"we have expanded…. We used …\" in Section II. \n3)There also some typos such as the word \"closed\" in \"are closed to human expression\" in Section III.\n4. The layout of the paper can also be optimized. TABLE II is only referenced in page 7 and is easier to read if put in page 7.\n5. For Fig 6, there is an odd \".\" in the title and some text in the figure is blocked or is out of the boundary.\n',55,'2021-08-13 16:48:27',81,_binary '\0'),(541,'This paper uses a comprehensive approach to gather practitioners\' views on six typical architectural smells of real telecommunications systems living in a microservice architecture, in order to better support the evolution of the microservice boundary and provide industry experience and basis. The paper can be improved in the following aspects:\n1. The practicability and efficiency of the scheme need to be further confirmed, lacking sufficient data support and demonstration.\n2. The sample quantity needs to be further expanded to ensure that the article is highly persuasive and the discussion content is universal.\n3. There is some formatting issues and  some language problems.',54,'2021-08-13 16:54:52',55,_binary '\0'),(542,'This paper proposes an automatic vulnerability detection method based on deep learning, which is innovative and can optimize the performance and improve the method. But here is some points:\n\n1.The main idea and major contributions should be clearly stated at the beginning of the article, especially when compared to other work that uses deep learning\n2.The  expression of the article needs further consideration, and the explanation of some concepts is a little more detailed\n3.The PreNNsem Framework\'s contributions and strengths need further elaboration',55,'2021-08-13 17:05:20',55,_binary '\0'),(543,'This paper proposes a vulnerability detection framework, which solves the limitation of manual feature extraction in the field of vulnerability detection. There are some suggestions:\n\n+ III-G,  At the end of the first paragraph, a \".\" is redundant\n+ IV-D, The last paragraph and the penultimate paragraph are repeated, one of which should be deleted. And, fot this paragraph, it is suggested to  add some specific data to support the conclusion\n+ Fig-6, Description of the horizontal and vertical axes is missing\n+ Table-3, The value of \"R\" (decile) and \"F1\" (hundredth) of \"BiLSTM\" are incorrect, please check it.\n+ IV-F, The end of the second paragraph misses a \'.\'',55,'2021-08-13 17:16:25',78,_binary '\0'),(544,'Some comments are as follows:\n1. The number of interviewees who participated in the individul interview is too small, I am afraid they could not provide a comprehensiv e understanding on ASs.\n2. The figure 3 is too complex and I think it should provide more details to illustrate the figure.',54,'2021-08-13 17:17:26',73,_binary '\0'),(545,'Some comments are as follows:\n1. In the abstract the contriution of this paper is not explicit, and the framework this paper proposed also dose not appaer in the abstract part.\n2. Some language mistakes such as \"a token s context\" in the first line in the  right side of page 3.',55,'2021-08-13 17:38:09',73,_binary '\0'),(546,'The author try to investigate the possible impacts, causes, and solutions of AS from practitioner s perspective through a mixed-method approach consisting of survey, interview and focus group. \n \nAs a manuscript which has been revised and reviewed several times before, I believe the author has tried her best to present this work to the community, and the latest version is well-written. However, I stiil worry about the lack of quantitative data. It depend on the oppion of reviewers.',54,'2021-08-13 18:28:55',39,_binary '\0'),(547,'This paper provides an automatic vulnerability detection method based on machine learning, which is novel and practical. There are some problems as follows:\n1. The interpretation of some terms is relatively rough, which may cause problems for beginners\' understanding.\n2. The description of PreNNsem framework needs to be more detailed.',55,'2021-08-13 19:24:23',17,_binary '\0'),(548,'In this paper, six kinds of architectural smells in a real telecommunication system are analyzed, which is practical.There are still some problems with this paper:\n1. Why these six architectural odors were chosen requires a more detailed explanation.\n2. The scheme needs some detailed verification data to prove its validity.',54,'2021-08-13 19:34:51',17,_binary '\0'),(549,'This paper investigate the possible impacts, causes,and solutions of Architectural Smell (AS) from practitioner’s perspective for exploringthe strategies of using AS to support evolving microservice bound-ary, explore the causes for AS, a five-aspect conceptual modelwith technology, project, organization, business and professional isproposed, both technical and non-technical solutions are distilledto deal with ASes, TAS and thestrategies in providing decision supports for evolving microserviceboundaries are discussed, this work has a certain research contribution and is meaningful. The language is well expressed and the content is substantial,  the lines in Figure 3 can be adjusted more clearly.',54,'2021-08-13 19:52:15',6,_binary '\0'),(550,'This paper proposes  intel-ligent  and  automated  vulnerability  detection  while  using  deep learning  and  heterogeneous  ensemble  learning, transform sample data from source code, represent  the  sample  data  as  real  vectors,  the  vectors  are  fed  to  a  deep  learning  model  to  obtainthe  features  of  vulnerability, then train  a  heterogeneous ensemble  classifier, analyze  the  effectiveness  and  resource consumption of different network models, compare approach with some other vulnerability  detection  commercial  tools  and academic methods. The experimental   results   show   that the proposed  method  provides  improvements  in precision,  recall etc. This work has a certain research contribution and is meaningful, the language is well expressed and the content is substantial.',55,'2021-08-13 19:52:41',6,_binary '\0'),(551,'This paper aims at investigating ASes for supporting decision makings in microservice boundaries evolution, by inspecting their impacts, causes, and solutions from practitioner’s perspective. \n\n- This article is rich in content and clear in expression，I vote to accept.',54,'2021-08-13 20:22:15',78,_binary '\0'),(552,'This paper aims at investigating ASes for supporting decision makings in microservice boundaries evolution, by inspecting theirimpacts, causes, and solutions from practitioner’s perspective. Amixed-method inquiry that combines survey, interview and focusgroup was carried out to analyze six typical ASes in a microservices-based telecommunication system. The paper is well written and there are some suggestions:\n\n1.In section 3.2, the author said “we analyzed a sample of fives nap shots of the ‘big’ releases in each month of the system.”. What does the ‘big’ releases mean? How the selected big releases will effect your result? Please explain the concrete meanings and prove the rationality. \n2.This paper proposed a holistic Taxonomy of the impacts, causes, and solutions for Architectural Smells (TAS) . It’s important to introduce the application in real project and whether it is effective. Quantitative data could be listed to show the experiment result.\n3.I notice that only four developers (SRD) and seven architects(SRA) replied your survey. The number of participators is too small for such a research. The result from their answers may not absolutely correct. How to prove they can satisfy the diversity and contribute the study sufficiently?\n4.There should be some clear specification for Figure 3 to . It’s hard to understand.',54,'2021-08-13 22:54:30',26,_binary '\0'),(553,'In this paper, according to existing detection methods, the author analyzed vulnerability detection’s core problem, which is the lack of proper feature extraction. They researched vulnerability detection methods related to deep learning and presented the PreNNsem  framework to detect vulnerabilities by analyzing source code. This paper is well written and there are some suggestions:\n\n1.The author introduced several deep learning based related work, It’s necessary to exclaim your motivation clearly and point out the superiority of your proposed method which differs from others.\n2.The author should consider whether the two hypothesis proposed in section 3 are useful. Why you raise these hypothesis and how will you prove them through your experiment? Background should be explained before the hypothesis and more content should be discussed in the end of the paper to response the hypothesis.\n3.There could be some explanation of why you choose these algorithm. They have been proved effective or you choose them in other reasons.\n4.The author spend a lot to write the technology theory in the paper. It seams like a detail introduction for deep learning techs. You should point out the innovation and superiority of your research.\n5.Figure 6 is not printed well, you should show it clearly.',55,'2021-08-13 23:23:45',26,_binary '\0'),(554,'This paper proposes intelligent and automated vulnerability detection while using deep representation learning and heterogeneous ensemble learning.Some comments are as follows:\n\n1、There should be explanations of the two hypotheses in the paper.\n2、The PreNNsem Framework should be stated clearly in the abtract part.',55,'2021-08-14 09:57:26',70,_binary '\0'),(555,'This paper investigate the possible impacts, causes, and solutions of AS from practitioner’s perspective for exploring the strategies of using AS to support evolving microservice boundary.\n\n1. This paper is well organized and written. But the theme of the paper might not be favored by ICSE.',54,'2021-08-14 10:13:39',70,_binary '\0'),(556,'some comments are as follows:\n1、According to the above, the full name of CO and SF in line 228 should be written for the first time\n2、In section 3.2, why  we choose “big” release from multiple versions ?Is this “big” release convincing?\n3、Participants in the survey need to further explain why the selected persons are sufficiently representative',54,'2021-08-14 10:24:44',74,_binary '\0'),(557,'Paper Title:\n\nTowards Understanding Architectural Smells in Support of Microservice Boundary Evolution\n\nPaper summary:\n\nMicroservices is a predominant architectural style. Architectural smell refers to architectural issues that have a negative impact on software maintenance. Its existence leads to poor maintainability of microservices. This paper uses questionnaires, interviews, and focus groups to study the impact, causes, and solutions of architectural smell. This research provides decision support for the research of microservices\n\nComments for author:\n\n1. How the article used the methods of questionnaires, interviews and focus groups to finally give the process of Fig. 3 is not clear enough. The paper do not give a specific amount.\n2. This research adopts different methods according to different roles. But did not explain the reason for this.\n3. Only two types of measures are given for architectural smell. There is no clear explanation on the rationality and completeness of this result.\n4. The classification of the causes and resolution strategies of architectural smell is not related to the specific architecture.\n5. The paper did not explain clearly the listed architectural reasons and strategies are relatively complete? The completeness of the study is not clearly explained.\n6. The author needs to consider whether it is necessary to give more project and team information to better understand the research background in the research of microservices。',54,'2021-08-14 10:37:27',31,_binary '\0'),(558,'some comments are as follow:\n1、If the performance of the algorithm is greatly improved, it is best to see the specific performance improvement in the summary\n2、In the comparison table with other typical algorithms, the result data of this algorithm should be highlighted\n3、In section Overview of PreNNsem, the whole process is described very concisely, and there is no explanation why such a process design is needed.',55,'2021-08-14 10:38:00',74,_binary '\0'),(559,'This study investigates the possible impacts, causes, and solutions of AS from practitioner’s perspective for exploring the strategies of using AS to support evolving microservice boundary. The whole paper is rich in content, smooth in logic, compact in layout, and very good in language. This paper has been revised and improved many times, and I believe it has been perfect in writing. But I know very little about empirical study, so I can only give some immature opinions as follows.\n\n- In terms of data collection, only one ICT company was selected for research. Are the conclusions drawn insufficient? As for the number of researchers in the survey, only 15 architects and developers were selected. Can the scale be expanded? It feels less universal.\n\n- Regarding the selection of architectural smell, 16 ASes selected from 84 ASes, what are the selection criteria? The reason for the selection of the final six ASes is not explained in detail. \n\n- Quantitative data is not used when talking about the impact of architectural smell. Personally suggest adding quantitative analysis, which may be more convincing.\n\n- The first impression that Figure 3 gives me is that it is very large and complex. If it can be simple and clear, I believe it would be better.',54,'2021-08-14 10:59:20',84,_binary '\0'),(560,'\nThis paper proposes a framework that involves pre-training for vector representation, neural networks for automated feature extraction, and ensemble learning for classification (PreNNsem) to improve the feature engineering of vulnerability detection. Stacking is a common trick to improve performance. It is good to migrate this method for vulnerability detection. In the experimental part, a lot of experiments have been done and the experimental results have also been explained in detail. It can be seen that the workload is sufficient.  However, there are some points are worthy of further improvement:\n\n- Abstract: Since the title of this paper describes an ensemble approach, it is recommended that the proposed approach should be introduced in the abstract, such as the motivation for adopting the ensemble method and the advantages of the method in the entire network structure. Thus it can clearly illustrate the contribution of this paper. (I personally think that the introduction of the entire algorithm process is not enough to show your highlights.)\n\n- Introduction: The part explains the two problems in the field of vulnerability detection, and then directly introduces the proposed method without explaining why the heterogeneous ensemble learning approach is used. It is recommended to organize some words to introduce the motivation of using the ensemble method.\n\n- Design Of PRENNSEM: CBOW is a classic word embedding model, which belongs to the scope of normal knowledge reserve. Personally, I don’t think too much space is needed to explain the model. Maybe you can focus on describing the function of CBOW (using contextual words to infer the center words) which also corresponds to the first hypothesis you put forward. Also, CNN and LSTM are the same. In addition, in the Introduction part, the first letter of the full names of CBOW and CNN is suggested to be capitalized.\n\nSome minor issues on the format of the paper:\n1. There is an extra \".\" at the end of the first paragraph of Part G of III.DESIGN OF PRENNSEM. \n2. Please check whether the F1 value (554.2) in the BiLSTM row of table III is wrong.\n3. The title of table VI is the same as that of table V, maybe you need to check it.\n4. It is recommended to use the three-wire table to present all tables. \n\nIn the NLP field, BERT is a popular model in recent years. In future work, you can consider using this model for feature learning, and the MLM(Masked Language Model) in it draws on the idea of using context to infer center words in the CBOW model.\n\n',55,'2021-08-14 10:53:26',84,_binary '\0'),(561,'\nPaper Title:\nAn Ensemble Learning Approach for Vulnerability Detection in Software\n\nPaper summary:\n\nThe paper proposes an in-depth study of vulnerability detection methods, deep representation learning and heterogeneous ensemble learning. Finally, the method index proposed by the classification research is improved.\n\nComments for author:\n1. The research motivation of the paper is not clear, and there is no explanation for the help that can be provided in other studies.\n2. The paper did not clearly present the difference between this research and other researches.\n3. The paper does not have a discussion.Readers cannot directly and clearly understand the main points of the paper.\n4. The paper regards that the indicators of the study have been improved, but it does not give the measures to provide the indicators only discusses the methods, what is the significance of the paper?\n5. The discussion of related work is insufficient to reflect the characteristics and differences among them.',55,'2021-08-14 10:55:59',31,_binary '\0'),(562,'This paper proposes intelligent and automated vulnerability detection while using deep representation learning and heterogeneous ensemble learning. The proposed framework, which involves pre-training for vector representation, neural networks for automated feature extraction, and ensemble learning for classification (PreNNsem), focuses on improving the feature engineering of vulnerability detection.\n\nSome comments are as follows:\n1. \"Therefore, we must reduce or eliminate reliance on intense labor from human experts.\" I think the argument for this conclusion is not sufficient. On the other hand, completely eliminating the dependence of experts is not necessarily the best. I think it is better to have some authoritative references to support the argument.\n2. \"In this section, we choose CNN and Long Short-Term Memory (LSTM) as the base deep learning model.\" In section III, the paper did not give the reasons for choosing CNN and LSTM as the base models. And the following \"three concatenated CNNs and one CNN as a network model\" also lack an explanation.\n3. The layout of Fig 6 is not very clear, and the font size is also inconsistent.\n4. The position of some charts is not appropriate. For example, Table 4 is mentioned on page 7, but it is shown on page 9.',55,'2021-08-14 11:17:15',76,_binary '\0'),(563,'This paper investigate architectural smells for supporting decision makings in microservice boundaries evolution, by inspecting their impacts, causes, and solutions from practitioner’s perspective.\nThis paper is well organized and informative. I voted to accept.',54,'2021-08-14 11:23:55',71,_binary '\0'),(564,'1. The layout of spacing does not look so comfortable, for example \"4 RESEARCH METHODOLOGY\", \"6.1 Dealing With Architectural Smells\" and \"AS is likely to lower the modularity of MSA-based systems\" in Section 5.\n2. The content of the paper is rich and detailed.',54,'2021-08-14 11:30:48',76,_binary '\0'),(565,'Title: Towards Understanding Architectural Smells in Support of Microservice Boundary Evolution\n\nSummary: As a metaphor for potential architectural issues that negatively impacts software maintenance, Architectural Smell (AS) can be used to pinpoint refactoring oppotunity for evolving microservice boundary. This paper investigates the possible impacts, causes, and solutions of AS from practitioner\'s perspective for exploring the strategies of using AS to support evolving microservice boundary. To achieve the purpose, this paper carries out a mixed-method approach consisting of survey, interview and focus group.\n\nComments:\n1. I think that Section 4.6 needs to describe the data analysis process in detail.\n2. Are there quantitative data to make the conclusion more convincing?',54,'2021-08-14 11:37:51',68,_binary '\0'),(566,'Title: An Ensemble Learning Approach for VulnerabilityDetection in Software\n\nSummary: \nThis paper proposes intelligent and automated vulnerabiliy detection while using deep representation learning and heterogeneous ensemble learning. The experimental results show that the proposed method is better than some well-known vulnerability detection commercial tools and academic methods in false positive rate, false negative rate, precision , recall and F1 score.\n\nComments:\n1. In Fig.6, symbols represented by green triangles are not clear, and the font style may need to be ajusted.\n2. The proposed method \'PreNNsem\' needs a more detailed description and highlights its contribution and innovation.',55,'2021-08-14 11:55:38',68,_binary '\0'),(567,'This paper proposes intelligent and automated vulnerability detection while using deep representation learning and heterogeneous ensemble learning.\nThis paper is rich in content and the results are meaningful. Some comments are as follows:\n- Introduction on page 2: should `feature engineer` be changed to `feature engineering`\n- Table I: should thousands separator be added to the `7285`\n- In my understanding, hypotheses usually need to be verified, and the hypotheses in this paper are more like the setting of preconditions. Is it better to express it in another way',55,'2021-08-14 11:57:15',71,_binary '\0'),(568,'This article proposes a framework using deep representation learning and heterogeneous integrated learning for intelligent and automated vulnerability detection.\n\n1.The paper did not clearly put forward the difference between this study and other studies.\n2.The paper believes that the research index has been improved, but it does not clearly provide measures to provide the index. I think this is more important.\n3.There is an extra “.” at the end of the first paragraph of Part G of III.DESIGN OF PRENNSEM.\n4.The title of Table VI is the same as that of Table V.\n5.The style of all tables should be unified.\n6.Some terms need to be explained more clearly and highlighted. ',55,'2021-08-14 12:20:10',16,_binary '\0'),(569,'This paper investigate architectural smells for supporting decision makings in microservice boundaries evolution, by inspecting their impacts, causes, and solutions from practitioner’s perspective.\n\n1. Section 4.6 needs to describe the data analysis process in detail.\n2. Since the data comes from only one company, how to ensure the universality of the conclusions? It can be elaborated in the limitation.',54,'2021-08-14 12:31:11',16,_binary '\0'),(570,'This study proposes an approach to assess SE grey literature by leveraging literature review and AHP method, which contributes to the up-to-data evidence-based SE. To improve the quality of this paper, I suggest the authors pay attention to the follows.\n1. Even for grey literature, there are a large number of categories. I\'m worried about the rationality and availability of several quality assessment criteria. Taking criterion – “reputation” as an example, rationale as it is, however, how can you distinguish the author published other work in the field? Too much effort is need to make on this point. Again, in my opinion, quality criteria for specific literature are better than general ones.\n2. Too many introductions of AHP method, note that this paper has already far over 10 pages.\n3. The experimental evaluation is conducted in a limited scale, which may exist biases.\n4. The mathematic notations should be improved, e.g. “x”.',56,'2021-08-20 10:02:48',44,_binary '\0'),(571,'The contribution of this paper is not yet clear enough. The authors might consider the following four suggestions to highlight its contribution.\nFirst, both abstract and conclusion have highlighted the rapid literature review and industrial survey conducted to identify quality criteria and their mappings to grades. Nevertheless, in the whole paper structure, the related discussion is limited in Sec. 4 while introducing EvaCRC. If the authors intended to emphasize the contribution about this review and survey, I suggest to standalone this part. Of course, more details and valuable findings should be present.\nSecond, what the contributions in Introduction highlight, \"the first to do sth.\" is not persuasive enough. Why this kind of \"first\" is significant to the community should be illustrated.\nThird, the contribution of the EvaCRC approach itself is not evident enough.\nForuth, why what is discussed in the discussion is important enough to be highlight in the end of introduction? It seems that these \"strategies\" are more of technical tips in implementing the methods, bringing little implication about its application in practice.',57,'2021-08-20 11:45:49',23,_binary '\0'),(572,'Some standards in the article do not seem very appropriate, such as:\n1 \"reputation\" is a very time-consuming standard in my opinion, but the actual benefit is not large;\n2. The \"timestamp\" article does not specify the scope of \"recent\";\n3 \"cited\" this is also a very time-consuming work, but there is no considerable income. Note that gray literature is not white literature, so it is difficult to find out whether it is cited;\nIn addition, the content distribution of the article is unreasonable and the length is too long. The first two chapters should be reduced',56,'2021-08-20 12:04:17',61,_binary '\0'),(573,'It seems that too many points are mentioned and emphasized in the introduction, e.g., \"evidence-based body of quality assessment checklist\", \"guidelines on the use of GL in SE\", \"prioritization taxonomy of quality assessment criteria of GL\", etc. This somewhat distracts our readers\' mind so that the contribution of this paper to the SE community is not clear enough.\nMoreover, the quality assessment instrument (RQ2) and the tailorable QA checklist for GL (RQ3) in the results cannot be clearly correlated to the RQs in introduction. \n',56,'2021-08-20 13:15:24',23,_binary '\0'),(574,'--- OVERVIEW ---\nThis paper propses an apporach named EvaCRC to evaluate the quality of code review comments and help the reviewers to improve therir comments in somehow. In my opinion, the quality criteria selected in this research are doubtful, no solid evidence can prove that \"kindness\" is a necassary attribute for good comment. Moreover, I expect more content about how EvaCRC can help reviewers to improve their comments, it is more important than the effectiveness and fairness of it.\n\n---Major Comments---\nSECTION 2: In my opinion, it is not a motivation example since I cannot understand why a new apporach for evaluating CRC is necassary for SE community. I would recommand to elborate more about the quality difference of CRC and the effect of it.\n\nSECTION 3: I recommand to explain why multi-label learning is suitable for this research and the comparsion with other method rather than simply describe what is multi-label learning.\n\nSECTION 5: A new research question about how EvaCRC can help reviewer to improve their review comments is necessary for this research, since the effectiveness and fairness of this model are not the key point of this work. Or you can discuss it in DISCUSSION. \n\n---Minor Correction---\nLINE 1186：Since \"516900/1496340\" would be split into two lines， \"516900 out of 1496340\" is better.',57,'2021-08-20 15:26:22',39,_binary '\0'),(575,'The authors propse a criteria list to assess trhe quality of GL through literature review and Analytical Hierarchy Process. It is a valuable work since there is an urgent need for quality assessment guideline in SE community, especially for the researchers who have interest with GL. In my opinion this work is worth to be discussed in an international conference like ICSE.',56,'2021-08-20 15:33:46',39,_binary '\0'),(576,'The paper also has the following problems:\n1 Contribution: This article proposes a method called EvaCRC to evaluate the quality of code review comments. Then I would like to see that the application of EvaCRC brings significant improvements over other methods, but the article covers less and is not prominent;\n2 Innovation: EvaCRC As far as I am concerned, in my opinion, he does not seem to have unique innovations. They are common methods. The narrative of the paper should be adjusted to highlight the innovation part. .',57,'2021-08-20 15:36:44',61,_binary '\0'),(577,'This paper provides a novel and practical method to analyze the quality of grey literature based on SLR and questionnaire. There are still some problems with this article:\n1. How to verify the effectiveness of the method finally, that is, how to measure the distance between the predicted value and the real quality of the method.\n2. How to deal with the default value, that is, the processing of N/A item.',56,'2021-08-20 16:39:14',17,_binary '\0'),(578,'- The results in the abstract can specifically report the research results.\n- The quantitative data in the Quality assessment criteria did not reflect the responses received from the invited SE community experts.\n- Table 11: Three GLs about DevSecOps only presents Link without a brief description.',56,'2021-08-20 17:18:06',6,_binary '\0'),(579,'The description of research motivation in abstract is not enough.\nThe Results and Analysis chapter can be refined and enriched, in order to better reflect the multi-label learning approach for evaluating code review comments.\nThe font of code review comment in Figure 2 needs to be adjusted.',57,'2021-08-20 17:30:43',6,_binary '\0'),(580,'This paper provides an innovative and practical evaluation method of code review comments based on multi-label learning. There are still some problems with this paper:\n1. Why is relevant work put at the end? Most papers put relevant work at the front of the paper.\n2. This article is actually a mapping from labels to quality rather than directly from comments to quality, so the title may cause misunderstanding.',57,'2021-08-20 17:36:05',17,_binary '\0'),(581,'This study evaluates SE grey literature through literature review and analytic hierarchy process. As more and more people are interested in grey literature in software engineering industry, the demand for evaluation guide is increasing. This study contributes to the empirical SE based on the latest data and has practical significance. Here is some suggestions.\n\n1. A list of standards for evaluating GL quality is proposed in the article, but many of them are difficult to quantify, and some descriptions are vague, which may lead to more errors.\n2. It is better to provide a specific scheme for the validity test of the method in the paper to prove the feasibility and credibility of the model.\n3. Be clear about your contributions. Listing and emphasizing concepts too much can make your essay seem scattered.\n4. The structure of the article is not appropriate. Some chapters should be deleted and some descriptions need to be simplified.',56,'2021-08-20 19:17:53',55,_binary '\0'),(582,'This paper propses an apporach named EvaCRC to evaluate the quality of code review comments, which has some innovative value, but there are still some areas to be improved.\n1.The main idea and major contributions should be clearly stated at the beginning of the article.\n2.The  expression of the article needs further consideration, and the explanation of some concepts is a little more detailed.',57,'2021-08-20 19:22:34',55,_binary '\0'),(583,'This study investigated quality criteria from both academia and industry and established mappings between quality characteristics and quality grades of CRCs. The author also proposed a BERT language model based multi-label learning approach (namely EvaCRC) for automatically characterizing and evaluating CRCs. the result showed that proposed model performed better than other baseline model. There are some suggestions:\n\n1.The introduction part described the implement and effectiveness of EvaCRC. There should be more content of contribution to researchers and practitioners. What will EvaCRC contribute to real code review process and what is the concrete superiority compared to others. These should be put in introduction part to point out your contribution.\n\n2.In 5.2 experiment setup, The author said “we conducted stratified samplings (by comment length) to ensure the consistent number of review comments.” There is expression problem here. “sample by comment length” to ensure “consistent number of review comments”?\n\n3.In 4.2.2 Criterion Synthesis and Mapping, how to prove the correctness of your mapping result? Some mapping may raise ambiguity.\n\n4.I didn’t see the label process before model implementation and validation, Readers may question how you label your data and whether it is correct and effective. It should be introduced before you experiment.\n\n5.Table 4 and 5 is hard to read, you could label the best validation data in each project to point out the best model.',57,'2021-08-20 21:39:19',26,_binary '\0'),(584,'This study evaluates SE grey literature through literature review and analytic hierarchy process. It contributes to the empirical SE based on the latest data and has practical significance. Tere is some suggestions:\n\n1)It could be some validation of your method to prove the effectiveness\n2) The background section spend too much to introduce related work and techs.',56,'2021-08-20 21:51:51',26,_binary '\0'),(585,'This paper assesses the quality of Grey Literature using a mixed method, and proposes the  credibility quality assessment criteria of GL. The results can be useful for both academia and industry to leverage GL in their research and work. However, there are also some issues to be addressed in my opinion.\n1. The results of RQ2 in Section 4.3 are important contributions of the paper, while the analysis of prioritization of the criteria is only about C2 and C15, which I think is not enough. More other criteria like Fairness could be taken into consideration to give readers more information.\n2. In figure 1, the logos of Tweets and Stack Overflow are emphasized while other kinds of GL not and there is no related text to explain why.\n3. There may be a reference error in the explanation of C24, which is a “?” in line 997.\n4. There are also some minor issues about language and figures. For example, the “find” in line 27 should be “found” because other parts of the abstract use simple past tense. And also, the style of Table 7 is different from other tables.\n',56,'2021-08-20 23:01:45',81,_binary '\0'),(586,'This paper uses a multi-label learning approach for evaluating code review comments and outperform the baselines in terms of effectiveness and fairness, which can help industry do better code reviews. However, there some issues to be addressed.\n1. The language in the paper is hard to understand maybe due to the lacking writing time.\n2. The fonts in the figures are too small to read, such as Figure 2.\n3. The Table 3 should be split in the middle to look better.\n',57,'2021-08-20 23:02:21',81,_binary '\0'),(587,'This paper proposes a multi-label learning approach for Evaluating Code Review Comments (namely EvaCRC). This is the first performs multi-grade, end-to-end evaluation, and also, is the first explores evaluation fairness. Here are some comments:\n- The text font in some pictures is too small.\n- The paper does not explain in detail why multi-label learning is suitable for this research. It makes this article appear to lack motivation.',57,'2021-08-20 23:24:49',83,_binary '\0'),(588,'This paper proposes the quality of of GL in SE with a mixed method, and proposes the credibility quality assessment criteria of GL. Here are some comments：\n- The article’s description of the research contribution is not clear and convincing enough.\n- Whether the treatment of N/A value in the text is the same as 0.',56,'2021-08-20 23:34:02',83,_binary '\0'),(589,'Some suggestions are as follows:\n1. In this paper, the authors propose a multi-label learning approach for Evaluating Code Review Comments, but they do not compare this approach with the existing approaches, so I think this part should be added to rich the contirbution of this paper.\n2. Some pictures are too small to recognise the text in them, and some formulas and algorithms\' explanations are too cumbersome.',57,'2021-08-21 09:12:11',73,_binary '\0'),(590,'This paper uses a mix-method approach with literature review and Analytical Hierarchy Process (AHP) to develop an initial version of evidence-based implements and guidelines to assess the quality of GL in SE. Following are some suggestions:\n- Introduction and Background take up too much space and it makes people tired to read.\n- The reason why choose AHP for analysis could be more detailed.\n- Maybe you can appropriately reduce the explanation of the specific items in the criteria list (because it takes up too much space) or change the format to express them.',56,'2021-08-21 09:34:06',84,_binary '\0'),(591,'Some suggestions are as follows:\n1. The contents of some criteria are similar so when using the check list some researchers may be confuse, such as C18 and C22. Besides, some criteria are difficult to understand or judge, such as C3 and C19.\n2. The direction of Table 4 is verticle so it is hard for readers to read.\n3. This method uses a 4-point Likert scale (yes=1, unclear=0.5, no=0, and N/A) to assign scores to assessment questions, but sometimes it is difficult to judge whether the score is unclear or N/A.',56,'2021-08-21 10:04:42',73,_binary '\0'),(592,'This paper proposes a weighted quality assessment checklist as the guideline to assess the quality of GL in SE. There are some suggestions:\n\n- Section 2 should be refined\n- Some error in Fig2：In Section 3，describe that research process contains 2 steps：1）use SLR to determine **candidate** quality assessment criteria；2）use questionnaire to determine the **final** quality assessment criteria. The output of step 1 should be the input of step 2，but the figure shows that the output of step is the final result. Why?\n- Table 4 is recommended place in the appendix, or place in horizontal after refining the description of each criteria',56,'2021-08-21 11:24:57',78,_binary '\0'),(593,'This paper proposes a BERT language model based multi-label learning approach (namely EvaCRC) for\nautomatically characterizing and evaluating CRCs. There are some suggestions:\n\n- It should be explained why CRC is suitable for multi label classification, and it can be compared with single label classification for verification\n- The font size and format in the picture should be adjusted\n\n- Section 3, line 284, the sentence \"Note that both CC and LR take into account...\", \"LR\" should be \"LP\"',57,'2021-08-21 12:05:15',78,_binary '\0'),(594,'Paper Title:\nEvaCRC: A Multi-label Learning Approach for Evaluating Code Review Comments\nPaper summary:\n\nThis article proposes a multi-label learning approach for Evaluating Code Review Comments, which design four quality criteria. The author believes that this approach is the first multi-grade,end-to-end evaluation.\n\nComments for author: \n1. The motivation of the paper is not sufficient, and the necessity of evaluating the code review is not reflected.\n2. The comparison between this paper and other studies is not sufficient, and there is no difference between this study and other studies. \n3. The motivation of the paper is not sufficient, the paper only same method in different scenario. The paper can discuss the characteristics and significance of the code review in the enterprise scenario.\n4. The author should analyze the advantages of this method from the characteristics of the enterprise scenario.\n5. The paper gives insufficient reasons for the four quality criteria, and the distinction between the four criteria is not clear enough. ',57,'2021-08-21 12:06:14',31,_binary '\0'),(595,'Paper Title:\nOn Assessing the Quality of Grey Literature in Software Engineering Research\n\nPaper summary:\nGrey literature is widely used in software engineering and other fields. However, researchers are troubled by the large and low quality grey literature. To solve this problem, the paper proposes a mix-method. At the same time, literature review was used to investigate the quality of grey literature. The author selected 26 articles and finally determined 24 quality assessment criteria for assessing the quality of GL in SE\n\nComments for author: \n- The quality assessment criteria is selected through literature review, but it is difficult to apply. For example, reputation is highly subjective in its application. This will affect the quality of assessment.\n- One of the contributions of this paper is to present a checklist. But the applicability of the checklist has yet to be confirmed. For other researchers, how to use the checklist to assessing the quality of grey literature and the possible problems in the assessment process are not discussed in this paper',56,'2021-08-21 12:50:54',31,_binary '\0'),(596,'The motivation of the paper is not sufficient, and it does not reflect the necessity of evaluating code review. In particular, it is necessary to repeatedly emphasize the difference between this research work and other work and its significance.\n\nSome pictures are too small to recognize the text, and some formulas and algorithm explanations are too cumbersome. ',57,'2021-08-21 22:17:29',16,_binary '\0'),(597,'review on EvaCRC: A Multi-label Learning Approach for Evaluating Code Review Comments\n\nThis article proposes a multi-label CRC evaluation algorithm based on BERT. The main work lies in the establishment of CRC evaluation standards and the construction of CRC\'s automated evaluation algorithm.\n1、Format problem: in line 114 ，it is werid to use \"suggest\" before \"the place\" ，or it\'s just that I misunderstood；line 483 ，this sentence seems to be incomplete\n2、The introduction of pre-training is very brief, and there is no description of the steps and input and output in combination with the specific scenarios considered in this article.\n3、For the process description of Figure 2, I hope to have a more detailed display. Do we need to explain the reason for the setting of hyperparameters?',57,'2021-08-21 22:41:14',74,_binary '\0'),(598,'This article uses various methods in the literature survey to complete the quality survey of gray literature in the field of software engineering.\nonly one comment:Some large charts are not easy for readers to read. It is best if  highlight some key information or re-format for adjustments.',56,'2021-08-21 22:53:06',74,_binary '\0'),(599,'This study evaluates learning-based predictors in a view of economic impact. This is a convincing，practice-driven research and is a great reminder for other researchers. I suggest the authors consider the following.\n1. The authors illustrate the impact of “false positive” and “false negative”, and later highlight the meaning of “recall”. However, I think “AUC” is also worth considering. More details please refer to “F1 VS AUC”.\n2. The types of predictors are limited, I suggest at least consider SVM that confirmed valid and highly effective before the era of DL.\n\n',58,'2021-08-27 09:24:14',44,_binary '\0'),(600,'1. Too many elements in title, pre-processing, machine learning, traceability, real-world project. Which do you really want to study?\n2. What are the real problems in terms of software traceability? Without empirical verification in real-world industrial projects is not enough. \n3. Confusion on the techniques’ taxonomy to software traceability.\n4. Confusion on the features presented in Table 3.\n5. Have you confirmed the rationality of features?\n6. Are there any correlations between data sparsity and class imbalance?\n7. Incomplete paper.\n\n\n',59,'2021-08-27 09:24:48',44,_binary '\0'),(601,'To be honest, the paper structure in this edition is much clear than the prior. However, several major points still confused me and could probably be refined to improve this paper.\n1. The objective presented in the abstract, i.e., \"to gain an understanding of how well the state-of-the-art ML-based trace link\nclassifier works in real-life applications\" seems somewhat decrease the contribution, if my understanding is what the authors intended to present.\n2. The results of the industrial investigation reveal that \"data imbalance and sparseness issues pose the main threat to predicting\ntrace links\". Then what implications these results have provide for the designing of EDPLTrace? Similarly, the experiments are claimed to better traceability tasks with greater performance and practicality. What are the relationships between these two benefits and the proposed EDPLTrace?\n3. The points of Sec. 4 are somewhat hard to get. Why the authors named the proposed ENDPTrace \"Exploratory Strategies\"? BTW, the structure of this section can be improved, e.g., using the steps in the process as subtitles directly. Again btw, the figure baout the process is too far from the discussion.\n4. In the experiment setup, why the two RQs are significant to be addressed? And how to devise experiments to answer them? Rather than just presenting the used metrics and the perspective of experiments, an overall discussion about the rationale of these experiments are expected.\n5. In the results of experiments, it seems that the observations from OSS projects are not distilled, e.g., in the take-aways.\n6. Still in terms of the experiments, what are presented in the RQ2 and what are answered are somewhat distracted. Specifically, from RQ2, how each component of EDPLTrace contributes to its effectiveness is expected to be analyzed and discussed.',59,'2021-08-27 10:17:45',23,_binary '\0'),(602,'\n1. The application strategies (i.e., in which conditions predictive CI can be applied) in the discussion are the prerequisite of using predictive CI in practice and significant to this paper. In my humble opinion, these strategies indicating that the authors have considered the practical considerations of applying predictive CI (e.g., risk of leaking defects) rather than justing pursuing for high cost saving\nand should be highlighted in the abstract and the conclusion.\n2. In terms of Sec 5.1, the expressions about the three RQs are not clear enough and could be further refined. Here are some specific understandings of mine. RQ1 is to study the impacts of different predictive performance (in terms of Rp and Rf) on the cost of service source and human resouces, RQ2 is to investigate the impacts of existing predictors on the cost of service source and human resouces, RQ3 is for the impact of predictive CI (existing predictors exactly) on the utilization rate of server resources. Compared to RQ2 and 3, the abstraction level of RQ1 seems to be too specific. As for RQ3, the target object (probably existing predictors) should be notified. Meanwhile, the authors should explain why the perspective of human resource is not involved.',58,'2021-08-27 14:24:26',23,_binary '\0'),(603,'In this paper, discrete event simulation is used to predict the results of continuous integration so as to reduce the waste of developer\'s time. This work is more valuable and novel. There are still some problems in the article:\n1. It seems that the article does not clearly put forward the application limitations of this method, which may attract some doubts.\n2. The article should be compared with some other methods to prove the advantages of using DES.',58,'2021-08-27 16:55:29',17,_binary '\0'),(604,'This paper proposes a method to enhance data preprocessing to improve the learning-based traceable model of real items, which has some practicability. There are still some problems in this paper:\n1. Some fonts in the figure are slightly blurred, such as in Figure 4.\n2. The Spaces between some letters in Figure 1 are too large and need to be adjusted.',59,'2021-08-27 17:52:51',17,_binary '\0'),(605,'In this paper, the discrete event simulation method is used to predict the results of continuous integration from the aspect of economic benefit, which can effectively evaluate and save time cost, and has good research value.\n1. Some of the limitations of the study can be explained, such as the type of predictor\n2. The  expression of the article needs further consideration, and the explanation of some concepts, especially the RQs, need to be little more detailed.',58,'2021-08-28 00:57:58',55,_binary '\0'),(606,'This paper improves the learning-based physical traceability model and verifies it with a large number of detailed data, which has certain innovation and value. And here is some suggestions:\n\n1. The motivation of RQ design is not clear, so it is suggested to elaborate RQ more specifically based on contribution points and experimental data.\n2. The  expression of the article needs further consideration, and the explanation of some concepts, need to be little more detailed.\n3. The interpretation of some of the diagrams and tables,such as table 3, is unclear and difficult to understand, and there are some formatting issues.',59,'2021-08-28 01:05:26',55,_binary '\0'),(607,'- The paragraph after the contribution in the introduction is a bit abrupt here.\n- The description of the participants in the Qualitative results can be placed in the experimental settings instead of in the results.',58,'2021-08-28 08:50:09',6,_binary '\0'),(608,'- There is no explanation and description of the research question, and the experimental setup needs to be related to the research question.\n- The organizational structure is not listed.\n- Contribution points need to be written about the contributions of this research.\n- The discussion part is less content.\n- Format issues, such as 814, 1086 lines, etc.',59,'2021-08-28 08:52:11',6,_binary '\0'),(609,'Some suggestions are as follows:\n1. In the abstract the authors show that the ENDPTrace can provide better support with an increase in F1-score by 40.7%, but they do not explain what F1-score is and what it means for industry.\n2. In the 233 line in page 3 \"As depicted in Figure 4\", we can see figure 4 is in the page 9 and it is so far from the paragraph where it first appear, so I think it is not appropriate.\n3. There are also some format issues, such as \"probabilistic techniques [2? ]\" in line 92 and the line 814 in page 8.',59,'2021-08-28 09:02:15',73,_binary '\0'),(610,'Some suggestions are as follows:\n1. The short paragraph after the contributions in the introduction is strange.\n2. The authors can add some comparison between the DES and other existing methods.',58,'2021-08-28 09:23:37',73,_binary '\0'),(611,'This paper aims to improve learning -based traceability model by using the EDPLTrace strategy proposed by the authors, which can benefit both the industry and academia to make the best of the software traceability. On the whole, this paper is of brilliant work, however, there are still some issues to be addressed in my opinion.\n1. According to the later content, the \"real-word projects\" in the title suggests the \"commercial projects\", but I think these two nouns are not equivalent because the OSS projects are also developed and used in the real world, so in this way the title is kind of misleading.\n2. The proposed EDPLTrace first appears in line 129 without interpretation. Given that it\'s the main contribution of the paper, this could make readers feel confused.\n3. The chosen projects first appeared in the Table 1, but they were not introduced before. I think some more introduction text could make the work more convincing.\n4. The text in Figure 1 is too small to read.\n5. There are also some minor errors in this paper. For example, the \"[2?]\" in line 10 is in messy code and there are repeated \"To our\" in line 51.\n6. There are some syntax errors. For example, the \"support\" in line 39 should be \"supports\". And the temporal tenses doesn\'t match in contributions at the end of Section 1, E.g., the \"We conducted ...\" in the 1st contribution and \"We propose ...\" in the 2nd.\n',59,'2021-08-28 09:48:13',81,_binary '\0'),(612,'This paper uses a simulation approach to evaluate the impact of predictors on CI process, which is a brilliant idea to make the predictive CI in industry more feasible. I\'m not so familiar with SPS, but I still think there are some issues to be addressed in this paper.\n1. The Sec.2 aims to indtroduce the predictive CI and the reason why simulation is needed, however the former one is emphasized but the latter one not. I think it\'s better to add a subsection in Sec.2 to make the reason to use simulation more clear.\n2. There are many elaborate figures in this paper to illustrate the content, while their font is too small to read，which makes. It\'s better to cut down some details or add other figures to illustrate the details.\n3. There are also some layout problems in the paper. For example, there are odd blank lines in the page 16 before the \"Simulation setup\".\n4. There are some typos and syntax errors. For example, in the \"main contributions\" at the end of Sec.1, the \"evaluating\" in \"approach to evaluating ...\" should be \"evaluate\". And in the next paragraph, the \"that\" in \"simulate CI processes that with and without ...\" is an odd one.\n',58,'2021-08-28 09:50:48',81,_binary '\0'),(613,'This paper proposed a novel approach that exploits Software Process Simulation (SPS) to simulate a predictive CI process for evaluation and conduct experiments to evaluate the economic impact of these predictors on the CI process using a Discrete-Event Simulation (DES) model. There are some suggestions:\n1.The contribution described in introduction seams too dim, it’s better to tease it more clearly.\n2.There is no overview description of integral methodology in section 3.\n3.There should be more description for tables.',58,'2021-08-28 10:08:28',26,_binary '\0'),(614,'This paper aims to improve learning -based traceability model by using the EDPLTrace strategy. There are some suggestions:\n\n1.There is no explanation for RQ in section 5.1. It’s hard to understand the real motivation of each RQ. It should be detail content to introduce your aim of each RQ.\n\n2.There is no introduction for RQ3, but it appeared in section 6.3 “RQ3:Effectiveness of CBST_Adjust”. Please notice your paper construction.\n\n3.Figure 4 is too complicated, There should be brief description to let readers understand it in a simple way.\n\n4.In section 2,The author introduce 3 related backgrounds, It seams background 3 “class rebalancing techniques” is a basic techniques which is not highly related to your target. \n\n5.There is an error on line 6 in your algorithm 1. What is the extra ‘z’ ?\n\n6.Meaningful data in table 4 and 5 should be labeled to high light. It will provides data support to your result.\n\n7.Please notice your format problem.',59,'2021-08-28 10:39:31',26,_binary '\0'),(615,'This paper proposes a novel approach that exploits Software Process Simulation (SPS) to simulate a predictive CI process for evaluation and conducts experiments to evaluate the economic impact of these predictors on the CI process using a Discrete-Event Simulation (DES) model. This paper is logically organized and the language is fluent. There are some suggestions:\n\n- \"Although the prediction performance of existing predictors are not good, prediction can still exponentially reduce the demand for server resources. \"So is it worthwhile to trade efficiency for performance? Perhaps the experimental part can be compared with other methods to weigh and evaluate.\n- In the main point, I did not find why the simulation is necessary. Maybe you can add some content to explain your reason.',58,'2021-08-28 11:28:53',84,_binary '\0'),(616,'Paper Title:\nEvaluating the Impact of Predictors on Continuous Integration Process: A Simulation Approach \n\nPaper summary:\nContinuous integration is one of the important process in software development, which can help developers find defects in time. However, the high evaluation rate and long-term make this practice impossible to carry out effectively. This paper uses discrete event simulation models to conduct experiments to evaluate the economic benefits of the predictor.\n\nComments for author:\nCompared with the continuous integration of predictors, the realization of simulation models is a more important contribution of this paper. However, this article does not fully discuss the motivations for choosing the simulation method. Secondly, the discussion on the choice of simulation paradigm is also inadequate. This article does not discuss in depth the reasons for the choice of paradigm. The motivation for paradigm selection is not clear enough.\n\nThe article\'s introduction to the simulation model is not clear enough. The parameter values of the key components are not given, which increases the difficulty for other researchers to restore the work.',58,'2021-08-28 11:41:01',31,_binary '\0'),(617,'Paper Title:\nEnhancing data pre-processing to improve learning-based traceability model for real-world projects\n\nPaper summary:\nThe traceability of software software is considered to be an important factor in supporting software activities. This article applies mainstream traceability technology to study the traceability of software. Two main challenges in traceability research. .\n\nComments to the author:\nThe experimental part of the article is very clear. Because the experiment part occupies a lot of other space, the content of the article is introduced very clearly. For example, the discussion of related research. There is no clear comparison of the differences between other studies and this study. ',59,'2021-08-28 11:48:39',31,_binary '\0'),(618,'The article also has some problems:\n1. The setting of RQ needs to explain the purpose, so that readers can understand the center of the article research;\n2. The words used in the article need to be unified. The \"real word projects\" and the \"commercial projects\" mean the same thing?\n3 there are many problems in details and format, which need to be carefully checked',59,'2021-08-28 11:52:23',61,_binary '\0'),(619,'There are still some problems in the article: \n1. The methods mentioned in the article need to further describe the necessity of efficiency for performance and the practicability of the methods. At present, it seems that the practicability is not very strong.\n2. The contribution of the article needs to be strengthened',58,'2021-08-28 11:53:45',61,_binary '\0'),(620,'This paper aims to improve learning -based traceability model by using the EDPLTrace strategy proposed by the authors, which can benefit both the industry and academia to make the best of the software traceability. There are some minor suggestions:\n- Fig. 4 and Tab. 4 are so close that the layout is strange, and the first impression of Fig. 4 is very complicated. Maybe you can simplify Fig. 4 and enlarge it a bit because the words are too small and a bit unclear.\n- In the abstract, it is said that the paper aims to understand the working conditions of the most advanced ML-based tracking link classifier in practical applications, and then proposed the ED-PLTrace method measures, so the focus of the paper is the proposed method or the ML classifier evaluation of? This point makes me confused.',59,'2021-08-28 11:53:46',84,_binary '\0'),(621,'Title: Evaluating the Impact of Predictors on Continuous Integration Process: A Simulation Approach\n\nSummary: \nThis paper aims to evaluate the effectiveness of predictors from the process perspective in order to facilitate decision making. To achieve this object, this paper proposes a novel approach that exploits Software Process Simulation (SPS) to simulate a predictive CI process for evaluation.\n\nComments:\n1. The penultimate paragraph in the introduction is a bit obtrusive.',58,'2021-08-28 11:58:18',68,_binary '\0'),(622,'This is an article with a complete structure and a very detailed description of the work. It introduces the experimental process of using simulation technology to evaluate the predictor, and discusses the inspiration for the experimental results.\ncomments are as follow:\n1、The position of some parts is a bit strange. For example, in the methodology chapter, two  paragraphs  were used at the beginning to clarify the reasons for using the simulator instead of real experiments. This may be better explained in Chapter 2\n2、Although according to the comparison and analysis of the previous work, it can be concluded that the simulation is necessary, it is difficult to see the necessity of this simulation at the beginning of the article.',58,'2021-08-28 12:50:10',74,_binary '\0'),(623,'comment are as follow:\n1、The explanation and further inference of the experimental results are relatively concise\n2、Figure 4 has a few places that are fuzzy\n3、The text in Figure 3 is too small to affect reading',59,'2021-08-28 13:17:18',74,_binary '\0'),(624,'This paper propose a novel approach that exploits Software Process Simulation (SPS) to simulate\na predictive CI process for evaluation, aiming to evaluate the effectiveness of predictors from the process perspective in order to facilitate decision making. Here are some comments:\n\n1. I think \"Predictors even with low predictive performance can significantly save the cost of CI practice.\" should be in the conclusion part of the Abstract.\n2. Figures 3 and 4 seem too crowded and difficult to read.',58,'2021-08-28 13:56:34',70,_binary '\0'),(625,'This paper developed an EPLTrace approach incorporating hybrid textual similarity measures and semi-supervised learning strategies as enhancements to the learning-based traceability approaches. Here are some comments:\n\n1. Figure 4 is too crowded and complicated to read, some simplication is necessary.\n2. In abstract, this paper aims to gain an understanding of how well the state-of-the-art ML-based trace link classifier works in real-life applications while EDPLTrace approach are proposed to overcome the limitation. So what\'s the point of the paper?\n3. Despite algorithms and formulas, there should also be diagrams to illustrate the structure of Semi-Supervised Learning and CSBT.',59,'2021-08-28 14:29:24',70,_binary '\0'),(626,'In order to make predictive CI in the industry more feasible, a simulation approach is used in this study to evaluate the impact of predictors. I’m not so familiar with SPS, but I still think there are some issues to be addressed in this paper.\n\nIn Sec.2, the aim is to introduce predictive CI and to explain the need for simulation, but the former is emphasized but the latter is not. It seems better if Sec.2 was further broken down to clarify why the simulation is necessary.\nIt is a fairly elaborate paper with many elaborate figures to illustrate the content, but the font is too \n\nsmall for easy reading. I recommend cutting down some details or adding other figures to illustrate details.',58,'2021-08-28 17:30:17',16,_binary '\0'),(627,'In this edition, the paper structure seems much clearer than ever before. However, several major points still confused me and could probably be refined to improve this paper.\n\nBy stating the objective in the abstract, namely, \"to gain an understanding of how well the state-of-the-art ML-based trace link classifier works in real-life applications,\" the authors seem to diminish their contribution if my understanding is what they intended to convey.\n\nAs a result of the industrial investigation, \"data imbalance and sparseness issues pose the biggest threat to predicting trace links\". So what implications do these results have for the design of EDPLTrace? These experiments promise to improve the effectiveness and practicality of traceability tasks. What is the relationship between these two benefits and the proposed EDPLTrace?',59,'2021-08-28 17:34:29',16,_binary '\0'),(628,'The authors try to simalate a predictive CI process to evaluate the ecnomic impact of predictors on CI through software process simulation. This work has been internal reviewed as a conference paper before and I think it has been improved this time. It is worth to sumbit this paper to TSE for experts\' comments.',58,'2021-08-29 08:47:40',39,_binary '\0'),(629,'This paper proposes an apporach called EDPLTrace to solve the data imbalance and sparse problems. This work has been internal reviewed several times before. Although this paper is diffclut to follow, I believe it caused by the knowledge limitatio of myself. In my oppion, the authors should remove part of formulas and algorithms and use more space to inroduce the meaning of this work.',59,'2021-08-29 08:59:06',39,_binary '\0'),(630,'The idea of this paper is clear.First of all,this paper describes the sequence of introducing the project background and content, introducing the research process and methods, introducing the data analysis of the research, focusing on the research focus - 3w1h, and finally summarizing and looking forward to this research, with clear logic and focus.It is worth mentioning that Part5 uses the 3w1h problem method to solve that four RQs. The description is very detailed and the logic is clear. Finally, my opinion is passed.',60,'2021-09-17 09:25:12',93,_binary '\0'),(631,'The research questions and methods are clear, and this paper conforms to the norms of a Systematic Mapping Study.\nBesides, I\'m curious about some details.\n1)In Figure 3, the Primary study amount in 2012 was higher than that in other years from 2004 to 2014\n2)In Section 2.3,The author says \"The members involved in this study include eight research students and their supervisor.\" I am curious about the status of these 8 research students. Are they PhD students, master students or university students?',60,'2021-09-17 10:12:29',8,_binary '\0'),(632,'This paper aims to reveal the reasons behind challenges the logging practices face and identify the gap between academia and industry. It is meaningful for identifying future directions to solve the problems.\nMy views are as follows：\n1. This paper adopts SMS as the research method and build a comprehensive analysis framework to establish a relative overall understanding of logging practice.\n2. Some illustrations are vague, such as without pointing out the positions of eight researchers in Section 2.3 and whether there are more qualitative criteria to evaluate threats caused by research process in Section 7.\n3. In general, the article’s conclusions about logging practices are instrumental both in programming practices and academia. So I vote for this paper.',60,'2021-09-17 10:43:09',90,_binary '\0'),(633,'The paper has taken a holistic view to inspect current logging practice research, and has revealed some key deficiencies in this area through cross analysis, which might indicate possible directions for the future research on logging practices and promote the industry to adopt the state-of-art research achievements.\nHere is the comment:\n1. The font in Figure 1 might be too small to read clearly.\n',60,'2021-09-17 11:00:41',89,_binary '\0'),(634,'This study aims to establish a comprehensive understanding of the research status of logging practices, which further sheds light on the possible reasons behind the challenges and helps identify potential gaps between the state-of-the-art and the state-of-the-practice.The overall content of the paper is substantial and the experiment is very solid. However, there are still some details:\n1. Although the abstract part is classified, it is not clear enough, so people can\'t grasp the key points. You can bold the classification points\n2. The terms in Table 1 can be arranged in a certain order\n3. Fig. 5 can keep the same relationship between text and line, and the position of \"validate\" can be adjusted\n',60,'2021-09-17 11:21:51',62,_binary '\0'),(635,'Summary：\nThis paper makes a comprehensive analysis of the current research status in the field of logging practices, and makes a systematic and comprehensive summary and analysis of the disconnection between theoretical research and production practice in this field, and points out possible directions for the further development of the field of logging practice.\nThis paper clearly introduces the contribution of this paper and the details of the research method, which is a great point.\n\nHere are my suggestions  \n(1) In the first paragraph of the introduction, the description of the current situation before the introduction of logging practices is too long, so consider simplifying;  \n(2) In the sixth paragraph of the FINAL REMARKS, \"The status quo of...\"  \"Quo\" may be a spelling error;  \n(3) It would have been better to emphasize the conclusion of this paper in investigating the \"disconnection between theoretical research and production practice\"; \n',60,'2021-09-17 13:21:34',85,_binary '\0'),(636,'In view of the problem that many research results in logging practices cannot be well adopted in industry, this paper puts forward some opinions. It reveals the potential obstacles and corresponding key deficiencies \nthat the industry can\'t carry out the latest research results of logging practices.Here is the suggestion:\n1、Figure 2 is holistic and logical, but it seems a bit crowded.\n',60,'2021-09-17 14:10:04',91,_binary '\0'),(637,'Logging is an important practice for quality assurance and knowledge transfer in modern software development, whose mining has been gradually concerned in recent years. This paper aggregates and synthesizes 55 primary studies with an expectation to draw a comprehensive picture of the state of logging practice, which significantly contributes to the research community. However, this rigor of the research method is weak. More details of comments are as follows.  \n1. Abstract: The “Background” is a somewhat result- or conclusion-prone style. Making these statements surely asks for a wide range of evidence. \n2. Research Questions: I am confused about the RQ1 and RQ2. How do you distinguish “issue” and “topic”? Can you give a further explanation in paper?\n3. Search: The numbers of target venues of manual search are limited, and therefore some studies may be omitted in this study. I suggest at least include the following venues: “ASE”, “ESEC/FSE”, and “IST”.\n4. Selection: I am confused about the first exclusion criterion – why studies that investigate log analysis or usage of log messages should be excluded? Would you mind explaining it in paper?\n5. Data Extraction and Synthesis: In my review, some extraction items are high-level. So, can you elaborate more examples of extraction and synthesis? \n6. Roles and Responsibilities: According to my experience, the roles and responsibilities of each author during each review process are necessary.\n',60,'2021-09-17 14:15:26',44,_binary '\0'),(638,'Using SMS method, this paper makes a comprehensive study of logging practices from the four aspects(3w1h), reveals the obstacles and gap between the theoretical research and industrial practice, and provides application suggestions of logging practices.\n\n- Some fonts in Figures 1 and 5 are too small\n- Some figures, such as figures 6, 7, 8, use the depth of the background color to represent the relevance strength. Because the font color is white, items with Light background(low relevance) is not clear.\n- In Table 9, data items consist of number and percentage, and the format needs to be adjusted (For example, place in one or two rows Uniformly)',60,'2021-09-17 15:19:32',78,_binary '\0'),(639,'This paper provides a holistic report of the research on logging practices using the SMS method, which can make researchers better understand the future direction of logging research. However, in my opinion there are some issues to be addressed.\n1. It seems rather uncommon to put \"related work\" Section at the bottom of paper. Given that the length of the paper is long, I think it\'s better to put the \"related work\" at top half of the paper, in order to make the content more readable.\n2. The word \"V&V\" appears many times in the paper while there is no related interpretation, which could make some readers like me confused. \n3. Also the \"&\" in the word \"I&Cs\" has a weird shape, and there may be a font issue.\n4. The format of TABLE2 doesn\'t look good, because it seems not a three-line-table.\n5. There are also some syntax issues, for example the sentence \"we have carried out …… in 2017.\" should use past tense instead of present perfect tense.',60,'2021-09-17 16:45:37',81,_binary '\0'),(640,'Logging practices provide the ability to record valuable runtime information of software systems.This study carried out a systematic mapping study on logging practices, aiming to establish a comprehensive understanding of the research status of logging practices. Here are some reviews.\n\n1. The font of Fig 1 is too small to read. \n2. The format of Table 2 is a bit messy, please use a three-line table.\n3. You should consider moving 3W1H part to research method part, since they are closely connected.',60,'2021-09-17 18:50:30',70,_binary '\0'),(641,'This paper aims to establish a comprehensive understanding of the research status of logging practices, which further sheds light on the possible reasons behind the challenges. The figures are beautiful and clear, and the study is strict. After reading, I have some suggestions as follow:\n1. I think you should research \"the research topics in logging practices\" before \"the issues in logging practices\", so the sequence about RQ1 and RQ2 should be adjusted.\n2. I think table 4 can be dropped.because the electronic libraries have been defined before, and the exact number of studies in each library doesn’t seem to matter.',60,'2021-09-17 18:34:44',18,_binary '\0'),(642,'This paper comprehensively analyzes the current research status in the field of logging practice, and summarizes and analyzes the disconnection between theoretical research in this field and production practice.\n- This paper clearly introduces the contribution and the details of the research method.\n- The description of the current situation in the part of introduction seems a little bit miscellaneous.\n- For the readability of the chart, the font size of all tables needs to be uniform.',60,'2021-09-17 19:26:36',83,_binary '\0'),(643,'As a syatematic mapping study, this paper is well-written and strcutured, the author give a comprehensive presentation of logging practices. Although I appreciate the sturcture of this paper, it is not clear that how can other researchers benefit from this paper since the target of it is TSE. The current version of this paper lack of insights for what is worth to do of logging practices in software engineering,',60,'2021-09-17 20:14:21',39,_binary '\0'),(644,'This paper focuses on a survey of logging practice research. The author found that the logging practice research always lack research on why and how well. The paper use plenty of researches to support his idea. However，if the author can give more examples on how logging practice works maybe it could be better.More comments are following:\n1) The font display of & in I&C may be incorrect.\n2) The fonts of fig 1 are too small to read.\n3) The contrast of the fig 4 may be so low after printing.',60,'2021-09-17 21:00:47',75,_binary '\0'),(645,'In this study, a systematic cartographic study of logging practice is carried out in order to have a comprehensive understanding of the research status of logging practice. Through a comprehensive analysis of the research status, the disconnection between theoretical research and production practice in this field is summarized and extracted, which provides the ability to record valuable operational information of software system.Here are some reviews:\n\n1.Abstract part is not clear enough, The \"background\" section needs further refined.\n2. The  expression of the article needs further consideration, and the explanation of RQs, need to be a little more detailed, and the sequence about RQ1 and RQ2 should be adjusted.\n3.The interpretation is unclear and difficult to understand such as data extraction and synthesis section.It is better to give some example,  and there are some formatting issues.',60,'2021-09-17 21:21:35',55,_binary '\0'),(646,'The overall structure of the article is clear, and there are still some small problems.\nThe introduction part needs to clarify the motivation of writing and the contribution of the article;\n2. The division of labor of the research team needs to be clear;\n3. The data synthesis is too brief. It is suggested to show the example of data synthesis in the form of set table.',60,'2021-09-17 21:45:15',61,_binary '\0'),(647,'- In my view, the motivation of this paper （in Sec 1.1） is not strong enough. Specifically, the authors told several stories trying to indicate \"current state\" of logging practice, i.e. the wide-spread issues and the gap betweeen the state-of-the-art and the state-of-the-practice, yet the solutions are not explicitly mentioned. More importantly, \"so what\" of the \"current state\" and the claimed objectives (i.e. a comprehensive understanding of the challanges, solutions, etc) is not illustrated. Btw, why the \"quantitative\" analysis discussed in the later paragraph important?\n- The \"3W1H\" questions are used as a basis to classify the results of this SMS. However, why these four questions are selected is not adequately explained. In particular, can these four questions cover all the aspects in those results about logging practice (e.g. the research topics of the primary studies)? That is, if there are any paper that ought to be categorized into other categories (if exist).Whether the answer is yes or not, is there any evidence? Or the authors might just claim the significance of these four questions, so that they only concerned these four aspects.\n\n- Other specific points in my review are as follows:\n1. Fig. 1 and Table 1 are both used to introduce the logging related terms, yet they are separated. In my personnal view, I suggest to combine the figure and table together, e.g., adding the discriptions of those terms in Fig. 1 to make easier to be understood.\n2. What is presented in Sec. 3 namely the \"metadata analysis\" is somewhat weak and less interesting.\n3. In Sec. 4, the authors say \"a study talking about the same issue of ?performance overhead? may be categorized as where to log in RQ1\", which is somewhat confused since they did not give enough explaination.\n4. In the whole section of results (i.e. Sec. 5), classifying the results across multiple categories and placing the results before others is a little awkward (can we just place these special kind of results after introducing other results).\n5. The considerations discussed in the \"Next Step\" are not actionable enough (e.g. about the design stage).',60,'2021-09-17 23:23:46',23,_binary '\0'),(648,'This study carried out a systematic mapping study on logging practices with 55 primary studies, the result provides a holistic report of the existing research on logging practices by systematically synthesizing and analyzing the focus andinter-relationship of the existing research in terms of issues, research topics and solution approaches. There are some suggestions:\n1.The motivation should be described clearly in introduction.\n2.There are some problem in your figures, please confirm these figures.',60,'2021-09-17 23:26:31',26,_binary '\0'),(649,'This manuscript established a comprehensive understanding of the research status of logging practices.It raised four explicit research questions to paint a landscape of logging practices through systematic mapping study.Here are some reviews:\n1.The text is well arranged and the logic is clear. \n2.It showed specific samples and percentage to prove that it is rational to categorize the issues into  different 3W1H questions and analyze reasons.\n3.Cross analysis made it possible to unveil problems from different perspectives.\n4.The number of studies is small, which raises the question of whether the results are accidental.For instance, the issue “Difficulties in V&V of log statements “ in table “distribution of issues in logging practices” just only account for 3.6%.\n',60,'2021-09-17 23:45:48',92,_binary '\0'),(650,'This paper carried out a systematic mapping study on logging practices to establish a comprehensive understanding of the research status of logging practices. This study provides a holistic report of the existing research on logging practices, suggestions are given on the research and adoption methods of logging practice. The research process of this paper is meticulous. Some comments are as follows.\n- There are some research processes in RESULTS. It is better to only put research results. The research process can be placed in the research process chapter. RESULTS mainly describes the research results.\n- The research status in the discussion should be the result, and it is more appropriate to describe the reasons for the research status.\n- The explanation of the metadata analysis and the reason are not stated.',60,'2021-09-17 23:56:04',6,_binary '\0'),(651,'This study aims to establish a comprehensive understanding of the research status of logging practices, which further sheds light on the possible reasons behind the challenges and helps identify potential gaps between the state-of-the-art and the state-of-the-practice. This is some suggestions:\n(1) The abstract part is not clear enough.\n(2) I\'m confused about \"issue\" and \"topic in RQ1-2\n(3) There are problems with the picture and table in the article.',60,'2021-09-18 01:14:49',2,_binary '\0'),(652,'1. Figure 1 is a little abrupt here. There are a lot of colors in the figure. I suggest to unify the color in Figure 1 with that in the back.\n2. The introduction is too cumbersome. I suggest to delete some contents or move them to the back.',60,'2021-09-18 10:52:03',77,_binary '\0'),(653,'Some suggestions are as follows:\n1. I think the difference between RQ1 and RQ2 is not obvious, and the authors should elaborate on the differences and meanings of the two research questions.\n2. The font in Fig. 1 is too small.',60,'2021-09-18 10:52:50',73,_binary '\0'),(654,'This study provides a holistic report of the existing research on logging practices by systematically synthesizing and analyzing the focus and inter-relationship of the existing research in terms of issues, research topics and solution approaches. I think it’s a good job.\nHere are some of my suggestions:\n1、In figure. 2, I think it is important to explain the elements or activities represented by each element in the diagram, including the meaning for dotted and solid arrows.\n2、Whether the abstract part is too long, and whether the results and conclusion part can be condensed',60,'2021-09-18 11:12:23',79,_binary '\0'),(655,'This paper carried out a systematic mapping study to examine 55 primary studies on logging practices and provided a holistic view of the existing research on logging practices. In addition, it also reveal gaps between the state-of-the-art and the state-of-the-practice and finally raise several future research directions. This paper also has some problems:\n1.	The font size in Figure 1 is a little bit too small for readers to see clearly.\n2.	The structure of the abstract is not clear due to the typesetting of the abstract. It is necessary to adjust the typesetting of this part.\n3.	In the conclusion section, the contribution of the article can be briefly described again.\n',60,'2021-09-18 11:35:09',72,_binary '\0'),(656,'1.The fonts of fig 1 are too small to read.\n2.The format of TABLE2 seems not a three-line-table.',60,'2021-09-18 11:40:03',80,_binary '\0'),(657,'This article sorts out 55 articles on logging practice, and summarizes the current problems in the field and the directions that deserve improvement. Specifically, 3W1H was used to explain in detail the 4 questions raised for the field.Here are some comments:\n1、In the first paragraph of section 1.1, the meaning of the sentence \"questionable realization of the primary purpose\" is vague to understand, and the \"runtime behavior\" that is derived from this sentence is not introduced in the previous paragraph.\n2、The difference between the statements of RQ1 and RQ2 is not obvious, and there is no obvious difference in the interpretation of these two questions.\n3、The graph used to describe \"Cross-checked and reviewed the activity and results\" in Figure 2 are similar to circle and difficult to distinguish\n4、*Personally* speaking, it’s a bit strange that section 4 is placed after the metadata analysis. This section is more like a part of the extension of review mothod, so it is more reasonable to be closer to review mothod or merged with it.\n',60,'2021-09-18 11:48:03',74,_binary '\0'),(658,'This paper aims to establish a comprehensive understanding of the research status of logging practices, which further sheds light on the possible reasons behind the challenges and helps identify potential gaps between the state-of-the-art and the state-of-the-practice. Here are some reviews:\n- I\'m confused about fig2',60,'2021-09-18 11:57:24',71,_binary '\0'),(659,'This article aims to establish a comprehensive understanding of the research status of logging practices and it is rich in content and full of details. However, I still have some questions.\n1、For rq1 and rq2, I think we should investigate the research topics before what problems are found in these research topics\n2、I think the position of “related work” Section in the paper is not appropriate',60,'2021-09-18 13:08:10',65,_binary '\0'),(660,'In order to fully understand the research status of logging practice, this paper makes a systematic cartographic study of logging practice. The work is of practical value. Here are some possible problems:\n1. The abstract and background need more detailed explanation.\n2. The work distribution of the research team needs more detailed explanation\n3. The text in Figure 1 is too small',60,'2021-09-18 13:21:09',17,_binary '\0'),(661,'Some suggestions：\n1. I think there are some overlaps in the design of RQ1 and RQ2. The issues in logging practices are exactly the research topics.\n2. Some diagrams are too far away from the places mentioned in the paper. For example, Fig.8 is drawn on the page 12 while it is mentioned on page 17.',60,'2021-09-18 13:24:14',76,_binary '\0'),(662,'This paper establishes a comprehensive understanding of the research status of logging practices by systematic mapping study on logging practices and provides a holistic report of the existing research on logging practices. The contribution of this paper are unveiling several key deficiencies in logging practice research, revealing potential barriers that may have prevented the industry from adopting the state-of-the-art research achievements and suggesting future research.\n\nHere are some of my personal suggestions:\n1、The descriptions of RQ1 and RQ2 can be confusing for readers for I think that the research hot spots usually are the main issues in a field\n2、The style of the figure can be improved, such as The font in Fig.1 is too small to make it difficult to see clearly, and the distinction between circles and hexagons in Fig. 2 is easy to confuse.\n3、Some of the results are presented in the discussion section，maybe you can refine the description of the result and discussion section\n\n',60,'2021-09-18 13:57:22',67,_binary '\0'),(663,'With the popularity of DevOps,logging is more and more important in modern software development.This paper aims to establish a comprehensive understanding of the research status of logging practices and provide a holistic report of the existing research on logging practices.\nMy suggestions:\n1.The text in Fig.1 is too small to read.\n2.The difference between rq1 and rq2 may be not clear enough.\n3.The abstract may be too long.',60,'2021-09-18 14:18:06',86,_binary '\0'),(664,'This article aims to establish a comprehensive understanding of the research status of logging practices and it is rich in content and full of details. However, I still have some questions.\n1、For rq1 and rq2, I think we should investigate the research topics before what problems are found in these research topics\n2、 The font in Fig.1 is too small to make it difficult to see clearly, and the distinction between circles and hexagons in Fig. 2 is easy to confuse.',60,'2021-09-19 10:07:25',63,_binary '\0'),(666,'Summary：By comparing different code review methods and the practical application of the new review method, this paper introduces the advantages and disadvantages of the new review method, and summarizes the research results and puts forward suggestions.\nThe logic of this paper is clear, and the research questions are very representative.\n\nAnd here are my suggestions  \n(1) The result and conclusion of the Abstract chapter are not very clear, so the contribution of this article cannot be seen intuitively;  \n(2) If the Introduction can be divided into several small fragments, readers can better understand this article;  \n(3) Although the comparison of various censorship methods is introduced in Table 1 in Chapter 3, I think when introducing new inspection, what is new should be highlighted again;  \n(4) Section 5.1 Outlines the additional benefits of the new approach at the beginning, but some sections do not provide sufficient justification for this. Benefit 4, for example, is one of the most commonly used methods of review, and it may be a stretch to consider it as an additional benefit;\n(5) A more explicit summary of the benefits of the new inspection would have worked better;',63,'2021-10-08 11:24:58',85,_binary '\0'),(667,'This paper describes an automatic mechanism that can automatically analyze and feed back the current working state based on the analysis of abnormal working condition.This idea is very novel, has great innovation, and can greatly improve the work efficiency of the software engineer industry, and has great market application prospects.Finally, The logic of this paper is clear, the views are output in detail, and the description of the method is also very detailed and clear.',62,'2021-10-08 13:56:30',93,_binary '\0'),(668,'Summary：This paper selects a framework with strong quantitative ability and designs and realizes the automatic evaluation mechanism of software engineer\'s working state through field investigation. The practical effect of this mechanism is discussed and analyzed.\nThe details of the experimental method are introduced in place, and the experimental results are also very clear. A very thoughtful article;\nThe first three paragraphs of Introduction are all about the problems existing in manual recognition, which can be simplified;',62,'2021-10-08 17:25:59',85,_binary '\0'),(669,'The paper used long-term observations and a data triangulation strategy to evaluate the altered Fagan inspection, and reported experience and lessons from the altered inspection, which might provide suggestions for inspection process improvement.',63,'2021-10-08 19:55:11',89,_binary '\0'),(670,'In order to to get timely feedback on work status for software engineers, the paper came up with an automated evaluation and anomaly identification mechanism, and implemented it in an information and communications technology (ICT) enterprise. Also, the study listed the challenges, solutions and lessons learned in the implementation, which might provide experience for future practitioners and researchers. \nThere is only one comment : The font in figure 2 could be changed to some other fonts, since some words in figure 2 seem like having redundant blank space in it.',62,'2021-10-08 19:55:40',89,_binary '\0'),(671,'This paper focuses on an altered Fagan inspection called new inspection, which is adopted in one global ICT enterprise. The study identifies four benefits, summaries four types of anomalies, identifies lessons and provides suggestion by employing the data triangulation research strategy. The topic of this paper is instructive for enterprises to strengthen code review.\nMy suggestions are as follows:\n1. Section Abstract does not convey what has the study done clearly. For example, it can be expressed clearly that the study identifies four benefits.\n2. For me the details of new inspection is not completely clear and I’m a little confused about what concrete alterations the new inspection revived.\n3. Expressions in Section 5.1 may be not exact. It is pointed out that assisting internal audit is the original intention of the new inspection, but after that it still includes internal audit as additional benefits.',63,'2021-10-08 20:35:14',90,_binary '\0'),(672,'The paper introduces an automated evaluation and feedback mechanism to identify anomalous work outcomes and further give feedback to manager and engineer through selecting a set of quantitative outcome metrics and introducing two methods based on TOPSIS and isolation forest. The theme of this paper is novel, which is different from previous researches and practices. \nAnd I think there may be to many discussions about factors influenced the quality and efficiency of software development and existing models or researches in abstract and introduction.',62,'2021-10-08 20:36:52',90,_binary '\0'),(673,' This article collects timely feedback on the status of developers\' work through interviews and framework mapping and implements an algorithm to automatically detect abnormal states. The ideas in this article are very innovative. This work effectively reduces the subjective judgement of managers when judging developers. I think the article should be accepted.',62,'2021-10-08 20:40:40',75,_binary '\0'),(674,'The automated employee status evaluation method proposed in this article explores how to help managers identify employees with abnormal status in a more efficient and effective way. The following are some comments:\n1. The tense of line 106 \"dealt\" is wrong, it should be normal tense;\n2. \"further identification and feedback still rely on the subjective experiments of engineers and managers\" needs further detailed description. What is the work scenario considered in this article?\n3. Line 311 should be Figure 4\n4. The data analysis part only introduces the method of data preprocessing, and does not tell us how the data is used and analyzed in this article.\n5. Line 514, a dot is missing after the subtitle\n6. The article lacks an introduction to the meaning of the dimensions represented by the i and j symbols\n7. It may be the reason for the limited space, but it would be better if there is a text introduction to the detailed algorithm flow of the isolated forest algorithm in this article (including the training process and the use of data)\n8. This automated Identification method is actually based on traditional manual evaluation procedures, because the most important parameters of the entire system, such as abnormal thresholds and parameter weight settings, actually need to be completely dependent on the manager’s subjective judgment. These variables fundamentally determine the success of this Identification method, which is essentially similar to the situation before the introduction of the method in this article, except that the mathematical mechanism used in this article eliminates some intermediate judgment steps. The most important ones are This question is just as confessed in the discussion chapter. The improvement of this part requires not only the improvement of academic methods, but also the knowledge and help of other fields such as human resource management.',62,'2021-10-08 20:43:43',74,_binary '\0'),(675,'This paper describes the innovation and importance of new era. It is reasonable to start from the deficiency of code review and lead to new era. The whole paper has clear views and clear methods.',63,'2021-10-08 21:01:56',93,_binary '\0'),(676,'This paper builds an automated evaluation and anomaly identification mechanism which can achieve timely feedback on working status of software engineers to support ability and efficiency improvement. The structure and expression of this paper are very clear, and the research is also very valuable. There are some suggestions:\n1. Introduction, Line 131, “**The** we introduced two methods” should be “**Then** …”\n2. Figure 2 can be slightly adjusted:\n\n- The **Position** and **Department** pie charts can be omitted and expressed directly in the text;\n- The data labels’ font of **Source** and **Role** pie charts can be increased\n\n3. Section 4.2，it should explain how the threshold is selected, and provide some suggestions for readers\n\n',62,'2021-10-08 21:09:06',78,_binary '\0'),(677,'This paper describes the importance of code review and gives a new code review scheme with adequate survey data.The positive point of this paper is that the survey gives a clear picture of what code review means in companies, but the results are not particularly impressive. The pictures in the text are clear and the descriptions are relatively clear. I give weak accept.',63,'2021-10-08 21:29:28',75,_binary '\0'),(678,'By realizing the automatic evaluation and feedback mechanism of abnormal work results, the problem that the traditional engineer evaluation needs to waste a lot of resources is solved. The realization of the project was previewed in the experiment, and the problems and solutions were provided.There is only one suggustion，an architecture diagram can be made in Engineer Evaluation and Framework to help intuitively understand the whole project structure.',62,'2021-10-08 21:32:38',91,_binary '\0'),(679,'In this paper, it is very valuable to get some suggestions on serving quality improvement by re-improving Fagan inspectio.Here are some reviews.\n1、The format of Table 1 is a bit messy,it is not so intuitive to understand.\n2、I think the description of new inspection can be more accurate and concrete, which may be more conducive to readers\' understanding.',63,'2021-10-08 21:43:23',91,_binary '\0'),(680,'This article analyzes the nature of the new mechanism and the impact of the new mechanism on the code review process by investigating and recording a new code review mechanism in an enterprise. This is an article with complete structure, rich content and proficient explanation of the analysis process. The expression of sentences is very authentic. I voted accepted.',63,'2021-10-08 22:04:55',74,_binary '\0'),(681,'This paper conducts long-term collections and analyses of various empirical evidence from data triangulation to understand the state-of-practice of new inspection. This paper summarizes the current practice of new inspection, summary the lessons in practice, and finally gives suggestions for improvement. Here are some comments.\n\n1. I think the result part of the abstract is not very clear. It starts with \"Many expert\" and then says \"On the other side, we...\". I think in general, the \"On the one side...On the other side\" structure should be used, and the front and back subject should use \"We\". This way, while maintaining consistency, highlight the results we found.',63,'2021-10-08 22:11:02',70,_binary '\0'),(682,'This paper aims to report experience and lessons from the altered inspection(a variant of Fagan Inspection), and to aggregate and serve suggestions for quality improvement. This paper has a clear theme, clear structure and proper organization. I vote accept.',63,'2021-10-08 23:10:00',78,_binary '\0'),(683,'The paper does a case study that aims to report experience and lessons from the altered inspection, and additionally, to aggregate and serve suggestions for quality improvement\n1. The node in Figure 1 does not correspond to the text. I am not sure where the \"Pull-request\" corresponds to.\n2. The following explanation of RQ3 is for  \"code anomalies\", so I think RQ3 should be written as \"Code anomalies\" rather than \"anomalies\".\n3. Code review not only improves the quality of development for developers, but also increases the test efficiency of testers, but this paper only mentions development when describing the benefits of code review.',63,'2021-10-08 23:16:54',18,_binary '\0'),(684,'The paper implements an automated evaluation and feedback mechanism of anomalous work outcomes in an information and communications technology (ICT) enterprise to achieve timely work status feedback for software engineers.\n1. In section 4.1, I feel that there is no sufficient reason why some indicators can be discarded without system data records.\n2. This paper should be compared with existing methods to show correctness and efficiency improvement\n3. Some minor formatting problems, such as \"g\" for \"group anomaly\" in section 3.3 should be capitalized and Formula 7 is missing \')\'.',62,'2021-10-08 23:18:06',18,_binary '\0'),(685,'This paper collects quantitative outcome metrics and maps each metric to an existing assessment framework. This paper also describes TOPSIS and iForest for automatically identifying abnormal work products of software engineers and reports feedback collected from engineers and managers. The paper also reports on the challenges, solutions and lessons learned during the implementation process.\nIn conclusion chapter, it would be better to add a summary of the findings of CHALLENGE AND LESSONS LEARNED. In addition, there are some grammatical errors in this paper, and indenting of paragraphs is not consistent, the style of pictures is also not consistent.',62,'2021-10-08 23:30:28',8,_binary '\0'),(686,'This paper do the code review research by employing long-term observations and a data triangulation strategy. This paper reports on a new variation of Fagan inspection, reports its origins, populations, participants, processes, and outputs, etc. This paper also identifies various limitations and risks of new inspection, and then recommends suggestions for inspection process improvement. The main points of this paper are obvious, and the results and findings are clear.',63,'2021-10-08 23:46:06',8,_binary '\0'),(687,'This paper implement an automated evaluation and feedback mechanism of anomalous work outcomes in an information and communications technology (ICT) enterprise to achieve timely work status feedback for software engineers. \nThe logic of the whole article is very clear and the method is reasonable. Here are my suggestions:\n1. In 3.2.2, the collected metrics should be listed in a table or graph. This part has been describing how to obtain metrics, but it does not give the results of metrics, which can make people feel confused. If metrics are listed below, readers should be told in this section which graph the metrics are in.\n2. In 3.3.1, in \"We call these two anomaly dimensions as \"group anomaly\" and \"Status anomaly\".\", the first letter of \"group anomaly\" is not capitalized, but the first letter of \"Status anomaly\" is capitalized.\n',62,'2021-10-08 23:46:07',79,_binary '\0'),(688,'In order to improve work efficiency and help engineers and managers in several aspects, this paper implement an automated evaluation and feedback mechanism of anomalous work outcomes in an information\nand communications technology enterprise based on ideal solution (TOPSIS) and isolation forest (iForest).\nMy suggestions:\n1) This paper should compare the results with those of other algorithms.\n2) The number of interviewees may be insufficient.',62,'2021-10-08 23:58:28',86,_binary '\0'),(689,'This paper introduces a new method by explaining the importance of code review, collects and compares the data of this method with other review methods, summarizes the experience and puts forward suggestions to aggregate quality improvement.This paper has strict logic and clear structure.',63,'2021-10-09 00:13:20',86,_binary '\0'),(690,'This paper implement an automated evaluation and feed-back mechanism of anomalous work outcomes for improving software engineers’ ability in a visible method.There are my comments:\n1.although the interviewees come from different positions, which makes work outcomes more comprehensive, the number of each positions are insufficient.\n2.There is no reason about why “Time spend on meeting ” and “Times pend on learning enterprise cources”  can represent indirectly.',62,'2021-10-09 00:57:05',92,_binary '\0'),(691,'This paper shows the experience and lessons about altered Fagan inspection.It has sufficient and detailed stuff  to show us.Although the diagrams and tables express lots of information,they are a little bit complicated .Generally speaking,the analysis is reasonable and logic,so my comment is accept.',63,'2021-10-09 02:22:35',92,_binary '\0'),(692,'This paper conducted long-term collections and analyses of various empirical evidence from data triangulation to understand the state-of-the-practice of new inspection. The investigation is meaningful and contributes to practitioners, but you should point out your contribution clearly in abstract.',63,'2021-10-09 08:59:57',26,_binary '\0'),(693,'This paper reports the experience and lessons about the new inspection in a global enterprise, which show the help to other organizations. All in all, the research idea is good and the process is rigorous, meantime the language is very rigorous. However, there are some issues to be addressed in this paper in my opinion.\n1. There is no paper structure information in the paper, and I think it\'s better to add it to make the paper easy to read.\n2. Some of the time tenses in this paper are mixed in use, and it\'s not so comfortable to read. For example, this problem appears in the 5th paragraph in the Section 1.\n3. There are some syntax errors in this paper. For example, the \"are\" in \"including but are not limited to\", line 295(line number on the left) is odd.\n4. The x axis in Figure 5 represents the time, but the range of each time period is different. It can be more intuitive if the \"2020-H1\" and \"2020-H2\" can be divided into quarters rather than halves.',63,'2021-10-09 09:15:00',81,_binary '\0'),(694,'Some suggestions are as follows:\n1. In the abstract part the authors should specify their contributions.\n2. In the research methodology part, the authors mention that they employ a data triangulation research strategy and then describe this strategy\'s advantages briefly. But I think authors should list some other similar strategies and explain why they choose this data triangulation research strategy.',63,'2021-10-09 09:16:13',73,_binary '\0'),(695,'This paper proposes an automated evaluation and feedback mechanism to identify engineers\' anomalous work outcomes, which can both benefit the engineers to improve themselves and the company to understand the engineers\' status better. This research idea is good, however, there are some issues to be addressed in this paper in my opinion.\n1. In the Abstract, there is a sentence \"we implement an automated evaluation ... in an ICT enterprise ...\" to explain the work done in this paper. I think this expression implies that the mechanism only adapts to this situation, which weakens the contribution of this paper. So I think it\'s better to make the mechanism independent from the situation, which means removing the \"ICT enterprise\" in the sentence and emphasizing the ICT enterprise situation is only the case study later in the paper.\n2. There are only 18 interviewees in this paper, which may be too few to draw out effective conclusions.\n3. There is no paper structure information in the paper, and I think it\'s better to add it to make the paper easy to read.\n4. The framework selection is an import step in this paper, but in the Section 3.1, there is little content to explain why to select the competency framework proposed by Moustroufas et al and the content of framework. There is also an error in Section 3.1: the \"Figure 3\" in the sentence \" These competency aspects are shown in Figure 3\" should be \"Figure 4\". And I think it\'s better to move Figure 4 close to Section 3.1 to make the framework easier to understand.\n5. There are some syntax errors in this paper. For example, the \"proposed\" in \"There are even some studies proposed competency frameworks\" in line 29(line number on the left) should be \"proposing\".\n6. There are some typos in this paper. For example, the \"inter interviews\" in line 124.\n7. Also, there are some wrong punctuation mark use. For example, the \".\" behind the \"Besides\" in line 145 should be \",\".\n8. In the Figure 3, the text of the 3 steps are better to be aligned left, so it can look better.',62,'2021-10-09 09:21:19',81,_binary '\0'),(696,'1. After reading the abstract, I was very confused. Firstly, the explanation of \"new inspection\" was not clear enough, and the readers did not know what it was doing; Secondly, the author seems to put more emphasis on \"lessons\" in the abstract, and the use of \"desire a distance from its expectations\" in the abstract will affect the senses of the whole article. The reviewers may not be interested in reading it, consider more display experience, and finally point out the lessons;\n2. some reviewers of the data analysis and synthesis meeting attach great importance to the expression \"we employed multiple data analysis and synthesis methods. This section discusses on three of them in particular.\" it is not appropriate. It is suggested to express all the analysis and synthesis methods, or we mainly use these three methods.\n3. from the results, the comparison between \"new inspection\" and \"peer code review\" is better, so this can be highlighted in the previous description.\n4. The explanation of Figure 5 needs to be strengthened. Does the value of box diagram represent each inspector? How many inspectors are there?\n5. in the discussion part, \"quality and productivity\" and \"synergy among multiple participant roles\" are old-fashioned and have no special new ideas.',63,'2021-10-09 09:56:18',61,_binary '\0'),(697,'This paper reports experience and lessons from the altered inspection, and additionally, aggregates \nand serves suggestions for quality improvement.The logic of this article is very clear, here are some of my opinions：\n1. The Fagan inspection is directly given in the summary. You should briefly explain the source or history of the Fagan inspection. People who have not been in contact with the Fagan inspection will be more confused about what a Fagan inspection is.\n2. The results in the summary are a bit abstract and not clear enough. I think we can discuss the results in Chapter 5 here to make it clearer.\n3. In Figure 2, each stage should be executed in sequence. Marking a serial number before each stage will make the diagram clearer.\n',63,'2021-10-09 09:32:56',79,_binary '\0'),(698,'1. It is better to have specific figures for the efficiency improvement in the summary, such as the percentage increase.\n2 in the introduction section, you need to briefly introduce the methods you use, what TOPSIS and iforest are and how to do it.\n3. Try not to start all contributions with \"we\". Secondly, don\'t describe your work and write your contributions directly.',62,'2021-10-09 09:35:55',61,_binary '\0'),(699,'This paper proposed automatic employee status evaluation method explores how to help managers identify employees with abnormal status more efficiently, it collects timely feedback on the status of developers’ work through interviews and framework mapping. Here is some suggestions: \n\n1.This paper should be compared with existing work to show contribution, correctness and efficiency improvement\n2.The  expression of the article needs further consideration, and the explanation of some concepts, need to be a little more detailed.\n3.The interpretation of some part is unclear and difficult to understand, and there are some formatting issues.',62,'2021-10-09 09:57:54',55,_binary '\0'),(700,'This paper implement an automated evaluation and feedback mechanism of anomalous work outcomes to help managers to know software engineers’ situation and improve software engineers’ ability .My comments are as following:\n- The number of interviewees in this article is only 18. Although they come from different positions, the conclusions drawn from this still lack feasibility.\n- The chart styles in this article are quite different. For example, Figures 2, 4, and 5 are in color, while Figures 1, 3, and 6 are in black and white. The percentage data in Figure 2 is difficult to read.',62,'2021-10-09 09:58:24',83,_binary '\0'),(701,'This paper reports on a new variation of Fagan inspection. The case study in this work aims to report experience and lessons from the altered inspection, and additionally, to aggregate and serve suggestions for quality improvement. Here is some suggestions: \n\n1.This paper should be added with paper structure. \n2.The  expression need to be a little more detailed, such as that section Abstract does not convey what has the study done clearly.\n3.The interpretation of some part is unclear and difficult to understand, and there are some formatting issues and syntax errors. ',63,'2021-10-09 10:04:06',55,_binary '\0'),(702,'Some suggestions are as follows:\n1. In the end of the introduction the author should add the paper structure information.\n2. In the section 3.1, the author explain the framework selection and the reason to select the competency framework proposed by Moustroufas, but the explaination is too short. I think the author should elaborate why to make this decision and compare this framework with other similar framwork.\n3. In the interview part the author select 18 interviewees to conduct data collection process, but I think the number is a bit small so the information may not be comprehensive.\n4. There are some grammar mistakes, such as \"when an engineer find that\" in line 748 and \"managers always need to find out and dealt with in time\" in line 105.',62,'2021-10-09 10:42:58',73,_binary '\0'),(703,'This paper introduces an altered Fagan inspection called new inspection. And reported the experience and lessons of a new inspection of a global company. My comments are as following:\n- All the Figures in this article except Figure 3 are in color. If change the icons in the picture to color, it may look more uniform.\n- If add more detailed research content and specific contributions to the abstract, readers will understand what this article is talking about more quickly.',63,'2021-10-09 10:47:23',83,_binary '\0'),(704,'This paper realizes the automatic evaluation and feedback mechanism of anomalous work outcomes, so that the working status of software engineers can be fed back in time. Here is my suggestions:\n1、The number of interviewees is not enough.\n2、It is not compared with the existing methods.',62,'2021-10-09 10:53:12',65,_binary '\0'),(705,'The goal of this paper is to propose a detection scheme for the automatic anomaly work outcome of software engineers and managers. This article mainly discusses which metrics are collected in the design, how to implement anomaly detection and how this solution will help engineers and managers.\nHere are some small suggestion:\n- 18 interviewees seem to be a bit small, which lacks universality.\n- It need to discuss more existing algorithms and models to compare the advantages of this method.',62,'2021-10-09 10:56:52',82,_binary '\0'),(706,'In the face of the human burden caused by the previous manual review of abnormal working conditions of engineers within large companies, the author interviews engineers and managers to judge the performance and status of the engineers that need to be reviewed, and generates an automatic review mechanism to reduce the workload, then assess the status of the individual and the team in two ways.\nQ：Fewer interviews were selected to obtain the correct assessment criteria to ensure the status of the engineer.\nQ:Lack of choice of occupation and breadth as an engineer.\n',62,'2021-10-09 10:57:57',88,_binary '\0'),(707,'This paper mentions a code review method, which is Fagan inspection with some alterations namely “new inspection”. For this method, this paper conducted long-term collections and analysis of various empirical evidence from data triangulation. Finally, some experiences and lessons about the new inspection are reported, and some suggestions for improving quality are put forward. Some suggestions are as followed:\n1. The whole article looks like an investigation report rather than an academic paper, and I feel that the article lacks some of my own innovation and further contribution.\n2. At the end of the first chapter, there is no general introduction to the content of the remaining chapters, which makes the structure of the article not very clear.\n3. According to the first point of contribution in the last part of the first chapter, investigation itself is only a kind of behavior and cannot be counted as contribution, only the conclusion drawn after investigation can be counted as contribution.\n4. There is no clear introduction to the concept of “Fagan inspection”, making it difficult for readers to understand the concept.\n5. The article mentions that the outcomes of the “new inspection” is far from the expected but does not give any explanation. What is the expectation and what is the difference between the final result and the expected results?\n',63,'2021-10-09 11:37:34',72,_binary '\0'),(708,'This paper introduces a new inspection method based on the Fagan inspection method, analyzes the benefits of the method, what kind of advice should be provided in the new method, what anomalies can be inspected, and what creativity the method brings.\nHere are some suggestions:\n- The authors should explain in more detail what new inspect is, who the participants are and how they should work. Otherwise, readers will find it difficult to understand subsequent concepts.\n- I think the bold part in abstract can be deleted, these words seem unnecessary.',63,'2021-10-09 11:07:57',82,_binary '\0'),(709,'This paper introduces an altered Fagan inspection and reports the experience and lessons about the new inspection in a global enterprise. Here is some suggestions:\n1、The \"Pull-request\" step in figure 1, I didn\'t find an explanation in the paper.\n',63,'2021-10-09 11:20:58',65,_binary '\0'),(710,'Some suggestions are as follows:\n1. I think the summary of the purpose in the abstract is too concise and not very appropriate.\n2. A organizational structure of the full paper is better put at the end of INTRODUCTION.\n3. The space between the image and the text is a bit small. ',63,'2021-10-09 11:23:57',76,_binary '\0'),(711,'Source Code Review can help people to better extend their knowledge and understanding of the program, but the readability of the code causes the barrier of reading the source code, and the importance of code review is highlighted. Changes to the Fagan inspection will help people understand the code, and increased peer review of the code will make it easier to understand. Can Bring the benefits of Internal Audit, Quality Assurance, cross-departmental communication, developer and peer training.The process is clear and effective.',63,'2021-10-09 11:25:39',88,_binary '\0'),(712,'This paper about code review tries to introduce a new set of practices about Fagan Inspection namely \"new inspection\", as well as the benefits, challenges, experiences, and lessons learned. The version of this paper is with much clear structure than its previous.\nYet, there are still several aspects from which the authors might find their way ahead to improving the paper.\nFirst, titled as \"fagan insepection with several alternations\", this so-called \"new inspection\" is linked to \"peer code review\" several times. In the answers of RQ2, \"new inspection\" is even be compared with \"peer code review\" to highlight its practices. I mean that the relationships between \"new inspection\" and \"fagan insepection\", as well as the relationships between \"new inspection\" and \"peer code review\" are not clear enough. The authors might clarify these relations, e.g., with tables.\nSecond, with regard to the RQs, RQ2 about the \"comments\" and RQ3 about the \"annomalies\" seem to disclose the practices of \"new inspection\". However, why there is a need for our readers to know these practices. In addition, RQ4 about the \"lessons\" lies under the challenges of \"new inspection\", as it is described in the front of the RQ4 results. I believe that the descriptions of these RQs should be refined to yield a clear RQ stcuture.\nThird, the results of RQ1 about the benefits might be stated once again. I mean, in the current version, I cannot figure out what are the benefits of \"new inspection\". The authors might describe those benefits using a complete sentence rather than just a keyword.\nFourth, what are claimed as \"experiences\" in the every end of the results (RQ1-3) cannot yield much practical suggestions to me. In my opinion, I believe that every valuable \"experience\" is about what should I do.... From this perspective, the authors might describe those \"experiences\" again, for example, what should I do or pay attention to so as to obtain those benefits of \"new inspection.\nFifth, \"experiences\" (in RQ1-3) and \"lessons learned\" (in RQ4) seem to be similar thing in my mind. It is somewhat radicular to describe the results in such a manner.\nSixth, by the way, the comparison of \"Listing 1\" and \"Listing 2\" ie less interesting. I cannot find any information about \"new inspection\" or even code review there.\nFor more comments about the introduction, call me if it is needed. ',63,'2021-10-09 11:28:24',23,_binary '\0'),(713,'This paper introduced and implemented an automated evaluation and feedback mechanism for identifying anomalous work outcomes, including two methods based on TOPSIS and iForest. \nThe sixth paragraph of the paper is not neatly formatted',62,'2021-10-09 11:29:02',62,_binary '\0'),(714,'This paper implement an automated evaluation and feedback mechanism of anomalous work outcomes in an information and communications technology (ICT) enterprise to achieve timely work status feedback for software engineers. Here are some comments:\n1. There were only 18 interviewees in the experiment, which is a little bit small and unconvincing.\n2. There are 18 people from 7 different positions, so there will inevitably be a situation where there are 2 people in some positions and 3 people in other positions. Is there any reason for this?\n3. In 3.2.3 part, \"eighteen\" should be changed to \"18\".',62,'2021-10-09 11:30:57',70,_binary '\0'),(715,'This case study aims to report experience and lessons from the altered inspection, and additionally, to aggregate and serve suggestions for quality improvement.\n1. The title of the paper is large in scope and needs to be further revised, otherwise it will be more difficult to pass\n2. The set period of the two-week code review process is too long, and the daily company’s code review cycle will not exceed one week',63,'2021-10-09 11:33:08',62,_binary '\0'),(716,'The results and discussion in this paper are written in one chapter, and it is better to describe them separately, otherwise the boundaries are not clear.',62,'2021-10-09 11:37:09',6,_binary '\0'),(717,'Some suggestions are as follows:\n1. A organizational structure of the full paper is better put at the end of INTRODUCTION.\n2. The evaluation work is only compared with manual identification. It is recommended to compare with other similar automatic identification methods to better highlight the advantages of our method.\n3. I think the expression of RQ3 is more appropriate about the effectiveness of automated anomaly identification, otherwise it is easy to be misunderstood how this method is applied in practice.',62,'2021-10-09 11:39:47',76,_binary '\0'),(718,'This paper selects some quantitative outcome metrics to measure competency or contribution of software engineers and map each metric to an existing competency framework with eighteen interviewees. Besides, this paper mentions two methods to identify anomalous work outcomes. Some suggestions are as follows:\n1. The content of the remaining chapters is not introduced at the end of the first chapter.\n2. The font in Figure 2 is a little fuzzy and a little small, which makes it difficult for readers to see clearly, and the same is true in Figure 3.\n',62,'2021-10-09 11:47:45',72,_binary '\0'),(719,'The authors might find the following opinions valuable in the paper improvement.\n1. The current gaps to bridge in the paper are not well-stated. Specifically, why the kind of \"work status feedback\" is targed in \"engineer valuation\".\n2. The evidences showing the effectiveness of the mechanism is not given, at least in the abstract.\n3. As a work introducing a mechanism and then evaluating it with case studies, the paper is suggested to first present the mechanism (outlining the mechanism structure and details), and then to design and answer research questions in the cases.',62,'2021-10-09 11:53:01',23,_binary '\0'),(720,'This paper lacks quantitative data when answering research questions, and needs to be combined with the data obtained, such as interview results. The highlighted text in the conclusion is relatively short. In order to facilitate understanding, the answer to the research question can be summarized in one sentence.',63,'2021-10-09 11:53:28',6,_binary '\0'),(721,'This paper realizes the automatic evaluation and feedback mechanism of anomalous work outcomes, so that the working status of software engineers can be fed back in time. Here is my suggestions:\n1、This paper should be compared with existing methods to show correctness and efficiency improvement\n2、The number of interviewees is not enough.',62,'2021-10-09 12:07:50',63,_binary '\0'),(724,'In this paper, they implement an automated evaluation and feedback mechanism of anomalous work outcomes to achieve timely work status feedback from software engineers. Their mechanism can improve work efficiency and help engineers in timely process improvement, growth feedback, efficient management and training. Here are some of my suggestions:\n1、	Only 18 interviewees made the results look less convincing;\n2、	Some spelling mistakes just like “the we……”in line 131，“group anomaly” and “Status anomaly” in line 386;\n3、	In Figure 2, it looks strange to display the information of interviewees through the fan chart. I don’t know if it will be better to display the information in a table.\n4、	Why the two methods (TOPSIS) and (iForest) are applicable in this scenario is not explained. A brief description of these two methods in the introduction section may make the article more convincing.\n5、	Is there no similar tool in the industry or academia? A brief introduction and comparison with the tool may be more appropriate\n6、	Why is there no space in the first paragraph of each part? This makes the paper format look weird\n',62,'2021-10-09 12:10:00',67,_binary '\0'),(725,'\nThis paper introduces an altered Fagan inspection and reports the experience and lessons about the new inspection in a global enterprise. Here is some suggestions:\n1、The “Pull-request” step in figure 1, I didn’t find an explanation in the paper.\n2、If the Introduction can be divided into several small fragments, readers can better understand this article.\n3、In the results, the comparison between “new inspection” and “peer code review” is better, so this can be highlighted in the previous description.\n',63,'2021-10-09 12:13:29',63,_binary '\0'),(726,'This paper reports a set of practices about the new Fagan inspection in a global enterprise, which cab help other organizations. Here are some suggestions: As for \"new inspection\", I did not get the point of your explanation(maybe you can desribe it clearer). And qualitative results analysis may be less convincing. Can more quantitative data be obtained? ',63,'2021-10-09 12:57:27',84,_binary '\0'),(727,'This paper proposes an automated evaluation and feedback mechanism to identify engineers’ anomalous work outcomes.Here are some suggestions: As for your method, TOPSIS and iForest sound reasonable in your study, but why you use those approaches as your method and is there any other methods can solve this problem? I did not find your elaboration on these two points.',62,'2021-10-09 13:05:47',84,_binary '\0'),(728,'This paper realizes the automatic evaluation and feedback mechanism of anomalous work outcomes, so that the working status of software engineers can be fed back in time. My suggestions are as follows:\n- It will be better if there is a comparison with other methods and explain the advantages of the methods used.',62,'2021-10-09 13:17:55',71,_binary '\0'),(730,'This paper aims to report experience and lessons from the altered inspection and aggregate suggestions for quality improvement by conducting and analyses of various empirical evidence from data triangulation. Here are some of my suggestions:\n1、“new inspection”in abstract part Will make the reader feel a little confused, a clearer description may be more appropriate\n2、There can be a clearer explanation for Figure 1, such as the meaning of pull-request\n',63,'2021-10-09 13:27:57',67,_binary '\0'),(731,'This paper aims to report experience and lessons from the altered inspection, and additionally, to aggregate and serve suggestions for quality improvement. If quantitative data are more abundant, the results may be more convincing.',63,'2021-10-09 13:32:55',71,_binary '\0'),(732,'**Summary of the submission**\nCode review is a common practice to ensure quality, however, the specific process of it is diverse. This paper shares the experience of implement \"new inspection\" (an improved method based on Fagan Inspection) in a global enterprise. The improvement of traditional method is worthy of encouragement, but this paper does not elaborate it clearly. In particularly, the following questions need to be answered in this paper:\n1. Why this enterprise revived Fagan inspection?\n2. What features does new inspection learnt from Fagan inspection?\n3. What is the difference between new inspection and modern inspection? Although Table 1 illustrates some differences, I expect more details about it, especially the content under specific context.\n\n**Major concerns**\n1. Fagan Inspection is a traditional method for code review, although few organize use it nowadays, many code review processes are affected by it. It is interesting that this paper brings this method up again, but the motivation of it is not clear. I can understand the modern code review is not satisfactory in some enterprise, but the authors need to elaborate the context to explain why the existing methods cannot solve your problems and how can Fagan Inspection work.\n2. As a quarterly program, new inspection seems totally irrelevant with modern inspection (daily), because the enterprise can use both of them while developing. Since the stage of new inspection is post-test, I would recommend to compare it with version acceptance.\n3. The experience seems too normal and without novelty. I recommend to elaborate more benefits/challenges/solutions in specific context and how can readers refer to your experiences. Some take away messages will be helpful for you to organize the paper. \n\n**Minor corrections**\n1. Figure 5 is difficult to read, fill the shapes with different color might be better.\n2. \"New inspection\" is not a good name, you can change it to ignore \"we propose a new inspection called new inspection\".\n',63,'2021-10-09 14:14:09',39,_binary '\0'),(733,'**Summary of the submission**\nThe authors implement an automated evaluation and feedback mechanism of anomalous work outcomes in an ICT enterprise to achieve timely work status feedback for software engineers. The authors did a lot of work on it, however, the objective of this paper seems not so appropriate with ICSE-SEIP.\n\n**Major concerns**\n1. I recommend to rewrite the ABATRACT because the current version focus on evaluate the engineers automatically. Since the evaluation of staff is an important work for enterprise, I cannot approve that traditional engineer evaluation is a waste, especially compared with risk of wrong evaluation. I recommend to point out the defect of traditional evaluation and how can your automatic mechanism to remedy them, which is similar with some descriptions in INTRDOCTION. Moreover, you need to elaborate how can engineers benefit from the feedback to perfect the logic of ABSTRACT.\n2. As an industry paper, you need to introduce the context of your work briefly, including the evaluation framework of engineering (What is evaluated), the hardware/software/organization support for automated evaluation (How to evaluated). This information will be helpful for readers to benefits from your paper.\n3. For this work, CHALLENGE AND LESSONS LEARNED is not necessary. Because you can remove the challenge and solutions to method section since they are naturally part of it. Moreover, the major contribution of this work is to propose an automated evaluation and feedback mechanism of anomalous work outcomes, your lessons are also the suggestions for others who want to adopt similar mechanism in their organization. Although I think the current lessons are meaningless.\n\n**Minor corrections**\n1. Line 672 and line 676. Need a blank. \n2. Abbreviation is not necessary if you just mention it one time, for example: SRE.\n',62,'2021-10-09 15:04:57',39,_binary '\0'),(734,'This paper proposes a new inspection method different from Fagan Inspection for code review, and verifies the effect of this inspection method through long-term collection and analysis. Overall, the structure is relatively complete.But there are a few hiccups, in my opinion:\n1. The difference between the new inspection proposed in the article and the \"modern code review\" mentioned in introduction is not very clear. I think the methods and disadvantages of \"modern code review\" should be explained more to enhance the motivation of the article.\n2. The article points out that the new inspection method is a variant of Fagan inspection, but what has the new inspection method learned and improved from Fagan Inspection?',63,'2021-10-09 15:48:09',58,_binary '\0'),(735,'This paper proposes an automated evaluation and feedback mechanism for abnormal work results to achieve timely work status feedback for software engineers.I think this topic is interesting, but the article still has some minor problems:\n1. In the abstract, I think it is not very hierarchical. It simply introduces what work has been done and what methods have been used, and it is suggested to emphasize the disadvantages of the traditional scheme and what improvements have been made in this work.\n2. In the relevant work section, I think the focus of the introduction is a little vague. In addition to introducing the current assessment framework, it should also introduce some current work on the supervision and feedback of the working status of software engineers, if not, it should emphasize the lack of work in this area.\n3、In Anomaly Detection for related work, the introduction of Anomaly Detection does not seem to be very relevant to the working status of software engineers.',62,'2021-10-09 16:01:02',58,_binary '\0'),(736,'Paper Title:\nFagan Inspection in the New Era: Experience and Lessons fromAn Industrial Case Study\n\nPaper summary:\nThis paper discussed the experience and lessons from the industry, which aims to give serve suggestions for quality improvement. Finally, the paper presents the case of the industry for correction and prevention. Authors identify serve lessons for researchers.\n\nComments for author: \nThe paper claims that they have applied Fagan inspection in the new Era, but they did not discuss the characteristics of the new Era so that researchers can identify which scenario is suitable for Fagan inspection.\n\nThe article does not demonstrate the necessity of the new inspection and the difference with others inspection\n\nThe paper aims to illustrate the effectiveness of the new inspection and its benefits to code review in the industry. For researchers, it is more meaningful to discuss how to apply this method in industry, that is, to propose an effective application framework',63,'2021-10-09 19:54:28',31,_binary '\0'),(737,'In this paper, an automated employee status assessment method is proposed, which can help managers identify employees with abnormal status more effectively, and timely collect feedback on the working status of developers through interviews and framework mapping. Here are some suggestions:\n1. This paper should be compared with some existing work to illustrate the improvement of this paper.\n2. The expression of the article is not clear and easy to understand. In addition, there may be some formatting problems.',62,'2021-10-10 16:59:59',17,_binary '\0'),(738,'This paper presents a new method of Fagan review. The case study of this work aims to report on the experience and lessons learned from the change inspection and to collect and provide recommendations for quality improvement. Here are some suggestions:\n\n1. The presentation needs to be more detailed. For example, this part of the abstract does not clearly convey what the research does.\n2. I\'s explanation of some terms is not clear enough and difficult to understand, and there are some formatting problems and grammatical errors.',63,'2021-10-10 17:08:10',17,_binary '\0'),(739,'This article focuses on the problems and benefits of using DEVOPS & Microservice in the Enterprise. It focuses on the software engineering management aspects of DEVOPS & MICROSERVICE and the benefits of using DEVOPS & Microservice, it overlaps slightly with the concepts of Peopleware:Productive Projects and Teams and The mythical Man-Month, but it is novel in direction and has great implications for the software industry. Furthermore, the software team can understand the interaction between DEVOPS & Microservice and the team better when they adopt the DEVOPS & microservice approach to overcome the team’s rigidities in software production.',64,'2021-10-15 21:41:34',88,_binary '\0'),(740,'This article uses ethnography to study the impact of DevOps and microservices in three companies, and uses grounded theory to analyze the results of the survey, and gives the practical application of the above two concepts in the industry. The feature of this article is to link DevOps and microservices for analysis and discussion, and obtain a lot of valuable lessons.So here is a format problem:maybe it would be better if the ordinate icon in Figure 1, 7 is marked;',64,'2021-10-15 23:21:20',74,_binary '\0'),(741,'This paper has taken an immersive perspective to inspect the adoption of DevOps and microservices in both real and virtual software teams. After carrying out an ethnographic study in three companies, the paper has mainly found three benefits and two deficiencies from the interviews and observations, which might help future practitioners and researchers to implement and study DevOps and microservices in software teams.',64,'2021-10-16 00:00:30',89,_binary '\0'),(742,'This study contributes to the understandings of software teams for DevOps and microservices.There are 3 RQs, and this study aims to explore the organization, benefit and issues of software teams using DevOps & microservices in industrial contexts. There are 4 topics in page 5, I think it\'s better to add topic5, Interviewees’ stories with DevOps & microservices. In Section 5.2, the lessons for practitioners and researchers are respectively explained, I think it is a good approach.',64,'2021-10-16 00:30:16',8,_binary '\0'),(743,'This paper research the information about organization, benefit and discuss of software teams using DevOps & microservices by analysing data which collected from individual and group interviews.It help us get a deeper understanding about DevOps and microservices practice,but I think there is not a lot of specific data description.',64,'2021-10-16 01:17:31',92,_binary '\0'),(744,'This study investigates the adoption of DevOps and microservices in real and virtual software teams, which is helpful to understand DevOps and microservices software teams, and has positive significance for the development and application of software. Specific examples are used to illustrate the contents that need to be paid attention to.\nThe  expression of the article needs further consideration, and the explanation of some concepts need to be a little more detailed. And some of the limitations of the study can be explained with specific examples to heightlight the key point when we use it.',64,'2021-10-16 03:25:08',55,_binary '\0'),(745,'This paper explores the performance of DevOPS in real-world application scenarios through a study of three software companies. The paper not only presents the advantages of DevOPS in practice, but also exposes the problems in its application and gives suggestions for corresponding solutions. The research article does not present particularly exciting issues, but it gives very useful conclusions for application.',64,'2021-10-16 09:13:57',75,_binary '\0'),(746,'Through observing and interviewing the participants of three software companies using DevOps and micro-services, the paper is more convincing based on the actual data, and the relationship between DevOps and micro-services in the actual scene is analyzed, which is different from the previous theoretical research. Although there is not much data practice in this paper, this paper provides systematic insights and help for deep understanding of DevOps and microservices.',64,'2021-10-16 09:42:10',91,_binary '\0'),(747,'This paper focuses on the organization, benefits and issues of software trams using DevOps and microservices. This study conducted an ethnographic study in three companies from an immersive perspective. Furthermore, by discussing the three RQs, the paper gives its findings and issues. However, as for me, there are some minor problems, such as the expression ‘In General, the principal investigator and the principal investigator’ in line 440.',64,'2021-10-16 09:44:12',90,_binary '\0'),(748,'This study investigates the adoption of DevOps and microservices in real and virtual software teams, which is helpful to understand DevOps and microservices software teams, and has positive significance for the development and application of software. it is well written but still needed further examination for detail grammer problem.',64,'2021-10-16 10:03:16',26,_binary '\0'),(749,'This article takes an immersive look at the use of DevOps and Microservices in real world scenarios from a developer\'s perspective, and summarizes the benefits and issues.\nThe questions posed are representative and answer the questions on the minds of readers.\nDifferent from the traditional research model mentioned in the paper, I think it is best to remention the differences between the traditional model and the research results in this paper.',64,'2021-10-16 10:08:35',85,_binary '\0'),(751,'This paper aims to discover the organization, benefit, and issues of software teams using DevOps & microservices from an immersive perspective.\n1. I think the author should make some suggestions after RQ3 raises the question.\n2. Section 3.3.1 does not explain the reasons for and benefits of observing in three time periods\n3. The paper did not say whether the results of the three RQ studies were accepted by the three companies surveyed',64,'2021-10-16 11:03:10',18,_binary '\0'),(752,'This paper explored the relationship between DevOps and Microservices by conducted case study in three company,  reported the adoption and implementation of DevOps and microservoces in the industry. \nBut in my opinion, there are still somme could to be improved. \n1. The details of the interview can be reported more. \n2. More discussion in the lesson section should be required instead of only list the conclusion',64,'2021-10-16 11:07:34',32,_binary '\0'),(753,'Since this paper has been reviewed before and the DDL is 16th October, the authors do not have much time to revise their paper. Therefore, I suggest to have a try and submit this paper without major revision. Anyway, the authors can benefit from review comments of ICSE-SEIP, which will be useful for the further revision. Good luck for you~\n',64,'2021-10-16 11:10:21',39,_binary '\0'),(754,'This paper research the impact of DevOps and microservices in three companies,and summarizes the advantages and problems.These may help future practitioners and researchers to implement and study DevOps and microservices in software teams.',64,'2021-10-16 11:19:20',86,_binary '\0'),(755,'This paper discovers the impacts of DevOps and microservices and reveal their problems arising in the daily work of software teams through an immersive ethnographic study. It gives me a good understanding of the real industrial situation of DevOps and microservices. However, there are some issues to be addressed in my view:\n1. There is an odd \",\" before \"and Issues\" in the title.\n2. I’m not familiar with ethnographic study, but I don’t think the data collected from participant observations and 9 interviews may be sufficient to get the conclusion. And there is no mentioned standard to prove the sufficiency of the data in this paper, which makes the conclusion less convincing.\n3. In part 3.4, the Ground Theory used to analyze data is introduced, but the process of data analysis is not explained clearly, and it may be better to illustrate this process with a graph. \n4. In Figure 1, the y axis name is missing, which reduces the information it can deliver. \n5. In Figure 7, the y axis name is missing too. And this make the figure less self-explanatory.\n6. There are some syntax errors in this paper. For example, there is an \",\" after \"DevOps\" in line 36(the number on the left) which shoud be \"and\" instead. And the \"brings\" in \"brings benefits to ...\" in line 40 should use past tense instead of present tense according to the other parts of the paragraph. The \"start\" in \"Not start from\" should be \"starting\".',64,'2021-10-16 11:24:43',81,_binary '\0'),(756,'Seven months of ethnographic research related to DevOps and microservices in three companies. Interviews to collect data and use grounded theory analysis.\nHere is a small suggestion:\n1. Unlike RQ1 and RQ2, the content of RQ3 has fewer issues, which does not seem to be enough.',64,'2021-10-16 11:27:23',82,_binary '\0'),(757,'This paper carried out an ethnographic study in three companies with different business, size, products, customers and degree of globalization and carried out nine interviews to to collect the data of software teams related to DevOps, microservices, aiming to discovering the organization, benefit and issues of software teams using DevOps & microservices from an immersive perspective. As a result, this paper promote to the understanding of the organization, benefits and issues of DevOps and microservices adoption from the immersive perspective of software teams.\n',64,'2021-10-16 11:27:52',67,_binary '\0'),(758,'This paper conducts ethnographic research on three companies to obtain the advantages and disadvantages of DevOps and microservices in software engineering management. The author’s interviews and observations revealed three advantages and two disadvantages of DevOps and microservices. This highly empirical article can provide practical experience for future development or management practitioners.',64,'2021-10-16 11:31:13',83,_binary '\0'),(759,'This paper executes an ethnographic study in three companies to discover the organization, benefit and issues of software teams using DevOps & microservices from an immersive perspective. There are some suggestions:\n1. The length of Table 1 can be consistent with Table 2. \n2. Table 1, Table 2, Fig 5. Appropriately increasing the font size is helpful for reading',64,'2021-10-16 11:48:53',78,_binary '\0'),(760,'Through ethnographic studies of three companies, this paper identifies some prevalent problems in Devops and microservices adoption by companies from an immersive perspective, and helps to understand the organization, benefits, and issues of Devops and microservices adoption. Some suggestions are as followed:\n1. The words in Figure 5 are small and fuzzy, which makes it difficult for readers to see clearly.\n',64,'2021-10-16 11:49:26',72,_binary '\0'),(761,'This paper conduct an ethnographic study to discover the organization,benefit and issues of software teams using DevOps & microservices from an immersive perpective. The paper found three benefits and two major pains while adopting DevOps and microsevice. Here are some my suggestions:\n\n1. In Abstract, \"This study aims to discovering...\" should be \"aims to discover\".\n2. The text in Figure 5 is too small to see clearly.',64,'2021-10-16 11:53:19',70,_binary '\0'),(762,'Title: A Cross-Company Ethnographic Study on Software Teams for DevOps and Microservices: Organization, Benefits, and Issues\n\nComments:\nThis paper carried out an ethnographic study to discover the organization, benefit and issues of software teams using DevOps & microservices from an immersive perspective.\n1. The text in Figure 5 is a little small.',64,'2021-10-16 12:00:09',68,_binary '\0'),(763,'This study aims to discovering the organization, benefit and issues of software teams using DevOps & microservices from an immersive perspective. My suggestions are as follows:\n- The font in Fig5 is a little small.\n',64,'2021-10-16 13:48:03',71,_binary '\0'),(764,'Figure 1, 5, 7 need to be adjusted',64,'2021-10-16 17:39:07',80,_binary '\0'),(765,'Paper Title:\nA Cross-Company Ethnographic Study on Software Teams for DevOps and Microservices: Organization, Benefits, and Issues\n\nPaper summary:\nDevOps and microservices are considered to be important paradigms for implementing today\'s software requirements. However, it is difficult to use DevOps and microservices in a real team. The research conducted a ethnographic study of three companies. Through seven months of participant observation and nine interviews, data on DevOps and microservices were collected. This paper discusses four lessons and implications for researchers. This study can helps other researchers understand DevOps and microservices.\n\nComments for author:\n- The paper did not clearly introduce why the study positioned DevOps and microservices in the background section. In the introduction, the paper introduced the concepts of DevOps and microservices, but did not introduce the relationship between the two and the necessity of combining them for research. \n- The paper does not introduce the bottleneck of existing research in the background part, which corresponds to the insufficient research motivation of this paper. The introduction did not explain the difficulties of applying DevOps and microservices.\n- The paper conducted an ethnographic study on three companies, but did not explain why it did so and why an ethnographic study on one company failed to achieve the research goal. Readers cannot understand the characteristics and differences of the three companies. \n- At the end of the paper, only experience and lessons are given, and no specific result that can be operated are given. It is difficult for other researchers to apply the results of this paper. ',64,'2021-10-16 21:50:05',31,_binary '\0'),(766,'This study investigates the application of Devops and microservices in real and virtual software teams, helps to understand DevOps and microservice software teams, and is of positive significance to software development and application. The contents needing attention are illustrated with specific examples.\n1.The expression of the article needs further consideration, and the explanation of some concepts needs to be more detailed. \n2.Some specific examples should be given to illustrate the problem, such as the limitations part。',64,'2021-10-17 23:08:04',17,_binary '\0'),(767,'Nowadays, the benefits of microservice architecture have been widely valued in both the academic and the industrial environment. However, there is a gap between the two communities. This paper understands microservice architecture by conducting industrial interviews with practitioners from a total of 20 software companies. As an extension of the conference paper, its shortcomings are summarized as follows.\n\nAbstract:\n1. A single inquiry cannot bring “systematic” insight into the industrial practices and sufferings on microservices.\n2. According to my experience, the previous work (conference paper) should be mentioned in BACKGROUND.\nIntroduction:\n1. The contributions should be placed after the summary of work.\n2. Why do you extend your conference paper, since it is only two years since the publication and the added sample size is limited?\nResearch method:\n1. The presentation of “Data analysis” is not clear. It is suggested to illustrate examples. \n2. How about developing one more research question to highlight the contribution of this extension paper.\nFindings:\n1. No comments to answering research questions, as I am not familiar to the microservice architecture.\n2. Figure 9 is unnecessary. \n\n\n',65,'2021-10-22 15:14:34',44,_binary '\0'),(768,'Title: What Do We Learn from the Migration to Microservice Architecture in Reality? An Industrial Inquiry\n\nThe authors use a paragragph to explain the extension of journal version based on ICSA2019, however, we wonder how could the updared contexts explain the necessity of the submission of the journal version on 2021? and does the updared rate achieve to 30-40% ?\n\nIn our opinion, the RQ should updated to at least three questions in a journal version, \"3) An integrated\noverview map and more in-depth discussion\" can this part summerized as a new question?\n\nThe reference list should recomplie.\n\n\n\n',65,'2021-10-22 16:12:18',33,_binary '\0'),(769,'This paper is based on a series of industry interviews with people working at various software companies. This paper does an investigation of the gap between the vision and the actual practice of microservices, including the practical experience, the reasons for the gap, puts forward a complete practice overview chart, and summarizes the future research directions of the academic community.',65,'2021-10-22 18:41:41',8,_binary '\0'),(770,'This paper is to investigate the gaps between the ideal visions and real industrial practices on microservices and what expenses microservices bring to in dustrial practitioners. I think this paper is very valuable and has great guiding significance for the application of microservices in the industry. Here are some of my personal views:\n1、In Section 1, the fifth paragraph should be placed after the sixth paragraph. It should first introduce the extension of this paper to the previous work, and then introduce the contribution of this article, so that it will be more logical.\n2、Section5, is it better to draw a decision diagram, so that you can more clearly introduce each decision point and the relationship between them.\n',65,'2021-10-22 22:08:16',79,_binary '\0'),(771,'In order to investigate the gaps between the ideal visions and real industrial practices on microservices and what expenses microservices bring to industrial practitioners, this paper carried out a series of industrial interviews with practitioners from twenty software companies, and the characterized the gaps between the typical characteristics accepted in the community and the industrial practices of microservices. The study has found out that despite the benefifits of the microservices for practitioners, decisions should be carefully made and the possible pains identifified need to be addressed with extra expense from experiences, which might inspire future researchers.',65,'2021-10-23 00:31:40',89,_binary '\0'),(772,'This article aims to shed light on the gaps between the ideal characteristics and the realistic practices of MSA by interviewing practitioners from twenty software companies.Here are some my suggestions:\n1.The position of Table 2 has a little bit influence on the cohesion of the article.It makes it impossible for the reader to find the other part of the conjunctions “software”  immediately.\n2.The number of different parts of each column in a horizontal histogram is difficult to discern the specific number.',65,'2021-10-23 01:03:40',92,_binary '\0'),(773,'This paper focuses on the problem of providing a suitable framework for software design, and puts it into practice, and explores the differences between micro-service as a lightweight architecture style and typical features generally accepted in the community in practical industrial practice. At present, when microservices are highly praised and respected, it is also necessary to analyze the disadvantages in practical application that may be caused by using microservices according to the actual situation, and various resources such as extra energy and manpower are needed. In addition, this paper systematically provides a comprehensive overview chart to analyze the heartache of using microservices in the current industry. However, I think there is a little abstraction in the data analysis, and it should be more convincing if we can provide some concrete data.',65,'2021-10-23 09:19:23',91,_binary '\0'),(774,'Some suggestions are as follows:\n1. Because this paper is the extended version of the conference paper before, I think the number of RQ should also extend and the authors should make some deeper decision.\n2. The description of Fig 14 is not in the middle of the figure.\n3. In the section 6 the authors do not discuss the internal validity.',65,'2021-10-23 09:36:05',73,_binary '\0'),(775,'This paper investigates the gaps between the ideal vison and actual practice of microservice and what expenses microservices brings. As an extension of conference paper, this paper characterized the gaps and practices. Furthermore, it summarized the benefits and pains, proposed an integrated overview and revealed the future research directions. As for me, this paper helps me establish a comprehensive understanding of the actual practice of microservice.',65,'2021-10-23 09:40:49',90,_binary '\0'),(776,'This study takes a unique angle different from allother studies on MSA, which compares the most influentialcharacteristic statements of MSA by Fowler and Lewis withthe industrial practices. The author aimed to gain an in-depth un-derstanding of the gaps between these community-wide ac-cepted visions and the real practices of microservices, in-cluding the practical experiences with specific ideal charac-teristics of microservices, the reasons behind the gap, andthe pains that should be mitigated.Please pay attention to the format and grammar mistakes such as figure 14.\n\n\n',65,'2021-10-23 10:02:00',26,_binary '\0'),(777,'Through industry interviews with practitioners of software companies, this article explores the two major issues of what is the gap between the vision and reality of microservices and what is the pain of implementing microservices in practice. Finally, it puts forward and summarizes the 8 practices and pains of microservices. \nHere is my small suggestion: the title of figure14 should be in the center, and the space in this figure should be compact.',65,'2021-10-23 10:18:08',82,_binary '\0'),(778,'In order to investigate the gaps between the ideal visions and real industrial practices on microservices and what expenses microservices bring to industrial practitioners, this paper interviewed practitioners from twenty software companies and conclude that microservices bring benefits as well as pains to practitioners.',65,'2021-10-23 10:20:48',86,_binary '\0'),(779,'This article focuses on microservice architecture, mainly to solve two problems, one is the gap between the reality and ideal of microservice architecture, the other is the pain point of implementing microservice, the data was obtained by interviewing programmers inside 20 companies who had been working there for years. After analyzing the 9 characteristics of micro-service, the author summarizes 5 items to give some heuristic thinking to the later practitioners as well as the people in this field. The main problem is that the number of practitioners interviewed is too small to be comprehensive and representative, and the analysis of micro-service characteristics is based only on what Fowler and Lewis suggest, it does not add what the author thinks is reasonable, I think it can be considered.',65,'2021-10-23 10:24:42',88,_binary '\0'),(780,'This study is to investigate the gaps between the ideal visions and real industrial practices on microservices and what expenses microservices bring to industrial practitioners. The point of the article is valuable and the logic is clear. I vote accept.\n\nThere are some small suggestions:\n1. The title of Figure 14 should be aligned to the left.',65,'2021-10-23 10:27:31',78,_binary '\0'),(781,'This paper studies the gap between the ideal application of micro-services and the application of real industrial scenarios, with a complete research method and practical reference value for the viewpoints proposed.',65,'2021-10-23 10:39:38',85,_binary '\0'),(782,'This paper initiated a series of industry interviews to explore the gap between the concept of microservices in industrial practice and community awareness. Some suggestions are as followed:\n1. Some text is not aligned, such as some text on pages 15 and 16.\n2. Some of the points in the article have been mentioned in the conference version, and I feel that the degree of innovation is somewhat insufficient.\n',65,'2021-10-23 11:39:29',72,_binary '\0'),(783,'This paper aims to reveal the gaps between the ideal visions and real industrial practices on microservices and the expenses of MSA. As the paper says, the reasearch angle is unique from others and I think the results are also very meaningful in this era of microservices. However, threre are still some issues to be addressed in my opinion.\n1. The sentence in the Section 1 says \"The main contributions of this study are fourfold\" while the interpretation after it contains onlly 3 aspects, which is confusing and I think it\'s a paradox.\n2. The word \"experiences\" means the things you experienced, and it may be misused in this paper. For example, the \"experiences\" in \" reviewed by the two supervisors with rich experiences in interview studies\" in Section 2.3 should be \"experience\" to stand for \"the knowledge and skill that you have gained through doing sth for a period of time\".\n3. The title of Figure 14 should be aligned center.\n4. There are some syntax errors in this paper. For example, the \"working\" in \"we plan to closely working with more practitioners\" at the end of the paper should be \"work\".',65,'2021-10-23 11:46:16',81,_binary '\0'),(784,'\nAs an expanded version of a conference paper, the first question is whether the expanded content reaches more than 30%. Secondly, it is necessary to explain in the background what the expanded content of the new paper and the old paper is, whether the conclusions of the last two papers are different and what new developments they have.\nThere are still many formatting and language errors in the paper that need to be corrected',65,'2021-10-23 13:04:23',61,_binary '\0'),(785,'This paper is to investigate the gaps between the ideal visions and real industrial practices on microservices and what expenses microservices bring to industrial practitioners by carrying out a series of industrial interviews with practitioners from twenty software companies. As a result, this paper characterized the gaps between the typical characteristics accepted in the community and the industrial practices of microservices, summarized the benefits and pains and proposed the future research directions.\nHere are some of my suggestions:\n1、There are a lot of blank parts in Figure 14. Can you adjust the style a little?\n',65,'2021-10-23 13:27:55',67,_binary '\0'),(786,'The author aimed to gain an in-depth un-derstanding of the gaps between these community-wide ac-cepted visions and the real practices of microservices, in-cluding the practical experiences with specific ideal charac-teristics of microservices, the reasons behind the gap, and so on. Furthermore, it summarized the benefits and pains, proposed an integrated overview and revealed the future research directions.  However, the interpretation of some of the concepts are unclear and difficult to understand, and there are some formatting issues and syntax errors.',65,'2021-10-23 17:17:19',55,_binary '\0'),(787,'This article is expanded on the basis of the original conference paper, introduced the actual effects and lessons of the industry\'s microservice architecture migration, pointed out the problems before and after the migration, and the gap between theory and practice. The structure of the whole article is complete. However, the extended part of this article is very important in my opinion. It can introduce all of them in the summary, such as 5 important decisions and suggestions for new-comers. For the introduction of the increase in the scale of the experiment in the first part, it is best to describe the increase in percentage, rather than just a digital display, and a specific comparison with the previous survey, so that people can know the difference before and after the increase. There are also some grammatical and formatting issues.',65,'2021-10-23 21:53:44',74,_binary '\0'),(788,'This paper is to investigate the gaps between the ideal visions and real industrial practices on microservices and what expenses microservices bring to industrial practitioners.\n1. I think the structure and illustrations of this paper are perfect\n2. There is no explanation as to why Table 1’s C3 is special labeled\n3. The paper may consider adding an RQ to discuss why the vision and practice of microservice will lead to gaps, as well as points for attention in practice\n',65,'2021-10-23 22:12:48',18,_binary '\0'),(789,'Only three points were mentioned in the first section, but fourfold was used',65,'2021-10-24 20:37:20',80,_binary '\0'),(790,'This paper is to investigate the gaps between the ideal visions and real industrial practices on microservices and what expenses microservices bring to industrial practitioners.\n1. The pain and practice parts in this paper are too scattered, and a table is needed to display the contents of these two parts in a unified manner, otherwise it will be unfriendly to people who want to read the key points of the paper.\n2. The labeling in Table 1 and Figure 14, the layout needs to be adjusted again, it can be adjusted to the center',65,'2021-10-24 21:35:53',62,_binary '\0'),(791,'Here are some of my suggestions:\n1.The title format in Figure 14 seems inappropriate.\n2.Some of the text on page 10 is not aligned at the end.\n',65,'2021-10-24 22:10:53',77,_binary '\0'),(792,'The purpose of this paper is to explore the gap between the ideal vision of micro-services and the actual industry practice, as well as the cost of micro-services to industry practitioners, generally complete, there may be some grammatical problems, etc.',65,'2021-10-24 22:40:04',17,_binary '\0'),(793,'Paper Title:\nWhat Do We Learn from the Migration to Microservice Architecture in Reality? An Industrial Inquiry\n\nPaper summary:\nAs a lightweight architecture style, microservices can avoid some of the problems of the existing architecture. However, there are some challenges and pains in the architecture migration of microservices. This paper analyzes the practice and pains of microservices through industrial interviews. To help companies decide whether to migrate the architecture.\n\nComments for author:\n1.The paper introduced the characteristics of different companies, but did not combine the two when analyzing the challenges and pain points to help researchers quickly determine the problems they are facing \n2.The paper focused on the challenges and pains of microservice migration, then these problems and the relationship between them should be displayed more clearly. Compared with the current content, how to avoid and solve these challenges and pains is a more critical issue. \n3.There are relationships between different practices and pains, and the paper does not show these relationships. This reduce the reference value for other researchers. ',65,'2021-10-24 22:44:40',31,_binary '\0'),(795,'Paper title:\nRevisit Security in the Era of DevOps: An Evidence-Based Inquiry into DevSecOps Industry.\n\nSuggestions:\n1, Format problem:  \n    The second page of the paper, the third paragraph is a bit too blank.  \n    Figure2, 3, 4, 5, 7, 8, 9, 10, 11, 12, 13 and Table1, 2, 3, 4 title is not in the center.\n2, In Figure2, phase3 can consider merging \"data extraction\" and \"extracted data\".  \n3, In the last paragraph of section 3.2.1, it is simply a broad range, but no specific data support is given.\n4, In Table1, only question 7 has the \"I don\'t know\" option. Other questions, such as question 8, do not have the option. It is recommended to set it.\n5, The latest statistics in figure7 are from 2019, so the timeliness may be a bit poor.\n\nReporter:\nXu Renhang\n\nMembers:\nWang Yanze, Li Gongyuan, Zhang Juzheng, Chen Qiwei, Guan Xingzheng, Zhang Lemin, Liu Xiaodong, Liu Liwen, Li Haoming. ',66,'2021-11-05 12:57:48',85,_binary '\0'),(796,'Paper title:\nRevisit Security in the Era of DevOps: An Evidence-Based Inquiry into DevSecOps Industry.\n\nSuggestions:\n1. Abstract, the motivation of this paper is unclear. For example, how did people study security before Devops was proposed and why did they study security after Devops was proposed.\n2. Compared with the conference version, the journal version has some new findings on the same research problems, which can be introduced in the introduction.\n3. Sec 2.2 is about methodology, that is, the application of grey literature in the field of software engineering, which can be briefly mentioned. Sec2.1 can be described in detail as the main body of sec2\n4. SEC 3.1 RQ1 is not suitable for a separate research question, because the contents of RQ1 and RQ2 are similar, RQ1 focus on China, while RQ2 focus on the whole field of software engineering. In other words, RQ2 can be described as a case of RQ1\n5. SEC 6.3 mainly talks about the experience and lessons of using grey literature in this paper, which does not fit the research theme of this paper, and it is suggested to be deleted\n6. This paper ignores one point. Another article [**Challenges and solutions when adopting DevSecOps: A systematic review**]\n is very similar with this paper about research work. Therefore, it is suggested to make comparison to highlight the value of this research.\n\nReporter:\n马维刚\n\nMembers:\n杨岚心、黄鑫、潘博、何家欢、张逸凡、王柯苏、翁芷洛',66,'2021-11-05 14:14:49',78,_binary '\0'),(797,'Paper title:\nRevisit Security in the Era of DevOps: An Evidence-Based Inquiry into DevSecOps Industry.\n\nSuggestions:\n1. With the conclusion unchanged, is the updated part enough to publish the paper again?\n2. It is recommended to add a highlight to the updated part.\n3. Both RQ1 and RQ2 are discussions on the development of DevSecOps in China. RQ1 comes from survey and RQ2 comes from literature. Why not use survey both?\n4. Figure 7 lacks legends.\n5. 6.3 is more obtrusive, consider moving it to the ttv part.\n6. 6.1 spent a lot of space to talk about the benefits of GL, but it is not very necessary, more should be combined with the topic.\n7. 6.1 and 6.3 should be discussed in separate chapters, and discussion part should only include 6.2.\n\nReporter:\nWang Zikuan\n\nMembers:\nDong Liming、Lv Jun、Li Yue、Zhang Xiaodong、Zhang Fuli、An Kuilin、Li Chao、Ding Mengjie',66,'2021-11-05 18:45:08',70,_binary '\0'),(798,'Paper title:\nRevisit Security in the Era of DevOps: An Evidence-Based Inquiry into DevSecOps Industry.\n\nSuggestions:\n1. In page4, \"In addition, we are still Publicity is carried out at conferences such as NJSD to attract more developers to participate in the survey\", any syntax error?\n2. Table 1 occupies a large space. So we suggest that table 1 questionnaire be placed in the appendix.\n3. Figure title is not in the center.\n4. The answer to RQ3 takes up too little space compared with other RQs.\n\nReporter:\nZhao Xue\n\nMembers:\nYin Huilin, Li Lingjie, Yu Yongda, Li Peiru, Zhang Chunxu, Zhang Yang, Liu Huikun, Liu Ruihong, Xu Qianwen, Meng Qinglong',66,'2021-11-06 01:15:49',77,_binary '\0'),(799,'Paper title:\nSecurity of Hyperledger Fabric Smart Contracts:A Literature Review\nSuggestions:\n1、The content of the summary is too broad, and it does not provide certain research inspiration and thinking direction for future resea-rchers.\n2、How the vulnerability detection tool in RQ3 detects vulnerabilities in RQ2 is not clearly stated.\n3、Too many subtitles, need to enlarge the subtitles.\n4、The code content on page 11 and page 12 are different in size.\n5、The sizes of the two pictures in Fig 1 are not consistent.\n6、The dots 1, 2, 3, 4 on page 15 are inconsistent with the space between the text.\nReporter:\nLiu LiWen\nMembers:\nZhao Xue,Wang ZiKuan,Zhang YiFan,Li LingJie,Pan Bo,Zhang FuLi,Jia JunYu,Xue JunMing,Wang JiaRui,Zhang XiaoDong',67,'2021-11-12 13:47:14',88,_binary '\0'),(800,'Paper title:\nSecurity of Hyperledger Fabric Smart Contracts:A Literature Review\n\nSuggestions:\n1、The title of RQ needs to be adjusted slightly\n  1.1 RQ1 mainly summarized the root causes of vulnerabilities in HF smart contracts, and classified \nall