o explain the special features of smart contract security, and then explain the significance of the research.\n2. The word “answer” cannot be used in the abstract. Generally, it does not appear in the abstract..\n3. The last sentence in the abstract should be more rigorous. It does not mention what problems the threat can cause, and the logic is not smooth.\n4. In the second paragraph of the introduction, the severity of the DAO attack needs to be explained\n5. RQ1 is Chinese English, it needs to be revised\n6. RQ3 is more colloquial, delete tools and methods\n7. Change detection tools and methods to detection technic, which should be reflected in the methods and characteristics of the tools\n8. All articles with specific references need to be labeled, such as S1, S2\n9. There is a problem with the order of RQ. Changing the position of RQ1 and RQ2 should be more simple first, and then the content found.\nReporter:\n李超\n\nMembers:\n安奎霖，翁芷洛，周鑫，毛润丰，杨岚心，胥倩雯，于永达，李超，（还有一个同学未登记）',67,'2021-11-12 16:50:01',79,_binary '\0'),(802,'Security of Hyperledger Fabric Smart Contracts:A Literature Review\n\nSuggestions:\n1. RQ1 describes the relationship between vulnerabilities and security. The title only mentions security, but RQ focuses on vulnerabilities and the title should be more focused.\n2. RQ3 and RQ4 are very casual.\n3. There is no systematic introduction of your contributions and the value of your work.\n4. 3.1 The seven papers are highly related and need to be listed to explain where they are related and are relatively abrupt.\n5. The content in Table 3 is too extensive and even mentions alliance chain, which may exceed the scope of the title and rise too high. The title only mentions the security of smart contracts.\n6. The classification dimension of Fig2 is chaotic, which needs further elaboration.\n7. 4.2.1.1 proposed many error types, but only proposed solutions for this vulnerability, making the overall structure inappropriate.\n8. In chapter 4, the titles of the four levels are a little strange, and there are too many sub-titles, up to 30, so we should consider using other presentation methods. The forms of vulnerability display are not uniform, some have code segments, some do not.\n9. 4.2.1.7 Is not explained in detail. Why code snippets should be explained in review should be specified for the purpose of listing the code.\n10. 4.3.2.1 Text classification: answer questions from two dimensions: methods and tools, but the organization is scattered. Tables should show logical relationships visually, but this is just a listing tool that needs to be improved.\n11. Article format confusion, space, indentation, line spacing need to be unified.\n\nReporter:\nWANG Yanze\n\nMembers:\nXU Renhang, ZHANG Yang, ZHANG Chunxu, LIU Huikun, LI Yue, ZHONG Chenxing, LI Haoming, WANG Kesu, ZHANG Juzheng\n',67,'2021-11-12 21:20:16',55,_binary '\0'),(803,'Performance Modeling of Cross-blockchain Systems Implemented by Relays Pattern: A Queuing Approach\nSuggestions:\n1. The headings of 4.1 and 4.1.2 are somewhat repeated. 4.1.2 it\'s too short. Can you explain it in detail?\n2. The title format of 4.2.2 seems to be incorrect.\n3. On page 11, there is a formula without the closing bracket \"}\". On page 17, the format of the formula is inconsistent.\n4. In the modeling method section, we suggest adding an overview of the method in this article.\n5. Considering the last paragraph of the conclusion section, the current form seems a little irregular. We suggest that this paragraph should become a new section.\n6. In Table 3, there seems to be a big gap between Theoretical Value and Test Value in L_q2. Does this prove that the model in this paper has defects?\n\nReporter:\n赵雪\nMembers:\n毛润丰、黄鑫、丁梦洁、胥倩雯、李佩如、刘惠坤、黄艺玲、刘晓东、赵雪、刘芮洪',69,'2021-11-19 13:40:00',77,_binary '\0'),(804,'Paper title:\nA Systematic Literature Review on Understanding SoftwareArchitectural Smells\nSuggestions:\n1、The depth of RQ’s answer is not enough, and the summary on the first page does not have enough depth for RQ’s answer. Specifically, for each RQ, we are more concerned about these RQ ectopics and application scenarios, and which quality attributes will be affected. And the impact on those quality attributes.\n2、The quotation of 32 is just a simple quotation, which is simply stated in the article, and the quotation of 32 is not compared with the content of the article.\n3、On the third page of the paper, do not use words like hope, it will be too subjective.\n4、Some RQs simply say what they want to do without saying the necessity of these RQs. For example, RQ1 is an exploration that it hopes to be able to carry out. It does not say the necessity of exploring for others, or the enlightenment for others.\n5、The title of 5.1.4 is redundant. There is no subtitle for each RQ\'s answer summary. The format of each part of the summary should be consistent.\n6、RQ3 data analysis and synthesis, there are some problems in the display of the results, how the architecture is generated, it just shows that external factors will cause architecture decision-making problems, and then cause architecture odor. These parts will lead to architectural decision-making problems, which leads to architectural odors. Why not these parts directly cause architectural odors? Why are there more architectural design decisions in the middle?\nIs the theoretical basis of the analysis model complete?\n7、The research method only analyzes the data from the results, but does not analyze the RQ.\n8、The answer to RQ is not supported by quantitative data and charts.\nReporter:\nLiu LiWen\nMembers:\nZhang LeMin,Xun JunMing,Wang ZiKun,Wang JiaRui,Yu YongDa,Fu ChangLan,Li Yue,Zhong ChenXing,Zhang FuLi,Pan Bo',68,'2021-11-19 16:43:55',88,_binary '\0'),(805,'Performance Modeling of Cross-blockchain Systems Implemented by Relays Pattern: A Queuing Approach\n\nsuggestions:\n1. There is an error in the flowchart, i=i+1 in fig6 should be changed to i=i-1.\n2. A lot of zeros are omitted from the 13-page matrix.\n3. In formula (23), the subscript should be N-b-2, because R0 is taken out separately.\n4. Whether formula 4.2.3 is rounded up or down is not explained in detail in the text.\n5. The font of Fig5 is too small and the typesetting is too crowded to be clear.\n6. The ellipsis is missing from the formula in Fig6.\n7. There is a problem with the format of formula (33).\n8. Many of the pictures after page 21 are someone else\'s. Later, you need to change to your own picture and analyze it according to your own picture.\n\nReporter:\nWang Zikuan\nMembers：\nZhao Xue,Wang ZiKuan,Zhang YiFan,Li LingJie,Pan Bo,Zhang FuLi,Jia JunYu,Xue JunMing',69,'2021-11-19 18:01:39',70,_binary '\0'),(806,'Performance Modeling of Cross-blockchain Systems Implemented by Relays Pattern: A Queuing Approach\n\nSuggestions:\n1. Section 2.1 Reasons for the use of Bitxhub splits into two paragraphs, which are suggested to be combined with the previous paragraph.\n2. Do you need to be specific about the difference between traditional blockchain and cross-chain performance modeling scenarios.\n3. Section 4 needs to explain why queuing theory model is used and why M/G/1/N and GI/M/1 are selected. Are there other models? Too little description of queuing theory model.\n4. Color drawing may cause problems, try to use grayscale map. Such as Fig.4.\n5. The parameter definition of Section 4.2 may not be so detailed. The derivation is too complicated, which leads to a bad look and confusion. It is recommended to introduce it in the form of an appendix.\n6. The content of Fig 5 is too complex to be understood intuitively, and the diagram should clearly represent the logical conceptual relationships.\n7. The image size is not suitable and needs to be adjusted, such as Fig.6.\n8. The formula still has some writing problems.\n9. There is no description of the practical significance of the work. The paper only models the cross-chain performance of blockchain, but there is no specific optimization scheme, which should be of value to practical applications or specific application scenarios.\n\nReporter:\nWANG Yanze\n\nMembers:\nZHANG Juzheng, ZHANG Chunxu, YANG Lanxin, ZHANG Yifan, XU Renhang, YIN Huilin, WENG Zhiruo, LI Haoming, ZHANG Yang',69,'2021-11-19 20:05:46',55,_binary '\0'),(807,'---- Summary of the submission ----\nArchitecture smell is effective property for architect/developer to understand the state of software and the existing publications cannot explain this concept in detail, which convinced me that an SLR is necessary in this domain. However, this paper does not achieve to elaborate the status of architecture smell, on the contrary, it makes me more confused about this concept. I suppose that this paper still need to be further modified or even rewrite some parts.\n\n---- Major concerns ----\nABSTRACT: I recommend to rewrite current version of abstract especially context part because I cannot get the necessity of this SLR form this context. In particular, the need for an SLR to clarify architecture smell is not clear in context. And I think “etc” is strange in objective part. Moreover, the authors just list their results without any logic, I recommend to add some logical transition to help readers better understand your study.\n\nMETHODOLOGY: The search range of this study is [2009, 2019] or [2009, 2021]? It is strange that there are 98 studies during manual search which is less than the final pool (50). Manual search is used to find the most relevant publications about research objective, but some of them seems be excluded in the subsequent steps.\n\nANALYSIS AND STNTHESIS: The current answers of RQs are too board and lack of key points. Although I can understand the author try to describe architecture smell from three aspects, the relationship between these aspects and why they can describe this concept is not explained. Moreover, I suppose the impact of architecture smell is important for readers to understand the importance of it, however, the author just answer it perfunctorily. The answers of RQ3 and RQ4 are too board to extract the core message, therefore, I cannot learn any new information form this part.\n\n---- Minor corrections ----\nABSTRACT: Present tense is recommended.\n\nRELATED WORK: \n1. …[named] Arcan…; \n2. have found [little?] SLR; \n3. conducted [an] SLR.\n\nMETHODOLOGY: \n1. Repeated “architecture* bad smell”; \n\n---- Reviewers ----\nRunfeng Mao, Xin Huang, Mengjie Ding, Qianwen Xu, Peiru Li, Huikun Liu, Yiling Huang, Xiaodong Liu, Xue Zhao, Ruihong Liu',68,'2021-11-20 11:48:57',39,_binary '\0'),(808,'Paper title:\nA Systematic Literature Review on Understanding SoftwareArchitectural Smells\nSuggestions:\n1.The relationship between RQS should be expressed in a graphical way. The current simple list is too scattered and there is no cohesive relationship.\n2.\"Described\" in RQ1 is too broad. What kind of description should be focused on to make the concept clearer.The first item in \"Table 5\" has the same problem, adding some description for \"detail\".\n3.RQ4 should use \"and\" instead of \"or\" because both are introduced later.\n4.In part \"METHODOLOGY\", it is stated that the data collected is 2009-2021, but in part 3.2, it is stated that the search interval is 2009-2019, which is inconsistent.\n5.The use of terms should be uniform, such as the mixing of \"library\" and \"database\" in Table 2, and the mixing of \"study\",\"paper\" and so on.\n6.Part 3.5 lacked the introduction of relevant background with Reviewer; Part 3.6 was too simple in the description of extraction method and did not take into account factors such as impact, which lacked the rigor of SLR.\n7.There are some case problems. For example, the first letter of the word \"architectural smells\" in \"MOTIVATION\" needs to be capitalized. Figure 2 also has the same problem.\nReporter:\n8.In Figure 1, \"automatic\" should be \"automated\", \"total\" should be \"totally\", \"select\" should be \"selection\", and the relationship between \"automated Search\" and \"Publication\" should be explained.\n9.The conferences in Table 3 are best written together, as is the Journal.\n10.Figure 2 takes up too much space, and Figure 3 also has a similar problem, lacking corresponding description of the figure.The title in Figure 3 has a syntax problem.\n11.The importance of security explained in 5.1.3 requires specific cases, not simple definitions\n12.RQ answers vary greatly in length, RQ2 is too short, as an RQ to be discussed, it should be at least one page long.\n13.The question in 5.3 is \"How\", but most of the answers are not verbs, so the answers are inconsistent with the question.\n14.The conclusion section should give some conclusive content that is separate from the work itself, and should be related to the RQ.\n15.The audience for this article is primarily architects rather than software practitioners in general, so you need to be more precise about the audience.\nReporter:\nLi HaoMing\nMembers:\nYang LanXin, Zhang YiFan, Zhang ChunXu, Wang YanZe , Zhang JuZheng, Xu RenHang, Yin HuiLin, Weng ZhiRuo',68,'2021-11-20 17:46:43',17,_binary '\0'),(809,'Paper title:\nInitiatives, Practices, and Challenges of Using Domain-Driven Design in Software Engineering: A Systematic Literature Review\n\nSuggestions:\n1. The motivation for adopting DDD described in Table 8 is less. Many of the benefits of adopting DDD described in this paper can complement the motivation for adopting DDD. For example, using DDD can increase the maintainability of code, so increasing the maintainability of code can be used as a motivation to adopt DDD\n2. Springer is often used in many SLRs, but this article does not retrieve articles from Springer\n3. The challenges and solutions of adopting DDD in RQ3 are too abstract. For example, C2-1“the challenge of applying a single pattern in DDD” is too abstract. Table 9 gives a total of 14 patterns. It is suggested to think about the common problems of these patterns and give a more specific introduction to the challenges\n4. Figure 8 missing S1-3\n\n\nReporter:\n马维刚\n\nMembers:\n付昌兰、刘晓东、刘佩如、陈琦玮、管兴政、刘惠坤、黄艺玲、胥倩雯',70,'2021-12-03 12:54:28',78,_binary '\0'),(810,'Paper title:\nInitiatives, Practices, and Challenges of Using Domain-Driven Design in Software Engineering: A Systematic Literature Review\n\nSuggestions:\n1. Is it possible not only to quote the original sentences in other people\'s papers, but to make some conclusions by yourself\n2. The primary study literature is relatively small\n3. A summary can be made after each RQ, such as a challenge, which can be summarized which challenges have received more attention\n4. The conclusion is strange, \"Understanding DDD\" may be better to change to \"Exploring DDD\"\n\nReporter:\n李超\nMembers:\n张乐民、翁芷洛、刘芮洪、潘博、王家瑞、薛俊明、吕俊',70,'2021-12-03 16:38:37',79,_binary '\0'),(811,'### Initiatives, Practices, and Challenges of Using Domain-Driven Design in Software Engineering: A Systematic Literature Review\n\nSuggestions:\n- Table 1: needed to be more organized. Put Conference and Jounral together are messy.\n- Table 3: Explain the processing of other SLR or survey in the Table and text description. IC1 can be extended, and if there is any generalize restrictions, we can divide into several items.\n- Section 3.3: The extraction process can be visually illustrated by a graph.\n- Section 3.4: \"Two student researchers\" do they need a brief description of their background?\n- Figure 5:  the specific benefits are mentioned above, but only the metrics mentioned below, should be changed to a consistent statement.\n- Section 4: Reasons for naming abbreviations.\n- Figure 7: There may be problems with color representation, so dotted lines can be considered.\n- Figure 8: Triangle, asterisk should be represented in legend. In addition, S1-3 is written but not shown in the figure.\n- Section4.3: it is not clear whether it is a summary of existing schemes or a proposal of future research directions.\n-