ematic Literature Review\nChanglan Fu\nJSS\n\nThis paper aim to conduct SLR on the topic\"AI in Security Requirements\"， \n\nI think that this is an interesting topic that has to be studied in the recent years.\n\nResearchers as well as practitioners in the relevant field will benefit from this resource. \n\n\nThe following comments will be given to the author:\n\n1. As the paper is a journal version, more details of slr process could be explained in the method section (e.g., how many initial studies were retrieved, and what was the main selection criteria).\n\n2.In the conclusion part of the abstract, I suggest moving the claim \"There still is a lot of room for exploration and improvement in the application of AI to deal with security requirements\" to the end, as it is the authors\' opinion that usually shouldn\'t appear so early in the conclusion.\n\n3. I\'m not familiar with \"NIST\", could you give me a complete name for it?\n\n4. In the middle of the introduction of the paper, the authors describe how AI has progressed over the last decade by saying, \"The last decade have seen rapid development of artificial intelligence (AI) and its applications.\" I suggest this section be changed to explain how AI approaches can be applied to security research. Accordingly, this sentence can change to \"The last decade have seen the rapid development of artificial intelligence (AI) and its applications in security research\". Then, the following explanation can concentrate more on specific AI approaches used in security research, opposed to the normative AI approaches.\n\n5. The paper claims that \"There is currently a lack of systematic understanding of the use of AI in security needs.\", but I think more citations are needed to support the claim.\n\n6. I mentioned before that \"2.2 AI\" should be changed to \"2.2 AI for Security\", then \"2.3 Related Work\" can be changed to \"2.3 Secondary studies for AI in Security\".\n\n7. Fig.1 can be more clearly displayed.\n\n8. In the results section of the paper, it states that \"We have identified six security requirements activities based on input and output of the included studies, and divided all studies into six categories\", but why are there six categories of security requirements activities? Did you follow any previous work in this area?\n\n9. It seems RQ1 has been divided into two parts, if the author could give an overview result by integrating two parts, it will be easier for readers to understand.\n\nTable 5 Validation Results, if the dataset and specific link used in the primary studies was included, the information would be more useful and relevant to the reader. We thought the validation results would be influenced by the original experimental datasets and data size, therefore, if the paper only summarized the validation results without those essential details, it would be meaningless. I suggest Table 5 can refers to this privious work[1], which gives an overview and a detailed classification of the primary publications including title, author, model, dataset, and evaluation, and so on.\n\n[1] Recovering from a decade: a systematic mapping of information retrieval approaches to software traceability\n\n11. Consider adding a figure to explain the result of RQ3 since this question and result is of the utmost importance and contributes to the paper.\n\n12. Wentao Wang et al.->Wang et al.\n\n13. In my opinion, the potential for improvement is just as important as the result of RQ3. Therefore, the introduction to this section should provide strong evidence for supporting the \"Potential for Improvement.\". \n\nAs an example, with respect to \"2)More experiments and evaluation in industry, most of the data sets currently available are open source\", in fact, how many studies in 20 primary studies used the industry dataset, could you explain why(the reason behind) this is the case?\n\n14. Does the claim \"There have been very few studies on applying deep learning to security requirements, and only one research ([S18]) used deep learning to identify SR issues\" contradict itself?  \n\n15. More importantly, it seems that there is one previous review on \"AI for security requirement\", \nthe author indeed gives some differents, however, could you analyze them in a more logistic way, \nfor example, what are their paper and yours\' review in common ? \nwhat are the differences?how many primary studies overlapped? \nwhy you focus on these three research questions that different from their paper? \ndoes these questions more important for security research? \ncan you used more citations to support it?',72,'2021-12-10 12:10:58',33,_binary '\0'),(816,'1. Introduction最后一段对全文结构描述与实际正文存在出入，正确的是： Section 6 discusses the implications of our research and provides avenues for future research. Section 7 discusses the possible threats to validity. And we draw the conclusions in Section 8.\n2. Figure 7的小标题建议改为“The mapping between the V&V methods and quality aspects”或者“the map of…… ”感觉能更好的前后呼应，开头提到的本文提出two maps，这是其中一个map，另一个map在Section 5.4中展示\n3. Section 6 第一段开头应该是 From不是Form吧\n4. Section 7第一段总结本章时只提到construct validity, internal validity, conclusion validity respectively三部分，少了7.3描述的external validity',71,'2021-12-10 12:18:53',105,_binary '\0'),(817,'1、缩进格式方面。有的地方进行了缩进、有的地方没有，如3 Research Method部分，3.3、3.5、3.6中部分段落进行了缩进，而其他部分则没有。\n2、表头格式不统一。如“Table 1: Study inclusion and exclusion criteria”“Table 2. An overview of the final included studies”“Table 3: Data items extracted from the identified studies”“Table 5 validation results”，有的使用冒号，有的使用点，有的则没有分隔符。\n3、4.2.1 Means of Validation中(4) CASE STUDY字母全体大写，和其他同类小标题不同。\n总体来说，我觉得全文思路很清晰。',72,'2021-12-10 12:20:31',102,_binary '\0'),(818,'1、1 INTRODUCTION部分最后一段Section 6 discusses the possible threats to validity. Section 5 discusses the implications of our research and provides avenues for future research. And we draw the conclusion in Section 7.中，对于section的内容描述错位。\n2、FIGURE4 Study distribution per year中展示的论文总数为105篇，而全文中提到提取的论文数量均为104篇。\n3、Figure7中最后一列标头未居中。\n总体来说，我觉得文章很好。',71,'2021-12-10 12:23:34',102,_binary '\0'),(819,'Reviews for the V&V paper:\nThis paper provides a systematic mapping study for verification and validation of software process simulation models.\nHowever, there are some disadvantages that can be further improved in future refinements.\n1. The motivations highlighted both in the abstract and in the introduction do not convince me. The research gap here, according to the authors, is that the current frameworks in this field are in “a high level of abstraction”, which could be bridged by “detailed information to support the application of frameworks”. However, I can not see, why these “information” from this SMS can support the application of such abstract frameworks. The authors might provide some concrete examples to  support these opinions. \n2. Even though these frameworks act as the background and motivation of this paper, we do not find enough discussions about the current drawbacks of these frameworks in Section 2. It seems that these discussions are incorporated into Section 3, with a meta-model of V&V process, which is not reasonable for me.\n3. The derivation of the meta-model in Figure 2 is not rigorous, neither the meta-model itself. For the derivation of the meta-model, the authors might find the related work from domain-specific language helpful. For the meta-model itself, I suggest to use the standard annotations from UML to represent the meta-model. Btw, the naming of this meta-model is not appropriate enough, for example, in the\nterm “goals of quality aspects”, “quality aspects” seems to be redundant, as there is already a term “quality aspects”.\n4. As for the phrase of RQs, the detailed motivations and objectives are not specified. For example, what are the so-called “different considerations” in the application of these methods in RQ3?\n5. Data synthesis of this SMS is not given.\n6. The categories, “syntactic quality, semantic quality, pragmatic quality, performance, value”, used frequently in this paper to map the results are not introduced and not resonate with me.',71,'2021-12-10 14:11:21',23,_binary '\0'),(820,'Requirements are critical to the success of software design, development, and testing, etc. This paper reviews the studies that use AI for security requirements by leveraging the SLR method, which contributes to the state-of-the-art AI for SE. However, this paper has the following shortcomings.\n1. The term “AI” is overwhelming to this paper. “ML” is more appropriate as widely mentioned in manuscript.\n2. No clear difference between the work (what you have done) and the contribution.\n3. The quality assurance measures of methodology are not enough.\n4. The data items are challenging to extract, e.g., “research strategy and method description”.  \n5. The answers to research questions, in particular the presentations of techniques are confused.\n6. The presentation needs to be improved.\n',72,'2021-12-10 15:26:00',44,_binary '\0'),(821,'This paper presents an overview of verification and validation of software process simulation models, which provides state-of-the-art research for modelers. This paper is well organized and easy to read. However, this paper has the following shortcomings.\n1. You should mention the original paper (published in ICSSP 2017) earlier and clearer, then the difference between the current version.\n2. The presentations should be more rigorous, e.g., Section 3.1, “Lack of xxx” --> “Short of xxx”.\n3. I do not agree with the “Threats to validity” as reported in the manuscript. Please distinguish rigorously among different types of validity.\n4. Should RQ4 can be a RQ? In my opinion, it should be placed in “Discussion”.\n',71,'2021-12-10 15:26:31',44,_binary '\0'),(822,'1. Use the wrong word. i) The last sentence of abstract should be true application rather than truly; ii) The second sentence of the last paragraph of Introduction should be related work rather than relate\n2. Typesetting issues. The whole is not aligned at both ends, such as Section 2.3, 3.3, 4\n3. In the two parts of Section 4.2 and 4.3, you can add a first paragraph to summarize the content of each part.',72,'2021-12-10 15:59:09',105,_binary '\0'),(823,'1. How can your keywords have System literature review\n2. There is a problem with the indentation of the article. The space between words appears to be of different sizes, which may be caused by justification at both ends.\n3. After The rest of this paper is organized as follows on the third page, in Section 2 should be removed in order to be consistent with the latter.\n4. In Section 3, you use automatic search and manual search for document sorting, followed by forward snowballing and reverse snowballing to improve your paper retrieval process, but why is there only one method on the third page?\n5. The capitalization of the first letter of the title of Specific Verification methods on page 22 does not match other titles',72,'2021-12-10 16:56:05',88,_binary '\0'),(824,'**---- Summary of the submission ----**\nAs a systematic mapping study of verification and validation of software process simulation models, this paper shows the status quo of how modelers adopt V&V methods to secure the quality and reliability of models. Since this paper has been reviewed before, I support to submit this revised version to new journal for opportunity of acceptance and good luck to you.\n\n**---- Major concerns ----**\nABSTRACT: I think the current version is normal but not good enough, because I cannot get more information about this paper after read it. I recommend to briefly introduce the logic of RQs to match your “Method” with “Objective”, and highlight your contribution about why this study can help modelers to improve their V&V process.\n\n**INTRODUCTION:** Although the difference between this version and ICSSP 2017 has been given in this section, the reason of these changes is unclear. I recommend to elaborate how V&V of SPSMs change in recent five years and why an updated and extended version is necessary for this domain.\n\n**METHODOLOGY:** The mapping between the results of RQ1-3 is valuable, however, it will be better to move it to DISUCSSION section rather than add a new RQ for it. In somewhere, I suppose that the mapping of quality aspects, goals and methods is naturally part of the answer to RQ3.\n\n**FINDINGS:** The visualization of research result is legible and I really appreciate it. For RQ1, I wonder why you add performance in this version and how it benefits for the answer of RQ1. Because performance is not a novel aspect and figure 5 shows performance has been discussed since 1999, the reason of why existing framework does not discuss it is unclear. For RQ2, I think the recent version is not so attractive, since you just list the method without summary or insights. And same problem exists in RQ3.\n\n**DISCUSSSION:** It will be interesting to evaluate the existing V&V methods and discuss the application of them.\n\n**---- Minor corrections ----**\n**INTRODUCTION:** It is weird to say that “we can not ensure that there is no problem in the separate study” in a systematic mapping study, because the quality of included study directly affect the reliability of secondary study.\n\n**RELATED FRAMEWORKS:** I am not expert of V&V framework, but it is strange that all of reference in this section were published 15 years ago. It seems that V&V framework is a active research domain in recent year.\n\n**DISCUSSION:** Do you mean “from a large dataset…”?\n',71,'2021-12-10 16:58:32',39,_binary '\0'),(825,'1. In section 2.5 of the article, a colon was used at the beginning of the second paragraph, but the subsequent paragraphs and previous paragraphs did not use colons, so the format should be unified.\n2. The bottom table of picture 3 says the period is 2016~2020, but the table also contains 2015 information\n3. The format of the references, whether the information of some references is missing',71,'2021-12-10 16:59:37',62,_binary '\0'),(826,'This is a SLR which aims to study the adoption of AI method in SE SRs in order to understand how AI method has been used in SE SRs and their effects. In my opinion, theree are too many typo and mistakes in this paper, and even there is a chinese journal is listed in reference. The quality of this paper is not enough for submitting to JSS.',72,'2021-12-10 17:03:36',39,_binary '\0'),(827,'- 3.6 The format of the third paragraph is not unified\n- Should each line be filled, or should the paper format be like this?\n- The first row of Table 5 is missing a lot of data, if it is empty, it should be filled',72,'2021-12-10 17:19:49',62,_binary '\0'),(828,'1. The paragraph format from page 5 to page 6 is a bit strange\n2. In fig3, do you make it clear whether your paper retrieval method is appropriate, whether to use the literature review method for the paper retrieval, whether to use the snowball method to retrieve the papers in the reference literature\n3. The annual research distribution on page 10 shows in the paper whether it is really necessary to mention it in the paper\n4. Syntactic Quality has so few documents in previous years, is there a thoughtful analysis and discussion?\n5. On page 18, there is a big gap between the format of your FIGURE 8 and Figure 9 below',71,'2021-12-10 20:55:33',88,_binary '\0'),(829,'1. It is shown in Figure 3 that the research work is from 2016 to 2020, but there are researches before 2015 in the table.\n2. The writing method of RQ2-Rq4 corresponding to \"Model V&V Method \"in Table 3 is inconsistent with other lines.\n3. The \"Form\" at the beginning of section 6 should be \"From\".',71,'2021-12-10 20:56:58',17,_binary '\0'),(830,'Paper Title:\nUsing Artificial Intelligence in Security Requirements: A Systematic Literature Review\n\nPaper summary:\nThis paper conduct a System Literature Review to study the AI method in SE. By reviewing 20 studies, this paper solves six research questions of activities in security requirement.\nComments for author:\n\n1. In abstract, the author did not show why AI in security is necessary to study. The motivation of this paper is not enough. What is the necessary of this study? The author did not make it clear that why AI is worth studying in security requirements.\n2. In Section 3.1, how researchers can effectively use AI before tackling challenges. I recommend that the author discuss the challenges to AI application before discussing AI effectiveness.\n3. RQ1-RQ3 are separated. The paper does not reflect the relationship between each RQ.\n4. “RQ2. How effective is the applied AI in dealing with security requirements?”RQ2 is difficult to measure, and what does it mean for other researchers? Specific AI methods are used to solve specific problems. Accuracy is a very specific parameter. What is the significance of this parameter for other studies?\n\n\n',72,'2021-12-10 21:07:01',31,_binary '\0'),(831,'1. The font in Figure 1 is too small.\n2. Table 4 should be formatted so that the entire word appears on the same line.\n3. There are also some spelling mistakes, etc.',72,'2021-12-10 21:07:32',17,_binary '\0'),(832,'This paper conducted a systematic mapping study on the researches of SPSMs that report on their V&V activities. The author identified 104 relevant studies from a pool of 309 papers on SPSMs until 2020. The findings revealed the relationships among the modeling process, three modeling steps, five quality aspects, and ten V&V methods. They also built two systematic maps, one illustrates the relationships between quality aspects of SPSMs and the V&V methods to ensure them; and the other depicts the relationships among the steps of modeling process, quality aspects, goals for each quality aspect, and V&V methods. There are some suggestions:\n1.It Needs to be considered whether Figure 11 should be placed in the discussion section\n2.The contribution of the abstract chapter only stays at the abstract level, it needs to show what the actual value of your work is.',71,'2021-12-10 21:08:50',26,_binary '\0'),(833,'This study reveals the-state-of-the-art of the use of AI in security requirements, including how to use AI to solve security requirement problems, the effects of the solution, and the existing challenges. The author discussed the deficiencies in the application of AI to security requirements, and provided researchers with improved directions and potential research points. Our efforts help guide practitioners to better use AI methods to solve security requirements. There  are some suggestions:\n1.The author only listed related works declaratively in section 2, without analyzing the shortcomings of these works and how did you make up for them.\n2.The logic of the introduction part is not clear enough, it should lead to the value of the work in a directional way, but I did not understand the target and goal of the work here.',72,'2021-12-10 21:16:20',26,_binary '\0'),(834,'1. Figure 7 title is not centered\n2. The beginning word of section 6 seems to be misspelled',71,'2021-12-10 21:38:44',80,_binary '\0'),(835,'1. Diagram and table format are not uniform',72,'2021-12-10 21:45:45',80,_binary '\0'),(836,'This paper provides an overview of verification and validation of software process simulation models, which is helpful and has positive significance. Here is my comment:\n1. Motivation is not sufficient and needs to be further specified. Motivation should correspond to the development and results of the implementation process\n2. Some of the limitations of the study can be explained, such as the current drawbacks of these frameworks .\n3. The  expression of the article needs further consideration, and the explanation of some concepts, need to be a little more detailed.',71,'2021-12-10 21:59:20',55,_binary '\0'),(837,'This paper provides an overview of  study the adoption of AI method in SE SRs in order to understand how AI method has been used in SE SRs and their effects. This work has positive significance and scientific research value. Here is my opinion:\n1. Further description of contributions is required， you can compare with existing work to show contribution, correctness and efficiency improvement\n2. The interpretation of some of the diagrams and tables, is unclear and difficult to understand, and there are some formatting issues and syntax errors.',72,'2021-12-10 22:05:55',55,_binary '\0'),(838,'This paper is a SLR of Verification and Validation of Software Process Simulation Models. The figures and tables are clear. I like RQ3 for it relates RQ1 and RQ2. However, the content of Discussion section is too little, there are few details about solutions that might improve the quality of the V&V process in the future, please add more explaination.',71,'2021-12-10 22:07:05',8,_binary '\0'),(839,'1. The motivation of this article is not sufficient.\n2. I suggest that you may need to rephrase RQ1. From the following text, we know that this question studies which AI Technologies (which) and what Security requirements Issues (what). But RQ1 is about “how to deal with” \n3. REFERENCES contains Chinese literature.',72,'2021-12-10 22:19:39',8,_binary '\0'),(840,'1. I think Figure 5 and Figure 6 are more suitable for thermal diagram',71,'2021-12-10 22:30:11',78,_binary '\0'),(841,'1. It is suggested to adjust the format of Table 4 and Table 5',72,'2021-12-10 22:42:43',78,_binary '\0'),(842,'This paper conducts a systematic mapping study and reveals the state-of-art V&V research in software process simulation models. This work is helpful. However, there are some minor errors:\n1. The structure of this paper illustrated at the end of Introduction is inconsistent with reality.\n2. The sentence \"Form a large dataset\" may intend to mean \"From a large dataset\".',71,'2021-12-10 22:48:25',90,_binary '\0'),(843,'This paper conducts a systematic mapping study and reveals the state-of-art of the use of AI in security requirements. The work is helpful and my views are as follows:\n1.There can be more information about the search process in Section 3.\n2.References contains a chinese papaer.',72,'2021-12-10 23:00:39',90,_binary '\0'),(844,'Some suggestions are as follows:\n1. In the process of the systematic mapping study, after the paper collection is selected, the authors should assess the quality of the literature.\n2. Some spelling mistakes such as \"Form\" in section 6.',71,'2021-12-10 23:14:02',73,_binary '\0'),(845,'Some suggestions are as follows:\n1. In table 4, the \"S12,S13\" in the third line dose not align with other lines.\n2. In section 5.3, the authors do not discuss external validity and construction validity.\n3. The contributions should be expanded, in terms of comparing with the existing works.',72,'2021-12-10 23:24:24',73,_binary '\0'),(846,'1. The the beginning word \'Form\' of section 6 should be \'From\'?',71,'2021-12-10 23:32:20',7,_binary '\0'),(847,'1. The format of diagram and paragraph is not uniform.\n2. Many misspellings.',72,'2021-12-10 23:37:35',7,_binary '\0'),(848,'Title: Using Artificial Intelligence in Security Requirements: A Systematic Literature Review\nAuthor: Fu Changlan\nThis paper aims at studying the adoption of AI method in SE SRs in order to understand how AI method has been used in SE SRs and their effects.\nFrom my view point, there are some issues in this paper:\n\n1. I think RQ\'s proposal is somewhat abrupt, perhaps it is better to introduce the basis for proposing RQ.\n2. I think the number of primary studies is a little small, which is not enough to support the conclusion.\n3. There are also some minor problems. For example, the ends of some lines in the paper are not aligned. The arrangement of words in the table seems not neat enough, for example, table 4.\n\n\n',72,'2021-12-10 23:57:20',77,_binary '\0'),(849,'Title: Verification and Validation of Software Process Simulation Models: A Systematic Mapping Study\nAuthor: Li Yue， Liu Bohan, Dong Liming\nThis paper focuses on systematically summarizing and mapping V&V studies in software engineering to provide guidelines for future research and practice. \nFrom my view point, there are some issues in this paper:\n\n1. I think it would be better to briefly explain the relationship between the Limitations mentioned in Section III and RQ.\n2. The basis for proposing the meta model seems a little vague. For me, I think it would be better to introduce the necessity.\n3. In page9, the paper said \"We identified 20 papers that meet C1, C2, and C3 after removing the duplication\", but this does not match the figure in Figure 3.\n4. There are some spelling errors, such as \' Form\'.\n',71,'2021-12-11 00:17:15',77,_binary '\0'),(850,'The paper aims at studying the adoption of the AI method in SE SRs by conducting a System Literature Review (SLR)\n1. The motivation is \"There is currently a lack of systematic understanding of the use of AI in security requirements\", I think it is not enough\n2. In the first chapter, the author mix uses the words “Article” and “Paper”\n3. In chapter 4.1.1,  I think the author can explain the reason  for the paucity of research\n4. In chapter 4.2.1, the “CASE STUDY” header is not consistent with the other header fonts\n5. In chapter 4.3, I think the author can provide integer challenges and then explain them from different categories\n6. In chapter 5, I think the author can talk about the implications of this article for practitioners and researchers',72,'2021-12-11 00:38:56',18,_binary '\0'),(851,'The paper aims to identify what aspects of SPSMs were verified and validated by using which V&V methods in software engineering research\n1. Some of the fonts about \"FIGURE\" are not uniform\n2. I think the number of papers in stage 2 in Figure 3 should be changed to a filtered result, from 35 to 20\n3. Quotations in the text can not be distinguished from corner marks',71,'2021-12-11 00:48:12',18,_binary '\0'),(852,'Summary：This paper conduct a System Literature Review to study the adoption of AI method in SecurityRequirement.\n\nsuggestions\n1.The format of Table 4 and Table 5 are strange.\n2. There are many spelling mistakes.\n',72,'2021-12-11 09:31:00',70,_binary '\0'),(853,'1. There is a spelling mistake at the beginning of section 6. \"Form\" should be changed to \"From\".\n2. Figure11 is not in the right place, it might be better placed for discussion .',71,'2021-12-11 09:32:31',85,_binary '\0'),(854,'Over all\nThis V&V mapping study introduces how to use the V&V method to ensure the quality and reliability of the model. I like this article very much, it is ready for submission.\nMinor problem\nThe research motives can be more clarified, but it seems a bit shallow at present.\nThe logic between RQ can be clearer.',71,'2021-12-11 09:36:32',61,_binary '\0'),(855,'1. There is no clear introduction of the work made in this paper and what is the contribution.\n2. References should not contain Chinese literature.',72,'2021-12-11 09:37:45',85,_binary '\0'),(856,'suggestions:\n1.The title of Figure 7 is not centered.\n2.In section 6,\"form\" should be \"from\".',71,'2021-12-11 09:41:51',70,_binary '\0'),(857,'Over all\nThis SLR is about \"AI in Security Requirements\". However, the scope of the term \"AI\" is too large, and it is recommended to focus more on the topic of the thesis. Secondly, the article looks like a draft, many of the formatting, wording, and diagrams have problems, and they need to be carefully revised. As an SLR, it needs to be repeatable, and the process of document retrieval needs to be described in detail.',72,'2021-12-11 09:43:02',61,_binary '\0'),(858,'This paper offers us an understanding of AI methods that are used in Security Requirements, including current status, how to use, challenges and deficiencies. Given the significance of security requirements, I think the research idea is brilliant and can bring benefit to both academia and industry. However, there are also some issues to be addressed in my view.\n1. The research topic of this paper is \"Security Requirements\", which may be unfamiliar to some people, so I think it\'s better to give an overall introduction of it with some SR examples in Section 2.1. And the readers can better understand the situations where the AI methods are used and how they are used.\n2. According to my modest experience, the number of the selected studies is rather small, and I think it\'s better to improve the search and snowballing progress, modify the search string to extend the scope of the study, and meanwhile the conclusion of this paper can be more convincing.\n3. I think there are too much duplicate content in the QA columns of table 2. Several sentences can convey the same information without a table, and the layout can also be clearer.\n4. In Section 4, the phrase \"identification and classification\" is used with \"identification\" and \"identification\" side by side. According to the literal meaning of the 3 phrases, the former one can include the latter ones, which is confusing for readers. It\'s better to emphasize why to do so before the answers to RQs.\n5. There is a reference entry written in Chinese in the reference list, which is not matched with others.\n6. There are also some syntax errors in this paper. For example, in Section 1, when the contributions of this paper are listed, the time tenses are not matched with each other (the present and past time tenses are used together). In Section 2.3, the \"performance\" in \"they did not performance a systematic review\" should be \"perform\".\n7. There are also some sentences that need polishing. For example, the sentence \"It is helpful for academic research results to truly application\" in Abstract is hard to understand. And in Section 4.2.1, when listing the Evaluation Criteria, the hierarchy of content is a little messy, and some criteria is in capitalization while others are not.\n',72,'2021-12-11 09:43:14',81,_binary '\0'),(859,'This paper conducts a SM study on the verification and validation of software process simulation models, which is meaningful to both academia and industry. All in all, the research idea is brilliant and worthy for paper submitting, but I still think there are some issues to be addressed in this paper.\n1. The end of Section 1 mentions that the paper is the extended version of the ICSSP paper and explain the new work done in this version. I think it\'s not enough to present the value of this paper, and this part need more content (not only the research work but also new findings) to highlight the new contributions.\n2. When briefing the paper structure in Introduction, some statements are confusing in this paper. First, there is a statement \"The preliminary findings … are reported in Section 5. Section 6 …\", and another statement \"Section 5 discusses …\" follows. I think it\'s better to reorder these statements.\n3. It\'s better to explain the meaning of V&V in Section 2 more in detail (by some examples or some other ways), in this way the readers can have more understanding on this topic and feel easy to move on reading.\n4. I think the title of Section 4 \"Methodology\" doesn\' t match the content in this section, which actually describes the research progress of this paper. So it might be better to choose another suitable title instead.\n5. In the STAGE III of FIGURE 3, the reference format doesn\'t keep up with FIGURE 9 and other figures, which can be confusing to readers\n6. There are also some syntax errors in this paper. For example, the time tenses are not matched with each other in Abstract, and the situation is frequent in this paper. There are also some other minor issues appearing in this paper, for example there is a missing \".\" after \"improve their V&V process\" in Abstract.\n7. There are also some typos in this paper which may be caused by rush work. For example, the \"exclusion\" in \"We exclusion 15 studies\" at the end of the Section 1 should be \"exclude\".\n',71,'2021-12-11 09:44:32',81,_binary '\0'),(860,'This paper aims at studying the adoption of AI method in SE SRs in order to understand how AI method has been used in SE SRs and their effects.\n\nsuggestions:\nChinese literature included in the reference',72,'2021-12-11 09:55:14',79,_binary '\0'),(861,'This paper presents a systematic literature review (SLR) on the use of AI in security requirements. Yet there are, from my point of view, some drawbacks in the current manuscript which could be improved in the further revisions.\n1. The motivation of this SLR highlighted in the manuscript is that there is “currently a lack of systematic understanding of the use of AI in security requirements”. However, we do not know why such a “systematic understanding” is indispensable for the SE community, at least from the Introduction.\n2. From the related work in Section 2, we see that in the field of security requirements engineering, two systematic reviews have been published previously. These reviews possibly cover the scope of AI in security requirements engineering, as I think. The authors should provide more explanations for the necessity of this SLR.\n3. As for the research questions, I think the current phrases of these questions are far more general than what are actually answered. For example, in RQ1, answering the question of “how to deal with security requirements with AI’’ by presenting only the AI technologies used to deal with security requirements and the security requirements issues dealt by the AI technologies can be disappointed for readers.\n4. From the results of quality assessment, it seems that the current criteria are less useful, given that almost all the reviewed papers got all “1” in these criteria.\n5. In the results, it leads to confusions by involving the “publication status” into the results of RQ1.\n6. Still in the results, we do not find an introduction of the security requirements issues (or possibly the activities) used to categorized the results. As such, the distinctions between “identification and classification”, “identification” and “classification” confuse us.',72,'2021-12-11 09:55:51',23,_binary '\0'),(862,'There are some spelling errors in the text',71,'2021-12-11 09:56:10',79,_binary '\0'),(863,'1. Chinese should not be included in the Reference.\n2. I think it is recommended to clean up misspelled words.',72,'2021-12-11 10:42:14',82,_binary '\0'),(864,'Just two suggestions:\n\n1. Change \'Form\' to \'From\' in Section6.\n2. There is a calculation error in the bottom table of Fig3: 85+19 should be 104.',71,'2021-12-11 10:49:33',82,_binary '\0'),(865,'This paper conduct a System Literature Review to study the AI method in SE. By reviewing 20 studies, this paper solves six research questions of activities in security requirement.\n- The motivation of this SLR is not clear.\n- No clear difference between the work (what you have done) and the contribution.',72,'2021-12-11 10:58:23',84,_binary '\0'),(866,'Some suggestions are as follows:\n1. Figure 6 looks messy as a whole and can be adjusted appropriately.\n2. The relationship between the four RQs is not strong, so there is a sense of fragmentation.',71,'2021-12-11 11:02:19',72,_binary '\0'),(867,'This paper presents an overview of verification and validation of software process simulation models, which provides state-of-the-art research for modelers. This paper is well organized and easy to read. However, this paper has the following shortcomings.\n- The difference with the ICSSP paper is not clear.\n- The logic between RQs is not clear.',71,'2021-12-11 11:04:16',84,_binary '\0'),(868,'1. I think the inclusion criteria used in screening papers are not very rigorous and have little connection with the topic of the paper.\n2. In 4.1.1, It is more appropriate to use the plural of publication, \"Number of publications per year\".',72,'2021-12-11 11:11:01',72,_binary '\0'),(869,'1.The format of the table 1 and table 3 needs to be improved\n2.there is too much extra space in table 5',72,'2021-12-11 11:24:05',92,_binary '\0'),(870,'1.The slanting font in figure 1 makes some reading troubles.\n2.Can the element of V&V in figure2 be more detailed?',71,'2021-12-11 11:29:49',92,_binary '\0'),(871,'Title: Verification and Validation of Software Process Simulation Models: A Systematic Mapping Study\n\nSummary: This paper aims at identifying what aspects of SPSMs were verified and validated by using V&V methods in software engineering research. And to reach the purpose, the authors counducted a systematic mapping study on the researches of SPSMs that report on their V&V activities.\n\n\nComments:\n1. In Section 6, \'Form\' -> \'From\'?\n',71,'2021-12-11 11:44:46',68,_binary '\0'),(872,'In section 6, The beginning of the first paragraph should be From.',71,'2021-12-11 11:54:11',83,_binary '\0'),(873,'Title: Using Artifical Intelligence in Security Requirements: A Systematic Literature Review\n\nSummary: \nThis paper aims at studying the adoption of AI method in SE STs in order to understand how AI method has been used in SE SRs and their effects. To reach this purpose, the authors conducted a SLR by reviewing 20 studies that use AI to handle security requirements.\n\nComments:\n1. Table 5 may need to be formatted to facilitate reading.\n2. The tenth reference needs to be formatted.\n',72,'2021-12-11 11:55:57',68,_binary '\0'),(874,'This article gave us an understanding of AI methods used in security requirements.\n- I think the author can explain the lack of research in Chapter 4.1.1',72,'2021-12-11 11:56:59',83,_binary '\0'),(875,'This papar conducted a systematic mapping study on the researches of SPSMs that report on their verification and validation (V&V) activities. This work helps to support modelers practice and improve their V&V process. The presentation is well, the format and diagrams are standard.',71,'2021-12-11 11:58:28',6,_binary '\0'),(876,'1、The abstract quotes the role of AI in security requirements rather bluntly.\n2、The format of the table 3 、table 4 、table 5 needs to be improved',72,'2021-12-11 21:01:43',74,_binary '\0'),(877,'1、the relation between elements in fig 11 is vague becouse of the messful link.',71,'2021-12-11 21:58:11',74,_binary '\0'),(878,'Note the wide variety of specifications in this article\nIn chapter 4.1.1, I think the author can explain the reason for the paucity of research',72,'2021-12-12 23:10:23',34,_binary '\0'),(879,'1、REFERENCES contains Chinese literature.\n2、The format of the tables needs to be uniformed.',72,'2021-12-12 23:39:15',86,_binary '\0'),(880,'1. In the introduction, lack the description of organizational structure\n2. In Sec 4.1.1, Figure 3 in the last paragraph should be Figure 4. The numbers of figures 3 and 4 should be exchanged, because figure 4 is referenced first.\n3. What is the meaning of \"source\" in Figure 3 and why it contains two role categories?\n4. Some categories in Figure 4 do not have corresponding metric mappings. How do you deal with these? (some missing measures in professional competencies are replaced by other indirect measures. There is no usable measure for innovation ability. How to deal with this part? Will this kind be discarded?)\n5. The TOPSIS algorithm (1981) used in dimension 1 and the iforest algorithm (2008) used in dimension 2 are too old. Have you considered newer technologies? Or consider adding a set of algorithms for comparison?',74,'2022-01-07 18:24:09',78,_binary '\0'),(881,'This study proposed a three-layer framework for anomaly identification of software engineer’s output and introduced the implementation process. The framework is beneficial to organizations and enterprises that aim to improve their management, and to engineers who aim to seek self-improvement.\nHere are some questions:\n(1) In 4.1.3, \"Interviewees provided us with comprehensive dimensions and abundant metrics for output assessment of software engineers\", Give specific quantitative indicators instead of \"abundant\". And What are the standards of each dimension in Figure 4, lacking evidence\n(2) You need to clarify why iforest is used and its advantages in this article\'s scenario\n(3) \"The evaluation results proved that our framework is effective and more efficient than the manual process, reducing the identification time from thirty minutes to seconds.\" I can also understand that automated tools replace manual tools to improve efficiency, rather than the framework you proposed',74,'2022-01-08 13:07:34',2,_binary '\0'),(882,'1. In figure1, in the Data Layer, the word you want to express is \"quantitative output metrics\" or \"output data\", but if you say\"output\" ,it can be misleading that it is the output of your  framework.\n2.In figure2, the illustrations of \"Dimension I\" and \"Dimension II\" is unrepresentative.\n3.In section 3.2.2 \" The output quantity and quality of some engineers may be far below average due to some reasons.\",but In 4.2.1,you use TOPSIS to \"order preference\",  is there any necessary connection ? May be you should  add some arguments about this.',74,'2022-01-08 13:39:28',34,_binary '\0'),(883,'This study propose a three-layer framework for anomaly identification of software engineer’s output and introduce the implementation process. Since this paper has been internal reviewed before and I have summarized some kay points for authors to refine the manuscript, I suggest to send this paper to another publication and seek for opportunity to be accepted. Good luck.',74,'2022-01-08 17:03:12',39,_binary '\0'),(884,'This paper proposes a framework for automated anomaly identification of software engineers, which can help a lot to tackle the pain points in personal evaluation and improvment in the industry. While I think it\'s a brilliant research idea, there are also some issues to be addressed from my viewpoint:\n1. The number of interviewees in the experiment seem to be rather small, and consequently the effect of the framework may be not convincing. It\'s better to enlarge the experiment scale.\n2. There is no paper structure in the Introduction or Background to illustrate how the content is organized, I think it\'s better to add this part.\n3. In Figure 1 and Figure 2, it\'s better to present the names of the 2 dimensions rather than \"Dimension I\" and \"Dimension II\", and the figure can be more self-evident. Meanwhile I also think it\'s better to put the 2 anomaly identification algorithms into the figure to help readers understand the use of the 2 algorathms.\n4. In Figure 3,  in the first pie chart the meaning of \"Source\" is not clear. And what is relationship between the engineers in the second pie chart and those of the first one? It seems the engineers in the second one are all employees, which should be explained to readers.\n5. In Figure 4, the color of the sub metric \"Managing Changes\" of innovative competences doesn\'t match the upper metric.\n6. There are also some language issues. For example, the \"whose\" in the first sentence of Abstract can be \"there\", because the second half is the result of the first, not the interpretation. The \",\" at the end of the first paragraph should be \".\". These little issues should be checked and tackled.',74,'2022-01-08 18:31:16',81,_binary '\0'),(885,'This study design a framework for software engineers to automatically identify anomalies.This work is in favor of organizations and enterprises that aim to improve their management, which has positive significance and scientific research value. Here is my comment:\n- The algorithm chosen should further describe the reasons for the choice in detail.\n- The  expression of the article needs further consideration, and the explanation of some concepts, need to be a little more detailed. And there are also some language issues.',74,'2022-01-08 19:28:32',55,_binary '\0'),(886,'This paper proposed a framework for automated anomaly identification of software engineer’s output. The authors deployed the framework in their collaborator enterprise and significantly reduced the time-consuming manual analysis process from 30 minutes to seconds.\nHere are several comments:\n1. The proposed framework (Section 3) was described in detail, but it lacks the description of the rational behind the framework, that is, why the framework includes three layers, why there are three stages in the implementation process. Furthermore, what is the relationship between the three-layer framework and the implementation process. Is there any mapping between them?\n2. IMHO, the accuracy of the anomaly identification is also important when talking about the evaluation of the framework. Maybe another section on this should be added.\n2. Threat to validity section may be needed to explain to what extent the framework can be used in other enterprises.',74,'2022-01-08 19:59:51',3,_binary '\0'),(887,'This paper proposed a three-layer framework to achieve anomaly identification of software engineering\'s output automatically. The framwork can identify and report anomaly from two dimensions and reduce the time spent on the analysis. My comments are as follow:\n1. There may be some mirror mistakes, such as in section 4.1.1, Figure 3 in the last sentence may be incorrect.\n2. In section 4.4, the evaluation includes suitability of the framework such as accuracy or correctness may be better.',74,'2022-01-09 00:26:41',90,_binary '\0'),(888,'this study proposed a three-layer framework for anomaly identification of software engineer’s output and introduced the implementation process. Here are some my comments:\n1. Reasons why the TOPSIS method was chosen was not detailed.\n2. The TOPSIS method may be sensitive to abnormal data, which can be considered in the limitation section.',74,'2022-01-09 11:05:01',70,_binary '\0'),(889,'Some suggestions are as follow:\n1. In the 4.4.2 feedback section, the reasons for the lower scores of some scenes were not given.\n2. There is no mention of areas where the framework can be improved and possible future research directions.',74,'2022-01-09 12:24:30',72,_binary '\0'),(890,'This paper presents a three-layer framework for software engineer to identify output anomalies and introduces its implementation. Here are some problems with this article:\n1. Figure 4 lacks the corresponding space to explain it.\n2. It is not explained why the algorithm mentioned in the paper is adopted.\n3. Lack of quantitative experimental verification and corresponding results display.\n4. There are only 12 questionnaires collected in this paper, which is relatively small and the conclusion is subjective.',74,'2022-01-09 14:09:05',17,_binary '\0'),(891,'Here are some small suggestions:\n1. In Figure 4, if the node color indicates one of the competences, then the \"Managing Change\" node color is wrong.\n2. Why these algorithms are used should be described in more detail.',74,'2022-01-09 17:31:26',82,_binary '\0'),(892,'This paper presents a three-layer framework for software engineer to identify output anomalies and introduces its implementation. Here are some suggestions:\n- The small number of respondents in the experiment appears to have compromised the viability of the experiment results.\n- The paper needs to add more detailed algorithm selection reasons.',74,'2022-01-09 18:31:37',83,_binary '\0'),(893,'This paper proposes a three-layer framework for software engineers to identify output anomalies and introduces its implementation. Here are some opinions:\n1、It would be better if the evaluation part could be more detailed',74,'2022-01-09 18:36:48',79,_binary '\0'),(894,'This paper presents a three-layer framework for software engineer to identify output anomalies and introduces its implementation. Here are my suggestions:\n\n- It would be better to elaborate on the reasons for choosing the algorithm.',74,'2022-01-09 20:18:59',71,_binary '\0'),(895,'This paper presents a method for software engineers to identify output anomalies and its implementation process. Here are my suggestions:\n1. It would be good to introduce the reasons for choosing the algorithm in this article.\n2. The number of questionnaires is small and the conclusions drawn from this lack sufficient support.',74,'2022-01-10 14:59:01',85,_binary '\0'),(896,'The paper put forward a framework for software engineers to achieve automated anomaly identification. Here is the comment:\n1. There could be more description about the algorithm and the implementation.',74,'2022-01-14 12:10:22',89,_binary '\0'),(897,'This paper proposes a program classifier implementing by abstract syntax tree and graph neural network representation learning techniques. The experiments indicate that the proposed classifier (UAST) significantly outperforms state-of-the-art baselines. Overall, I think the idea behind this classifier is innovative. The following is my comments for improvement.\n1. Why do we need program classification? Especially in the context of software industry.\n2. As you only leverage source code, why claim to perform \"program classification\"? （\"program = code + document\"）\n3. Why do you construct the private dataset (Leetcode)？\n4. The lead of UAST is too big. I know this is positive for experiments, but maybe negative for review.\n5. The presentation of this paper need to be improvement. \n\n',80,'2022-01-14 20:25:09',44,_binary '\0'),(898,'This study proposes a theoretical solution based on queuing theory to evaluate the performance of Hyperledger Fabric 2.0, and numerical analysis and simulation are implemented to verify the accuracy of the model and formula. I have reviewed the paper serval times before, and I support to submit this work to this conference for opportunity of acceptance. However, I stiil find some points which needs to be modified to improve the quality of this manuscript:\n\n**ABSTRACT: **It seems the authors have rewrote abstract, however, the new version do not elaborate the major motivation and contribution of this work. And I suspect the reliability of \"research methods are not reproducible\", this description is controversial.\n',81,'2022-01-14 20:38:55',39,_binary '\0'),(899,'1. It is hard (actually impossiable for me) to understand so many equations. I suggest explaining more context of some equations.\n2. There are few correlations between the problem (performance of Hyperledger Fabric 2.0) and the method (queuing theory) in Section 3.\n3. As you have proposed a new approach, there should be controlled experiments to prove the validity and advanced of your approach.\n4. The presentation of Section 4 need to be improved, e.g., there are results but a few analyses.',81,'2022-01-14 20:43:45',44,_binary '\0'),(900,'This study propose a new neural network based on unified abstract syntax tree to capture the features of the semantic level of the code. A mechanism called unified vocabulary is also proposed to reduce the feature gap between different programming languages. The experiment result exhibited in paper is surprising, and I recommand to submit it to conference for peer-review.',80,'2022-01-14 20:58:37',39,_binary '\0'),(901,'This study designs a new neural network based on unified abstract syntax tree, the classifier UAST has shown its optimization among other works. This work has positive significance and scientific research value. Here is my opinions:\n1. Further description of motivations is required， you can compare with existing work to show the research condition to  illustrate your improvement and optimization.\n2.The expression of the article needs further consideration, and the explanation of some concepts, need to be a little more detailed. And there are some formatting issues and syntax errors.',80,'2022-01-14 21:17:50',55,_binary '\0'),(902,'This paper modelled the Hyperledger Fabric v2.0 using the queuing theory model, aiming to provide a theory feasible and extensible solution of performance understanding and measurement. \nHere are some comments:\n1. The motivation and the challenges/limitations of existing approaches should be clearly explained in the introduction.\n2. More description should be added about the underlying principles behind the equations and how the underlying principles relate to the problem you are trying to solve.\n3. Some summaries are missing in section 4.\n4. Please pay attention to the typography.\nThis paper modelled the Hyperledger Fabric v2.0 using the queuing theory model, aiming to provide a theory feasible and extensible solution of performance understanding and measurement. \nHere are some comments:\n1. The motivation and the challenges/limitations of existing approaches should be clearly explained in the introduction.\n2. More description should be added about the underlying principles behind the equations and how the underlying principles relate to the problem you are trying to solve.\n3. Some summaries are missing in section 4.\n4. Please pay attention to the typography.\n',81,'2022-01-14 21:51:59',3,_binary '\0'),(903,'This paper proposed a Unified Abstract Syntax Tree  neural network (UAST) framework for cross-language program classification task to support program comprehension and quality assurance.\nHere are some comments:\n1. In the Introduction, you claimed “Cross-language program classification can realize code transfer in different programming languages, and can also promote cross-language code reuse”, but how can cross-language program classification realize code transfer? Therefore, it needs more description to prove the necessity of cross-language classification. \n2. Two problems (from line 145 to line 165) were mentioned in the Introduction, but they seem to be a little bit contradictory. The bi-NN framework is not highly scalable since it learns programming language respectively, while the pre-trained model does not consider the differences of different languages. How do you solve both problems at the same time? In my opinion, they are two sides of a coin, and you can only achieve a balance.\n3. It is better to discuss the implication of the experiment in Section 5.',80,'2022-01-15 00:05:40',3,_binary '\0'),(904,'This paper focuses on program normalization using AST, which is an interesting research idea and achieves good results. However, there are also some issues to be addressed from my view point.\n1. There is little illustration about how to get the unified vocabulary in the paper, such as the concrete method to obtain the unified vocabulary, which can stop others to reproduce your work.\n2. Figure 3 illustrates the aggregation of GAST with the first letter of each word, which can confuse the readers to believe you only use the first letters.\n3. the numbers in the table 1 miss the according unit names, such as lines or methods.\n4. The language in the paper should be polished. For example, the \"code clone\" in the 4th line of the Abstract should be \"code clone detection\".',80,'2022-01-15 08:49:07',81,_binary '\0'),(905,'This article construct a unified AST neural network including SAST and GAST(SASt for extracting the global code syntactic features contained inthe AST path sequence;GAST for capturing the localcode semantic features in the AST tree)to learn code semanticfeatures.Besides,it also propose a unified vocabulary mechanism to reduce differences between different programming languages.Overall,the article is well organized and its presentation is good.',80,'2022-01-15 09:24:07',92,_binary '\0'),(906,'Some suggestions are as follows:\n1. It is better to add a background part to explain some used concepts.\n2. I think the authors should give some evidences to explain the selection of the evaluation metrics, rather than only \"it is common\".(line 647)\n3. In the \"Threats to Validity\" part, the authors do not talk about conclusion validity or construction validity.',80,'2022-01-15 09:29:49',73,_binary '\0'),(907,'This paper focuses on the modeling and analysis of the performence of Hyperledger Fabric 2.0 using the queuing theory. Although I\'m not so familiar with the mathematical mechanisms, I think the research idea is brilliant. However, there are some issues to be addressed.\n1. In the Abstract, it\'s said that the proposed method in this paper can be applied to other BLC systems, however there is no validation in this paper, so it\'s better to put this conclusion in the discussion part rather than Abstract.\n2. The figures of this paper should be optimized. For example, the \"validating\" in the Figure 2 should be \"Validating\".\n3. The matematics in this paper is too complex to understand, please use some easy approaches to illustrate.',81,'2022-01-15 09:34:33',81,_binary '\0'),(908,'Some suggestions are as follows:\n1. In the abstract, the authors talk little about their motivations and conclusions, and some expression is not formal.\n2. Fig. 4 is a bit tanglesome and it is hard to distinguish every relations.\n3. The number of formulas in this paper is so large for me to understand.',81,'2022-01-15 09:39:06',73,_binary '\0'),(909,'This study proposes a theoretical solution based on queuing theory to evaluate the performance of Hyperledger Fabric 2.0.There are some suggestions.\n1.For many readers, the consensus and principles in the paper are difficult to understand, and it is hoped that they can be expressed in a more detailed and logical way.\n2.Please check your grammar.',81,'2022-01-15 10:15:34',26,_binary '\0'),(910,'1. It\'s hard for me to understand so many equations in this paper.\n2. I think the size of figures needs to be adjusted.',81,'2022-01-15 10:17:02',70,_binary '\0'),(911,'This paper proposed a Unified Abstract Syntax Tree neural network (namely UAST in this paper), in which the unified neural network can not only extract the global syntactic features of the code from the AST traversal sequence, but also the local semantic features of the code from the graph-like AST structure, so as to capture the features of the semantic level of the code. There some suggestions:\n1.It\'s neccessary to add more content in your disscussion section.\n2.The grammar in the paper needs to be further checked and polished.',80,'2022-01-15 10:21:23',26,_binary '\0'),(912,'This paper propose a Unified Abstract Syntax Tree neural network (namely UAST) to extract semantic\nfeatures of different programming languages. Here are my suggestions:\n1. The format of table 1 is little weird, please check.\n2. In abstract, \"The cross-language program classification can realize code transfer in different programming languages\", I don\'t really understand how program classification does it.',80,'2022-01-15 10:41:04',70,_binary '\0'),(913,'This paper proposes a Unified Abstract Syntax Tree neural network which contains 5 parts to realize the cross-language program classification. And the model achieves good results. As for me, I\'m not familiar with program classification and I do not understand the values of it, which may need expression in detail for review.',80,'2022-01-15 11:11:00',90,_binary '\0'),(914,'This paper proposes a method based on queuing theory to achieve the modeling and analysis of the performance of Hyperledger Fabric 2.0. The method proposed may be helpful. However, as for me, there are to many equations and it is hard for me to understand them. If there are more explanations about these equations, it may be helpful to readers to understand the method.',81,'2022-01-15 11:23:29',90,_binary '\0'),(915,'This paper proposes a unified abstract syntax tree neural network (UAST in this paper), which can not only extract the global syntactic features of the code from the AST traversal sequence, but also extract the local semantic features of the code from the class graph AST structure, Thereby capturing code semantic-level features to address how to extract semantic features of different programming languages, the main challenge of cross-language program classification.At the same time, this paper constructs a mechanism called a unified vocabulary to reduce the feature gap between different programming languages and achieve the role of cross-language program classification. Here are some of my comments:\n\nI can\'t understand the benefits of cross-language classification, that is, why cross-language classification can promote code reuse, which can be explained in more detail\n',80,'2022-01-15 11:24:47',67,_binary '\0'),(916,'Some suggestions ars as follow:\n1. Figure 4 and Figure 7 is a bit confusing so I can\'t see it clearly.\n2. There are many formulas but few explanations, which makes it difficult for readers in the field of soft engineering to understand.',81,'2022-01-15 11:28:41',72,_binary '\0'),(917,'In order to make up for the non-repeatable and non-quantifiable problems of the Fabric network configuration performance evaluation method, this paper establishes a consensus process for transactions, and proposes a theoretical solution based on queuing theory for the problem of limited transaction pools. At the same time, the platform built in this paper tests the relevant parameters, and conducts a lot of numerical analysis and simulation to verify the approximate accuracy of the model and formula.Here are some of my comments：\nThe large number of equations in this article makes the article difficult to understand.“We believe that this method can be extended to a wide range of scenarios in other blockchain systems” mentioned in the abstract is this description somewhat inaccurate?',81,'2022-01-15 11:34:21',67,_binary '\0'),(918,'1. I think it would be better to put the formula in the appendix but in the main text.\n2. I have no idea about what Fig4. wants to highlight. Its complex relationships and nodes seem a bit confusing to the readers.',81,'2022-01-15 11:35:25',82,_binary '\0'),(919,'This paper propose a Unified Abstract Syntax Tree neural network (namely UAST) to extract semantic\nfeatures of different programming languages. Here are my suggestions:\n1、In fig1, it means that icons in various languages can be added directly, which may look good\n2、“leveraging the unified vocabulary to generate the embedded vector is a good choice for cross-language classification tasks.”Why is it a good choice, the explanation is not very clear？',80,'2022-01-15 11:37:39',88,_binary '\0'),(920,'Title: Modeling Analysis of Hyperledger Fabric 2.0 Using Queuing Theory\nComments:\nThis paper proposes a theoretical solution based on queuing theory and establishes a consensus process for transactions to evaluate the performance of Hyperledger Fabric 2.0.\n1. Figure 4 isn\'t esay to understand\n2. The formula proof process in the paper is difficult to understand. Maybe it needs to be simplified, and the complete proof process can be placed in the appendix.',81,'2022-01-15 11:43:28',68,_binary '\0'),(921,'Some suggestions are as follow:\n1. The text of the figures are a little small, which makes it difficult to see, as shown in Figure 4, Figure 5, etc.\n2. I think the formatting of table 1 can be modified to make it more beautiful.',80,'2022-01-15 11:50:32',72,_binary '\0'),(922,'Here are some suggestions:\n1. I\'m not sure why cross-language program classification can help developers in certain aspects. Adding more content about the benefit would be better.\n2. I\'m guessing you may have forgotten to put \"Phase\" in the first column of Table1.?',80,'2022-01-15 11:56:58',82,_binary '\0'),(923,'Title: Unified Abstract Syntax Tree Representation Learning forCross-language Program Classification\nComments:\nThis paper proposes a Unified Abstract Syntax Tree neural network to capture the features of the semantic level of the code. In addition, this paper constructs a mechanism called unified vocabulary, which can reduce the feature gap between different programming languages.\n1. It\'s necessary to describe the benefits of cross-language classification in more detail.\n2. The content of Discussion section is a little small and needs to be enriched.',80,'2022-01-15 11:57:49',68,_binary '\0'),(924,'I agree with the decision to submit this manuscript. However, I found something from the abstract that confuses me. First, why the \"modeling and analysis of the performance of Hyperledger Fabric is necessary\" and why \"research methods are not reproducible and quantifiable\". That is, the motivation of this manuscript is not clear to me. Second, I think it reckless to generalize the proposed method to other scenarios in blockchain systems without providing any evidence and rationale.',81,'2022-01-15 13:16:04',23,_binary '\0'),(925,'I aggree to submit the manuscript. However, from the abstract, I noticed the following drawbacks that may need to be improved. First, the abstract does not give any word about what is program classification. Second, more information about the four metrics used in the experiement can be named in the abstract to promote the reliability of the results.',80,'2022-01-15 13:23:28',23,_binary '\0'),(926,'This paper proposed a Unified Abstract Syntax Tree neural network (UAST) framework for cross-language program classification task to support program comprehension and quality assurance. This is a very innovative idea and i have some suggestions:\n1. Some concepts of terms in this paper need to be briefly introduced, such as program classification.\n2. It is suggested to adjust the format of Table 1. For example, the two data sets of Table 1 can be separated by vertical lines, and the leftmost introduction column can also be separated by vertical lines. The width of Table 1 can be reduced a little\n3. It is suggested to replace \'TT\' with \'TP\' in formula 16, which is consistent with the above. \" What does the \'-\' above TP mean? Is there an error?\n4. The performance of uast on the two data sets is quite different. The reason seems to be unexplained? Can we dig out the limitations of uast?\n5. The discussion on threats in Section 5.2 is not comprehensive enough, such as lack of construction validity. In addition, are there any limitations of uast, which can also be introduced as one of the improvement directions in the future?\n6. One point can be added at the end of each section of relevant work: compare your work with previous work to highlight the innovation and value of this work',80,'2022-01-16 12:39:44',78,_binary '\0'),(927,'This paper proposes a theoretical solution based on queuing theory and establishes a consensus process for transactions to evaluate the performance of Hyperledger Fabric 2.0. Following are my suggestions:\n\n1. Many terms in the article have no concept introduction and are not easy to understand\n2. Figure 4 is too messy. You can consider cutting a part for explanation, showing a clear derivation process\n3. Figure 6 / 7 is too small, the scale range of the horizontal and vertical axis is inappropriate, and the difference between the results is not obvious (for example, (d)). It is suggested to add a legend to explain the value of b corresponding to each line, instead of directly marking on the line\n4. The formula writing specification needs to be adjusted. For example, in formula (20), the value description of i is too close to the formula body, and the formula is not intuitive\n5. There are a lot of formulas and derivation process in this paper, which is difficult to understand. It is suggested to add more explanations to the derivation process',81,'2022-01-16 14:03:23',78,_binary '\0'),(928,'In this paper, a unified abstract syntax tree neural network consisting of five parts is proposed for cross-language program classification. The model achieves good results. Here are my suggestions:\n1. The discussion section is relatively short and should be increased.\n2. There are some strange fonts in Table 1.',80,'2022-01-16 22:39:02',17,_binary '\0'),(929,'Paper Title:\nUnified Abstract Syntax Tree Representation Learning for Cross-language Program Classification\n\nPaper summary:\nThis paper propose the Unified Abstract Syntax Tree for cross-language program classification. The experimental result show that the performance of UAST is better than baselinees.\n\nComments for author:\n\n1. The discussion of related work is not sufficient, and the difference between the current study and other studies is not clearly discussed, so the necessity of this study is not sufficient.\n2. The paper does not give sufficient reasons for selecting the Leetcode dataset.\n3. In my opinion, rather than emphasizing the influence of different experiments on UAST, the author should emphasize why this method is superior to other methods.\n',80,'2022-01-16 22:51:34',31,_binary '\0'),(930,'Paper Title:\nModeling Analysis of Hyperledger Fabric 2.0 Using Queuing Theory\n\nPaper summary:\nThis paper established a consensus process for transactions. Besides, the paper bulid a platform to test the performance the method.\n\nComments for author:\n1. The discussion of the background about the research is incomplete, for example, the necessity of the research and the significance of the scientific question to be solved are not clear.\n2. The graphic presentation of the article needs to be improved, for example, the font size and the structure of the content in the figure need to be modified.\n3. The paper lacks a discussion section to discuss the meaningful content of the paper to illustrate the need for the work.\n',81,'2022-01-16 23:14:56',31,_binary '\0'),(931,'The study put forward a method of modeling analysis of the performance of Hyperledger Fabric 2.0 using queuing theory. Here is the comment:\n1. Figure 6 might be too small to see clearly.',81,'2022-01-19 09:13:20',89,_binary '\0'),(932,'The paper proposed a unified AST neural network to learn semantic features of the code. Here is the comment:\n1. Table 1 could be improved.',80,'2022-01-19 09:18:15',89,_binary '\0'),(933,'This article represents code segments in AST and semantically categorizes code in cross-language terms. The biggest contribution should be in the unified vocabulary and how the neural network is built. Here are suggestions:\nThe icons in Figure 4 and Figure 5 are too small, and it is not easy to see the difference between the various methods. You can consider enlarging it a bit.',80,'2022-01-19 19:58:51',74,_binary '\0'),(934,'1. The fonts in Figure 1 are not uniform\n2. Figure 4 is very blurry and it is difficult to see the connection lines. Can it be represented by a unit structure?\n3. The lines in Figure 7 are all entangled together',81,'2022-01-19 20:02:13',74,_binary '\0'),(935,'This paper proposes intelligent and automated vulnerability detection while using deep representation learning and heterogeneous ensemble learning. This paper has clear logic and innovative ideas. And I have the following suggestions:\n1. The introduction mentions that \"this paper has made four contributions\", but it does not introduce the contributions\n2. SEC 4.1 the selection of evaluation indicators is not explained. Are these indicators widely used in relevant work or for other reasons?\n3. The results in SEC 4.3 show that cbow is better than skipgram, but the results are not explained and analyzed\n4. SEC 4.4 repetition of the last two paragraphs\n5. Line 819 mentioned that \"CNN performs well in FNR and recall\". Is this conclusion obtained by comparing with LSTM? If yes, according to the data in Table 4, CNN is not superior to LSTM in recall; Moreover, the comparison is not explained by statistical methods, and whether the conclusion is statistically significant？\n6. Should effectiveness threats be introduced in a separate chapter?\n7. Fig. 6 is too vague. It is recommended to replace it with a vector diagram',83,'2022-01-21 23:58:18',78,_binary '\0'),(936,'This article investigates the possible impacts, causes, and solutions of AS in MSA-based systems. The article has clear logic and rich content. Following are my suggestions:\n1. The introduction lacks the introduction of the organizational structure of the article\n2. The legend in Figure 2 covers some data. It is recommended to adjust the legend position\n3. How the construction validity is alleviated in SEC 6 is not explained\n4. Page 23, \"how to cite this article\" needs to be updated',82,'2022-01-22 00:03:25',78,_binary '\0'),(937,'This paper proposes an automatic vulnerability detection method based on deep learning and ensemble learning. Compared with other tools and methods, this method has a great improvement in various indicators. Some suggestions are as follow:\n1. There are some places where punctuation is missing and redundant, such as the missing period in Hypothesis 2 of Section 3.1, an extra period in the first paragraph of Section 3.7, etc. \n2. Figure 6 is a little unclear and can\'t see clearly.\n',83,'2022-01-22 11:28:27',72,_binary '\0'),(938,'Some suggestions are as follow:\n1. The space between a line of words at the bottom of table 2 and the table is too small.\n2. Part of the data in the \"CCF\" column of Figure 2 is blocked by text.',82,'2022-01-22 11:54:56',72,_binary '\0'),(939,'Some suggestions are as follows:\n1. In the line 129, the authors said \"In summary, we make four contributions\", but there was no explanation below.\n2. In the part 4.1, the authors did not explain the reason to choose these evaluation metrics.',83,'2022-01-22 21:21:30',73,_binary '\0'),(940,'This paper investigates the impacts, causes and solutions of architectural smells in microservices. A mixed-method of data collection was used to analyze six typical ASes and an in-depth and holistic view was revealed. This paper is well-organized and well-written.',82,'2022-01-22 22:50:28',3,_binary '\0'),(941,'This paper proposes the ELAVD framework to detect vulnerabilities using deep representation learning and heterogeneous ensemble learning, which is in line with the research interests of the academia and can also do benefit to the industry. However, I also think there are some issues to be addressed:\n1. The ELAVD framework is the core contribution of your work, but it doesn\'t appear in the Abstract, which I think is not suitable.\n2. The \"featured engineer\" in line 43 in the Introduction should be \"feature engineering\" according to the context of the paper.\n3. The sentence \"we make four contributions\" in line 128 seems to be unfinished.  And I think the following paper structure introduction is rather short ambiguous, and it\'s better to add some details to it, for example what problems are discussed in Section 5.\n4. The Section 3.4, 3.5 and 3.6 mainly focuses on the technology details of each part of the framework, but the relating knowledge of principles take too much space and may not be useful to readers.\n5. The figure 6 is blurred and some elements is out of bound, and I think it needs to be refined.',83,'2022-01-22 23:06:12',81,_binary '\0'),(942,'This paper proposes a framework that focuses on improving the feature engineering of vulnerability detection.\nHere are some comments:\n1. Better to present the existing problems and your contributions in the form of a list.\n2. Are there any implications or discussions or threats to validity?',83,'2022-01-22 23:25:16',3,_binary '\0'),(943,'Some suggestions are as follow:\n1. Line 101, \"Feature Engineering\" instead of \"Feature Engineer\"\n2. The sentence on line 129 is very abrupt\n3. Line 233 is an introduction to the concept without multiple explanation points, but \"·\" is used to indicate the queue.\n4. Line 246, \"a token\'s context\"\n5. Line 579, an extra dot\n6. The icon in Figure 6 is very blurry',83,'2022-01-22 23:49:02',74,_binary '\0'),(944,'\nThis study is carried out to analyze six typical ASes in a microservice-based telecommunication system with a mixed-method of data collection by employing repository analysis, survey, interview and focus group. It is well written but some grammer faults should be checked.',82,'2022-01-23 09:10:51',26,_binary '\0'),(945,'This paper proposes intelligent and automated vulnerability detection while using deep representation learning and heterogeneous ensemble learning.  There are some suggestions.\n1.Are there limitations in the trial or factors that affect the accuracy of the results? Is there a need to add a chapter describing the threat to validity?\n2.The important contribution of the paper could be more highlighted in the introduction section.',83,'2022-01-23 09:18:23',26,_binary '\0'),(946,'This paper adopts methods such as questionnaire survey to analyze common ASes in the telecommunication system based on micro-service development, which is relatively comprehensive and may only have some problems in grammar.',82,'2022-01-23 11:17:21',17,_binary '\0'),(947,'This paper takes a step forword to focus on the impacts, causes, and solutions of ASes in MSA. I think this is a brilliant research idea. Here are some issues that I think need to be addressed.\n1. It\'s better to add the paper structure introduction in Section 1 or Section 2.\n2. The figures in this paper can be refined. The grey text in the figure is blurred with the grey background. And in figure 2, some part of the figure is blocked by the legend and the space behind it is too large.\n3. If possible, the research methodology of Coding Techniques should be added, so the readers can easily understand and reproduce the research process.\n4. The language of this paper should be polished. For example, I think the sentence \"such as43,4 and those focusing on AS in MSA\" in the 3rd paragraph is not complete and these minor issues should be checked.',82,'2022-01-23 11:19:16',81,_binary '\0'),(948,'Title: Is a Single Model Enough? ELAVD: An Ensemble LearningApproach for Vulnerability Detection\nComments:\nThis paper proposes intelligent and automated vulnerability detection while using deep representation learning and heterogeneous ensemble learning.\n1. In Line 100, \'featured engineer\' -> \'feature engineering\' ?\n2. The contribution of this paper should be highlighted in the introduction section.\n3. Figure 6 is not very clear.',83,'2022-01-23 11:37:42',68,_binary '\0'),(949,'Title: Impacts, Causes, and Solutions of Arctitectural Smells in Microservices: An Industrial Investigation\nComments:\nThe paper investigates the possible impacts, causes, and solutions of AS in MSA-based systems.\n1. The description of the paper structure may need to be added in the introduction section.',82,'2022-01-23 11:48:36',68,_binary '\0'),(950,'This paper proposes intelligent and automated vulnerability detection while using deep representation learning and heterogeneous ensemble learning. Here are some suggestions:\n- line 212/907/1043 data set -> dataset\n- Figure 6 blur when zooming in',83,'2022-01-23 11:53:55',71,_binary '\0'),(951,'To thoroughly find out impacts, causes, and solutions of Architectural Smells in microservices, this paper was conducted in a large scale microservice-based system.The methodology and results analysis of this article are well established,so the remaining structural issues are as follows:\n1. Some letters and lines in the table are too close\n2. The data in Figure 2 is covered by the icon\n3. The structure of the entire article is not introduced in the introduction',82,'2022-01-23 11:55:05',74,_binary '\0'),(952,'This article investigates the possible impacts, causes, and solutions of AS in MSA-based systems. It\'s written very well.',82,'2022-01-23 11:57:20',83,_binary '\0'),(953,'This paper investigated the possible impacts, causes, and solutions of AS in MSA-based systems. Here are some suggestions:\n1. The template at the end needs to be modified',82,'2022-01-23 11:59:32',71,_binary '\0'),(954,'This paper proposes intelligent and automated vulnerability detection while using deep representation learning and heterogeneous ensemble learning. The idea of ensemble learning approach is pretty good, so the motivation must be clearly stated to make sure this paper is helpful to ensemble learning. Besides, stacking models usually makes the performance better, so why? The reason behind this phenomenon has been a concern of reviewers.',83,'2022-01-23 12:03:17',84,_binary '\0'),(955,'This paper takes a step forword to focus on the impacts, causes, and solutions of ASes in MSA. This paper is well written and this logic is clear.',82,'2022-01-23 12:05:16',84,_binary '\0'),(956,'This paper proposes intelligent and automated vulnerability detection while using deep representation learning and heterogeneous ensemble learning. There are some suggestions.Here are some suggestions:\n- The icons in Figure 6 are a bit vague and can\'t be understood',83,'2022-01-23 12:05:33',83,_binary '\0'),(957,'An intelligent automatic vulnerability detection method based on deep representation learning and heterogeneous ensemble learning is proposed in this paper. There are some suggestions.\n1. Figure 6 is a little fuzzy\n2. The reasons for the selection of some indicators in this paper are not explained',83,'2022-01-23 12:05:36',17,_binary '\0'),(958,'This paper proposes intelligent and automated vulnerability detection based on deep representation learning and heterogeneous ensemble learning, and the method outperforms than existing methods. However, there are some minor mistakes needed to be corrected, such as line 100 \"The featured engineer\" and after line 129 may miss the part of contribution and so on.',83,'2022-01-23 14:55:05',90,_binary '\0'),(959,'This paper proposes an ensemble learning approach for detecting software vulnerabilities, which contributes to the state-of-the-art AI4SE. Overall, the idea of this paper is innovative. However, there are also some shortcomings that may result in the failure of acceptance.\n1. So far, the architecture of this paper is incomplete. I mean lacking a section of “Threats to validity”. Hurry up, otherwise, u will miss the DDL.\n2. Why do you need deep learning methods? And especially ensemble learning-powered deep learning methods? \n3. Why full name of authors in Section “Related Work”？\n4. Should Section 3.1 be placed in Section 4 (Experiments and Results)?\n5. The organization of Section 3 is not clear to me (actually to most readers who have no background of deep learning). I suggest that renaming most section titles.\n6. The architecture of the proposed ELAAVD is to some extent old-style, as I have noticed various state-of-the-art architectures, such as GNN. Never mind, this is a minor problem.\n\n',83,'2022-01-23 17:23:59',44,_binary '\0'),(960,'The goal of this study is to bridge this gap by investigating the possible impacts,causes, and solutions of AS in MSA-based systems.',82,'2022-01-23 17:35:45',79,_binary '\0'),(961,'This paper proposes intelligent and automatedvulnerability detection while using deep representation learningand heterogeneous ensemble learnin.',83,'2022-01-23 17:36:31',79,_binary '\0'),(962,'This paper reports an industrial investigation of impacts, causes, and solutions of architectural smells in microservices. This paper is well organized and well presented. I suggest the authors improve this paper by addressing the following shortcomings.\n1. A case study cannot cover such big topics – impacts, causes, and solutions. As you do not want to extend cases, I suggest changing title, e.g., “An industrial investigation of understanding architectural smells in microservices” \n2. How about extend Section 2? As I can understand that studying “Microservice Architecture” and “Architectural Smell” are important and urgent. At least, I can understand they are interesting topics.\n3. I suggest indicating the need of studying these topics in both researchers’ and practitioners’ perspective. Actually, I think the latter is more important, as you actually perform an industrial case study.\n4. How about clearly indicating that you employing “Triangulation” in data collection?\n5. The remainder of this paper beyond my knowledge of software architecture. I suggest reconsidering the presentation of “Construct Validity”. ',82,'2022-01-23 17:50:30',44,_binary '\0'),(963,'This article aims to understand the possible impact of AS, its causes and solutions by investigating architectural smells in MSA systems. This paper collects database data and practitioners\' perceptions of six typical ASs in a real MSA-based telecommunication system through an industry case study, and conducts statistics and analysis of quantitative and qualitative data. Ultimately, our results show that AS affects the modularity, modifiability, analyzability, and testability of MSA-based systems.\nHere are some of my suggestions:\nIn Figure 2, the box in the upper left corner blocks the display of some data.',82,'2022-01-23 18:35:21',67,_binary '\0'),(964,'This paper proposes intelligent and automated vulnerability detection using both deep representation learning and heterogeneous ensemble learning. Through experiments, the results show that the method proposed in this paper has improved in terms of false positive rate, false negative rate, precision, recall rate and F1 score.\nHere are some of my suggestions:\nThe display of picture 6 is not clear enough.\nSome English expressions in this article have some problems.\n',83,'2022-01-23 18:49:51',67,_binary '\0'),(965,'My suggestions are as follows:\n1. Fig. 6 is not clear enough.\n2. Show your contribution in a clearer way.',83,'2022-01-23 20:29:26',86,_binary '\0'),(966,'This paper investigates the impacts, causes and solutions of architectural smells in microservices. This paper is well written, but there are some problems in grammar.',82,'2022-01-23 20:32:14',86,_binary '\0'),(967,'This study aims to bridge this gap by investigating the possible impacts causes, and solutions of AS in MSA-based systems through an industrial case study. Since this paper has been reviewed before and it also got some review comments from international conference, I support to expand it to journal version and submit it to SPE for opportunity.',82,'2022-01-23 21:41:28',39,_binary '\0'),(968,'Surely, this paper presents an outstanding study for vulnerability detection. Yet there are some points for which the improvements can be made from my opinions.\n- First of all, what the authors intended to present in the title and the paper itself seem be not aligned. From the title, I hope to see whether an ensemble learning approach outperforms a single-model approach. However, from the paper I dd not see the comparison between such two approaches.\n- From the introduction section, I am confused with the involvement of featured engineering and deep learning.\n- It is a pity that from the whole paper I miss the rationale underlying the designing of the proposed framework.',83,'2022-01-23 22:35:13',23,_binary '\0'),(969,'This paper reports an industrial investigation of impacts, causes, and solutions of architectural smells in microservices. Here are some problems from my perspective:\nI think the title of the article involves too many elements, the content of the article can not cover all elements well.\nThis paper is well writen but some grammer problems should be checked and some sentences need to be polished.\n',82,'2022-01-23 22:38:50',58,_binary '\0'),(970,'This paper provides intelligent and automated vulnerability detection while using deep representation learning and heterogeneous ensemble learning through the ELAVD framework. This work has positive significance and scientific research value. Here is my opinion:\n1. Further description of contributions is required, you can compare with existing work to show contribution, correctness and efficiency improvement\n2. The interpretation of some of the diagrams and tables, is unclear and difficult to understand, and there are some formatting issues and syntax errors.',83,'2022-01-23 22:50:54',55,_binary '\0'),(971,'This paper reports an industrial investigation of impacts, causes, and solutions of architectural smells in microservices, which aims to understand the possible impact of AS, its causes and solutions by investigating architectural smells in MSA systems. This work has positive significance and scientific research value. Here is my opinion: \n1. I think you should narrow the topic of the discussion to highlight your contribution of the work.\n2. The interpretation of some of the parts, is unclear and difficult to understand,like: \"Triangulation\" in data collection. And there are some formatting issues and syntax errors.',82,'2022-01-23 22:55:41',55,_binary '\0'),(972,'This paper investigates the possible effects, causes and solutions of AS in MSA-based systems. And here is one little suggestion:\n1. A part of Figure 2\'s data is blocked by the text.',82,'2022-01-24 00:30:31',82,_binary '\0'),(973,'This paper proposes automated vulnerability detection using both deep representation learning and heterogeneous ensemble learning. Here is my suggestion:\n1. It seems that Figure6 is not a vectogram.\n2. Some typo should be noticed: \"Feature Engineer\", \"Data Set\"... ',83,'2022-01-24 00:34:07',82,_binary '\0'),(974,'This article systematically characterize the state-of-the-art and the topicsof secondary studies in the field of MSA from the analyse of 39 secondary study publications.My question is whether it is necessary to add the data newly added this year for this article?',85,'2022-01-28 12:55:17',92,_binary '\0'),(975,'I do believe that the motivation of this paper is strong enough to submit it to the EASE conference.',84,'2022-01-28 22:58:25',23,_binary '\0'),(976,'This study provides a state-of-the-art outline of tertiary studies (TSs) in the software engineering community by following a TS-style research methodology. According to Figure 2, the number of TSs has increasingly risen in recent years. It is vital to retrospect the usage of TSs and therefore helps improve in the future. The following comments are suggested to be noticed as soon as possible.\n1. As this is a conference paper, I\'m more interested in findings and discussion based on your review, rather than many demographics. e.g., Figure 2, Table 4.\n2. The second is about \"quality assessment\". As the seconday studies have performed rigorous quality assessment, I think it is not mandatory for that in a tertiary study. So how about discussing such topic in more detail.\n3. As you placed muach attention to \"Reserach Methodology\" of perfoming tertiary studies, so how about discussing specific research interests/topis in the selected studies.\n4. Too long for Secontion \"Conclusion\". How about put some presentations into Section Introduction.     ',84,'2022-01-29 10:59:20',44,_binary '\0'),(977,'This paper provides an overview of microservies architecture in systematic literature reviews by conducting a tertiary study. However, the organization and presentation of this paper are unsatisfactory. To be specific,\n1. Which do you value most -- the microservies architecture itself or the reserch methodology for conducting and reporting microservies architecture? It seems that you place much attention to the latters. But to be honest, it is less interesting for me.\n2. RQ1 is overwhelming. The term \"state-of-the-art\" surely covers \"research topics\" that post in RQ2.\n3. Even for sub-reserch questions in RQ2, it is to some extent overwhelming. As this is a 10-page conference paper, you have only a few space to answer such research questions.\n4. The \"quality assessment\" is not mandatory in a mapping study or tertiary study according to Kitchanham\'s guidelines. At least, I do no suggest reporting Table 4 in paper (it can be placed in Figshare or somewhere else). \n5. Table 3 is woring. I mean that guideline is not equal to reference. ',85,'2022-01-29 11:22:15',44,_binary '\0'),(978,'The paper put forward automated vulnerability detection using deep representation learning and heterogeneous ensemble learning. Here is the comment:\n1. Figure 6 might be a little hard to see clearly.',83,'2022-01-30 09:27:10',89,_binary '\0'),(979,'This study designs a new neural network based on unified abstract syntax tree, the classifier UAST has shown its optimization among other works. This work has positive significance and scientific research value. Here is my opinion:\nThe expression of the article findings and discussion may be further required, and the explanation of some concepts, need to be a little more detailed. ',84,'2022-01-30 09:48:49',55,_binary '\0'),(980,'This study describes the topics of 39 secondary studies in the field of MSA , and provides an overview of microservies architecture in systematic literature reviews. This work has positive significance and scientific research value. Here is my opinions:\n1. The RQ can be adjusted according to the author\'s own wishes. The expression of some part of the article needs further consideration.\n2. I wander whether it is necessary to add the latest data to the article or not.',85,'2022-01-30 10:01:14',55,_binary '\0'),(981,'This paper complete a tertiary study about MSA, which is necessary given the popularity of the MSA study. I think the work can do benefit to both academia and industry. By the way, I think the RQs are too many in this paper, it\'s better to simplify them.',85,'2022-01-30 11:56:28',81,_binary '\0'),(982,'This paper does a 4th level study about SE, which is an innovative research idea. Given this, I vote for it.',84,'2022-01-30 11:58:19',81,_binary '\0'),(983,'This paper aims to review the current status of the studies focusing on the secondary studies in SE and using SLR to review related TSs in the past years. It discovers the scopes and topics of the existing TSs, as well as the ways that SE researchers conducted TS. It is well-written and well-organized.',84,'2022-01-30 16:21:21',3,_binary '\0'),(984,'This paper is a tertiary study in the field of MSA. \n- A stronger motivation should be presented.\n- The research questions are relatively superficial. What if I know the answers to the RQs? What in-depth knowledge can I gain?\n- Discussions may needed to explore the implications.',85,'2022-01-30 16:31:32',3,_binary '\0'),(985,'In this paper, we design a new neural network based on unified abstract syntax tree, and the classifier UAST shows its superiority. This work has positive significance and scientific research value. There may be some grammatical problems in the article, please revise it.',84,'2022-01-30 23:14:34',17,_binary '\0'),(986,'This study describes 39 research topics in the MSA domain and provides a systematic literature review of microservice architecture. This work has positive significance and scientific research value, only need to ensure that there are no grammar problems in the paper.',85,'2022-01-30 23:18:39',17,_binary '\0'),(987,'This paper presents a kind of review on quality attributes of AI systems. From my point of view, there are some drawbacks that could be improved in the following revisions.\n1. The title is not comprehensive compared to the topic discussed in the paper. I mean that in addition to quality attributes, the approaches and practices are also studied.\n2. As for the research questions, it seems that RQ3 and RQ4 are redundant for two reasons. First, RQ3 and RQ4 can be some kind of extended questions of RQ1, and second, these two questions are not answered in the results. The authors can probably transfer these questions into the discussion part.\n3. The link between the approaches and practices to quality attributes are not highlighted explicitly in the text, which impairs the reliability of Table 2.\n4. Figure 2 is not clear enough to show the two specific quality attributes of AI systems.',86,'2022-02-11 09:30:44',23,_binary '\0'),(988,'1.	Main content and contribution: \nSeize the essential difference between artificial intelligence software and traditional software, propose that SE should make changes for AI, and return to specific and controllable things: quality attributes. The specific method is to extract relatively independent quality attributes from various normative documents, and conduct integrated research. Finally, a set of relatively comprehensive and clear quality attributes is proposed and measures are partly provided. This work is to standardize the quality attributes of AI software as the way to answer the question of what SE4AI is going to do.\n2.	Advantages: \nThe 12 most important quality attributes are extracted and explained in detail. The details are appropriate and the results of the research are displayed in a concentrated manner. At the same time, it pays equal attention to theoretical research and practical research, and expounds the significance of each attribute in the practical research process.\n3.	Disadvantages: \nAs mentioned in the text, it is difficult to propose general measurements for most of the quality attributes, thus, the guiding significance in practical work is not so strong for now.\n4.	Comments for revision: \nThe text in picture 2 is too small to read, and the typesetting is not rigorous enough.\n5.	Conclusion: \nThe work of this paper is unique and innovative, I recommend it as accept.\n',86,'2022-02-11 11:48:37',109,_binary '\0'),(989,'Title: Quality Attributes of AI Systems: Perspective From Normative Documents\nComments:\nThis paper makes a review to synthesize quality attributes of AI systems and identify existing practives or approaches to assess or assure the quality of AI systems.\n\n1. The text in Figure 2 needs to be in a unified format. For example, all words should be capitalized.',86,'2022-02-11 23:52:05',68,_binary '\0'),(990,'By summarizing the existing normative documents, this paper completely defines the quality attributes of AI systems and determines the evaluation methods of quality attributes.Some suggewtions are as follow:\n1. Figure 2 is a bit small so that the reader cannot see the text in the figure.\n2. The narrative in the \"Practices or Approaches\" section is a bit confusing and doesn\'t clearly answer several RQs.',86,'2022-02-12 13:11:14',72,_binary '\0'),(991,'This paper summarizes the quality attributes of artificial intelligence systems, which is of certain reference value to AI practitioners. There may also be the following problems in this paper:\n1. There are some ambiguities in Figure 2, which may make it difficult for readers to see clearly.',86,'2022-02-12 21:48:44',17,_binary '\0'),(992,'This paper presents a kind of review on quality attributes and summarizes the quality attributes of artificial intelligence systems. This work has positive significance and scientific research value. Here is my opinions:\n1. The RQ can be adjusted according to the author\'s own wishes. The expression of some part of the article needs further consideration.\n2. The topic is not comprehensive and needs to be further specified. You can compare with existing work to show contribution, correctness and efficiency improvement. \n3. The interpretation of some part is unclear and difficult to understand like figure 2, and there are some formatting issues and syntax errors. ',86,'2022-02-13 10:17:54',55,_binary '\0'),(993,'- The research methodology should be elaborated in detail since you claim that the process followed the SLR guidelines.\n- It may be better to classify the results into several categories.\n- Limitations/ttv can be presented following the external, internal and conclusion structures.',86,'2022-02-13 22:04:19',3,_binary '\0'),(994,'论文从云原生角度解读当下DevOps的发展，从当前版本来看，可能有以下几个方面的不足值得被进一步改进。\n1. 问卷设计部分的解释不够详细，其理由也不够充分。这部分值得被扩展和进一步防御。\n2. 结果部分区分准高效能团队和高效能团队的效能标准的依据不明。另外，论文后续部分使用准高效能团队作为分类讨论的依据，部分又使用高效能团队，有筛选数据的嫌疑，这也需要进一步加以防御。\n3. 讨论部分所强调的结论与段落内的具体讨论之间的关联并不明显，建议对其修改，比如“DevOps 不仅仅是云”。并且，仅从该部分讨论，我们很难得到国内外报告对比的关键点。\n4. 图33所给出的部分实践建议的可用性不强，比如“微服务实践”的“识别微服务边界”对实践者的指导意义就比较小。\n5. 小问题：论文大量使用了无意义短语的高亮显示，容易使读者感到困惑，比如“占比仍相对较少”，从这里我们并不能获取什么关键的信息，倒不如将作者想要强调的整个句子高亮出来。',87,'2022-02-18 15:22:44',23,_binary '\0'),(995,'建议：\n1、第三页3.1问卷设计下面的字的间距有问题\n2、3.1中所选中的调查选项和删除的调查选项没有给出明确的原因\n3、图21中少了2020，需要说明因为疫情而无法进行统计\n\n',87,'2022-02-18 17:01:29',88,_binary '\0'),(996,'论文聚焦于云原生中DevOps相关内容，对相关从业者有一定的参考价值。本文还存在一些问题：\n1.图21中的统计数据缺少2020年，应该进一步给出缺少的原因。\n2.文中部分的语言描述非常模糊，需要更加精确一些来给人以实际参考价值。',87,'2022-02-19 21:30:32',17,_binary '\0'),(997,'Title: 云原生时代下DevOps的发展报告\nComment:\n本文通过问卷调查的方式，综合分析了云原生时代下DevOps在国内的发展现状与趋势。\n1. 3.1节问卷设计中，2021年问卷的网址无法打开\n2. 3.1节问卷设计的描述是否较少，可以进行一定的扩充\n3. 图21中缺乏2020年的数据',87,'2022-02-20 16:37:49',68,_binary '\0'),(998,'文章结合云原生对devops的发展做详细的解读分析，具有一定的研究意义，对业内人员也有较高的参考价值。下面是一些意见：\n1、问卷设计可能需要进一步优化，进一步梳理问题设计的逻辑。\n2、数据收集不全面，图21中的缺少2020年数据',87,'2022-02-20 18:51:18',55,_binary '\0'),(999,'文章标题：云原生时代下 DevOps 的发展报告\n文章主要内容：该研究在2019年问卷的基础上，对问卷内容进行调整从而分析云原生时代下DevOps的发展趋势。\n文章可改进的内容：\n1. 文章在第二章研究背景中提到了多个新兴名词，但是没有介绍各名词之间的关系。\n2. 从图1中可以看出本次问卷在2019年问卷的基础上进行了较多的调整，但是在文章中却没有明确说明调整的原因。\n3. 文章第三章和第四章集中于对数据结果的讨论，但是在此之前没有说明为什么这些数据是有价值的，即文章的动机需要加强。\n4. 作者在第五章中提到对比了 Puppet Labs2021年最新发布的DevOps全球现状调查报告结果，但是缺少实际数据的对比。\n',87,'2022-02-20 20:32:18',31,_binary '\0'),(1000,'Paper Title: Quality Attributes of AI Systems: Perspective From Normative Documents\n\nThere are some mistake in the paper:\n1. The paper lacks comparison with other studies.\n2. The research question presented in the article lacks motivation. The correlation between different RQs is not close enough.\n3. The motivation of the paper is not sufficient, different standards are proposed from different apsects, and the meaning of horizontal comparison is not clearly discussed.\n\n',86,'2022-02-20 20:48:36',31,_binary '\0'),(1001,'以下是针对本文章的几点建议：\n1. 图21的字有些小，可以适当调大一些。\n2. “综合分析”模块整个以思维导图形式描述，可以适当给一些文字性描述帮助读者理解具体的建议。',87,'2022-02-20 22:41:28',72,_binary '\0'),(1002,'To overcome the challenge of data imbalance and sparse problems in traceability automation, this paper developed a framework called SPLINT to incorporate hybrid textual similarity measures and semi-supervised learning strategies as enhancements to the learning-based traceability approaches. In summary, This paper is innovative and has a clear structure. There are some suggestions:\n1. Section 1 contributions & Section 4.1 RQs, It is recommended to adjust the indentation of the list\n2. Some pictures are not standardized, such as the title (a) (b) of Fig 5. The two figures can be expanded and placed on a column for easy reading',89,'2022-03-04 11:14:32',78,_binary '\0'),(1003,'在代码评审领域，现有工作的研究对象均为英文代码评审意见，对中文代码评审意见的语义分析、总结和质量评价较为欠缺。因此，本文提出了一种基于多标签学习的中文代码评审意见质量评价方法，并通过实验证实了该方法的可行性。本文结构清晰，想法创新。我有以下建议：\n（1）3.2 \"数据源3：意见实例\"部分，表格中的4个质量属性名称，和表上面内容中提到的名称有些许差别，比如：\"友好\"--kin，\"疑问\"--Que。在表格中的名称是\"情绪\"和\"疑问\"',88,'2022-03-04 11:29:47',78,_binary '\0'),(1004,'- Even though I have not went through every detail in the manuscript, from the title, abstract, and subtitles, I am so curious about the most significant contribution of this manuscript,e.g., in the abstract the saying \"this paper aims to gain an understanding of the potential challenges for the underperforming of the state-of-the-art\" and from the subtitles we know that the proposed framework is in the centre. I suggest that the author might clear her mind about the Section 2 and make an unambiguous statement in the whole paper.\n- The contribution of the proposed framework to the SE area is still not clear. If it aims at addressing the data balance and sparse problem of the traceability tasks in real-world projects, why the authors involve the OSS projects in their evaluation. By the way, I suggest the authors make clear statements about what are \"real-world projects\" in this paper (e.g., industrial projects or both industrial and OSS projects)\n- The creativity of the framework is told ambiguously. Is the hybrid textual similarity measure or the semi-supervised learning strategies the same important as the enhancements to the current learning-based traceability approaches? What about the pre-processing? In other words, what is the new thing in the proposed framework as in Section 3 we only see the most traditional steps in traceability tasks.',89,'2022-03-04 13:42:44',23,_binary '\0'),(1005,'The title element of the dissertation is somewhat complex. \"Semi-Supervised\", \"Pre-processing\" also describe \"Learning-based Traceability Framework\", which makes it impossible to quickly understand what is going on. Secondly, the term \"Real-World\", although I don\'t know much about this field, but since the real world is mentioned, it must be emphasized that it is different from the unreal world, but this article does not seem to be the case.',89,'2022-03-04 14:43:25',61,_binary '\0'),(1006,'1 序言，部分过长，建议缩减\n2 方法的提出，特别的是指标的提出，还缺乏说服力，建议通过成熟的方法论提出指标，增加可信度',88,'2022-03-04 14:46:30',61,_binary '\0'),(1007,'- 本文所强调的方法好处包括“可解释性”、“有效性”、“公平性”、“可行性”、“先进性”等的具体含义不明确，论文中未提供充分的说明，导致这些好处本身缺乏可信度。\n- 论文中强调“考虑到语言特征的巨大差异,相关研究经验并不能直接迁移”，但具体由于哪些研究结果不能直接迁移是未明的，作者应提供更充分的解释。\n- 论文声称自己“供了若干建模经验,如数据清洗、标注和校验等”，然而，并没有解释什么情形下应该进行重新建模以及重新建模的步骤，因此仅在倒数第二节简略地提及一些建模经验，意义较小。\n- 论文对图2：“研究方法及研究过程”，本文最重要的内容之一并未提供充足的解释。\n- 方法形式化部分的公式似乎是有问题的，比如F=pai(X,Y)旨在从原始代码评审意见 X 中学习其质量属性 Y,又说公式3是建立质量属性(F)和质量等级之间的关联，要么F=pai(X,Y)公式有误，要么公式3的解释有误。\n- 论文3.2.1中所述“数据三角论证”与我的理解是不一致的，如果作者坚定自己的观点，建议在论文中给出该方法的必要解释。\n- 数据源2中所声称的研究方法“快速文献综述”与其实际所做的工作同样与我对该方法的理解不同。\n- 数据源2根据“代码评审review”收集代码评审的好处，从而得到代码评审意见的几个质量属性，其合理性在于哪\n- 四个质量属性均经过“数千的评审意见上得到了验证”，如何进行该验证的过程令人迷惑，类似的问题还有很多，比如“若干人若干 轮独立执行和集体讨论”。\n- 四个代码评审意见质量属性本身的含义与我对质量属性的理解是不一致的，并且四者之间的正交性看起来较差。\n- 看起来两个训练策略“自监督预训练”和“有监督微调”看起来不是可选的，而是AND关系，然而这部分的解释是不足的。',88,'2022-03-04 14:52:29',23,_binary '\0'),(1008,'本文创新性地将多标签学习应用于中文代码评审意见质量评价，能够以较高的准确率在大量的中文代码评审中筛选出高质量的评审意见，辅助提升代码评审的质量。由于目前国内学术界在中文代码评审意见质量评价领域是空白的，这份工作具有开创意义，但同时也由于缺少可靠的参考，在评价指标的制定，中英文代码评审意见的特征区分以及最终的实验评估及基线选择上存在很多问题。具体而言，主要有如下几个问题：\n\n1. 摘要中提到“考虑到语言特征的巨大差异”，而正文部分并没有正面反应中文和英文的代码评审意见在语言特征上差异体现在何处。相反地，作者在提出自己的评价体系时，在一定程度上参考了英文的代码评审意见评价指标（见1.2节），这导致作者并没有实际体现这篇文章在“中文代码评审”方面的创新之处，削弱了文章的价值。\n2. 目前的“情绪、疑问、评价、建议”代码评审意见质量属性的制定过程并不严谨，并且缺少实验验证，因此这套评价体系看起来并不能让人信服。\n3. 虽然能够理解作者在中文环境下找不到相似工作来进行实验对比的困难，但是目前的实验设计是存在很多问题的。目前文章中选择的基线都是在英文语境下使用广泛的模型，且作者并未给出选择BERT作为中文代码评审模型的理由，该模型事实上并未针对中文做出相应的优化或适应，这使得这个工作的方法本身是存在问题的。',88,'2022-03-04 15:18:30',39,_binary '\0'),(1009,'This paper aims to gain an understanding of the potential challenges for the underperforming of the state-of-the-art, ML-based trace link classifiers applied in real-world projects through investigating different industrial datasets. Moreover, the authors developed a framework called SPLINT to incorporate hybrid textual similarity measures and semi-supervised learning strategies. This draft has been submit to different publications serval times and received review comments. I recommend to submit it to FSE/ESEC to seek for the recognization of international conference.',89,'2022-03-04 15:24:25',39,_binary '\0'),(1010,'本文通过多标签学习对评审意见进行智能筛选，提高代码评审的质量。由于目前研究较少，数据整理方面确实是不小的挑战，工作量较大，但也可以弥补这方面的空白。有以下几点建议：\n1. 对于评审意见的筛选很大程度上依赖于个人经验，虽然效果是很直观的，但可能会缺乏一点理论依据，由于国内这方面的参考内容较少，想要更加让人信服，可能还需要继续加大数据的收集整理，最好可以给出不同筛选词条筛选结果的统计对比',88,'2022-03-05 16:19:03',85,_binary '\0'),(1011,'This paper surveys different data sets to understand the research status and challenges in the industry, but does not give a precise description of the specific contributions of this paper. In addition, some terms are not very clear about his definition, such as \"real-world projects\".',89,'2022-03-05 16:46:48',85,_binary '\0'),(1012,'本文通过使用多标签学习的方法来对中文代码评审意见进行评价，得到了较好的结果。\n1、由于目前没有相似的工作可作为baseline，导致文本的可信服度不是很高。\n2、在对比时使用了英文的代码评审的相关工作，但应就中文和英文之间的区别和联系做一定的说明，说明为什么“不能直接迁移”，已经文中提出方法的有效性和创新型。',88,'2022-03-05 17:25:32',58,_binary '\0'),(1013,'This paper improves the learning-based traceability model and verifies it with a large number of detailed data, which has certain innovation and value. And here is some suggestions:\n\n1.I think it should be explained what \"Real Word Projects\" means and how it differs from OSS projects.\n2.The interpretation of some of the diagrams and tables,such as table 3, is unclear and difficult to understand.',89,'2022-03-05 17:38:37',58,_binary '\0'),(1014,'一些简单的建议：\n1. 表3需要一些解释，否则读者会疑惑为什么同一个罗马数字会多次出现，会不清楚含义。\n2. 图表是否需要翻译成中文？\n3. RQ在4.1中提出，我认为是否提出得略晚。',88,'2022-03-05 20:26:51',82,_binary '\0'),(1015,'This study describes a framework called SPLINT to overcome the challenge of data imbalance and sparse problems in traceability automation. This work has positive significance and scientific research value. Here is my opinions:\n1. Contribution is not sufficient and needs to be further specified. Motivation should correspond to the development and results of the implementation process\n2. The  expression of the article needs further consideration, and the explanation of some concepts need to be a little more detailed. Clearly describe the innovation points.',89,'2022-03-05 20:38:19',55,_binary '\0'),(1016,'本研究提通过多标签学习对评审意见进行智能筛选，由于软件工程业界内部对代码质量评估感兴趣的人越来越多，因而其需求也日益加大。该研究有助于弥补研究空白，有实际意义。以下有几点建议\n1.文章结构有部分冗余，对部分章节做删减，同时简化一些描述\n2.对于文章方法的有效性以及检测指标，应做进一步说明，证明该方法的可行性和信任度',88,'2022-03-05 20:41:58',55,_binary '\0'),(1017,'建议：\n1、在摘要中提出了有国外的少部分研究，后面的可以列出你的做的代码评审和国外的代码评审的创新点和难点在什么地方\n2、文章的第三页的贡献里面：什么叫效度威胁，不应该是有效性威胁嘛？\n3、第4页中，·与文字之间的距离过大，建议修改一下格式\n',88,'2022-03-05 21:28:32',88,_binary '\0'),(1018,'文章提出一种基于多标签学习的中文代码评审意见质量评价方法。该方法用4个属性综合评价评审意见质量。\n一些意见：\n1. 第二章中研究目标和科学挑战之间的关系是什么？为什么解决了这两个挑战就能实现研究目标？这一关系需要进一步明确。\n2. 图2需要详细解释过程，具体每一步的作用和含义是什么。\n3. 第三章中没有体现出该方法是如何应对“中文”这一特定场景的。',88,'2022-03-05 21:43:37',3,_binary '\0'),(1019,'This paper proposes SPLINT with the incorporation of an adjusted class-balancing self-training in semi-supervised learning mechanism and hybrid semantic similarities. SPLINT can solve data imbalance and sparsity problems encountered in real-world projects. This paper is well-structured and well-written. IMHO, it would be better to clearly seperate the threats to validity into internal validity, external validity, and conclusion validity.\n',89,'2022-03-05 21:55:10',3,_binary '\0'),(1020,'suggestion：\n1、The number of data sets referenced is not very large。\n2、In the sixth page,the symbol of the D has a problem.\n',89,'2022-03-05 22:05:03',88,_binary '\0'),(1021,'1. 文章的大部分图表中的文字用的都是英文，既然这篇文章要投稿到中文期刊上我认为还是修改成中文比较好一些。\n2. 并没有对表3作出解释，不是很懂什么意思。',88,'2022-03-05 22:11:28',72,_binary '\0'),(1022,'1. The font in Figure 4 is a little too small to read.\n2. The RQ could have been proposed earlier, but it would have been late in Chapter 4.',89,'2022-03-05 22:19:58',72,_binary '\0'),(1023,'This paper aims to gain an understanding of the potential challenges for the underperforming of the state-of-the-art, ML-based trace link classifiers applied in real-world projects through investigating different industrial datasets.  The current version of this paper has been revised relatively well and can be further optimized',89,'2022-03-05 22:28:57',26,_binary '\0'),(1024,'本研究提出通过多标签学习对评审意见评论进行智能筛选， 随着越来越多的人对软件工程行业的代码质量评估感兴趣，其需求也在增加。 该研究有助于填补研究空白，具有现实意义。目前版本已经比较完善，可以做进一步的优化。',88,'2022-03-05 22:31:52',26,_binary '\0'),(1025,'Title: 一种基于多标签学习的中文代码评审意见质量评价方法\nComment:\n本文提出了一种基于多标签学习的中文代码评审意见质量评价方法，基于多标签学习的文本分类算法和启发式的映射规则建立起评审意见质量属性和质量等级的关联。\n1. 表3可能需要增加解释说明',88,'2022-03-05 23:32:48',68,_binary '\0'),(1026,'本研究提出通过多标签学习对评审意见评论进行智能筛选， 较有实际意义且较创新，但是还存在部分问题。\n1.缺少对于表3的解释。',88,'2022-03-05 23:57:46',17,_binary '\0'),(1027,'1. The data set size may not be sufficient.\n2. The font in Table 4 May be slightly small.',89,'2022-03-06 00:01:14',17,_binary '\0'),(1028,'第4页中，·与文字之间的距离过大\n图标中文字为英文',88,'2022-03-08 17:00:53',34,_binary '\0'),(1029,'1. The use of words \"freamwork\" is inappropriate.\n2. The focus of the title is not prominent',89,'2022-03-08 17:02:20',34,_binary '\0'),(1030,'suggestion：\n1、There is a certain degree of interchangeability between domain modeling language which is lack of DDD and our model-to-code or code-to-model language transformation, and there is no real research significance.\n2、In the previous course on software architecture, what you said about domain-driven modeling was the result of interaction between domain experts and developers, however, this paper does not see the role of domain experts in domain modeling languages, but simply discusses the relationship between domain modeling languages and the transformation between models and code.\n3、For your figures of figure 4 and figure 5, they are too cumbersome and cumbersome for a domain expert or product developer to capture the logic and process represented in the figure.\n4、Given the wrong-implemented element (DIMO) in figure 12, why is there no supplemental explanation or validity threat analysis for what happened.\n5、What I don’t understand is why your references are not marked with something like [1] , but instead are marked with parentheses, as unfinished work or as required by the Journal.\n',90,'2022-03-11 12:00:33',88,_binary '\0'),(1031,'suggestion：\n1. The entire article focuses on modeling at the tactical level, not at the strategic level. Maybe the title can be designed more clearly, saying that the focus is on the tactical level.\n2. Diagrams of modeling languages, such as Figure 4, are difficult for domain experts to understand.\n3. Page 7 code formatting is not very pretty.\n4. When DIMO is mentioned for the first time, its uniqueness should be introduced.',90,'2022-03-11 14:44:11',70,_binary '\0'),(1032,'suggestion：\n1、Se Software Engineering expert reply is less, and may face the representative of expert is not strong.\n2、Whether the number of articles in figure 2 can be added or expanded.\n3、The different layers on page 6 are missing.\n',91,'2022-03-11 15:38:06',88,_binary '\0'),(1033,'In order to solve the consistency problem of model and code in DDD, this paper proposes a novel domain-specific modeling language, DIMO, to automatically manage the design and implementation of domain models. There are some suggestions:\n1. In Figure 5, there is a problem of segment overlap, especially for \"AuxiliaryObject\" and \"DomainAttribute\"\n2. Page 7, \"Listing 1: The declaration of the Cargo object\", the problem is that the list content is split into two parts\n3. In Figure 6, the relationship \"root 1..1\" between \"Aggregate\" and \"AggregateRoot\" is masked',90,'2022-03-12 14:53:24',78,_binary '\0'),(1034,'In order to evaluate the quality of GL and provide guidelines for using GL, this paper proposes a mixed method, formulates a set of quality evaluation standards and proposes a weighted quality model for GL. There are some suggestions:\n1. Figure 3 missing content\n2. The format of the table needs to be adjusted (width), such as Table 5,6,7,8,11',91,'2022-03-12 15:02:31',78,_binary '\0'),(1035,'This study empirically investigated the understanding of GL quality among researchers in SE and other disciplines. Furthermore, a model that can be used to assess the quality of GL is proposed.\n\nHere are some comments:\n1. The reason that you combine Delphi and AHP should be clarified. Why do you choose Delphi and AHP rather than other methods?\n2. Section 3.3 should be described in detail. For example, How does AHP combine qualitative and quantitative methods.\n3. IMHO, a section for the threats to validity is necessary.\n4. Line 146: an model -> a model',91,'2022-03-12 18:08:00',3,_binary '\0'),(1036,'This study proposes DIMO to provide a language support for domain modeling in domain-driven design and to help achieving the consistency between model and codes.\n\nHere are some comments:\n1. Both in Section 1 and Section2, the reason of pursuing the consistency between models and codes is not clarified. Why is such consistency so important for DDD in practice? “keep (domain) models up-to-date and relevant to the running software” and so what?\n2. The first obstacle/motivation does not seem to be strong enough. You said “DDD still lacks a systematic language in this process”. Are DCSL and CML not systematic languages? I don’t think readers are often misled to have different understandings if they only use DCSL or CML, since they are designed to be DSL. In this sense, what are the advantages of using DIMO in terms of “systematic”.\n3. “according to our previous systematic literature review”, a citation should be added.\n4. “Listing 1: …”is in another page. You can change the caption from “listing” to “code”.',90,'2022-03-12 18:08:20',3,_binary '\0'),(1037,'This study describes the understanding of GL quality among researchers in SE and other disciplines.\n. This work has positive significance and scientific research value. Here is my opinions:\n1.The contribution is not comprehensive and needs to be further specified. You can compare with existing work 2.to show contribution, correctness and efficiency improvement. \nThe explanation of some section need to be a little more detailed',91,'2022-03-12 21:14:47',55,_binary '\0'),(1038,'This study describes a novel domain-specific modeling language, DIMO, to automatically manage the design and implementation of domain models. This work has positive significance and scientific research value. Here is my opinions:\n1.The topic is not clear enough. The entire article focuses on modeling at the tactical level, not at the strategic level. \n2.When the DIMO is first mentioned, it is better to  explain its characteristics, especially compared with the UML.',90,'2022-03-12 21:19:03',55,_binary '\0'),(1039,'This study introduces DIMO to automatically manage domain model design and implementation. This work is innovative and usable. Here are some possible problems:\n1. The difference between DIMO and plain UML needs to be made clearer',90,'2022-03-12 21:23:40',17,_binary '\0'),(1040,'This study describes the relevant practitioners\' understanding of GL quality. This work is more practical. Here are some possible problems:\nSome of the table formats should be tweaked, and some parts of this article need to be explained in more detail',91,'2022-03-12 21:27:03',17,_binary '\0'),(1041,'This study investigated the understanding of GL quality among SE researchers with a mix-method. However, the reason why Delphi and AHP were adopted is not currently clarified. Moreover, from the current unfinished version, as a reader, I miss a complete view of the manuscript.',91,'2022-03-12 23:54:57',23,_binary '\0'),(1042,'1. Figure 3 has too much blank space.\n2. Table 11 is too wide, and its width can be appropriately reduced.',91,'2022-03-13 00:44:33',72,_binary '\0'),(1043,'Some suggestions are as follows:\n1. There is a meaningless horizontal line under the word \"models\" on the first page.',90,'2022-03-13 00:55:20',72,_binary '\0'),(1044,'Paper Title:\nShaping and Binding the Design and Implementation of Domain Models in Domain-Driven Design\n\nPaper summary:\nDomain-driven design has become one of the main software design methods now. The paper proposes a modeling language called DIMO to automate the design and construction of domain models. It is proved by experimental experiments that the completion speed of modeling with DIMO is 3.5x faster than that without the tool.\nComments for author:\n1. When the paper gives DIMO for the first time, it should give full spelling.\n2. The title of the article contains too much content and does not highlight the main point.\n3. In the second section, the tool is proposed because other researches do not specifically focus on Domain-Driven Design. For example, the difference between tactics and strategy. The introduction of tactics and strategy is too abstract, the author should explain the impact of confusing the two.\n4. Are there any studies to support the two motivations proposed by the author?\n5. Could the structure of the paper be tighter? Can the connections between the different section be solidified by the diagrams?\n',90,'2022-03-13 20:37:23',31,_binary '\0'),(1045,'Paper Title:\nOn Assessing the Quality of Grey Literature in Software Engineering Research\n\nComments for author:\nThe motivation of the article is not enough, and the reason for choosing the Delephi method is not enough. The main part of the paper is not completed. Authors need to complete the full text as soon as possible and check it.\n',91,'2022-03-13 20:53:03',31,_binary '\0'),(1046,'Paper Title:\nSemi-Supervised Pre-processing for Learning-based Traceability Framework on Real-World Software Projects\n\nComments for author:\nThe building of traceability for software artifacts is time-consuming. To address this issue, this paper proposes a framework SPLINT to automate the implementation of traceability in practice. This article selects six open source projects and ten enterprise projects. The results show a 15.2% improvement in F1\n\nPaper summary:\n1. There is no doubt that the workload of this paper is very large. But is this paper innovative enough? The steps contained in the framework proposed in the paper are common steps in machine learning. What are the characteristics of the framework?\n2. The title of the paper needs revise. Real-world corresponds to simulation.\n3. Compared with the last review, the paper has not changed much. It is recommended to revise the paper according to the previous review comments.\n',89,'2022-03-13 21:16:14',31,_binary '\0'),(1047,'1. 文章在摘要处提出了“可行性”和“先进性”，但是在正文并未解释也未这对这些特性进行验证，文章的表述需要更加严谨。\n2. 文章选择BERT作为预训练模型，但是在对模型选择时的评价较为主观，这里需要其他文章的表述来说明。\n3. 文章对评审意见质量属性分类的依据是什么？文章中没有说明，作者应该给出这样分类的依据。此外，为什么提出疑问是表示知识共享？换句话说，评审意见应该直接且给出合理建议，为什么疑问是评判“好”评审的因素之一？\n4. 文章基准模型选择的标准是什么？\n',88,'2022-03-13 21:34:39',31,_binary '\0'),(1048,'In Figure 1 , The element “Review Protocol” points to the \"Review Team\", that\'s not accurate，maybe you want to say the \"Review Team\" search the paper according to the “Review Protocol” . In the other words, the process of obtaining the \"Pilot Study\" is not clear.\n\nIn 3.2, you say \"We excluded the retrieved short papers from the review,\" and  \"We also excluded workshop papers to ensure the high quality of our included TSes.\" in the end of the paragraph. Wouldn\'t it be better to put the meaning at the beginning of the paragraph.\n\nIt\'s not clear about the number of the literatures in the process of literature filtering, whether it should be show the numberof the literatures about the Search results based on \" search string\", then show how to get the 178. And I don\'t understant the \"The left studies were divided into ...\"  what is the \"left studies\".\n\nIs the presentation of the Figure 4 appropriate?\n\nIn table 6 ,does it get prettier if the first column of the table is centered?',92,'2022-03-25 17:05:44',34,_binary '\0'),(1049,'Tertiary Studies in Software Engineering: A Critical Review\n\n1. In Table 1 study inclusion and exclusion criteria, check whether the number of the inclusion standard is correct.\n\n2. On the fourth page, there are two commas on the penultimate line of the left part.\n',92,'2022-03-25 19:13:52',77,_binary '\0'),(1050,'Although I have many questions about the value of this review of tertiary studies, I support to submit this paper to IST for opportunity of acceptance because of the limiation of time.',92,'2022-03-26 12:35:45',39,_binary '\0'),(1051,'This paper aims to review the current status of the studies focusing on the secondary studies in SE and using SLR to review related TSs in the past years. It discovers the scopes and topics of the existing TSs, as well as the ways that SE researchers conducted TS. One minor comment: Table 9 and included tertiary studies can be listed in appendices.',92,'2022-03-26 12:42:05',3,_binary '\0'),(1052,'The purpose of this study is to review the current situation of the secondary studies in SE and using SLR to review the research on TSE in the past few years.As far as I am concerned, there are several areas that can be improved.\n1. It is mentioned that the literature from 2009 to 2020 was counted, but it is now 2022, so it would be better if the 2021 study were included.\n2. When introducing the work of this paper, some dilemmas of TSes are mentioned in the introduction. It would be better if some points could be simply summarized.\n3. \nThis article has a unique perspective, which is of great reference value, and you can see the huge workload. Good luck with your submission.\n',92,'2022-03-26 12:51:35',85,_binary '\0'),(1053,'There is something wrong with the formatting of the table 3 headers.',92,'2022-03-26 12:55:16',70,_binary '\0'),(1054,'This paper does a quaternary study on the TSes in software engineering, and I think it summarizes the the situation of EBSE and is a good research idea. However there are also some issues to be addressed from my viewpoint.\n1. The figures in this paper are not in the same style, and some figures like Figure4 are ambiguous.\n2. The reason to make a quaternary study can be more emphasized.',92,'2022-03-26 13:26:20',81,_binary '\0'),(1055,'This paper systematically investigate and report on the TSes in SE, and I think the subject is novel but there still are some problems:\n1.In the content part, there should be more introduction to TS, because I don\'t think many people know this concept.\n2.In the result part, I think the conclusion is a little abstract. Could you please give some examples with significant differences related to research methodology and practice.\n3.In the objective part, it is mentioned that collected TSes are started in 2009, but later it is stated that the time of the paper is from 2009 to 2020, and whether the papers are updated.\n4.The title of section 4 \"Current Status of Tertiary Studies\" is more like a response to RQ3 instead of RQ1, I think maybe can put it another way.\n5.In my opinion, when describing the corresponding number of TSes in different research contents in Chapter 5, pie charts can be used instead of the form of \"10 out of 46\".\n\n',92,'2022-03-26 13:31:32',58,_binary '\0'),(1056,'Although there are still many problems with this paper, I think you can submit it and try to get the chance to be accepted.',92,'2022-03-26 14:08:06',61,_binary '\0'),(1057,'This study investigate the existing TSes and  research purposes and the current status of  TSes in EBSE. \nHowever, \n1. This is a survey on tertiary study, is it too high-level? \n2. In Figure 1, it would be better to add initiate Search results and literature quantity information in the Review phase and pilot Study phase.\n3. There should be some decription about Table 3. Although the relevant data are explained in the later section, but they are scattered.\n4. In 4.1.2, the authors compared the citations of the TSes and secondary studies published in the same year and same venue. However, I do not know whether the number of citations in Figure 4 is from one article or the maximum or average of all articles. Even if the articles were published in the same year and same venue, is there a bias in the selection of articles and the quality of articles?\n5. Can the results and discussion of Figure 6 be put before Chapter 4? Because these three categories were used when answering the three RQS, and part of the same classification information and results have been shown in Table 3. For example, in Figure 4 of 4.1.2 (RQ1) and quality Assessment of 6.2 (RQ3), three classifications are used.\n6. In abstract or conclusion section, will it be better to add description of contributions of findings on existing TSes from the perspective of methodology, including defining research questions, study search & selection, quality assessment, data extraction, and data synthesis?',92,'2022-03-26 14:30:11',8,_binary '\0'),(1058,'Some suggestions are as follows:\n1. Figure 4 itself and the font inside can be appropriately enlarged.\n2. When answering RQ3 in Part 6, the beginning is not linked to the previously proposed RQ.',92,'2022-03-26 14:57:29',72,_binary '\0'),(1059,'This paper systematically investigate and report on the TSes in SE, it is well writen but there are some suggestions:\n1.The contribution of tertiary research in this area needs to be highlighted or its significance will be questioned.\n2.Some formatting errors need to be noticed',92,'2022-03-26 15:08:29',26,_binary '\0'),(1060,'suggestion：\n1、First of all, there are a few words on the first page that are not aligned.\n2、Why affiliation in Table3 needs to be identified as belonging to which country\n3、In table3, SLR are selected mostly before 2015, which may not cause a lack of consideration of the most recent time paper.\n\n',92,'2022-03-26 15:41:08',88,_binary '\0'),(1061,'The paper has primarily investigated the Tertiary Studies in Software Engineering. Here is the comment:\n1.Figure 4 might need to be revised since it seems kind of confusing',92,'2022-03-26 16:14:07',89,_binary '\0'),(1062,'This paper systematically investigates and reports THE TSes of SE, which is practical and comprehensive, but has some suggestions:\n1. It may be necessary to emphasize the significance of this article in the field of soft engineering to fit the theme of the conference\n2. Some images may be a little blurry, as shown in Figure 4\n3. There may be some formatting errors',92,'2022-03-26 20:06:22',17,_binary '\0'),(1063,'Title: Tertiary Studies in Software Engineering: A Critical Review\nComment:\nThis paper systematically investigated and reported on the state-of-the-art of TSes in SE. And the authors found significant difference from the SLRs on the level of secondary study can be observed in particular from the perspective of research methodology and practices.\n1. The abstract is so brief and could not give readers a clear idea of the problem and motivation for the study.\n2. What is the difference between \'Purpose\' and \'Research purpose\' in Table 2?\n3. Table 3 needs some description.\n4. The setting of the three research questions and the way they are answered can be confusing to the reader, are these three questions important for studying the current status of TSes? The answers to each of the research questions still lack some clear findings, and if so the authors would do well to highlight them all.\n5. The data used in the paper are up to 2020, and it is necessary to consider whether to add data for 2021.',92,'2022-03-26 20:20:00',68,_binary '\0'),(1064,'Sincerely, I do not understand quite much the meaning of this tertiary study.',92,'2022-03-26 21:04:56',23,_binary '\0'),(1065,'This paper has primarily investigated the Tertiary Studies in Software Engineering.\nComment:\nThe style of the picture is somewhat inconsistent.',92,'2022-03-26 23:18:42',71,_binary '\0'),(1066,'This study systematically investigate and report on the state-of-the-art of TSes in SE by carrying out a systematic literature review on TSes in SE. As a result, this paper find that TS has become an influential research methods.\n\nHere are some of my suggestionsz:\n1、The data mentioned in the paper comes from 2009 to 2020. Updating the data to 2022 may make the paper more convinced.\n2、This study is the first to investigate and report on the state-of-the-art TSes in EBSE. But is this problem really concerned by the SE? I think the description of relevant research does not reflect the necessity of this work.\n3、The three research questions mentioned in the paper only seem to be the summary of the existing work. From RQ, I can not see the help of the research content of this paper to other tertiary studies.\n4、There is a problem of text layout in the introduction part\n5、Table 3, table 4 and picture 4 in the paper are not introduced',92,'2022-03-27 00:12:27',67,_binary '\0'),(1067,'In this paper, a new method is proposed to detect missing and redundant dependencies, and the experimental evaluation is carried out in several projects. The results show that the efficiency of this method is significantly improved, and the value of the work is obvious. Here are some of my suggestions:\n\nSuggestions\n1. The background statements in paragraphs 2, 3 and 4 of INTRODUCTION are a little redundant. You may consider simplifying the description or naming the key points by title.\n2. In 2.1 Build System, when introducing make System, 50 years was mentioned twice, part of which could be deleted.\n3. In 2.1 Build System, two tools, GNU make and CMake, are mentioned. This paper mainly focuses on GNU make, but there is no clear statement about why it is selected. Some more convincing features can be added. In addition, both tools can be introduced at the beginning of the paragraph, and the introduction of CMake is a bit awkward in the middle of the paragraph.\n4. In the 3.2 Actual Dependency Graph section, it would have been nice to include a description of the Actual dependency graph, in the form of a flowchart.\n\nLittle tips\n1. There is no punctuation at the end of the fourth paragraph of INTRODUCTION.\n2. In 2.1 Build System in BACKGROUND, the part of **Evaluation** phase and **Execution** phase can be bold to make it easier to distinguish.\n3. In 3.3 Detecting Dependency Error, **Redundancy** Dependencies and **Missing **Dependencies at the beginning of the last two paragraphs can be boldface, which can better reflect the focus of the work.\n4. \"Make Data Base \"or \"Make database\" in the upper left corner of Figure 6?\n',93,'2022-04-01 11:56:18',85,_binary '\0'),(1068,'1. From the background section, we can figure out neither the significance of this work nor its research niche. Why not merge the related work and background section together?\n2. There is no an overview of method in Section 3, both in the text and in the pictures. Personally, I suggest to move figure 6 into the method section and treat it as the overall introduction of this method.\n3. In the experimental setup, the authors have not introduced from which aspects the experiment is going to be done and why.\n4. From Section 2.1, the authors emphasized that their approach relies on GNU make while in Table 1 both the projects built using GNU make and CMake were included.\n5. There are 19 project in table 1 and 18 projects in table 2, rather than 20 projects as highlighted in the abstract.\n6. The experimental results are confusing and not valid enough. First, the detected dependency errors from Buildcheck and Mkcheck are not the same, and it seems that there is not a well-established golden-truth in these projects. Second, the validity of table 2 is undermined since only 50 sets of dependency errors were manually checked. Finally, given  that these dependency errors were checked after the detection, thereby whether this process might induce some subjective biases is unknown.',93,'2022-04-01 12:20:26',23,_binary '\0'),(1069,'1. This is an unfinished paper as its main text less than 10 pages.\n2. The mechanism of the proposed approach should be outlined in \"introduction\".\n3. The \"background\" is to some extent redundant. ASE is one of the top venues in software engineering, the potential readers should have technical knowledge.\n4. There are no research questions in anywhere this paper. \n5. There are no overview of the proposed approach, making it hard to understand the approach\'s process, innovations, etc.\n6. The \"experimental setup\" should be more organized and detailed.\n7. The presentation of this paper should have been polished.',93,'2022-04-01 13:25:01',44,_binary '\0'),(1070,'1. This \"introduction\" is weakly presented. For example, one of the motivations of this paper should be \"without systematic understandings of microservices architecture, rather than without tertiary studies\".\n2. I do not agree with the second contribution (empirical methodogloy), as this paper should concern on the microservices architecture.\n3. \"Related Work\" -> \"Background and Related Work\", as there are no tertiary studies about microservices architecture. Accordingly, I suggest reporting more background.\n4. The first reserach question is overwhelming. I suggest extending it to demographics and content-specific reserach questions.\n5. Some data extraction items (e.g., D8 and D9) are overwhelming.\n6. The measurements for miltigating internal validity (e.g., ensure consistence in the coding process) should be reported.',94,'2022-04-01 13:55:58',44,_binary '\0'),(1071,'This paper focuses on secondary research in the MSA field and provides a new way of exploration in this field. Through a comprehensive survey, some instructive conclusions are given, and my suggestions are as follows：\n\nSuggestions:\n1. In the Introduction, it is best to have a clear summary of the significance of the work of the article. You can consider adding the final summary part of the article to this point in another way of thinking or perspective.\n2. In 3.2. Search String, the number of theses was increased from 37 to 39 by snowball method. We can consider where the two extra papers were marked and what caused the omission.\n3. In 5.1. State-of-the Art (RQ1), there are a lot of contents under almost every sub-title, which may be to consider the completeness of the research conclusion. However, I think it would be better to extract the most critical aspects, briefly introduce other aspects, or add a summary at the end of each small section.\n4. In 5.2.1. Architectural Analysis, it was mentioned that three potential research directions were selected based on the previous analysis results, which should best illustrate the selection and criteria for judging potential.\n5. The article research involves a wide range of coverage is also very comprehensive, but it is not intuitive to see where the focus is. For example, chapter 5.1 occupies a large part of the article, but the content is too comprehensive, but it is not easy to grasp the focus.\n\nLittle tips:\n1. Table 3 is discussed in 4.3. The Result of Quality Assessment, but The specific positions in The Table are far apart, so it can be adjusted. 5.1. Table 5 in state-of-the art (RQ1) is similar.\n2. Table 4 does not find references.',94,'2022-04-01 16:53:08',85,_binary '\0'),(1072,'This article is the first tertiary research on MS, and has made two contributions: \n1)  the state-of-the-art of secondary studies themselves and the classification of their findings (challenging topics, solutions identified, and future directions); \n2) Future research directions in the field of MS. This information can provide direction guidance for future researchers in the field of MS.\n\nFollowing are my suggestions:\n1) Sec 3.3, E6 in Exclusion criteria is repeated\n2) Sec 6 needs to be completed\n',94,'2022-04-01 17:17:15',78,_binary '\0'),(1073,'This paper proposed a new approach to obtain static dependencies and combine the actual dependencies to detect dependency errors(missing and redundant dependencies) by comparing the difference between the two dependencies.Following are my suggestions:\n1. In the summary and summary, \" experiments show that our approach outperforms the state-of-the-art in detection efficiency without losing accuracy\". It is suggested to give specific data, which is more convincing\n2. In the introduction, the third paragraph, line 9, repeats the description. \"Similarly..\"\n3. The fourth paragraph of the introduction expounds \"the universality of dependency management errors\", and the third paragraph expounds \"the main causes of dependency management errors\". According to the description logic, \"first introduce the problems, and then introduce the causes of the problems\", so this paragraph should be placed in front of the third paragraph',93,'2022-04-01 17:42:11',78,_binary '\0'),(1074,'This paper provides a new way of exploration and reports on secondary research in the MSA field. Through a comprehensive tertiary research. Here is my opinions:\n1. The introduction is very inadequate and it is better to make the contributions clear.\n2. Motivation is not sufficient and needs to be further specified. Motivation should correspond to the development and results of the implementation process.',94,'2022-04-01 19:20:52',55,_binary '\0'),(1075,'This paper shows a new approach to obtain static dependencies and combine the actual dependencies to detect dependency errors. The experimental evaluation is carried out in several projects. This work has positive significance and scientific research value. Here is my opinions:\n1. \"Background\" is somewhat redundant, you can simplify some descriptions.\n2. The experimental result is not sufficient and needs to be further discussed.',93,'2022-04-01 19:28:34',55,_binary '\0'),(1076,'This paper provides a new way of exploration and reports on secondary research in the MSA field. There are some suggestions:\n1.The contribution of the article is not focused enough\n2.Please notice your grammer problem',94,'2022-04-01 21:22:12',26,_binary '\0'),(1077,'This paper shows a new approach to obtain static dependencies and combine the actual dependencies to detect dependency errors. There are some suggestions:\n1.Research questions can be set to focus attention\n2.Please notice your grammer problem',93,'2022-04-01 21:23:57',26,_binary '\0'),(1078,'This paper proposes a new method to obtain static dependencies from makefile and detect dependency errors based on actual dependencies. The method is innovative and practical. Here are some suggestions:\n1. The font in the code section is too different from the font in the rest of this article.\n2. There may be some grammar problems.\n3. The experiment should be more detailed, including the experimental environment.',93,'2022-04-01 22:41:09',17,_binary '\0'),(1079,'This paper provides a new way for secondary research in MSA field. Here are some suggestions:\n1. More emphasis should be placed on the contribution of this article.\n2. There may be some grammatical problems that need to be corrected.',94,'2022-04-01 22:43:07',17,_binary '\0'),(1080,'This paper searches for and describes secondary research in the MSA field from two perspectives(state-of-the-art of secondary studies and the classification), and finally draws some conclusions and gives some suggestions. Here are some of my suggestions for this paper:\n1. For the description of the first article of the inclusion criteria is not very clear, you can consider adding some general descriptions, such as the clear structure of the paper.\n2. When RQ2 is proposed in section 3, it should be described in more detail, which can be changed to \"potential future research directions\" and so on.\n3. There is word missing in section 4.2, should be \"according to table 2\".\n4. The content and meaning contained in Figure 4 should be explained in further detail\n5. The discussion section should be expanded to give specific findings and suggestions based on the survey results.\n6. When introducing the design pattern on page 9, you can use the paragraph \"(1) Service Composition\" as a separate paragraph, which makes the article more hierarchical. The same question comes up on page 12, \"Testing Techniques\" should be a separate paragraph.\n7. For Section 5.1. I suggest that you can briefly introduce common topics or methods that have existed for a long time; In contrast, focus on topics or methods that are new or recently emphasized in academia, so that the important content can be highlighted.',94,'2022-04-02 00:55:45',72,_binary '\0'),(1081,'suggestion：\n1、The question of RQ1 is too simplistic. If you are just looking for what the latest secondary research on MSA reflects, I think it can be displayed in your survey results, or explained as a reason.\n2、The research direction of RQ2 shows that I think it is okay as a question of this third-level research, but I always feel that it should not be regarded as RQ only\n3、Your method uses the snowball commonly used by predecessors. If others are using it, you just put this method on the MSA and re-adjust the method. There is no specific innovation, but the workload is indeed relatively large. , see that you are looking for more than 300 papers in general, and the latter papers have finally shrunk to about 40. It is because the nouns in the string search in front of you are not standard, or you have mixed some not very relevant content.\n',94,'2022-04-02 10:15:57',88,_binary '\0'),(1082,'suggestion：\n1、You said that your method is superior to previous experiments, and everyone will take this as a highlight of their paper, but I think that the performance of your paper is better than other methods and can not be fully regarded as your highlight。\n2、related work should be placed in the first part\n',93,'2022-04-02 11:07:53',88,_binary '\0'),(1083,'1. There were several claims made by the author for limitations of current dependency error detection techniques, including: \n\n\"Current techniques for detecting both dependency errors are more or less limited\"\n\n\"These methods have more or less some limitations\", however, without further explainations for what are those \"limitations\"? \n\n\n\n2. \"some efforts[5][11][7] have tried to detect dependency errors by using actual dependency or unified dependency \n\n(combination of static dependency and actual dependency). But their methods have limitations in effectiveness or efficiency.\" \n\nWhy did those studies not achieve high efficiency or effectiveness? \n\n\n\n3. As I looked at the experiment results, I couldn\'t understand how your approach differs from earlier approaches. \n\nWhat are the metrics we should focus on?',93,'2022-04-02 11:32:58',33,_binary '\0'),(1084,'This paper searches and describes the secondary research in the MSA field from the perspectives of the current status and classification of secondary research, and finally draws some conclusions and puts forward some suggestions. Here are some of my suggestions for this article:\n- The Discussion section should be expanded to give specific findings and recommendations based on the findings.\n- Contribution could be a bit clearer',94,'2022-04-02 11:34:02',83,_binary '\0'),(1085,'This paper proposes a new method to obtain static dependencies, by comparing the difference between two dependencies, combined with the actual dependencies to detect dependency errors (missing and redundant dependencies). Here are my suggestions:\n- A more detailed description of why GNU make was chosen would be more convincing.\n- The method proposed in this paper requires a more detailed overview.',93,'2022-04-02 11:44:01',83,_binary '\0'),(1086,'Title: Detecting Dependency-Related Build Error\nComment:\nThis paper proposes a new approach, which combines static dependencies with actual dependencies and detects missing and redundant dependencies by comparing the difference between the two.\n1. The background part is a little redundant.\n2. Research questions need to be set to highlight the validity of the method as well as the contribution of the paper.\n3. The implementation part and the experimental setup part need more detail.',93,'2022-04-02 11:50:15',68,_binary '\0'),(1087,'1. Although the authors claimed that \" To the best of our knowledge, there is no tertiary study focusing on the MSA domain\", the question remains: why conduct a tertiary study on MSA research?\nWould you please provide us with some information about the motivation behind this tertiary study?\n\n2. In the introduction, this paper explains that\n\"A tertiary study, a mapping study of secondary studies, is to identify how many SLRs and SMSes\nin specific domains have been published, what research topics were being addressed, or the limitations of current SLRs,\" it seems that the definition of SLR is basically the same, so what is the difference between a secondary and tertiary study?\n\n3. Does Figure4 show the distribution of research methods? However, the legend on this figure only includes \"Focus type\" without \"Research method\".\n\n',94,'2022-04-02 11:54:41',33,_binary '\0'),(1088,'This paper develops a new approach to detect the missing dependencies and redundant dependencies error by combining static dependencies with actual dependencies and detecting missing and redundant dependencies by comparing the difference between the two. The method proposed in this paper outperforms state-of-the-art in detection efficiency without losing accuracy. Here are some suggestions:\n1. In section 2.1, the sentence \"Make is one of the popular build systems and it has been around for over 50 years.\" is repetitive, and when introduce the GNU make, maybe it is better to explain the reason of choosing it.\n2. I think the motivation presentation should be more detailed, highlighting the problems with previous studies or tools, why they have these limitations, and thus highlighting the value of this work.\n3. In the last paragraph of 2.1, the sentence \"Handwriting relies on the developer’s subjective awareness, and errors will inevitably occur.\" is also repetitive.\n4. In section 2.2, I think the typical structure of build script is not easy to understand, maybe it\'s better to use an actual example.\n5. I think there is too little in Figure 1, which could be more informative.\n6. There is no explanation related to Figure 4.\n7. I think the chapter 4 Implementation is too short and not clear enough.\n8. The experimental setup should be more organized and detailed, and experimental result is not sufficient and needs to be further discussed.\nAll in above, I think the presentation should be polished and the content of methods and experiments should be more adequate, which seems to be insufficient at present',93,'2022-04-02 11:57:47',58,_binary '\0'),(1089,'Title: Research on Microservice Architecture: A Tertiary Study\nComment:\nThis paper conducts a tertiary study and collect data from secondary studies of MSA published by the end of 2021. Finally, this paper draws some conclusions and gives some suggestions.\n1. The contribution of the paper needs to be more emphasized.\n2. Section 6 is not completed.',94,'2022-04-02 11:59:50',68,_binary '\0'),(1090,'This paper conducted a tertiary study in the field of MSA from the view of state-of-the-art of secondary studies themselves and the classification of their findings. Finally, this paper provide some suggestions and conclusions.\nHere are some suggestions:\n1. This paper is not clear in describing the motivation. Although it states that there is no tertiary research in this field before, it still fails to explain why tertiary research is needed and what positive impact it can bring to the development of the current field.\n2. The Introduction part should explain more about the definition of tertiary research, and I think there seems to be some difference in the current understanding of tertiary research in the industry.\n3. The two views of the study are valuable, but it should be explained what enlightenment can be brought from these two views for current researchers.\n4. At the end of Introduction, it should emphasize on the value and contribution of the work, but this part is not enough at present.\n5. The description of RQ1 does not quite match its purpose, which is to study the \"state-of-the-art\" or focus on the \"common topics addressed and key findings\".\n6. Research Methodology is not detailed enough, and does not fully explain why to do so.\n7. In my opinion, the front part of the whole paper is relatively small, while the following chapters take up too much. I agree the summary and conclusion of the tertiary research is a relatively important part, but you can rethink the distribution of chapter length.\n8.The unfinished Section 6.\n',94,'2022-04-02 12:24:25',58,_binary '\0'),(1091,'Title: Research on Microservice Architecture: A Tertiary Study\nThis study aims to characterize the secondary studies in the field of MSA from two main views, i.e. the state-of-the-art of secondary studies themselves and the classification of their findings (challenging topics, solutions identified, and potential research directions).\nHere are some suggestions:\n\n1. The paper does not explain the positive impact that this work can bring to the industry, and it seems that the value of this article is not clear.\n2. I think the direction of the two RQs seems superficial. It seems that it is not of high value for secondary research.\n3. The answers to the two RQs in this paper occupy a lot of space, but the focus seems unclear. It is suggested to summarize in the introduction or conclusion and point out the contribution.\n\nHere are some low-level errors：\n\n4. The number E6 of the exclusion standard is repeated.\n5. The end of some lines in the text are not aligned, for example, page 7.\n6. Some punctuation marks in the text are not standardized, for example, page 4.\n',94,'2022-04-02 17:17:29',77,_binary '\0'),(1092,'Detecting Dependency-Related Build Error\nThis paper proposes a novel approach to detect missing and redundant dependencies. Use a new approach to obtain static dependencies and combine the actual dependencies to detect dependency errors by comparing the difference between the two dependencies. \nHere are some suggestions:\n\n1. The organizational form of this paper is somewhat chaotic, and the background part seems to be introducing the method. Therefore, I suggest merging the focus of the background part into the method chapter.\n2. There is no overview in the method section. I suggest adding a method overview diagram in the method section.\n3. This paper does not introduce the limitations of the method or evaluation process. I suggest adding limitations and deriving the future research direction.\n4. The organization of paragraphs in this paper is different. Some paragraphs have spaces in front of them, while others do not.\n',93,'2022-04-02 17:32:42',77,_binary '\0'),(1093,'This paper does a tertiary study on MSA, and provides remarkable understandings about the current state of the secondary studies. In my view, the research idea behind this paper is brilliant, but there are also some issues to be addressed.\n1. As a tertiary study, there are not so many figures or charts to illustrate the findings, which I think is not intuitive. And also the figures should be adjusted to look more artistic.\n2. The contributions are better to be listed in the end of the Section 1.',94,'2022-04-03 11:48:37',81,_binary '\0'),(1094,'This paper develops a new approach to detect two dependency errors and test it on 20 projects, which can benefit for both industry and academia. But I still think there are also some issues to be addressed.\n1. The language in this paper should be polished. For example, the sentence \"As a result errors often occur, the common ones being missing dependencies and redundant dependencies\" in the Abstract is not smooth.\n2. The content of background knowledge of software building may take too much space.',93,'2022-04-03 11:57:26',81,_binary '\0'),(1095,'This paper did a tertiary study on microservice architecture. \n1. The challenge, lack of research, or the need for tertiary studies, is not clearly stated as to why tertiary studies are conducted and why these two RQs are set up.\n2. In abstract,Objective emphasizes ‘the state-of-the-art of secondary studies themselves and the classification of their findings’, however, two RQs emphasizes state-of-the art and future research directions. The data extracted in Table 1 and section 4 also show the author\'s concern about Demography. The description of the objective of this paper is not very uniform, and it is not easy to get the main points of this paper.\n3. It is better to put numbers on the figures to make them more intuitive, such as figure 2 and figure 3.\n4. The result of RQ1 in section 5.1 is just a display of the findings of these secondary studies, lacking summary and information refinement.\n5. Some of the expressions in the text are \"in S33\" and some are \"in [Vura 17]\", which should be unified. Moreover, the data of S1~S33 is directly given in Table 3 and text, but readers do not know the correspondence of ‘S+index’ and the specific study. Is it sorted according to the list in Table 2?\n6. In section 7, the bias of study selection can be discussed.',94,'2022-04-04 13:58:17',8,_binary '\0'),(1096,'This paper did a tertiary study on microservice architecture.\n\nThe challenge, lack of research, or the need for tertiary studies, is not clearly stated as to why tertiary studies are conducted and why these two RQs are set up.\nIn abstract,Objective emphasizes ‘the state-of-the-art of secondary studies themselves and the classification of their findings’, however, two RQs emphasizes state-of-the art and future research directions. The data extracted in Table 1 and section 4 also show the author’s concern about Demography. The description of the objective of this paper is not very uniform, and it is not easy to get the main points of this paper.\nIt is better to put numbers on the figures to make them more intuitive, such as figure 2 and figure 3.\nThe result of RQ1 in section 5.1 is just a display of the findings of these secondary studies, lacking summary and information refinement.\nSome of the expressions in the text are “in S33” and some are “in [Vura 17]”, which should be unified. Moreover, the data of S1~S33 is directly given in Table 3 and text, but readers do not know the correspondence of ‘S+index’ and the specific study. Is it sorted according to the publication time?\nIn section 7, the bias of study selection can be discussed.',94,'2022-04-04 14:03:00',8,_binary '\0'),(1097,'This paper proposes a method for evaluating software engineer output that significantly improves the efficiency of the engineer evaluation process. In addition, the paper also gives the experience and lessons encountered in the process of implementing the method, which provides a reference for the practice of software process improvement. Here are some of my suggestions:\n1. The first paragraph on page 2, \"It is important to offer explanations for both assessment mechanisms and results.\" This sentence is a bit abrupt here and doesn\'t seem to be very contextually related. \nI suggest re-arranging the word order.\n2. The first paragraph on the page 3, how to understand the \"information mining\" in the evaluation method advantage, although there are corresponding explanations later, it is a bit difficult to understand here.\n3. What are the meanings of blue and orange in Figure 1, and what are the differences between them, which is not mentioned in the text.\n4. When introducing the two methods in Section 3.2, the method flow chart is given for the second method isolation forest, while the first method does not have a corresponding method diagram. I suggest that both methods are given a method diagram for consistency and also can help readers understand the method more easily.\n5. The fonts in Figure 5 and Figure 6 can be enlarged, and the words are a little unclear.\n6. The paper mentioned in the evaluation section that the model has some uncovered metrics that lead to false positives, but it does not give how to supplement the uncovered metrics to improve the model in the future. Even if there are no methods and plans yet, that can be given as work that can continue to be explored in the future.\n7. Section 4.2 gives some feedback from the company\'s internal staff on the evaluation method, but here only the advantages of the method are given, and the shortcomings of the method are not given. In order to show people\'s feedback on the evaluation method more comprehensively, I suggest that you can consider adding some relevant information.',97,'2022-05-13 15:55:20',72,_binary '\0'),(1098,'This paper investigates the situation of model-driven development in various stages of the blockchain development life cycle. Based on the review, the paper proposes a model-driven development method and develops a corresponding semi-automated tool. Here are some of my suggestions:\n1. I suggest that the contributions of this paper can be written separately at the end of the first section, which will allow readers to see all the contributions of this paper more intuitively.\n2. The typesetting of Figure 1 is a bit messy, for example, some arrows block the text. I suggest that the typesetting can be adjusted appropriately.\n3. There is still a text error in Figure 1, what does \"Scoups\" mean, it should be \"Scopes\".\n4. Section 3.1 gives the inclusion criteria for studies selection, but does not give the corresponding exclusion preparation\n5. When describing the results of the literature review in Section 4.1, the RQs answered in this subsection can be marked at the title or beginning of the three subsections, which will make the structure of the article clearer.\n6. I suggest that the survey results of the implementation process in Section 4.1.2 be sorted into categories and presented in a table. The current text format makes the presentation of the results somewhat confusing.\n7. I think Section 4.2 and Section 4.3 in Chapter 4 can be integrated into a separate chapter, because they are more like a part of the complete work, and Section 4.1 is the review result belonging to the SLR part and should be a separate chapter.\n8. The fonts in Figure 7 and Figure 11 are a bit small, and some text is obscured by other lines. The same situation also occurs in other figures, such as Figure 14 and Figure 17.',96,'2022-05-13 17:38:02',72,_binary '\0'),(1099,'This article proposes an approach called MDD4BSDLC and designs tools that eliminate the need for developers to have in-depth knowledge of blockchain platforms like Ethereum and Hyperledger Fabric. At the same time, it reduces the amount of work to develop the same business logic for different blockchain platforms. Through a real blockchain application scenario, the effectiveness of MDD4BSDLC and the proposed tool is verified. My suggestions are as follows:\n\nSuggestions:\n1，At the end of 1 INTRODUCTION, there is no clear summary of the work made in this paper. It is better to highlight the innovation or value of this paper, for example, there is no such tool in this field before, the tool we proposed fills the gap in this field, or how much our method is improved compared with other tools in this field, etc.\n2，In the second paragraph of 2 RELATED WORK, \"but the results are more abstract\" is mentioned at the end, which is a little strange. It is not clear what meaning this sentence is intended to express. If it is not RELATED to the research results obtained in this paper, it is suggested to delete it.\n3，3.1 Systematic literature Review, the search process of literature can be presented in the form of tables or pictures, and all words seem a little messy.\n4，It is better to add a concluding paragraph under 4 RESULTS to summarize the content of the following sections.\n5，4.1 Literature Review Findings mentioned 25 primary studies were selected, but only 22 of them were introduced, and the other 3 studies were not mentioned. Even if the proportion was small, all the investigation results should be fully displayed. It\'s more credible. In addition, there is only a mention of widely used platforms as the target, but there is no general introduction to the subsequent content of this chapter, which is a bit odd.\n6，The information in Figure 1 is rich, but the introduction of Figure 1 is a little weak. The information contained in this Figure can be introduced in more detail in 3 METHODOLOGY.\n7，In the third paragraph of 4.2 MDD4BSDLC, when introducing Figure 2, it is better to explain the meanings of red and blue lines in detail.\n\nLittle tips:\n1，3.1 Systematic literature Review in the penultimate paragraph, three sentences all began with \"We\", it is a bit strange to read, consider changing the sentence pattern.\n2，The arrow in Figure 18 is a little strange. It is suggested to straighten and not turn.\n',96,'2022-05-13 18:03:34',85,_binary '\0'),(1100,'This paper proposes a Hyperledger Fabric-based blockchain cloud framework and Kubernetes Operator prototype tool, and conducts maturity model analysis and quantitative comparison of Cello, aiming at the weakness of cloud computing to enhance blockchain infrastructure. It is proved that this tool has a good performance effect. My suggestions are as follows:\n\nSuggestions:\n1，In the Introduction, it mentions that \"Most BaaS platform underlying blockchain support technologies choose Hyperledger Fabric\". It is best to enumerate a few simple examples to improve the persuasiveness of the article itself.\n2，The tool of Cello has been mentioned repeatedly in the article. However, the third paragraph of 2 BACKGROUND AND RELATED WORK gives a rough introduction about Cello. It can be considered to add some supplements such as its position in the industrial field or its application status, which can make the quantitative analysis and comparison part more convincing.\n3，3.2 Blockchain Cloudification Design Principles Introduces \"Blockchain Cloudification framework needs to meet the following Design Principles\", but does not mention where these rules come from or are based on objective practical experience. It is suggested to add some explanations.\n4，In the third paragraph of 5.2, it is mentioned that Cello and Prototype Tool use different versions of Hyperledger Fabric Network. Will this affect the experimental results? How to avoid or reduce its impact is not mentioned in the article.\n\nLittle tips:\n1，The two-way arrows between Cache and ApiServer in Figure 4 can be split into two one-way arrows so that the relationship between the two can be more obvious.\n2，\'cello\' should be replaced by \'cello\' in the penultimate line of the first paragraph of Part 5.2\n',95,'2022-05-13 18:05:21',85,_binary '\0'),(1101,'This paper investigates the situation of model-driven development in various stages of the blockchain development life cycle. Based on the review, the paper proposes a model-driven development method and develops a corresponding semi-automated tool. Here are some of my suggestions:\n1. I suggest that the contributions of this paper can be written separately at the end of the first section, which will allow readers to see all the contributions of this paper more intuitively.\n2. The typesetting of Figure 1 is a bit messy, for example, some arrows block the text. I suggest that the typesetting can be adjusted appropriately.\n3. There is still a text error in Figure 1, what does “Scoups” mean, it should be “Scopus”.\n4. Section 3.1 gives the inclusion criteria for studies selection, but does not give the corresponding exclusion preparation.\n5. When describing the results of the literature review in Section 4.1, the RQs answered in this subsection can be marked at the title or beginning of the three subsections, which will make the structure of the article clearer.\n6. I suggest that the survey results of the implementation process in Section 4.1.2 be sorted into categories and presented in a table. The current text format makes the presentation of the results somewhat confusing.\n7. I think Section 4.2 and Section 4.3 in Chapter 4 can be integrated into a separate chapter, because they are more like a part of the complete work, and Section 4.1 is the review result belonging to the SLR part and should be a separate chapter.\n8. The fonts in Figure 7 and Figure 11 are a bit small, and some text is obscured by other lines. The same situation also occurs in other figures, such as Figure 14 and Figure 17.',96,'2022-05-13 18:26:32',72,_binary '\0'),(1102,'This paper proposes the Kubernetes Operator prototype tool, a blockchain cloud framework based on Hyperledger Fabric, which improves the portability of Hyperledger Fabric, etc. Here are some of my suggestions:\n1. There is a word error in Figure 1, it should be \"scopus\" instead of \"scoups\". Also have this problem in table 2.\n2. I suggest that you can set up several RQs in advance at the beginning of the third section, so that the review results can be displayed more clearly.\n3. There is no detailed introduction to Figure 2, which may be difficult to understand for readers who read this paper for the first time.\n4. Figure 3 has a word error, it should be \"CRD\" instead of \"CURD\".\n5. Section 5.1.5 says \"the prototype tool in this paper basically meets the functions of the five maturity levels.\", but in fact there is a third level that is not met, so I think it might be more accurate to change it to \"meet most of them\".\n6. The title of Table 7 is wrong, this table should show the version information of the node instead of \"Network Deployment Time\".',95,'2022-05-13 19:48:33',72,_binary '\0'),(1103,'In this paper, an output evaluation method is proposed to capture the activities of engineers in the software development process, and has achieved remarkable results in the actual industrial environment, which has great reference value for researchers and practitioners in this field. My suggestions are as follows:\n\nSuggestions:\n1，In 1 INTRODUCTION, there is some repetition of the conceptual statement, for example, consider merging the first two paragraphs together.\n2，In the Data Source section of 3.1 Metrics Collection, it was mentioned that 18 interviewees were interviewed, but it did not explain how to select them. I suggest a brief explanation.\n\nLittle tips:\n1，In the last line of the first paragraph of 1 INTRODUCTION, there is a full stop before the reference [7].\n2，In Figure 1, there is a missing space in the middle of \"OutputAssessment\". In addition, Stage ii has an extra line that looks a bit like a hair.\n3，Figure 3. Subheading line spacing looks a little bit wrong, a little bit down.\n4，There are two subheadings in Figure 8? The one in the picture can be removed.\n',97,'2022-05-13 22:07:54',85,_binary '\0'),(1104,'This paper finished a full research on blockchain cloudification，which includes a rapid review of of cloudification using Kubernetes Operator；a framework and prototype tool for blockchain cloudification and a evaluation between the prototype tool and Cello.\nHere are some of my questions and suggestions:\n1. When the first chapter summarizes the core value of this paper, some statistical data are lack of citation support, such as \"Currently, 10% to 20% of the value delivery ......\". Compared with the similarities below, it is slightly less convincing here.\n2. Figure2 describes the strategy set application，but why the titles in the figure have inconsistent singular and plural forms(\"principles、attributes\" VS \"strategy、scheme\"). And if it is necessary to adjust the order of design principles to keep consistent with the order introduced in the above paragraphs？\n3. Figure3 describes the proposed framework，and some behavior verbs of nodes in the graph have inconsistent forms(\"watches、manages\" VS \"use、generate、invoke\").\n4. I noticed that contents about Cello appeared in several chapters of the article. Maybe it\'s a good idea to use a separate paragraph in the evaluation section to describe its technical principles and background to help readers understand the tool and enhance the persuasiveness of the evaluation.',95,'2022-05-14 08:53:26',96,_binary '\0'),(1105,'This paper aimed at the shortcomings of model-driven blockchain development，conducted a systematic literature review of model-driven development.   Based on the result of review, this paper proposed an approach called Model-Driven Development for Blockchain Software Development Life Cycle (MDD4BSDLC) and build a semi-automated tool. By conducting the case study, this paper verified the correctness and efficiency of generated code.\n\nHere are some of my questions and suggestions:\n\n1. The layout of Figure1 can be adjusted appropriately because the approach and case study parts are a little crowded. In addition, the case study part is messy at present, and some process relationships can be added appropriately.\n2. The title of Chapter 4 is \"Result\", in order to help readers quickly understand the contents of this chapter rather than mistakenly thinking that this is the result of the experimental evaluation part, a chapter description should be added. \n3. At the last of 4.1.3, there is a sentence breaking error: \"and cannot be directly combined. With UML,\", maybe it should be \"and cannot be directly combined with UML\".\n4. At the beginning of 4.2, there is a quantifier format error: \"we use situational method engineering to propose a approach called\", it should be \"an approach\".',96,'2022-05-14 10:23:50',96,_binary '\0'),(1106,'This paper proposed an output assessment approach，which comprehensively evaluate the output of engineers from two dimensions Cross-comparison and Self-comparison. The whole data extraction, metric collection, approach proposal and evaluation were conducted in the real company.\n\nI have two questions and suggestions for this paper:\n1. Figure 1 describes the output assessment approach, in stage I, there are two reverse arrows between the employee(manager and engineer) and the output metric. There is a lack of specific explanation for the metric arrow pointing to the engineer.\n2. The discussion chapter should be supplemented with some additional defensive explanations of the shortcomings of the current assessment approach, such as: how to consider the impact of organizational structure and business adjustment at the company level on the output metrics of engineers; periodic problem of engineers participate in the major projects; how to deal with relevant output metrics differently for engineers in different working stages(such as there is more development work in the initial stage of the project, while there is more testing and maintenance work in the later stage)',97,'2022-05-14 11:56:12',96,_binary '\0'),(1107,'Title: An Industry Practice to Improve Software Development Process: Output Assessment of Software Engineers\n\nThis paper proposes, implements, and evaluates an  output assessment approach. It continually collects various outputs,  employs two dimensions of assessment (i.e., cross-comparison and  self-comparison), and reports results to engineers and managers according to specific requirements. It helps to eliminate the weakness of manual assessment, meanwhile  seeking more automated, intelligent assessment for software engineers’ activity.\n\nHere are some suggestions:\n\n1. I think 18 respondents may not be enough. As mentioned in Section 3.1 of this paper, the respondents include development engineer, testing engineer, maintenance engineer, and some others. Many types of personnel mean that the number of each type of personnel may be small, and the data obtained may not cover a series of comprehensive indicators. So, I propose to elaborate on the credibility of the indicators obtained.\n2. As far as I\'m concerned, I think moving the \"In summary...\"  at the end of section 3.2.1 to the beginning of this section will be easier to understand, because this will reduce the confusion caused by the previous formulas. And also section 3.2.2.\n3. The two figures A and B in Figure 6 are too small to pay attention to details. I suggest placing these two pictures vertically rather than horizontally.\n4. This paper is an industry practice. I think it would be better to introduce RQ and answer it\n\nHere are some low-level errors：\n\n1. The last line of the first paragraph of the introduction, \". [7]\", punctuation is wrong.\n2. In section 4.1.2, in the last line of the first paragraph, \"figure 8\", the format is inconsistent with other parts',97,'2022-05-14 12:56:29',77,_binary '\0'),(1108,'This study design an output evaluation method is proposed to capture the activities of engineers in the software development process.This work is in favor of organizations and enterprises that aim to improve their management, which has positive significance and scientific research value. Here is my comment:\n  It is better to give both methods a method diagram for consistency and also can help readers understand the method more easily\n  The interpretation of Figure 1 needs to be refined, especially the specific explanation for the metric arrow pointing to the engineer',97,'2022-05-14 14:15:47',55,_binary '\0'),(1109,'This study designan approach called MDD4BSDLC and designs tools that eliminate the need for developers to have in-depth knowledge of blockchain platforms like Ethereum and Hyperledger Fabric, which has positive significance and scientific research value. Here is my comment:\n\n1. Clearly describe the innovation points and the contribution points in the end of the Introduction section .\n2. The  expression of the article needs further consideration, and the explanation of some concepts need to be a little more detailed.\n3. The interpretation of some of the figures, are unclear and difficult to understand,like Figure 2.  And there may be some formatting issues and syntax errors. \n4. By adding some summary paragraphs to summarize the chapters, the paper will be more organized and logical\n5. The process of the Systematic literature Review can be presented in the form of figures or flow diagram. It can make the paper more concise and easy to understand\n',96,'2022-05-14 14:26:47',55,_binary '\0'),(1110,'This study design a Hyperledger Fabric-based blockchain cloud framework and Kubernetes Operator prototype tool, which has positive significance and scientific research value. Here is my comment:\n\nGive a few simple examples to enhance the persuasiveness of the paper itself\nThe interpretation of some of the figures, are unclear and difficult to understand,like Figure 2.  And there may be some formatting issues and syntax errors. ',95,'2022-05-14 14:28:59',55,_binary '\0'),(1111,'This paper proposes a model- driven development approach for the blockchain soft- ware development life cycle, covering the requirements analysis, design, coding/implementation, testing, and deployment phases. However, there exists several issues in the current manuscript that can be taken into considerations in the following revisions.\n- The title \"Research on Model-driven Development Techniques for Blockchain-based Systems\", is too general to describe both the content and the contribution of this paper. In my point of view, it is more likely to be a title of a secondary study, rather than a primary study.\n- The motivation of this paper is far from clear. First, the authors argued that \"it is difficult for researchers to form a consistent understanding of the status quo, limitations, and research opportunities in model- driven blockchain development\". However, why is the lack of \"a consistent understanding\" and why such a understanding is significant for the community is unknown. The authors have to make a clear claim. Second, the authors claimed that \"most studies currently only support Ethereum [8], the advantages of model-driven development that supports multi-objective frameworks have not been well utilized.\" However, what are the interrelations between Ethereum and the multi-objective frameworks?\n- Due to the ambiguous motivations, I can not figure out why there is a need for the systematic literature review on model- driven blockchain development. More importantly, the relationships between this review and the proposed approach is not clear to me. I don\'t think that a systematic review is required to motivate the following approach. A more specific questions is about RQs of the review and the approach. For example, given that RQ3 is to investigate the challenges of MDD for blockchain SDLC, I cannot understand why the MDD techniques can be applied to solve the found challenge, as claimed in section 4.2.2.\n- The research niche of the proposed model- driven approach for the blockchain software development lifecycle is not underlined, at least in the Introduction section. In Section 4.2, the authors highlighted that \"there is still no method or tool to support the development of blockchain-based systems based on model-driven systems of different phases and for multiple platforms\". However, why there is a need to cover the different phases of the development of blockchain-based systems? And what are the difficulties of designing such a method or tool?\n- The paper structure that combines results of the literature review and the proposed approach is somewhat odd to me.\n- It seems that the proposed approach aims to address all the observed challenges, from challenge 1 to 10. If so, that could be a quite significant contribution for this approach. However, I doubt that whether there exists some overclaims here. For example, C3 is about that \"the smart contract implementations of design patterns are still written manually\". Then, whether the Pattern2Logic meta-model and the model transformation based on it is enough to address C3 and how? The authors have to provide more specific details and make more careful statements here.\n- For the case study, a more quantitative evaluation with solid study design and rigurous measurment is required, especially for the \"correctness of codes generated\". For example, some automated testing frameworks can be leveraged to check whether the transformed models are correct as expected.',96,'2022-05-14 16:09:16',23,_binary '\0'),(1112,'This paper proposes a cloudification framework for blockchain based on hyperledger fabric and instantiates the framework with a kubernetes operator prototype tool. However, it confused me with several questions when I read the current manuscript.\n- For the motivation, given that BaaS is a cloud service platform, I do not understand why it is weak in empowering the blockchain with cloud capabilities. Specifically, the authors highlighted that the blockchain services are more complex than regular cloud services without further explainations about the reasons and the possible effects. Furthermore, the first challenge claimed in the Introduction, \"the basic commercial application tools of blockchain are not perfect\", is too general and seems to be a kind of overclaim, as your intention in this paper is not to fix the current \"unperfert\" commericial tools.\n- The authors argued that \"the proposed framework\" is \"based on\" Hyperledger Fabric, and it can \"make full use of the characteristics of the cloud to improve the portability, reliability, usability, scalability, and security of Hyperledger Fabric\". My question is that given that the Hyperledger Fabric is a mean in this paper for cloudification, why it is significant to improve the quality of Hyperledger Fabric. Shouldn\'t our focus be on how well the Hyperledger Fabric can solve the challenges we face? After reading the whole manuscript, I realized that the framework is not proposed based on but oriented to Hyperledger Fabric. I suggest the authors using more specific statements here.\n- For addressing the challenges that \"the BaaS platform is weak in using cloud capabilities to empower the blockchain infrastructure\", I wonder why a quick review about Kubernetes is required. I mean, the interrelations between the challenge and Kubernetes are not stated. A further question is that whether the review about Kubernetes is enough to provide required knowledge for addressing the challenge.\n- For the \"RAPID REVIEW\" section, what are the role of the \"Blockchain Cloudification Design Principles\" in this paper? Which resources of evidence from the data extraction contribute to these principles? Is there any relationship between them to the \"principles\" in section 3.3.\n- For the \"BLOCKCHAIN CLOUDIFICATION FRAMEWORK\" section, the framework proposed in figure 3 is disordered, which is inconsistent with what are described in section 4.1 and should be refined. Similar problems exist in figure 4, where some appropriate legends should be provided to indicate the activities and artifacts in the process. Second, there is no formalized descriptions in table 4 for each attribute, which could impede the application of the framework. Given that \"Hyperledger Fabric has a set of standardized data structures and interfaces\", I wonder if it is possible to give more formal descriptions of these attributes. Third, section 4.1.2 is unstructured and hard to follow. Fourth, for me section 4.1.3 is more like an background introduction of Hyperledger Fabric networks deployed in the Kubernetes, rather than part of a proposed framework. I cannot figure out find the \"design\" and its research niche.\n- For the \"EVALUATION\" section, the authors claimed that \"it is necessary to compare the Cello and prototype tools in terms of network deployment time\". But why? If so, does it mean that the Cello is one of the state-of-the-art solutions in the field? Then, what are the gaps of these solutions that are needed to be bridged? I have not find the relevant descriptions in the Introduction. Moreover, the design of this comparative study in terms of its intentions and study process is not detailed.',95,'2022-05-14 17:53:23',23,_binary '\0'),(1113,'This research designs a blockchain cloud framework and Kubernetes Operator prototype tool based on Hyperledger Fabric, which has practical significance. Here are some possible problems:\n\nSome detailed cases are needed to add conviction\nThere may be some formatting problems and syntax errors.',95,'2022-05-14 22:34:57',17,_binary '\0'),(1114,'This study designed a method named MDD4BSDLC, designed a convenient tool for blockchain development, has positive significance and scientific research value. Here are my comments:\n\nThe expression of the article needs further consideration, and some concepts need to be explained in more detail.\nThis article may have some formatting problems and syntax errors.',96,'2022-05-14 22:36:44',17,_binary '\0'),(1115,'This study proposes an output evaluation method to capture engineers\' activities during software development. This work is beneficial to organizations and enterprises aiming at improving management level and has positive significance and scientific research value. Here are my comments:\n\nIt is better to give method diagrams of both methods to keep the consistency of the methods and to help readers understand the methods more easily\nThere may be some other syntax problems, etc',97,'2022-05-14 22:39:47',17,_binary '\0'),(1116,'This paper proposed an output assessment approach for engineers\' activity, and evaluated it in 7 large software divisions in an worldwide ICT company. There are several comments that might be taken into considerations by the authors in subsequent revisions.\n- What is claimed in the abstract, \"an output assessment approach\", is at odd with the highlighted \"industry practice\" in the paper title.\n- In the introduction, the underlined TOPSIS and iForest approaches are somewhat strange to me. I mean that firstly, the authors do not explain what are cross-comparison and self-comparison. Second, what are the roles of these two approaches in the comparisions are not explained.\n- Still in the introduction, the evaluation results from a half year are described in a qualitative way, which is not persuasive enough. I wonder whether it is possible for the authors to complement the results with more quantitative and rigurous evidence.\n- The first contribution is inexplicable for me. I mean in which section/subsection the \"real-world empirical practice\" is stated. Furthermore, I don\'t agree that a \"real-world empirical practice\" in industry can be significant to the SE community.\n- In section 3, I think that the authors mixed the data collection process for proposing the assessment approach and that for measuring the metrics about engineers\' activity, accoring to figure 3 and 3.1 subsection. Specifically, given that the metrics collection is one of the major steps in the proposed approach, the \"data source\", \"data collection\", and \"data analysis\" which are the research activities for proposing the approach should not be included in the Metrics Collection section. Cause it might bring the ambiguity whether these activities should be included in the assessment approach. More importantly, as the foundation of the assessment approach, the rationale underlying collected metrics should be explained further.\n- For section 3.2, why the TOPSIS and iForest approaches were adopted is not well-explained. \n- Still for section 3.2, the authors argued that \"the standard TOPSIS method attempts to choose alternatives that simultaneously have the shortest distance from the positive ideal solution and the farthest distance from the negative ideal solution\". However, in this approach, what are the specific meanings of the retults? That is, which kinds of two developers can be derived by using this approach is not explained. Furthermore, are the derived developers alined with the intentions of the \"cross -comparison\", which aims to explore the differences in work output between team members.\n- Still for section 3.2, given that the iForest approach was proposed in prior study, I doubt the real contributions of the approach in terms of self-comparison. I wonder is there any adapdations made for this assessment problem.',97,'2022-05-15 00:10:18',23,_binary '\0'),(1117,'This paper proposes a cloudification framework and a Kubernetes Operator prototype tool for blockchain based on Hyperledger Fabric by comprehensively considering the blockchain network nodes and smart contract. \n1. Some syntax needs to be improved, for example, \"With the rapid development of blockchain, it has brought significant changes to traditional fields such as supply chain and finance.\" can be changed to \"The rapid development of blockchain has brought significant changes to traditional fields such as supply chain and finance.\" \n2. Table 7 has an error in name and should not be \"Network Deployment Time (Second)\" \n3. Cello and Prototype Tool use different versions, so the description of the impact of different versions of HF on the experimental results needs to be added. ',95,'2022-05-15 11:27:27',8,_binary '\0'),(1118,'Title: A Cloudification Framework for Blockchain Based on Hyperledger Fabric\n\nThis paper proposes a cloudification framework and a Kubernetes Operator prototype tool for blockchain based on Hyperledger Fabric by comprehensively considering the blockchain network nodes and smart contract.\n\nHere are some suggestions:\n\n1. This paper introduces the overview of the research process before the background part, and I think it will be more coherent to place the research process at the beginning of section III. And this part doesn\'t seem to explain the reasons for the setting of the research process. I suggest explaining why to carry out the steps.\n2. The \"Search String\" settings for different databases in Table 2 are different, but it does not explain why they are different. If it is only because of the constraints of the retrieval rules of each database, I suggest pointing out this point to avoid confusion to readers.\n3. Throughout the full paper, the content of Table 3 \"Strategy Set\" seems to be very important to the following text, and the process of obtaining Table 3 in this paper seems very casual. I think it would be better to introduce the selection process of \"Strategy Set\" in detail.\n4. The last paragraph of section 3, \"as shown in Figure 2, combined with the design principles of the cloudification framework, the strategy is not applicable to the hyperledger fabric network\", I think this is a good example to illustrate the worth of this paper, but its role seems not to play very well, so I think \"why\" and \"its worth\" will be great under this part of explanation!\n5. The \"Lv. X\" font in Figure 7 looks too small and the whole figure is not very harmonious. I suggest enlarging the font.',95,'2022-05-15 12:49:28',77,_binary '\0'),(1119,'This paper aims at building a comprehensive perception of developers’ intentions and concerns in logging practices.Here are some suggestions for improving this paper in the subsequent revisions.\nFirst, the abstract may provide more concrete evidence from the research process to make it more persuasive. For example, how many developers were surveyed and how long did all the interviews take.\nSecond, the descriptions in the results can be modified further to avoid ambuguities. For example, \"the developers’ I&Cs focus on troubleshooting and I/O overhead, respectively\", I don\'t think the use of \"respectively\" is proper. And the phrase about \"will all have an impact on ...\" is distracted for me. Why is \"will have\"? ',99,'2022-05-22 23:09:18',23,_binary '\0'),(1120,'Title: How to Log in Daily Development? An Industrial Survey to Logging Practices\nComment:\nThis paper aims to explore developers\' intentions and concerns in logging practices in industrial projects. To achieve this purpose, the authors conducted a large-scale empirical study using a combination of questionnaire surveys and interviews. Finally, this paper finds that a noticeable gap exists between log statements and I&Cs, and there is still room to improve logging practices.\n1. The abstract section may consider adding some quantitative descriptions about the results of questionnaire surveys and interviews.\n2. \"Factors such as design, guidelines, and changes to log statements will all have an impact on the degree to which a developer’s I&Cs are properly embodied.\" I think this sentence should not be in the future tense, but in the present tense.',99,'2022-05-23 02:22:53',68,_binary '\0'),(1121,'Starting from the relationship between log and i&c, this article attempts to summarize the practical effect of log by clarifying i&c. The questionnaires and interviews are used to describe i&c. The following are comments on this article:\n1. The description of the experimental conditions is relatively simple. What is the proportional structure of the occupation and work experience of the participants in the 91 questionnaires? If an occupation has a small number, do we need to explain it? Otherwise, we don’t know if the obtained data can represent the actual situation.\n2. The general logic of the entire investigation is: what are i&c, i&c has a great influence on the log, and how does i&c affect the log. But there is no detailed discussion on how i&c affects the log, and how we determine the degree of correlation between i&c and the log.\n3. The previous part lacked the introduction of automation tools. After acknowledging that there are problems with logs, he pointed out that many people want to have automatic logging tools, but which pain point does the automatic logging tools solve in this scenario, and why can it be solved?\n4. In the discussion part of the article, most of the discussion about the implementation effect of the log is a little bit deviating from the theme of the article, that is, the relationship between i&c and the log.',99,'2022-05-24 14:04:55',74,_binary '\0'),(1122,'Title: How to Log in Daily Development? An Industrial Survey to Logging Practices\n\nThis paper aims to explore the developers’ I&Cs in industrial projects. This paper conducted a large-scale empirical study using a combination of questionnaire surveys and interviews to explore and analyze the I&Cs regarding logging practices in different business areas and different companies.\n\n\nHere are some suggestions:\n1. The third section of the paper mentioned that \"to achieve the research goal, we have defined the following research questions\". This paper describes the goal of this study using a Goal-Question-Metric (GQM) [33] style. However, the article only marked the serial number of RQ, but the goals not. I suggest to number the goals and explain the corresponding relationship between the goals and RQs.\n2. I think part B and part C of section III overlap. When I see \"Implementation\" in the title of B, I think it includes the questionnaire collection part. However, this part is placed in \"C. Execution\" in this paper. It seems that it is not coherent to describe \"Implementation\" and \"Execution\" separately. I think you can consider merging these two parts.\n3. In the \"THREATS TO VALIDITY\" section, I think you can remove the three subheadings, and show the difference of each threat in the main body. Because this part has less content, it is divided into three subheadings, which looks top heavy and light.\nHere are some low-level errors：\n\n1. In Section 3, I suggest checking the punctuation of each “goal”, and I notice that punctuation is missing in some places.\n2. When representing graphics in the body, please pay attention to the case. For example, \"fig.3\" is written in the body of section 3, while the picture is \"Fig.3\".',99,'2022-05-24 16:10:02',77,_binary '\0'),(1123,'Title: How to Log in Daily Development? An Industrial Survey to Logging Practices\n\nThis paper aims to explore the developers’ I&Cs in industrial projects. This paper conducted a large-scale empirical study using a combination of questionnaire surveys and interviews to explore and analyze the I&Cs regarding logging practices in different business areas and different companies.\n\n\nHere are some suggestions:\n1. The third section of the paper mentioned that \"to achieve the research goal, we have defined the following research questions\". This paper describes the goal of this study using a Goal-Question-Metric (GQM) [33] style. However, the article only marked the serial number of RQ, but the goals not. I suggest to number the goals and explain the corresponding relationship between the goals and RQs.\n2. I think part B and part C of section III overlap. When I see \"Implementation\" in the title of B, I think it includes the questionnaire collection part. However, this part is placed in \"C. Execution\" in this paper. It seems that it is not coherent to describe \"Implementation\" and \"Execution\" separately. I think you can consider merging these two parts.\n3. In the \"THREATS TO VALIDITY\" section, I think you can remove the three subheadings, and show the difference of each threat in the main body. Because this part has less content, it is divided into three subheadings, which looks top heavy and light.\n\nHere are some low-level errors：\n1. In Section 3, I suggest checking the punctuation of each “goal”, and I notice that punctuation is missing in some places.\n2. When representing graphics in the body, please pay attention to the case. For example, \"fig.3\" is written in the body of section 3, while the picture is \"Fig.3\".',99,'2022-05-24 16:10:26',77,_binary '\0'),(1124,'The study has put forward automated vulnerability detection using deep representation learning and heterogeneous ensemble learning through the ELAVD framework. Here are the comments:\n\n1) In the introduction, there is a sentence “this paper has made four contributions:”, which might indicate the existence of detailed list of these four contributions in the next paragraph. However, there is lack of the introduce of the four contributions in the following sentences, which seems a little incoherent in the logic.\n\n2) There might be lack of the chapter of “Threats to validity”, which seems a little incomplete for this paper.\n\n3) Figure 6 could be refined to be more easy to understand, since it seems quite confusing and disordered for the readers.\n\n4) In the EXPERIMENTS AND RESULTS, the author has not explained the reason for the choose of these evaluation metrics.',107,'2022-06-17 22:32:32',89,_binary '\0'),(1125,'This paper proposes an ensemble learning approach for automated vulnerability, which outperforms than exisiting state-of-the-art approaches. Overall, the paper is well organized and innovative. My suggestions are as follow: \n1. The Introduction mentions that “This paper has made four contributions”, but these four contributions seem not to be introduced.\n2. When comparing the proposed approach with other embedding methods, it may be better to elaborated and analysze the result of Fig.6.\n3. Reasons or benefits for using ensemble learning approach may need to be stated. \n4. The title need to be updated since there is no comparison between siglne model methods and the ensemble learning approach.\n5. There are some minor mistakes, such as “feature engineer” in the 5th paragraph may be “feature engineering” and the last two paragraphs of Section IV.d.\n',107,'2022-06-18 11:49:51',90,_binary '\0'),(1126,'This paper proposed a process-based, dynamic approach that employs Software Process Simulation Modeling (SPSM) and Learning-to-Rank (LtR) techniques for prioritizing CRRs. Here are some reviews.\n1. The title of this paper is inaccurate. The focus of the title should be on using simulation models to explore how different LtR approaches improve the process of code review.\n2. Comparison of different LtR algorithms related questions should be added to RQs.\n3. Perhaps one should consider putting the LtR model in the model construction section.\n4. Productivity indicators Ed2 and Ed1 are the same, typo.\n5. The format of table 2 is not neat enough.',108,'2022-06-24 17:17:28',70,_binary '\0'),(1127,'This paper uses DDD and microservice methods to propose a reference model for the problems existing in blockchain, which is of practical value and relatively innovative. There are still some problems in this paper:\n1. The usage method of DDD is not introduced in detail, and there is a lack of detailed discussion in relevant literature.\n2. There is no detailed explanation of why DDD is mostly divided into four layers.\n3. In the introduction, the blockchain proposed by Satoshi Nakamoto in 2008 is bitcoin, which does not support smart contracts. It can be said that it was first proposed by Satoshi Nakamoto.\n4. The process of rapid review in Section III, Part A is too rough, so I don\'t know what it is.\n5. There is no corresponding explanation why the Presentation Layer is divided into six layers.\n6. QR code is mentioned several times in the article, but bar codes are often used in general logistics, which can be expressed in a more general way.\n7. Mentioned on page 7\n\"The gateway can connect to the blockchain network and interact with the enterprise sub-chain and smart contracts\"\nSub-chain and smart contracts should not be side-by-side, both main and sub chains may contain smart contracts.\n8. There are font problems in the picture, some of the text is beyond the border of the picture.\n9. Sometimes microservices and sometimes microservices are used in the text, which should be unified.\n10. There are punctuation problems, such as sometimes there is a space after the serial number, sometimes there is no space.',112,'2022-07-08 21:21:22',17,_binary '\0'),(1128,'This study is expected to provide a general evidence-based criteria set and a systematic process to advance the set to a rigorous and reliable model, which can suit the requirements of researchers to identify high-quality GL. There are some suggestions:\n\n1.The expression in the contribution part is too specific, it just describes the criteria and systematic process proposed by the author, and does not rise to a general contribution to other researchers and industries\n2.Have the authors considered the impact of the proposed criteria and process in actual use? i.e. are there preliminary experiments to demonstrate the effect on the GL quality of the included studies after using it\n3.Dimensions of interviewees can be expanded to reduce possible threats\n4.V.A wrong format\n5.VII.C “The Delphi method does not guarantee correct answers, as it only ensure the consensus” ensure -> ensures, “for survey” -> the survey\n6.Figure2. Some text is covered',115,'2022-08-06 13:36:58',26,_binary '\0'),(1129,'1. Title: Checking Pattern Conformance of Models with Implementation in Domain-Driven Design\n\n2. Main contents and contributions:\nDDD utilizes a set of standard patterns in models and implementations, however, implementations may deviate from domain models and patterns. This paper mainly proposes methods to check the schema consistency of domain models.\nThe main method is to assume some schema-related concepts and constraints, implement them in the model and code using a specific language, then extract the implemented model backwards from the code, and verify whether the schema conforms to the predefined rules by comparing the conceptual model and its implementation. \n\n3. Advantages of this paper\n	Pay attention to the consistency of DDD\n	Extend UML and Java with a new language that formally defines schema-related concepts in models and defines schema-related concepts in code that follows predefined conformance rules.\n	Statically extract information from actual source code to build an implementation knowledge base. Based on the knowledge base, a mapping model between the target domain model and the implementation is established to further clarify the differences and missing relationships between them.\n	To collect results from the implementation, use the Java reflection mechanism to review the software and store the collected data in the implementation knowledge base.\n\n4. Disadvantages of this article\nThe versatility of the implementation method is relatively limited, it would be better if it could be implemented on other language.\nPage 8, All the results, either manual and automatic ones, were then compared and discussed by researchers to find any difference (see Table). A TABLE is missing.\n\n5. Conclusion:\nRecommended as accepted.\n',124,'2022-09-30 10:32:58',106,_binary '\0'),(1130,'-- Summary of the submission --\nTo aviod the deviation of design and implemenation in Domain-Driven Design (DDD). This study proposes an approach for checking pattern conformance of domain models with implementation, including a set of patternrelated concepts and constraints as well as a novel domain specific language. In general, this work is well-structured and complete.\n\n-- Major concerns --\n1. This paper intends to elaborate the whole processes of DDD implemenation with their apporach, which makes this submission disordered. Although the major contribution claimes to be an approach to verify the pattern consistency between models and implementation, the authors use two sections to introduce the domain specific language. However, the evaluation is about the implementaion of code-to-model. I recommend to reduce the introduction of language and focus on the consistency.\n2. Case study is common in such type of reseach, but in this submission we can not get the result of this case study. More quantitative data is needed to prove the effectiveness and availability of proposed apporach.',124,'2022-10-05 21:40:50',39,_binary '\0'),(1131,'1.第1页，Abstract部分，第六行，“Prior studies have developed ...”。这句转折的有点生硬，前一句说现代代码评审最大的挑战是确定CRR的优先级，后面一句直接说LtR模型了，LtR和该挑战的关系没能说明。建议在“Prior studies have developed ...”前面加半句，类似于“LtR是一种排序算法，可被用于解决CRR的优先级问题。。。”；\n2.第2页，INTRODUCTION部分，倒数第2段，第一行，“We develop seven LtR models ...”。选择这7种模型的依据是什么（换句话说，为什么是7种，而不是6种或8种，为什么是这7种，而不是其他7种）。如果是根据某些论文的总结，建议把原因写在开头，并附上参考文献，会更令人信服。\n3.第3页，PRELIMINARIES工作，倒数第2段，“There are three major learning strategies in LtR ...”。LtR的三种学习策略的简介中，只说了每个策略的特征（或者说做法），但读者可能更想知道每个策略的区别（即，优缺点）。建议每种策略后补充半句用于描述各策略的优劣势，例如，pointwise实现简单，但是没有考虑CRR之间的顺序关系；pairwise考虑了CRR之间的顺序关系，但是考虑的顺序关系不全面；listwise针对pairwise缺点进行了修正，更好的考虑了顺序关系。\n4.第5页，TABLE 1。Icon图标失真，且存在未对齐的问题。',125,'2022-10-14 18:04:48',87,_binary '\0'),(1132,'Team ZhongChengxin, XuJinwei et al.\n\n1. inappropriate title, more content is needed if using \'Approach\', especially need the evaluation process of the method and the results of the evaluation\n\n2. the indicators, the differences of the item indicators in Table V are very small and not persuasive enough, besides, 10 items are not quite enough, which may lead to the lack of generality of the algorithm.\n\n3. the article uses manual evaluation when analyzing semantic rationality, which is a qualitative analysis; and only a graph is given for the quantitative analysis of the algorithm . It is suggested to split it and prove the validity of the simulation model first, and then illustrate the algorithm, which can be illustrated and evaluated with more graphs and metrics.\n\n4.The three evaluation metrics used in Table V are not very rigorous in proving the validity \n\n\nTranslated with www.DeepL.com/Translator (free version)',125,'2022-10-14 21:24:30',109,_binary '\0'),(1133,'1. Page 3 a token s is missing an \'s\n2. Page 3 introduces hypothesis 1 in which I personally do not understand whether the token refers to the token in NLP or the token in the abstract syntax tree?\n3. Page 3 \"The same types of vulnerabilities have similar semantic characteristics. These characteristics can be learned from the context of vulnerabilities\" Is this assumption supported by any relevant papers?\n4. Page 5 on L1=Logistic Regression is a bit too far apart. 5.\n5. \"Figure 5: Stacking classifier framework\" This sentence is not centered',127,'2022-12-17 19:26:23',109,_binary '\0'),(1134,'1. Introduction part page 2 , \"In summary, we make four contributions:\",contributions are missing or could be described more clearly.\n2. in Related Work,there are Prior Studies Related to Vulnerability Detection and Prior Similar Studies,I think the subtitle is kind of confusing.\n3. The introduction of Figure 1 is not centered,and in Figure 1 Pre-Training seems Not as big as the Peresentation Learning and Ensemble Classifier.',127,'2022-12-17 20:29:31',106,_binary '\0'),(1135,'1. The label ‘identifier’ of Figure5 are too close with edge, not easy to read\n2. the number of empty lines below Figure 8 seems to be 3 lines, the other should be two lines\n3. the \'UML\' superscript on the first line below \'4 Evaluation\' is a question mark, is it because the reference is missing?\n4. the empty lines between Figure12 13 and the previous are different, and Figure12 blocked the header, Figure12 would be more appropriate if there is no background line',128,'2022-12-23 22:55:37',109,_binary '\0'),(1136,'格式问题：1、第三页的Uniqueness. Specifies the duplication……Specifies前面多了一个空格。\n2、factors重点加粗s没加粗。',130,'2022-12-30 19:48:33',108,_binary '\0'),(1137,'内容很全面，图片数据等支撑也足够，我觉得被录用的希望很大。',129,'2022-12-30 20:00:35',108,_binary '\0'),(1138,'1.page 2 the first mention of \"DQMoS\" with no explaination, until page2 \"B. DQMoS: Data Quality Model for Software Engineering Experiments\"\n2.the same issue with \"SPSM\" “DQ”“DQA”\n3.page 4 “as shown in Table ”, in which table?\n4. page5 “is a ”cali-bration” variable. Data about ”time”” , I am not sure whether the quotation marks are right\n5.page5 “Simulation Material: papers, model” and “Analysis of data sources tools and data repositories” and “A preliminary identification of the raw data” ended without period\n6. page 5 “Requirement test completion time” may should be Requirements ?',130,'2023-01-02 13:46:37',109,_binary '\0'),(1139,'1.个人认为可以提MacOS的rosetta 2，一个比较成熟的x64转译arm技术\n2.个人认为可以提一下高通的8cx系列，在硬件层面为arm提供了32位x86的运行条件\n3.个人认为如果把x86和x64混合来讲不太好，因为x86主要指的是32位exe，转译技术较多，x64则较少\n4.第9页，“此外，文献[P25]提到编译迁移的过程中，构建目标的规模也会逐渐增加，会给持续集成系统带来巨大的压力” 缩进多了\n5.第13页，选取的目标程序是“较为常见的微信小程序微服务项目，所以选定作为案例项目”，个人觉得不是很好，因为微信小程序实际上是基于浏览器的web应用，设计之初的目的就是为了跨平台。如果能找一个C++、QT和.NET框架融合的项目就更有说服力了。\n',129,'2023-01-02 14:11:29',109,_binary '\0'),(1140,'1. Abstract:  As we enter the AI era entering the AI era, the importance of 可能有语法错误\n2.  2.2搜索过程 中 “针对性搜索主要在技术论坛及开源社区进行，主要包括工具官网、ARMDeveloper、GitHub、CSDN、InfoQ和Docker等社区，搜索其是否提供ARM处理器架构支持.”（句号）\n3. 表4\\表5\\表8中的。应该为.',129,'2023-01-02 15:33:48',106,_binary '\0'),(1141,'1. Fig. 2中第二张图右边边框可以截掉\n2. Fig. 3有点模糊\n3. IV.DATA PREPARING PROCESS FOR SPSM中(as shown in Table ),没有标出是哪个table\n4. 3) Outputs resulting from Step 1::（两个：：）\n',130,'2023-01-02 16:15:06',106,_binary '\0'),(1142,'1.Page 3 Table 1, the first mention of KLOC, no explanation\n2.Page 3 Table 1, Code quality (assessed by tools), if the tools named will be better.\n3.Page 3, in ref [30], until the third time mentioned TOPSIS, no explanation gave.\n4.Page8, “c) Neglect of Qualitative Work Output “and” d) Negative Emotions and Ethical Issues” with extra blank line.\n5.(This may base on my misunderstanding) the front part mentioned some Numerical calculation methods, but the back part only analyzes the RQs by Questionnaire, no more numerical analyze was found.\n6.(This may base on my misunderstanding) The final result” Specifically, the weights of output metrics and parameters of assessment algorithms should be able to be customized flexibly.” is not Specifical enough, I expect the rules of tweaking params.\n',131,'2023-01-07 13:23:28',109,_binary '\0'),(1143,'1.“Macho et al. [20] used version updates, remove dependencies, and adding repositories to fix build break in Maven.” Maven is used for JAVA based language, the main target is MAKE for C++, it may be conflicted.\n2. Page 5 Table1 “- : Not involved in this class. n\\a : No data reported.” Doesn’t replace any symbol in table.\n3. Figure 4: Approach Overview, the top fronts may be better if the background is transparent\n4. Figure 8: Missing dependencies from ck missed a blank line\n',134,'2023-01-13 15:36:13',109,_binary '\0'),(1144,'1. Page 2 the first figure doesn’t have name.\n2. Page4 in 5.1, usually we called “GeForce RTX 3080 Ti”\n3. Page5, the “#NS” abbreviations may not very usually in thesis.\n4. Page8 in 7 Conclusions, some concrete data maybe more convincing \n',135,'2023-01-13 15:48:17',109,_binary '\0');
